INSERT INTO `baike_related_items_js` VALUES ('0', 9, '水浒传', '', '', '（元末明初传为施耐庵创作长篇小说）', '', '《水浒传》，中国四大名著之一，是一部以北宋末年宋江起义为主要故事背景、类型上属于英雄传奇的章回体长篇小说。作者或编者一般被认为是施耐庵，现存刊本署名大多有施耐庵、罗贯中两人中的一人，或两人皆有。全书通过描写梁山好汉反抗欺压、水泊梁山壮大和投降朝廷以及投降朝廷后镇压田虎，王庆，方腊等各路反抗宋朝政府的政治势力，最终走向悲惨失败的宏大故事，艺术地反映了中国历史上宋江起义从发生、发展直至失败的全过程，深刻揭示了起义的社会根源，满腔热情地歌颂了起义英雄的反抗斗争和他们的社会理想，也具体揭示了起义失败的内在历史原因。[1] 《水浒传》问世后，在社会上产生了巨大的影响，成了后世中国小说创作的典范。《水浒传》是中国历史上最早用白话文写成的章回小说之一，流传极广，脍炙人口；同时也是汉语文学中具备史诗特征的作品之一，对中国乃至东亚的叙事文学都有极其深远的影响。[2-3] ', '[{\"name\":\"中国\",\"href\":\"/item/%E4%B8%AD%E5%9B%BD/1122445\",\"id\":\"1122445\"},{\"name\":\"四大名著\",\"href\":\"/item/%E5%9B%9B%E5%A4%A7%E5%90%8D%E8%91%97\"},{\"name\":\"北宋\",\"href\":\"/item/%E5%8C%97%E5%AE%8B/396063\",\"id\":\"396063\"},{\"name\":\"宋江起义\",\"href\":\"/item/%E5%AE%8B%E6%B1%9F%E8%B5%B7%E4%B9%89\"},{\"name\":\"英雄传奇\",\"href\":\"/item/%E8%8B%B1%E9%9B%84%E4%BC%A0%E5%A5%87/17328678\",\"id\":\"17328678\"},{\"name\":\"章回体\",\"href\":\"/item/%E7%AB%A0%E5%9B%9E%E4%BD%93\"},{\"name\":\"施耐庵\",\"href\":\"/item/%E6%96%BD%E8%80%90%E5%BA%B5\"},{\"name\":\"罗贯中\",\"href\":\"/item/%E7%BD%97%E8%B4%AF%E4%B8%AD\"}]', 'https://baike.baidu.com/item/水浒传', '', '32935');
INSERT INTO `baike_related_items_js` VALUES ('1011729', 10, '薛福成', '2413', '941', '', '', '薛福成（1838年4月12日—1894年7月21日），字叔耘，号庸庵，江苏无锡宾雁里人，出生于书香门第、官宦之家。近代散文家、外交家、洋务运动的主要领导者之一、资本主义工商业的发起者。自幼即受时代影响，广览博学，致力经世实学，不做诗赋，不习小楷，对八股尤为轻视。薛福成一生撰述甚丰，著有《庸庵文编》四卷、《续编》二卷、《外编》四卷、《庸庵海外文编》、《筹洋刍议》十四卷、《出使四国日记》六卷、《续刻》、《庸庵笔记》、《出使奏疏》二卷、《出使公牍》十卷等书。 薛福成的著作基本上均已编入《庸庵全集》。其《出使日记》及续刻已被编入《走向世界丛书》。', '[{\"name\":\"无锡\",\"href\":\"/item/%E6%97%A0%E9%94%A1/135983\",\"id\":\"135983\"},{\"name\":\"书香门第\",\"href\":\"/item/%E4%B9%A6%E9%A6%99%E9%97%A8%E7%AC%AC/15499\",\"id\":\"15499\"},{\"name\":\"洋务运动\",\"href\":\"/item/%E6%B4%8B%E5%8A%A1%E8%BF%90%E5%8A%A8/298687\",\"id\":\"298687\"},{\"name\":\"资本主义\",\"href\":\"/item/%E8%B5%84%E6%9C%AC%E4%B8%BB%E4%B9%89/87961\",\"id\":\"87961\"},{\"name\":\"经世实学\",\"href\":\"/item/%E7%BB%8F%E4%B8%96%E5%AE%9E%E5%AD%A6/4096597\",\"id\":\"4096597\"},{\"name\":\"小楷\",\"href\":\"/item/%E5%B0%8F%E6%A5%B7/8566047\",\"id\":\"8566047\"},{\"name\":\"八股\",\"href\":\"/item/%E5%85%AB%E8%82%A1/1191318\",\"id\":\"1191318\"},{\"name\":\"外编\",\"href\":\"/item/%E5%A4%96%E7%BC%96/7102767\",\"id\":\"7102767\"},{\"name\":\"筹洋刍议\",\"href\":\"/item/%E7%AD%B9%E6%B4%8B%E5%88%8D%E8%AE%AE/8573527\",\"id\":\"8573527\"},{\"name\":\"出使四国日记\",\"href\":\"/item/%E5%87%BA%E4%BD%BF%E5%9B%9B%E5%9B%BD%E6%97%A5%E8%AE%B0/8973281\",\"id\":\"8973281\"},{\"name\":\"续刻\",\"href\":\"/item/%E7%BB%AD%E5%88%BB/4728921\",\"id\":\"4728921\"},{\"name\":\"庸庵笔记\",\"href\":\"/item/%E5%BA%B8%E5%BA%B5%E7%AC%94%E8%AE%B0\"},{\"name\":\"走向世界丛书\",\"href\":\"/item/%E8%B5%B0%E5%90%91%E4%B8%96%E7%95%8C%E4%B8%9B%E4%B9%A6/2345809\",\"id\":\"2345809\"}]', 'https://baike.baidu.com/item/薛福成/1011729', '', '8610084');
INSERT INTO `baike_related_items_js` VALUES ('1023266', 9, '直流电', '2526', '154', '（电流）', '', '“直流电”（Direct Current，简称DC），又称“恒流电”，恒定电流是直流电的一种，是大小和方向都不变的直流电，它是由爱迪生发现的。1747年，美国的富兰克林根据实验提出电荷守恒定律，并且定义了正电和负电的术语。恒定电流是指大小（电压高低）和方向（正负极）都不随时间（相对范围内）而变化，比如干电池。脉动直流电是指方向（正负极）不变，但大小随时间变化，比如：我们把50Hz的交流电经过二极管整流后得到的就是典型脉动直流电，半波整流得到的是50Hz的脉动直流电，如果是全波或桥式整流得到的就是100Hz的脉动直流电，它们只有经过滤波（用电感或电容）以后才变成平滑直流电，当然其中仍存在脉动成分（称纹波系数），大小视滤波电路的滤波效果。', '[{\"name\":\"爱迪生\",\"href\":\"/item/%E7%88%B1%E8%BF%AA%E7%94%9F/124298\",\"id\":\"124298\"},{\"name\":\"脉动直流电\",\"href\":\"/item/%E8%84%89%E5%8A%A8%E7%9B%B4%E6%B5%81%E7%94%B5/5413276\",\"id\":\"5413276\"}]', 'https://baike.baidu.com/item/直流电/1023266', '本词条由“科普中国”科学百科词条编写与应用工作项目审核。', '33197');
INSERT INTO `baike_related_items_js` VALUES ('1040087', 9, '房屋', '312', '29', '', '', '房屋是住人或存放东西的建筑物。房屋是家庭的基体，房屋是人类生存的寄托，在这里人们可以避开外界一切干扰，和自己的亲人享受自由自在的生活。这种以房屋为本的思想深深的影响着人们，人们都为拥有自己的房屋而努力。', '[]', 'https://baike.baidu.com/item/房屋/1040087', '', '32794');
INSERT INTO `baike_related_items_js` VALUES ('10422272', 9, '资本主义工业化', '73', '3', '', '', '资本主义工业化是资本主义生产方式建立时期机器大工业在国民经济中取得统治地位的发展过程。受资本主义基本经济规律的支配，它是在资本家追逐利润的竞争中自发实现的。资本主义工业化开始于18世纪60年代英国的产业革命，至19世纪后期，美、法、德、日、俄等主要资本主义国家先后完成了工业化。由于各国自然、历史条件不同，各国资本主义工业化都有自己的特点，但剥削、掠夺本国人民和殖民地附属国人民是实现资本主义工业化所需资本的共同来源。[1] ', '[{\"name\":\"资本主义生产方式\",\"href\":\"/item/%E8%B5%84%E6%9C%AC%E4%B8%BB%E4%B9%89%E7%94%9F%E4%BA%A7%E6%96%B9%E5%BC%8F/9751978\",\"id\":\"9751978\"},{\"name\":\"资本主义基本经济规律\",\"href\":\"/item/%E8%B5%84%E6%9C%AC%E4%B8%BB%E4%B9%89%E5%9F%BA%E6%9C%AC%E7%BB%8F%E6%B5%8E%E8%A7%84%E5%BE%8B/10920099\",\"id\":\"10920099\"}]', 'https://baike.baidu.com/item/资本主义工业化/10422272', '', '895');
INSERT INTO `baike_related_items_js` VALUES ('10605212', 8, '营利', '176', '14', '', '', '词语，是指以金钱、财务、劳务等为资本而获得经济上的利益。谋取利润。', '[{\"name\":\"劳务\",\"href\":\"/item/%E5%8A%B3%E5%8A%A1/2688172\",\"id\":\"2688172\"}]', 'https://baike.baidu.com/item/营利/10605212', '', '3463603');
INSERT INTO `baike_related_items_js` VALUES ('1064478', 9, '英格兰', '2747', '144', '', '', '英格兰（英语：England），是大不列颠及北爱尔兰联合王国的主体，因此习惯上英格兰一词也泛指英国。英格兰位于大不列颠岛的东南部，苏格兰以南，威尔士以东，还包括怀特岛、锡利群岛和沿岸各小岛，面积约13万平方公里，是英国面积最大、人口最多、经济最发达的一个部分。在历史上，英格兰与苏格兰之间是以哈德良长城为界。英格兰这个名字源自“盎格鲁人”（Angles），其原名“Engla-lond”意为“盎格鲁人之地”，他们继原住居民之后居住在这个地方，属西欧民族。英格兰集中了英国本土84.3%的人口，是世界人口最稠密的地区之一，80%以上的人居住在城市里。', '[{\"name\":\"大不列颠及北爱尔兰联合王国\",\"href\":\"/item/%E5%A4%A7%E4%B8%8D%E5%88%97%E9%A2%A0%E5%8F%8A%E5%8C%97%E7%88%B1%E5%B0%94%E5%85%B0%E8%81%94%E5%90%88%E7%8E%8B%E5%9B%BD/1062463\",\"id\":\"1062463\"},{\"name\":\"习惯\",\"href\":\"/item/%E4%B9%A0%E6%83%AF/1022\",\"id\":\"1022\"},{\"name\":\"英国\",\"href\":\"/item/%E8%8B%B1%E5%9B%BD/144602\",\"id\":\"144602\"},{\"name\":\"大不列颠岛\",\"href\":\"/item/%E5%A4%A7%E4%B8%8D%E5%88%97%E9%A2%A0%E5%B2%9B/1063127\",\"id\":\"1063127\"},{\"name\":\"威尔士\",\"href\":\"/item/%E5%A8%81%E5%B0%94%E5%A3%AB/4834248\",\"id\":\"4834248\"},{\"name\":\"怀特岛\",\"href\":\"/item/%E6%80%80%E7%89%B9%E5%B2%9B/45603\",\"id\":\"45603\"},{\"name\":\"锡利群岛\",\"href\":\"/item/%E9%94%A1%E5%88%A9%E7%BE%A4%E5%B2%9B/560247\",\"id\":\"560247\"},{\"name\":\"哈德良长城\",\"href\":\"/item/%E5%93%88%E5%BE%B7%E8%89%AF%E9%95%BF%E5%9F%8E/1388568\",\"id\":\"1388568\"},{\"name\":\"盎格鲁\",\"href\":\"/item/%E7%9B%8E%E6%A0%BC%E9%B2%81\"},{\"name\":\"英国\",\"href\":\"/item/%E8%8B%B1%E5%9B%BD/144602\",\"id\":\"144602\"}]', 'https://baike.baidu.com/item/英格兰/1064478', '', '895');
INSERT INTO `baike_related_items_js` VALUES ('10752910', 7, '感知', '349', '32', '', '', '感知即意识对内外界信息的觉察，感觉，注意，知觉的一系列过程。感知可分为感觉过程和知觉过程。感觉过程中被感觉的信息包括有机体内部的生理状态，心理活动，也包含外部环境的存在以及存在关系信息。感觉不仅接受信息，也受到心理作用影响。知觉过程中对感觉信息进行有组织的处理，对事物存在形式进行理解认识。', '[]', 'https://baike.baidu.com/item/感知/10752910', '', '86');
INSERT INTO `baike_related_items_js` VALUES ('10883', 6, '大西洋', '1495', '112', '（世界四大洋之一）', '', '大西洋（Atlantic Ocean），是世界第二大洋，占地球表面积的近20%，原面积9165.5万平方千米，在南冰洋成立后，面积调整为7676.2万平方千米，平均深度3627米，最深处波多黎各海沟深达9219米。大西洋呈“S”型，以赤道为界被划分成北大西洋和南大西洋。此外，大西洋还有数个附属海，较大的如地中海、加勒比海、北海、波罗的海、墨西哥湾等。大西洋南北距离甚远，故气候多样，自北部格陵兰岛的极地气候，直至西非、巴西沿岸的热带沙漠或雨林气候，大西洋都囊括其中。而在欧洲、美国、加拿大以及巴西和几内亚湾以南的海域则常年出现大风浪。', '[{\"name\":\"大西洋\",\"href\":\"/item/%E5%A4%A7%E8%A5%BF%E6%B4%8B/10883\",\"id\":\"10883\"},{\"name\":\"地球\",\"href\":\"/item/%E5%9C%B0%E7%90%83/6431\",\"id\":\"6431\"},{\"name\":\"南冰洋\",\"href\":\"/item/%E5%8D%97%E5%86%B0%E6%B4%8B\"},{\"name\":\"波多黎各海沟\",\"href\":\"/item/%E6%B3%A2%E5%A4%9A%E9%BB%8E%E5%90%84%E6%B5%B7%E6%B2%9F/5839252\",\"id\":\"5839252\"},{\"name\":\"地中海\",\"href\":\"/item/%E5%9C%B0%E4%B8%AD%E6%B5%B7/11515\",\"id\":\"11515\"},{\"name\":\"加勒比海\",\"href\":\"/item/%E5%8A%A0%E5%8B%92%E6%AF%94%E6%B5%B7/257070\",\"id\":\"257070\"},{\"name\":\"北海\",\"href\":\"/item/%E5%8C%97%E6%B5%B7/8036244\",\"id\":\"8036244\"},{\"name\":\"波罗的海\",\"href\":\"/item/%E6%B3%A2%E7%BD%97%E7%9A%84%E6%B5%B7/446433\",\"id\":\"446433\"},{\"name\":\"墨西哥湾\",\"href\":\"/item/%E5%A2%A8%E8%A5%BF%E5%93%A5%E6%B9%BE/318506\",\"id\":\"318506\"},{\"name\":\"格陵兰岛\",\"href\":\"/item/%E6%A0%BC%E9%99%B5%E5%85%B0%E5%B2%9B/23598\",\"id\":\"23598\"},{\"name\":\"极地气候\",\"href\":\"/item/%E6%9E%81%E5%9C%B0%E6%B0%94%E5%80%99/2381323\",\"id\":\"2381323\"},{\"name\":\"西非\",\"href\":\"/item/%E8%A5%BF%E9%9D%9E/5577721\",\"id\":\"5577721\"},{\"name\":\"巴西\",\"href\":\"/item/%E5%B7%B4%E8%A5%BF/5422\",\"id\":\"5422\"},{\"name\":\"欧洲\",\"href\":\"/item/%E6%AC%A7%E6%B4%B2/145550\",\"id\":\"145550\"},{\"name\":\"美国\",\"href\":\"/item/%E7%BE%8E%E5%9B%BD/125486\",\"id\":\"125486\"},{\"name\":\"加拿大\",\"href\":\"/item/%E5%8A%A0%E6%8B%BF%E5%A4%A7/145973\",\"id\":\"145973\"},{\"name\":\"几内亚湾\",\"href\":\"/item/%E5%87%A0%E5%86%85%E4%BA%9A%E6%B9%BE/318028\",\"id\":\"318028\"}]', 'https://baike.baidu.com/item/大西洋/10883', '', '6230');
INSERT INTO `baike_related_items_js` VALUES ('109997', 7, '英语', '26708', '539', '（印欧语系-日耳曼语族下语言）', '', '英语（English）是印欧语系-日耳曼语族下的语言，由26个字母组成，英文字母渊源于拉丁字母，拉丁字母渊源于希腊字母，而希腊字母则是由腓尼基字母演变而来的。英语是国际指定的官方语言（作为母语），也是世界上使用最广泛的语言，英语包含约49万词，外加技术名词约30万个，是词汇最多的语言，也是欧盟以及许多国际组织以及英联邦国家的官方语言，拥有世界第三位的母语使用者人数，仅次于汉语和西班牙语母语使用者人数。英语由古代从丹麦等斯堪的纳维亚半岛以及德国、荷兰及周边移民至不列颠群岛的盎格鲁-撒克逊人，以及朱特部落的白人所说的语言演变而来，并通过英国的殖民活动传播到了世界各地。由于在历史上曾和多种民族语言接触，它的词汇从一元变为多元，语法从“多屈折”变为“少屈折”，语音也发生了规律性的变化。在19至20世纪，英国以及美国在文化、经济、军事、政治和科学在世界上的领先地位使得英语成为一种国际语言。如今，许多国际场合都使用英语做为沟通媒介。英语也是与电脑联系最密切的语言，大多数编程语言都与英语有联系，而且随着网络的使用，英文的使用更普及。英语是联合国的工作语言之一。 低地撒克逊语、丹麦语、德语、荷兰语和英语也很接近。拥有法国血统的诺曼人于11世纪征服英格兰王国，带来数万法语词汇和拉丁语词汇，很大程度地丰富了英语词汇外，相对也驱使不少原生的语汇作废。', '[{\"name\":\"英语\",\"href\":\"/item/%E8%8B%B1%E8%AF%AD/19915502\",\"id\":\"19915502\"},{\"name\":\"印欧语系\",\"href\":\"/item/%E5%8D%B0%E6%AC%A7%E8%AF%AD%E7%B3%BB/1188904\",\"id\":\"1188904\"},{\"name\":\"日耳曼语族\",\"href\":\"/item/%E6%97%A5%E8%80%B3%E6%9B%BC%E8%AF%AD%E6%97%8F/1188647\",\"id\":\"1188647\"},{\"name\":\"拉丁字母\",\"href\":\"/item/%E6%8B%89%E4%B8%81%E5%AD%97%E6%AF%8D/1936851\",\"id\":\"1936851\"},{\"name\":\"希腊字母\",\"href\":\"/item/%E5%B8%8C%E8%85%8A%E5%AD%97%E6%AF%8D/4428067\",\"id\":\"4428067\"},{\"name\":\"腓尼基字母\",\"href\":\"/item/%E8%85%93%E5%B0%BC%E5%9F%BA%E5%AD%97%E6%AF%8D/5285617\",\"id\":\"5285617\"},{\"name\":\"官方语言\",\"href\":\"/item/%E5%AE%98%E6%96%B9%E8%AF%AD%E8%A8%80/2410217\",\"id\":\"2410217\"},{\"name\":\"英联邦国家\",\"href\":\"/item/%E8%8B%B1%E8%81%94%E9%82%A6%E5%9B%BD%E5%AE%B6/3905041\",\"id\":\"3905041\"},{\"name\":\"官方语言\",\"href\":\"/item/%E5%AE%98%E6%96%B9%E8%AF%AD%E8%A8%80/2410217\",\"id\":\"2410217\"},{\"name\":\"斯堪的纳维亚半岛\",\"href\":\"/item/%E6%96%AF%E5%A0%AA%E7%9A%84%E7%BA%B3%E7%BB%B4%E4%BA%9A%E5%8D%8A%E5%B2%9B/531962\",\"id\":\"531962\"},{\"name\":\"德国\",\"href\":\"/item/%E5%BE%B7%E5%9B%BD/147953\",\"id\":\"147953\"},{\"name\":\"荷兰\",\"href\":\"/item/%E8%8D%B7%E5%85%B0/190469\",\"id\":\"190469\"},{\"name\":\"不列颠群岛\",\"href\":\"/item/%E4%B8%8D%E5%88%97%E9%A2%A0%E7%BE%A4%E5%B2%9B/6312089\",\"id\":\"6312089\"},{\"name\":\"盎格鲁-撒克逊人\",\"href\":\"/item/%E7%9B%8E%E6%A0%BC%E9%B2%81-%E6%92%92%E5%85%8B%E9%80%8A%E4%BA%BA/8591707\",\"id\":\"8591707\"},{\"name\":\"白人\",\"href\":\"/item/%E7%99%BD%E4%BA%BA/6715447\",\"id\":\"6715447\"},{\"name\":\"民族语言\",\"href\":\"/item/%E6%B0%91%E6%97%8F%E8%AF%AD%E8%A8%80/15817432\",\"id\":\"15817432\"},{\"name\":\"美国\",\"href\":\"/item/%E7%BE%8E%E5%9B%BD/125486\",\"id\":\"125486\"},{\"name\":\"文化\",\"href\":\"/item/%E6%96%87%E5%8C%96/23624\",\"id\":\"23624\"},{\"name\":\"政治\",\"href\":\"/item/%E6%94%BF%E6%B2%BB/169778\",\"id\":\"169778\"},{\"name\":\"编程语言\",\"href\":\"/item/%E7%BC%96%E7%A8%8B%E8%AF%AD%E8%A8%80/9845131\",\"id\":\"9845131\"},{\"name\":\"工作语言\",\"href\":\"/item/%E5%B7%A5%E4%BD%9C%E8%AF%AD%E8%A8%80/15714728\",\"id\":\"15714728\"},{\"name\":\"低地撒克逊语\",\"href\":\"/item/%E4%BD%8E%E5%9C%B0%E6%92%92%E5%85%8B%E9%80%8A%E8%AF%AD/9104730\",\"id\":\"9104730\"},{\"name\":\"丹麦语\",\"href\":\"/item/%E4%B8%B9%E9%BA%A6%E8%AF%AD/3546141\",\"id\":\"3546141\"},{\"name\":\"德语\",\"href\":\"/item/%E5%BE%B7%E8%AF%AD/240836\",\"id\":\"240836\"},{\"name\":\"荷兰语\",\"href\":\"/item/%E8%8D%B7%E5%85%B0%E8%AF%AD/676102\",\"id\":\"676102\"},{\"name\":\"诺曼人\",\"href\":\"/item/%E8%AF%BA%E6%9B%BC%E4%BA%BA/10972144\",\"id\":\"10972144\"},{\"name\":\"英格兰\",\"href\":\"/item/%E8%8B%B1%E6%A0%BC%E5%85%B0\"}]', 'https://baike.baidu.com/item/英语/109997', '', '19915502');
INSERT INTO `baike_related_items_js` VALUES ('114119', 7, '因特网', '7654', '848', '', '', '因特网（Internet）是一组全球信息资源的总汇。有一种粗略的说法，认为INTERNET是由于许多小的网络（子网）互联而成的一个逻辑网，每个子网中连接着若干台计算机（主机）。Internet以相互交流信息资源为目的，基于一些共同的协议，并通过许多路由器和公共互联网而成，它是一个信息资源和资源共享的集合。', '[]', 'https://baike.baidu.com/item/因特网/114119', '', '155722');
INSERT INTO `baike_related_items_js` VALUES ('1145168', 10, '运动系统', '501', '52', '', '', '运动系统由骨、关节和骨骼肌三种器官组成。骨以不同形式连结在一起，构成骨骼。形成了人体的基本形态，并为肌肉提供附着，在神经支配下，肌肉收缩，牵拉其所附着的骨，以可动的骨连结为枢纽，产生杠杆运动。运动系统主要的功能是运动。简单的移位和高级活动如语言、书写等，都是由骨、骨连结和骨骼肌实现的。运动系统的第二个功能是支持。构成人体基本形态，头、颈、胸、腹、四肢，维持体姿。运动系统的第三个功能是保护。由骨、骨连结和骨骼肌形成了多个体腔，颅腔、胸腔、腹腔和盆腔，保护脏器。从运动角度看，骨是被动部分，骨骼肌是动力部分，关节是运动的枢纽。能在体表看到或摸到的一些骨的突起或肌的隆起，称为体表标志。它们对于定位体内的器官、结构等具有标志性意义。', '[{\"name\":\"器官\",\"href\":\"/item/%E5%99%A8%E5%AE%98/53932\",\"id\":\"53932\"},{\"name\":\"神经支配\",\"href\":\"/item/%E7%A5%9E%E7%BB%8F%E6%94%AF%E9%85%8D/8221041\",\"id\":\"8221041\"}]', 'https://baike.baidu.com/item/运动系统/1145168', '', '33802');
INSERT INTO `baike_related_items_js` VALUES ('1176273', 7, '业务', '1298', '27', '', '', '“业务”更白话一些来说，就是各行业中需要处理的事务，但通常偏向指销售的事务，因为任何公司单位最终仍然是以销售产品、销售服务、销售技术等等为主。“业务”最终的目的是“售出产品，换取利润”。所以通常会把业务员等于销售员，也就是这个原因，业务就是进行或处理商业上相关的活动。业务也是渠道就是指产家与销点之间关系是通过渠道之间建立起来的。而业务员在这中间起了重大的作用。业务员的工作直接影响到产家、销点、消费者这三者之间的关系。', '[{\"name\":\"业务员\",\"href\":\"/item/%E4%B8%9A%E5%8A%A1%E5%91%98/1579128\",\"id\":\"1579128\"},{\"name\":\"原因\",\"href\":\"/item/%E5%8E%9F%E5%9B%A0/32935\",\"id\":\"32935\"}]', 'https://baike.baidu.com/item/业务/1176273', '', '81');
INSERT INTO `baike_related_items_js` VALUES ('1188904', 6, '印欧语系', '888', '100', '', '', '印欧语系（英：Indo-European languages）是十九世纪的英国人威廉·琼斯提出的一个语言学概念，即认为印度和欧洲的大部分语言都是从“原始印欧语”分化出来的，这些语言彼此之间具有亲属关系和相似性。按照母语人口来排名，印欧语系是世界上第一大语系，占世界人口的41.8%。如今印欧语系包含了四百多种语言，其中包括英语、德语、法语、俄语、威尔士语、希腊语、印地语、伊朗语、阿尔巴尼亚语、亚美尼亚语、波罗地语等。是当代世界上分布区域最广的一个语系，使用者几乎遍及整个欧洲、美洲、澳大利亚、新西兰，还有非洲和亚洲的部分地区。从15世纪开始，随着欧洲殖民势力不断扩张，一些欧洲语言陆续传到世界其他许多地区，这是印欧语系分布如此之广的直接原因。今天，以某一种印欧语系语言为自己母语的人，加在一起有15亿以上。需要指出的是，欧洲的巴斯克语、匈牙利语、拉普语、芬兰语、爱沙尼亚语、苏联的少数几种阿尔泰语言、乌拉尔语言、高加索语言、土耳其语、马耳他语，以及印度南部的达罗毗荼（德拉维达）诸语言虽然也分布于欧洲或印度，但均不属印欧语系。', '[{\"name\":\"十九世纪\",\"href\":\"/item/%E5%8D%81%E4%B9%9D%E4%B8%96%E7%BA%AA/9848425\",\"id\":\"9848425\"},{\"name\":\"英国人\",\"href\":\"/item/%E8%8B%B1%E5%9B%BD%E4%BA%BA/74292\",\"id\":\"74292\"},{\"name\":\"印度\",\"href\":\"/item/%E5%8D%B0%E5%BA%A6/121904\",\"id\":\"121904\"},{\"name\":\"欧洲\",\"href\":\"/item/%E6%AC%A7%E6%B4%B2/145550\",\"id\":\"145550\"},{\"name\":\"印欧语系\",\"href\":\"/item/%E5%8D%B0%E6%AC%A7%E8%AF%AD%E7%B3%BB/1188904\",\"id\":\"1188904\"},{\"name\":\"英语\",\"href\":\"/item/%E8%8B%B1%E8%AF%AD/109997\",\"id\":\"109997\"},{\"name\":\"德语\",\"href\":\"/item/%E5%BE%B7%E8%AF%AD/240836\",\"id\":\"240836\"},{\"name\":\"法语\",\"href\":\"/item/%E6%B3%95%E8%AF%AD/660115\",\"id\":\"660115\"},{\"name\":\"俄语\",\"href\":\"/item/%E4%BF%84%E8%AF%AD/315852\",\"id\":\"315852\"},{\"name\":\"威尔士语\",\"href\":\"/item/%E5%A8%81%E5%B0%94%E5%A3%AB%E8%AF%AD/4743146\",\"id\":\"4743146\"},{\"name\":\"希腊语\",\"href\":\"/item/%E5%B8%8C%E8%85%8A%E8%AF%AD/675775\",\"id\":\"675775\"},{\"name\":\"印地语\",\"href\":\"/item/%E5%8D%B0%E5%9C%B0%E8%AF%AD/1192255\",\"id\":\"1192255\"},{\"name\":\"伊朗语\",\"href\":\"/item/%E4%BC%8A%E6%9C%97%E8%AF%AD/2883378\",\"id\":\"2883378\"},{\"name\":\"阿尔巴尼亚语\",\"href\":\"/item/%E9%98%BF%E5%B0%94%E5%B7%B4%E5%B0%BC%E4%BA%9A%E8%AF%AD/1190175\",\"id\":\"1190175\"},{\"name\":\"亚美尼亚语\",\"href\":\"/item/%E4%BA%9A%E7%BE%8E%E5%B0%BC%E4%BA%9A%E8%AF%AD/1192594\",\"id\":\"1192594\"},{\"name\":\"语系\",\"href\":\"/item/%E8%AF%AD%