INSERT INTO `baike_related_items_js` VALUES ('1218690', 7, '组合', '497', '34', '（汉语词语）', '', '组合，汉语词语.，既可以作为名词又可以作为动词使用。作为名词，指由几个部分或个体.结合成的整体；作为动词，是指组织成整体。', '[{\"name\":\"动词\",\"href\":\"/item/%E5%8A%A8%E8%AF%8D/502192\",\"id\":\"502192\"},{\"name\":\"整体\",\"href\":\"/item/%E6%95%B4%E4%BD%93/7193606\",\"id\":\"7193606\"}]', 'https://baike.baidu.com/item/组合/1218690', '', '479832');
INSERT INTO `baike_related_items_js` VALUES ('124859', 6, '电脑', '7856', '262', '（计算机）', '', '电脑（Computer）是一种利用电子学原理根据一系列指令来对数据进行处理的设备。电脑可以分为两部分：软件系统和硬件系统。第一台电脑是1946年2月14日在美国宾夕法尼亚大学诞生的ENIAC通用电子计算机。人们把没有安装任何软件的计算机称为裸机。随着科技的发展，现在新出现一些新型计算机有：生物计算机、光子计算机、量子计算机等。 1954年5月24日，这时晶体管电子计算机诞生。', '[{\"name\":\"软件系统\",\"href\":\"/item/%E8%BD%AF%E4%BB%B6%E7%B3%BB%E7%BB%9F/224122\",\"id\":\"224122\"},{\"name\":\"硬件系统\",\"href\":\"/item/%E7%A1%AC%E4%BB%B6%E7%B3%BB%E7%BB%9F/1513031\",\"id\":\"1513031\"},{\"name\":\"美国宾夕法尼亚大学\",\"href\":\"/item/%E7%BE%8E%E5%9B%BD%E5%AE%BE%E5%A4%95%E6%B3%95%E5%B0%BC%E4%BA%9A%E5%A4%A7%E5%AD%A6/6792310\",\"id\":\"6792310\"},{\"name\":\"ENIAC\",\"href\":\"/item/ENIAC\"},{\"name\":\"生物计算机\",\"href\":\"/item/%E7%94%9F%E7%89%A9%E8%AE%A1%E7%AE%97%E6%9C%BA/363245\",\"id\":\"363245\"},{\"name\":\"光子计算机\",\"href\":\"/item/%E5%85%89%E5%AD%90%E8%AE%A1%E7%AE%97%E6%9C%BA/1880523\",\"id\":\"1880523\"},{\"name\":\"量子计算机\",\"href\":\"/item/%E9%87%8F%E5%AD%90%E8%AE%A1%E7%AE%97%E6%9C%BA/363335\",\"id\":\"363335\"}]', 'https://baike.baidu.com/item/电脑/124859', '', '140338');
INSERT INTO `baike_related_items_js` VALUES ('125486', 7, '美国', '52966', '3445', '（美利坚合众国）', '', '美利坚合众国（英语：United States of America），简称“美国”（United States），是由华盛顿哥伦比亚特区、50个州和关岛等众多海外领土组成的联邦共和立宪制国家。其主体部分位于北美洲中部，美国中央情报局《世界概况》1989年至1996年初始版美国总面积是937.3万平方公里，人口3.3亿[1] ，通用英语，是一个移民国家。[2] 美国原为印第安人的聚居地，15世纪末，西班牙、荷兰、法国、英国等相继移民至此。[2] 18世纪前，英国在美国大西洋沿岸建立了13个英属北美殖民地。1775年，爆发了美国人民反抗大英帝国殖民统治的独立战争。1776年7月4日，在费城召开了第二次大陆会议，由乔治·华盛顿任大陆军总司令，发表《独立宣言》，宣布美利坚合众国正式成立。[2] 1783年独立战争结束，英国承认13个殖民地独立。1787年通过美国宪法，成立联邦制国家。1861年~1865年，美国爆发了南北战争。亚伯拉罕·林肯领导北方的自由州战胜了南方的蓄奴州。美国从此结束了“半奴隶半自由的状态”，开始全面实行自由资本主义，走上了快速发展的道路。1803年~1959年间，通过购买和战争的手段，领土不断扩张。美国是一个高度发达的资本主义国家，在两次世界大战中，美国和其他盟国取得胜利，经历数十年的冷战，在苏联解体后，成为目前唯一的超级大国，在经济、文化、工业等领域都处于全世界的领先地位。[3-4] ', '[{\"name\":\"华盛顿哥伦比亚特区\",\"href\":\"/item/%E5%8D%8E%E7%9B%9B%E9%A1%BF%E5%93%A5%E4%BC%A6%E6%AF%94%E4%BA%9A%E7%89%B9%E5%8C%BA/83601\",\"id\":\"83601\"},{\"name\":\"州\",\"href\":\"/item/%E5%B7%9E\"},{\"name\":\"关岛\",\"href\":\"/item/%E5%85%B3%E5%B2%9B/519630\",\"id\":\"519630\"},{\"name\":\"海外领土\",\"href\":\"/item/%E6%B5%B7%E5%A4%96%E9%A2%86%E5%9C%9F/5127375\",\"id\":\"5127375\"},{\"name\":\"共和立宪制\",\"href\":\"/item/%E5%85%B1%E5%92%8C%E7%AB%8B%E5%AE%AA%E5%88%B6\"},{\"name\":\"北美洲\",\"href\":\"/item/%E5%8C%97%E7%BE%8E%E6%B4%B2/135465\",\"id\":\"135465\"},{\"name\":\"美国中央情报局\",\"href\":\"/item/%E7%BE%8E%E5%9B%BD%E4%B8%AD%E5%A4%AE%E6%83%85%E6%8A%A5%E5%B1%80\"},{\"name\":\"世界概况\",\"href\":\"/item/%E4%B8%96%E7%95%8C%E6%A6%82%E5%86%B5\"},{\"name\":\"英语\",\"href\":\"/item/%E8%8B%B1%E8%AF%AD/109997\",\"id\":\"109997\"},{\"name\":\"移民\",\"href\":\"/item/%E7%A7%BB%E6%B0%91/12980648\",\"id\":\"12980648\"},{\"name\":\"印第安人\",\"href\":\"/item/%E5%8D%B0%E7%AC%AC%E5%AE%89%E4%BA%BA/254718\",\"id\":\"254718\"},{\"name\":\"西班牙\",\"href\":\"/item/%E8%A5%BF%E7%8F%AD%E7%89%99/148941\",\"id\":\"148941\"},{\"name\":\"荷兰\",\"href\":\"/item/%E8%8D%B7%E5%85%B0/190469\",\"id\":\"190469\"},{\"name\":\"法国\",\"href\":\"/item/%E6%B3%95%E5%9B%BD/1173384\",\"id\":\"1173384\"},{\"name\":\"英国\",\"href\":