INSERT INTO `baike_related_items_js` VALUES ('129361', 8, '塞浦路斯', '2196', '316', '', '', '塞浦路斯共和国（希腊语：Κύπρος；土耳其语：Kıbrıs），简称塞浦路斯，是位于欧洲与亚洲交界处的一个岛国，处于地中海东部，面积达9,251平方公里。塞浦路斯在地理位置上属于亚洲[1] ，但在文化、政治上又是欧洲的一部分[2] 。已知人类在塞浦路斯的活动足迹最早可以追溯至公元前10,000年，此一时期的遗址有乔伊鲁科蒂亚，为新石器时代保存至今依然完好的建筑群。塞浦路斯因地处地中海进入西亚地区的要冲，公元前1500年古希腊人移居塞岛。后曾被亚述、古埃及、波斯、古罗马和拜占庭统治。[3] 公元前333年，亚历山大大帝从波斯人手中接管了此岛。1571年由奥斯曼帝国统治。1878年被割让给英国，1925年正式沦为英国殖民地。1960年8月16日宣告独立，隔年成为英联邦成员国。[4] 塞浦路斯独立后，主体民族希腊人和少数民族土耳其人零星冲突不断，直至1974年爆发严重的种族流血冲突。主要居住于该岛北部的土耳其人在土耳其的干预和支持下在当地另立政权北塞浦路斯土耳其共和国。因此塞浦路斯共和国法理主权为塞浦路斯全岛及其周围海域（除了一小部分地区因为条约分配予英国作为军事基地），然而事实上有效统治区域仅为南方，占全岛面积的63%。北塞浦路斯作为政治实体目前仅为土耳其所承认。[3] 塞浦路斯是一个发达的资本主义国家，于2004年5月1日加入欧盟。[5] ', '[{\"name\":\"希腊语\",\"href\":\"/item/%E5%B8%8C%E8%85%8A%E8%AF%AD/675775\",\"id\":\"675775\"},{\"name\":\"土耳其语\",\"href\":\"/item/%E5%9C%9F%E8%80%B3%E5%85%B6%E8%AF%AD/4743637\",\"id\":\"4743637\"},{\"name\":\"欧洲\",\"href\":\"/item/%E6%AC%A7%E6%B4%B2/145550\",\"id\":\"145550\"},{\"name\":\"亚洲\",\"href\":\"/item/%E4%BA%9A%E6%B4%B2/133681\",\"id\":\"133681\"},{\"name\":\"岛国\",\"href\":\"/item/%E5%B2%9B%E5%9B%BD/6530236\",\"id\":\"6530236\"},{\"name\":\"地中海\",\"href\":\"/item/%E5%9C%B0%E4%B8%AD%E6%B5%B7/11515\",\"id\":\"11515\"},{\"name\":\"平方公里\",\"href\":\"/item/%E5%B9%B3%E6%96%B9%E5%85%AC%E9%87%8C\"},{\"name\":\"乔伊鲁科蒂亚\",\"href\":\"/item/%E4%B9%94%E4%BC%8A%E9%B2%81%E7%A7%91%E8%92%82%E4%BA%9A/7789003\",\"id\":\"7789003\"},{\"name\":\"新石器时代\",\"href\":\"/item/%E6%96%B0%E7%9F%B3%E5%99%A8%E6%97%B6%E4%BB%A3/21432\",\"id\":\"21432\"},{\"name\":\"西亚\",\"href\":\"/item/%E8%A5%BF%E4%BA%9A/524955\",\"id\":\"524955\"},{\"name\":\"古希腊\",\"href\":\"/item/%E5%8F%A4%E5%B8%8C%E8%85%8A/14206\",\"id\":\"14206\"},{\"name\":\"亚述\",\"href\":\"/item/%E4%BA%9A%E8%BF%B0/1156579\",\"id\":\"1156579\"},{\"name\":\"古埃及\",\"href\":\"/item/%E5%8F%A4%E5%9F%83%E5%8F%8A/226771\",\"id\":\"226771\"},{\"name\":\"波斯\",\"href\":\"/item/%E6%B3%A2%E6%96%AF/157194\",\"id\":\"157194\"},{\"name\":\"古罗马\",\"href\":\"/item/%E5%8F%A4%E7%BD%97%E9%A9%AC/888