INSERT INTO `baike_related_items_js` VALUES ('138427', 9, '三皇五帝', '7016', '799', '（历史神话中的人物）', '', '三皇，有前三皇、中三皇、后三皇之分，合为九皇。《路史》：前天皇、前地皇、前人皇之事太过久古，杳杳冥冥，所谓事有不可尽究，物有不可臆言。史书上说盘古开天辟地后第一代天下君主中天皇君天皇氏，兄弟十三人，号曰天灵，其中一人发明了数字，继而又发明了天干、地支，为人推为皇。其余兄弟十二人带领部众各占一方，立国称皇，各传国一万八千年。[1-2] 三皇五帝分别有以下各种说法：天皇、地皇、泰皇；出自《史记·秦始皇本纪》天皇、地皇、人皇；出自《史记·补三皇本纪》燧人、伏羲、神农；出自《尚书大传》伏羲、女娲、神农；出自《春秋运斗枢》伏羲、神农、黄帝。出自《三字经》东方天帝太昊伏羲，属神句芒；南方天帝炎帝神农，属神祝融；西方天帝少昊金天，属神蓐收；北方天帝颛顼高阳，属神玄冥；中央天帝黄帝轩辕，属神后土。三皇五帝，并不是真正的帝王，仅太古时期出现的为人类作出卓越贡献的部落首领或部落联盟首领，後人追尊他们为“皇”或“帝”。人民则把他们敬为神灵，以各种美丽的神话传说来宣扬他们的伟大业绩。2.指历史时期。即“三皇五帝时代”，又称“上古时代”、“远古时代”或“神话时代”。也可以简称为“三皇五帝”。三皇五帝率领民众开创了中华上古文明，近现代考古发现了大量与这一时期相对应的龙山文化遗址，证明三皇五帝时期确实存在。', '[{\"name\":\"盘古开天辟地\",\"href\":\"/item/%E7%9B%98%E5%8F%A4%E5%BC%80%E5%A4%A9%E8%BE%9F%E5%9C%B0/1322995\",\"id\":\"1322995\"},{\"name\":\"天皇氏\",\"href\":\"/item/%E5%A4%A9%E7%9A%87%E6%B0%8F/2903671\",\"id\":\"2903671\"},{\"name\":\"天皇\",\"href\":\"/item/%E5%A4%A9%E7%9A%87/8103382\",\"id\":\"8103382\"},{\"name\":\"地皇\",\"href\":\"/item/%E5%9C%B0%E7%9A%87/3167881\",\"id\":\"3167881\"},{\"name\":\"泰皇\",\"href\":\"/item/%E6%B3%B0%E7%9A%87/8383938\",\"id\":\"8383938\"},{\"name\":\"史记\",\"href\":\"/item/%E5%8F%B2%E8%AE%B0\"},{\"name\":\"秦始皇\",\"href\":\"/item/%E7%A7%A6%E5%A7%8B%E7%9A%87/6164\",\"id\":\"6164\"},{\"name\":\"天皇\",\"href\":\"/item/%E5%A4%A9%E7%9A%87/8103382\",\"id\":\"8103382\"},{\"name\":\"地皇\",\"href\":\"/item/%E5%9C%B0%E7%9A%87/3167881\",\"id\":\"3167881\"},{\"name\":\"人皇\",\"href\":\"/item/%E4%BA%BA%E7%9A%87/73631\",\"id\":\"73631\"},{\"name\":\"燧人\",\"href\":\"/item/%E7%87%A7%E4%BA%BA/279607\",\"id\":\"279607\"},{\"name\":\"伏羲\",\"href\":\"/item/%E4%BC%8F%E7%BE%B2/279357\",\"id\":\"279357\"},{\"name\":\"神农\",\"href\":\"/item/%E7%A5%9E%E5%86%9C/279451\",\"id\":\"279451\"},{\"name\":\"尚书大传\",\"href\":\"/item/%E5%B0%9A%E4%B9%A6%E5%A4%A7%E4%BC%A0/9626183\",\"id\":\"9626183\"},{\"name\":\"伏羲\",\"href\":\"/item/%E4%BC%8F%E7%BE%B2/279357\",\"id\":\"279357\"},{\"name\":\"女娲\",\"href\":\"/item/%E5%A5%B3%E5%A8%B2/6416\",\"id\":\