INSERT INTO `baike_related_items_js` VALUES ('140338', 5, '计算机', '14142', '1216', '', '', '计算机（computer）俗称电脑，是现代一种用于高速计算的电子计算机器，可以进行数值计算，又可以进行逻辑计算，还具有存储记忆功能。是能够按照程序运行，自动、高速处理海量数据的现代化智能电子设备。由硬件系统和软件系统所组成，没有安装任何软件的计算机称为裸机。可分为超级计算机、工业控制计算机、网络计算机、个人计算机、嵌入式计算机五类，较先进的计算机有生物计算机、光子计算机、量子计算机等。计算机发明者约翰·冯·诺依曼。计算机是20世纪最先进的科学技术发明之一，对人类的生产活动和社会活动产生了极其重要的影响，并以强大的生命力飞速发展。它的应用领域从最初的军事科研应用扩展到社会的各个领域，已形成了规模巨大的计算机产业，带动了全球范围的技术进步，由此引发了深刻的社会变革，计算机已遍及一般学校、企事业单位，进入寻常百姓家，成为信息社会中必不可少的工具。计算机的应用在中国越来越普遍，改革开放以后，中国计算机用户的数量不断攀升，应用水平不断提高，特别是互联网、通信、多媒体等领域的应用取得了不错的成绩。1996年至2009 年，计算机用户数量从原来的630万增长至6710 万台，联网计算机台数由原来的2.9万台上升至5940万台。互联网用户已经达到3.16 亿，无线互联网有6.7 亿移动用户，其中手机上网用户达1.17 亿，为全球第一位。', '[{\"name\":\"俗称\",\"href\":\"/item/%E4%BF%97%E7%A7%B0/6538506\",\"id\":\"6538506\"},{\"name\":\"电脑\",\"href\":\"/item/%E7%94%B5%E8%84%91/124859\",\"id\":\"124859\"},{\"name\":\"运行\",\"href\":\"/item/%E8%BF%90%E8%A1%8C/5480697\",\"id\":\"5480697\"},{\"name\":\"硬件\",\"href\":\"/item/%E7%A1%AC%E4%BB%B6\"},{\"name\":\"软件\",\"href\":\"/item/%E8%BD%AF%E4%BB%B6/12053\",\"id\":\"12053\"},{\"name\":\"组成\",\"href\":\"/item/%E7%BB%84%E6%88%90/10881662\",\"id\":\"10881662\"},{\"name\":\"网络计算机\",\"href\":\"/item/%E7%BD%91%E7%BB%9C%E8%AE%A1%E7%AE%97%E6%9C%BA/101471\",\"id\":\"101471\"},{\"name\":\"个人计算机\",\"href\":\"/item/%E4%B8%AA%E4%BA%BA%E8%AE%A1%E7%AE%97%E6%9C%BA/3731770\",\"id\":\"3731770\"},{\"name\":\"生物计算机\",\"href\":\"/item/%E7%94%9F%E7%89%A9%E8%AE%A1%E7%AE%97%E6%9C%BA/363245\",\"id\":\"363245\"},{\"name\":\"光子计算机\",\"href\":\"/item/%E5%85%89%E5%AD%90%E8%AE%A1%E7%AE%97%E6%9C%BA/1880523\",\"id\":\"1880523\"},{\"name\":\"量子计算机\",\"href\":\"/item/%E9%87%8F%E5%AD%90%E8%AE%A1%E7%AE%97%E6%9C%BA/363335\",\"id\":\"363335\"},{\"name\":\"约翰·冯·诺依曼\",\"href\":\"/item/%E7%BA%A6%E7%BF%B0%C2%B7%E5%86%AF%C2%B7%E8%AF%BA%E4%BE%9D%E6%9B%BC/986797\",\"id\":\"986797\"}]', 'https://baike.baidu.com/item/计算机/140338', '', '3045210');
INSERT INTO `baike_related_items_js` VALUES ('1405051', 9, '属性', '1014', '40', '（词语）', '', '属性就是人类对于一个对象的抽象方面的刻画[1] .一个具体事物，总是有许许多多的性质与关系，我们把一个事物的性质与关系，都叫作事物的属性。事物与属性是不可分的，事物都是有属性的事物，属性也都是事物的属性。一个事物与另一个事物的相同或相异，也就是一个事物的属性与另一事物的属性的相同或相异。由于事物属性的相同或相异，客观世界中就形成了许多不同的事物类。具有相同属性的事物就形成一类，具有不同属性的事物就分别地形成不同的类。苹果是一类事物，它是由许多具有相同属性的个别事物组成的。梨也是一类事物，它也是由许多具有相同属性的个别事物组成的。苹果和梨是两个不同的类。苹果这个类的共同属性是不同于梨这个类的共同属性的。', '[{\"name\":\"刻画\",\"href\":\"/item/%E5%88%BB%E7%94%BB\"},{\"name\":\"具体\",\"href\":\"/item/%E5%85%B7%E4%BD%93/4577821\",\"id\":\"4577821\"},{\"name\":\"性质\",\"href\":\"/item/%E6%80%A7%E8%B4%A8/10893606\",\"id\":\"10893606\"}]', 'https://baike.baidu.com/item/属性/1405051', '', '33073');
INSERT INTO `baike_related_items_js` VALUES ('1416088', 6, '非政府组织', '686', '118', '', '', '非政府组织是英文Non-Governmental Organizations的意译，英文缩写NGO。20世纪80年代以来，人们在各种场合越来越多地提及非政府组织（NGO）与非营利组织（NPO），把非政府组织与非营利组织看作在公共管理领域作用日益重要的新兴组织形式。2014年12月22日，全国人大常委会将审议境外非政府组织管理法草案。草案规定了境外非政府组织在中国境内设立代表机构和开展一次性临时活动的申请登记许可程序，还明确了违法行为的法律责任。[1] ', '[{\"name\":\"场合\",\"href\":\"/item/%E5%9C%BA%E5%90%88/5151566\",\"id\":\"5151566\"},{\"name\":\"非营利组织\",\"href\":\"/item/%E9%9D%9E%E8%90%A5%E5%88%A9%E7%BB%84%E7%BB%87/3463603\",\"id\":\"3463603\"},{\"name\":\"法律责任\",\"href\":\"/item/%E6%B3%95%E5%BE%8B%E8%B4%A3%E4%BB%BB/416117\",\"id\":\"416117\"}]', 'https://baike.baidu.com/item/非政府组织/1416088', '', '779832');
INSERT INTO `baike_related_items_js` VALUES ('145550', 9, '欧洲', '7043', '370', '（地球七大洲之一）', '', '欧洲，也称作“欧罗巴洲”（Europe），名字源于希腊神话的人物“欧罗巴”（希腊语：Ευρώπης），欧洲位于东半球的西北部，北临北冰洋，西濒大西洋，南滨大西洋的属海地中海和黑海。大陆东至极地乌拉尔山脉（66°10′E，67°46′N），南至马罗基角（西经5度36分，北纬36度），西至罗卡角（9°31′W，38°47′N），北至诺尔辰角（27°42′E，71°08′N）。[1] 欧洲的面积是世界第六，人口密度70人/km²，是世界人口第三的洲，仅次于亚洲和非洲，99%以上人口属欧罗巴人种，是人种比较单一的大洲。欧洲是人类生活水平较高、环境以及人类发展指数较高及适宜居住的大洲之一。[1] 欧洲东以乌拉尔山脉、乌拉尔河，东南以里海、大高加索山脉和黑海与亚洲为界，西隔大西洋、格陵兰海、丹麦海峡与北美洲相望，北接北极海，南隔地中海与非洲相望（分界线为：直布罗陀海峡）。欧洲最北端是挪威的诺尔辰角，最南端是西班牙的马罗基角，最西端是葡萄牙的罗卡角。欧洲是世界上第二小的洲、大陆，仅比大洋洲大一些，其与亚洲合称为亚欧大陆，而与亚洲、非洲合称为亚欧非大陆。因为文化、经济、政治等原因，欧洲的边界总是不一样的，所以就有了多个‘欧洲’的概念。[1] ', '[{\"name\":\"欧罗巴洲\",\"href\":\"/item/%E6%AC%A7%E7%BD%97%E5%B7%B4%E6%B4%B2/2693796\",\"id\":\"2693796\"},{\"name\":\"希腊神话\",\"href\":\"/item/%E5%B8%8C%E8%85%8A%E7%A5%9E%E8%AF%9D/63444\",\"id\":\"63444\"},{\"name\":\"欧罗巴\",\"href\":\"/item/%E6%AC%A7%E7%BD%97%E5%B7%B4/67286\",\"id\":\"67286\"},{\"name\":\"希腊语\",\"href\":\"/item/%E5%B8%8C%E8%85%8A%E8%AF%AD/675775\",\"id\":\"675775\"},{\"name\":\"北冰洋\",\"href\":\"/item/%E5%8C%97%E5%86%B0%E6%B4%8B/443996\",\"id\":\"443996\"},{\"name\":\"地中海\",\"href\":\"/item/%E5%9C%B0%E4%B8%AD%E6%B5%B7/11515\",\"id\":\"11515\"},{\"name\":\"黑海\",\"href\":\"/item/%E9%BB%91%E6%B5%B7/10976\",\"id\":\"10976\"},{\"name\":\"亚洲\",\"href\":\"/item/%E4%BA%9A%E6%B4%B2/133681\",\"id\":\"133681\"},{\"name\":\"欧罗巴人种\",\"href\":\"/item/%E6%AC%A7%E7%BD%97%E5%B7%B4%E4%BA%BA%E7%A7%8D/3627038\",\"id\":\"3627038\"},{\"name\":\"生活水平\",\"href\":\"/item/%E7%94%9F%E6%B4%BB%E6%B0%B4%E5%B9%B3/7959051\",\"id\":\"7959051\"},{\"name\":\"人类发展指数\",\"href\":\"/item/%E4%BA%BA%E7%B1%BB%E5%8F%91%E5%B1%95%E6%8C%87%E6%95%B0/1239294\",\"id\":\"1239294\"},{\"name\":\"乌拉尔山脉\",\"href\":\"/item/%E4%B9%8C%E6%8B%89%E5%B0%94%E5%B1%B1%E8%84%89/1317856\",\"id\":\"1317856\"},{\"name\":\"乌拉尔河\",\"href\":\"/item/%E4%B9%8C%E6%8B%89%E5%B0%94%E6%B2%B3/4385108\",\"id\":\"4385108\"},{\"name\":\"里海\",\"href\":\"/item/%E9%87%8C%E6%B5%B7/310941\",\"id\":\"310941\"},{\"name\":\"大高加索山脉\",\"href\":\"/item/%E5%A4%A7%E9%AB%98%E5%8A%A0%E7%B4%A2%E5%B1%B1%E8%84%89/5387962\",\"id\":\"5387962\"},{\"name\":\"黑海\",\"href\":\"/item/%E9%BB%91%E6%B5%B7/10976\",\"id\":\"10976\"},{\"name\":\"大西洋\",\"href\":\"/item/%E5%A4%A7%E8%A5%BF%E6%B4%8B/10883\",\"id\":\"10883\"},{\"name\":\"格陵兰海\",\"href\":\"/item/%E6%A0%BC%E9%99%B5%E5%85%B0%E6%B5%B7/1011956\",\"id\":\"1011956\"},{\"name\":\"丹麦海峡\",\"href\":\"/item/%E4%B8%B9%E9%BA%A6%E6%B5%B7%E5%B3%A1/10806569\",\"id\":\"10806569\"},{\"name\":\"北美洲\",\"href\":\"/item/%E5%8C%97%E7%BE%8E%E6%B4%B2/135465\",\"id\":\"135465\"},{\"name\":\"地中海\",\"href\":\"/item/%E5%9C%B0%E4%B8%AD%E6%B5%B7/11515\",\"id\":\"11515\"},{\"name\":\"直布罗陀海峡\",\"href\":\"/item/%E7%9B%B4%E5%B8%83%E7%BD%97%E9%99%80%E6%B5%B7%E5%B3%A1/317363\",\"id\":\"317363\"},{\"name\":\"诺尔辰角\",\"href\":\"/item/%E8%AF%BA%E5%B0%94%E8%BE%B0%E8%A7%92/1868818\",\"id\":\"1868818\"},{\"name\":\"马罗基角\",\"href\":\"/item/%E9%A9%AC%E7%BD%97%E5%9F%BA%E8%A7%92/8836919\",\"id\":\"8836919\"},{\"name\":\"罗卡角\",\"href\":\"/item/%E7%BD%97%E5%8D%A1%E8%A7%92/2926231\",\"id\":\"2926231\"}]', 'https://baike.baidu.com/item/欧洲/145550', '', '197766');
INSERT INTO `baike_related_items_js` VALUES ('1513031', 7, '硬件系统', '354', '23', '', '', '硬件系统是指构成计算机的物理设备，即由机械、光、电、磁器件构成的具有计算、控制、存储、输入和输出功能的实体部件。如CPU、存储器、软盘驱动器、硬盘驱动器、光盘驱动器、主机板、各种卡及整机中的主机、显示器、打印机、绘图仪、调制解调器等等，整机硬件也称“硬设备”。 随着电子系统的复杂化，系统设计已经成为一门重要的学科，传统的反复试验法已经越来越不适应时代的发展。发展迅速的软硬件协同设计技术越来越受到人们的重视。它是在系统目标要求的指导下，通过综合分析系统软硬件功能及现有资源，最大限度地挖掘系统软硬件之间的并发性，协调设计软硬件体系结构，以使系统工作在最佳工作状态。', '[{\"name\":\"物理设备\",\"href\":\"/item/%E7%89%A9%E7%90%86%E8%AE%BE%E5%A4%87/2692368\",\"id\":\"2692368\"},{\"name\":\"输入\",\"href\":\"/item/%E8%BE%93%E5%85%A5/5481954\",\"id\":\"5481954\"},{\"name\":\"输出\",\"href\":\"/item/%E8%BE%93%E5%87%BA/11056752\",\"id\":\"11056752\"},{\"name\":\"存储器\",\"href\":\"/item/%E5%AD%98%E5%82%A8%E5%99%A8/1583185\",\"id\":\"1583185\"},{\"name\":\"软盘驱动器\",\"href\":\"/item/%E8%BD%AF%E7%9B%98%E9%A9%B1%E5%8A%A8%E5%99%A8/235608\",\"id\":\"235608\"},{\"name\":\"硬盘驱动器\",\"href\":\"/item/%E7%A1%AC%E7%9B%98%E9%A9%B1%E5%8A%A8%E5%99%A8/213766\",\"id\":\"213766\"},{\"name\":\"光盘驱动器\",\"href\":\"/item/%E5%85%89%E7%9B%98%E9%A9%B1%E5%8A%A8%E5%99%A8/212458\",\"id\":\"212458\"},{\"name\":\"主机\",\"href\":\"/item/%E4%B8%BB%E6%9C%BA\"},{\"name\":\"绘图仪\",\"href\":\"/item/%E7%BB%98%E5%9B%BE%E4%BB%AA/2626376\",\"id\":\"2626376\"},{\"name\":\"调制解调器\",\"href\":\"/item/%E8%B0%83%E5%88%B6%E8%A7%A3%E8%B0%83%E5%99%A8/103486\",\"id\":\"103486\"},{\"name\":\"电子系统\",\"href\":\"/item/%E7%94%B5%E5%AD%90%E7%B3%BB%E7%BB%9F/7322865\",\"id\":\"7322865\"},{\"name\":\"系统设计\",\"href\":\"/item/%E7%B3%BB%E7%BB%9F%E8%AE%BE%E8%AE%A1/3073283\",\"id\":\"3073283\"},{\"name\":\"软硬件协同设计\",\"href\":\"/item/%E8%BD%AF%E7%A1%AC%E4%BB%B6%E5%8D%8F%E5%90%8C%E8%AE%BE%E8%AE%A1/7654377\",\"id\":\"7654377\"},{\"name\":\"体系结构\",\"href\":\"/item/%E4%BD%93%E7%B3%BB%E7%BB%93%E6%9E%84/8174145\",\"id\":\"8174145\"}]', 'https://baike.baidu.com/item/硬件系统/1513031', '', '124859');
INSERT INTO `baike_related_items_js` VALUES ('1539938', 8, '个人', '642', '45', '', '', '个人，或者称个体，一般指一个人或是一个群体中的特定的主体。', '[{\"name\":\"个体\",\"href\":\"/item/%E4%B8%AA%E4%BD%93/2667121\",\"id\":\"2667121\"},{\"name\":\"一个\",\"href\":\"/item/%E4%B8%80%E4%B8%AA/45496\",\"id\":\"45496\"},{\"name\":\"主体\",\"href\":\"/item/%E4%B8%BB%E4%BD%93/2888766\",\"id\":\"2888766\"}]', 'https://baike.baidu.com/item/个人/1539938', '', '3463603');
INSERT INTO `baike_related_items_js` VALUES ('155722', 6, '网站', '2598', '342', '（互联网词汇）', '', '网站(Website)是指在因特网上根据一定的规则，使用HTML（标准通用标记语言下的一个应用）等工具制作的用于展示特定内容相关网页的集合。简单地说，网站是一种沟通工具，人们可以通过网站来发布自己想要公开的资讯，或者利用网站来提供相关的网络服务。人们可以通过网页浏览器来访问网站，获取自己需要的资讯或者享受网络服务。', '[{\"name\":\"因特网\",\"href\":\"/item/%E5%9B%A0%E7%89%B9%E7%BD%91/114119\",\"id\":\"114119\"},{\"name\":\"HTML\",\"href\":\"/item/HTML\"},{\"name\":\"标准通用标记语言\",\"href\":\"/item/%E6%A0%87%E5%87%86%E9%80%9A%E7%94%A8%E6%A0%87%E8%AE%B0%E8%AF%AD%E8%A8%80/6805073\",\"id\":\"6805073\"},{\"name\":\"网页\",\"href\":\"/item/%E7%BD%91%E9%A1%B5/99347\",\"id\":\"99347\"},{\"name\":\"沟通工具\",\"href\":\"/item/%E6%B2%9F%E9%80%9A%E5%B7%A5%E5%85%B7/7531004\",\"id\":\"7531004\"},{\"name\":\"网络服务\",\"href\":\"/item/%E7%BD%91%E7%BB%9C%E6%9C%8D%E5%8A%A1/9498645\",\"id\":\"9498645\"},{\"name\":\"网页浏览器\",\"href\":\"/item/%E7%BD%91%E9%A1%B5%E6%B5%8F%E8%A7%88%E5%99%A8/8309940\",\"id\":\"8309940\"},{\"name\":\"网络\",\"href\":\"/item/%E7%BD%91%E7%BB%9C\"}]', 'https://baike.baidu.com/item/网站/155722', '本词条由“科普中国”科学百科词条编写与应用工作项目审核。', '99347');
INSERT INTO `baike_related_items_js` VALUES ('1579128', 8, '业务员', '7203', '870', '', '', '业务员是指在组织中担负具体专项经济业务，如生产、计划、跟单、财会、统计、物价、广告等具体业务的工作人员。同时指负责某项具体业务操作的人员。在制单时，都可以称为业务员。', '[]', 'https://baike.baidu.com/item/业务员/1579128', '', '1176273');
INSERT INTO `baike_related_items_js` VALUES ('1604578', 6, '杀毒引擎', '288', '4', '', '', '用简单的话说，杀毒引擎就是一套判断特定程序行为是否为病毒程序（包括可疑的）的技术机制。杀毒引擎是杀毒软件的主要部分。是去检测和发现病毒的程序。而病毒库是已经发现的病毒的标本。用病毒库中的标本去对照机器中的所有程序或文件，看是不是符合这些标本，是则是病毒，否就不一定是病毒（因为还有很多没有被发现的或者刚刚产生的病毒）。', '[]', 'https://baike.baidu.com/item/杀毒引擎/1604578', '', '2874935');
INSERT INTO `baike_related_items_js` VALUES ('197766', 8, '希腊', '6076', '469', '', '', '希腊共和国（希腊语：Ελληνική Δημοκρατία），简称希腊（希腊语：Ελλάδα），是地处欧洲东南角、巴尔干半岛的南端的共和制国家。全国由半岛南部的伯罗奔尼撒半岛和爱琴海中的3000余座岛屿共同构成。希腊为连接欧亚非的战略要地，本土从西北至正北部分别邻阿尔巴尼亚、马其顿、保加利亚三国，东北与土耳其国境接壤。周围则自东而西分别濒临爱琴海、地中海本域与伊奥尼亚海。[1] 希腊的历史可一直上溯到古希腊文明，被视为西方文明的发源地。公元前3000年~前1100年克里特岛曾出现米诺斯文明，公元前1600年~前1050年伯罗奔尼撒半岛出现迈锡尼文明。[2] 公元前800年形成奴隶制城邦国家，前5世纪发展到鼎盛时期。公元前146年并入罗马帝国。[1] 15世纪中期被奥斯曼帝国统治。1821年，爆发希腊独立战争。1832年建立希腊王国。1974年通过全民公投改为共和制。[2] 希腊还是西方哲学、奥林匹克运动会、西方文学、历史学、政治科学、民主制度、科学和数学原理，以及西方戏剧的发源地。希腊的文化与技术进步对世界历史曾具有极大的影响力，通过亚历山大大帝和罗马帝国传播至东方世界和西方世界。[1] 希腊是一个发达的资本主义国家，也是欧盟和北约的成员国，而且还是巴尔干地区最大的经济体。其海运业，旅游、侨汇并列为外汇收入三大支柱。且农业发达，工业主要以食品加工和轻工业为主。希腊2016年人均国内生产总值因经济危机仅为欧盟平均水平的67%。[3] ', '[{\"name\":\"欧洲\",\"href\":\"/item/%E6%AC%A7%E6%B4%B2/145550\",\"id\":\"145550\"},{\"name\":\"巴尔干半岛\",\"href\":\"/item/%E5%B7%B4%E5%B0%94%E5%B9%B2%E5%8D%8A%E5%B2%9B/502528\",\"id\":\"502528\"},{\"name\":\"共和制\",\"href\":\"/item/%E5%85%B1%E5%92%8C%E5%88%B6/359379\",\"id\":\"359379\"},{\"name\":\"伯罗奔尼撒半岛\",\"href\":\"/item/%E4%BC%AF%E7%BD%97%E5%A5%94%E5%B0%BC%E6%92%92%E5%8D%8A%E5%B2%9B/1002732\",\"id\":\"1002732\"},{\"name\":\"爱琴海\",\"href\":\"/item/%E7%88%B1%E7%90%B4%E6%B5%B7/659\",\"id\":\"659\"},{\"name\":\"岛屿\",\"href\":\"/item/%E5%B2%9B%E5%B1%BF/1697394\",\"id\":\"1697394\"},{\"name\":\"战略要地\",\"href\":\"/item/%E6%88%98%E7%95%A5%E8%A6%81%E5%9C%B0/4566482\",\"id\":\"4566482\"},{\"name\":\"阿尔巴尼亚\",\"href\":\"/item/%E9%98%BF%E5%B0%94%E5%B7%B4%E5%B0%BC%E4%BA%9A/361248\",\"id\":\"361248\"},{\"name\":\"马其顿\",\"href\":\"/item/%E9%A9%AC%E5%85%B6%E9%A1%BF/417760\",\"id\":\"417760\"},{\"name\":\"保加利亚\",\"href\":\"/item/%E4%BF%9D%E5%8A%A0%E5%88%A9%E4%BA%9A/419072\",\"id\":\"419072\"},{\"name\":\"土耳其\",\"href\":\"/item/%E5%9C%9F%E8%80%B3%E5%85%B6/198448\",\"id\":\"198448\"},{\"name\":\"爱琴海\",\"href\":\"/item/%E7%88%B1%E7%90%B4%E6%B5%B7/659\",\"id\":\"659\"},{\"name\":\"地中海\",\"href\":\"/item/%E5%9C%B0%E4%B8%AD%E6%B5%B7/11515\",\"id\":\"11515\"},{\"name\":\"伊奥尼亚海\",\"href