INSERT INTO `baike_related_items_js` VALUES ('19963973', 8, '著作权法', '276', '', '（李明德、许超著图书）', '', '《著作权法(第2版)》以中国著作权法为主线，通过比较欧美等发达国家的著作权法，系统论述了著作权制度中的一系列问题，如著作权的概念、客体、内容、权利的限制与保护期限、权利的获得与归属、权利的转让与许可、侵权与救济等。', '[]', 'https://baike.baidu.com/item/著作权法/19963973', '', '269454');
INSERT INTO `baike_related_items_js` VALUES ('2', 9, '石纲', '2289', '834', '', '', '石纲 (1967.7—) 湖南长沙人。 擅长中国画。 长沙书画院画家。作品《团扇系列之八》荣获’92国际水墨画大奖赛优秀奖，《苍苍暗绝谷》获首届全国中国山水画展优秀奖，《楚地之灵》、《春兆》（合作）入选首届全国中国画展览，《扇面结集·楚云》入选第八届全国美展优秀作品展，后赴德国和马来西亚展出。', '[{\"name\":\"石纲\",\"href\":\"/item/%E7%9F%B3%E7%BA%B2/8438312\",\"id\":\"8438312\"},{\"name\":\"中国画\",\"href\":\"/item/%E4%B8%AD%E5%9B%BD%E7%94%BB/197394\",\"id\":\"197394\"}]', 'https://baike.baidu.com/item/石纲', '', '32935');
INSERT INTO `baike_related_items_js` VALUES ('2024035', 8, '英格兰人', '269', '12', '', '', '英格兰人（英语：English people，古英语：Anglecynn），又称英吉利人，是英国的主体民族，一般所说的英国人即英格兰人，使用英语，属印欧语系日耳曼语族，多信基督新教分支中的英国国教，极少数信仰天主教，主要分布在英格兰和威尔士，少数分布在苏格兰、北爱尔兰、美国、加拿大、澳大利亚、新西兰和南非。属欧罗巴人种，大多为大西洋波罗的海类型。他们在超过千年前被古英语称作“Anglecynn”时已有高度的身份认同。从种族角度来看，英格兰人被认为是盎格鲁-撒克逊人的后裔。[1] ', '[{\"name\":\"英语\",\"href\":\"/item/%E8%8B%B1%E8%AF%AD/109997\",\"id\":\"109997\"},{\"name\":\"古英语\",\"href\":\"/item/%E5%8F%A4%E8%8B%B1%E8%AF%AD/6391646\",\"id\":\"6391646\"},{\"name\":\"英国\",\"href\":\"/item/%E8%8B%B1%E5%9B%BD/144602\",\"id\":\"144602\"},{\"name\":\"英国人\",\"href\":\"/item/%E8%8B%B1%E5%9B%BD%E4%BA%BA/74292\",\"id\":\"74292\"},{\"name\":\"英语\",\"href\":\"/item/%E8%8B%B1%E8%AF%AD/109997\",\"id\":\"109997\"},{\"name\":\"印欧语系\",\"href\":\"/item/%E5%8D%B0%E6%AC%A7%E8%AF%AD%E7%B3%BB\"},{\"name\":\"日耳曼语族\",\"href\":\"/item/%E6%97%A5%E8%80%B3%E6%9B%BC%E8%AF%AD%E6%97%8F\"},{\"name\":\"基督新教\",\"href\":\"/item/%E5%9F%BA%E7%9D%A3%E6%96%B0%E6%95%99/2472355\",\"id\":\"2472355\"},{\"name\":\"英国国教\",\"href\":\"/item/%E8%8B%B1%E5%9B%BD%E5%9B%BD%E6%95%99/5095761\",\"id\":\"5095761\"},{\"name\":\"天主教\",\"href\":\"/item/%E5%A4%A9%E4%B8%BB%E6%95%99/201996\",\"id\":\"201996\"},{\"name\":\"英格兰\",\"href\":\"/item/%E8%8B%B1%E6%A0%BC%E5%85%B0/1064478\",\"id\":\"1064478\"},{\"name\":\"威尔士\",\"href\":\"/item/%E5%A8%81%E5%B0%94%E5%A3%AB/4834248\",\"id\":\"4834248\"},{\"name\":\"北爱尔兰\",\"href\":\"/item/%E5%8C%97%E7%88%B1%E5%B0%94%E5%85%B0/4463472\",\"id\":\"4463472\"},{\"name\":\"美国\",\"href\":\"/item/%E7%BE%8E%E5%9B%BD/125486\",\"id\":\"125486\"},{\"name\":\"加拿大\",\"href\":\"/item/%E5%8A%A0%E6%8B%BF%E5%A4%A7/145973\",\"id\":\"145973\"},{\"name\":\"澳大利亚\",\"href\":\"/item/%E6%BE%B3%E5%A4%A7%E5%88%A9%E4%BA%9A/146759\",\"id\":\"146759\"},{\"name\":\"新西兰\",\"href\":\"/item/%E6%96%B0%E8%A5%BF%E5%85%B0/255519\",\"id\":\"255519\"},{\"name\":\"南非\",\"href\":\"/item/%E5%8D%97%E9%9D%9E/127666\",\"id\":\"127666\"},{\"name\":\"欧罗巴人种\",\"href\":\"/item/%E6%AC%A7%E7%BD%97%E5%B7%B4%E4%BA%BA%E7%A7%8D/3627038\",\"id\":\"3627038\"},{\"name\":\"波罗的海\",\"href\":\"/item/%E6%B3%A2%E7%BD%97%E7%9A%84%E6%B5%B7\"},{\"name\":\"古英语\",\"href\":\"/item/%E5%8F%A4%E8%8B%B1%E8%AF%AD/6391646\",\"id\":\"6391646\"},{\"name\":\"盎格鲁-撒克逊人\",\"href\":\"/item/%E7%9B%8E%E6%A0%BC%E9%B2%81-%E6%92%92%E5%85%8B%E9%80%8A%E4%BA%BA\"}]', 'https://baike.baidu.com/item/英格兰人/2024035', '', '74292');
INSERT INTO `baike_related_items_js` VALUES ('215962', 8, '系统软件', '1388', '94', '', '', '系统软件是指控制和协调计算机及外部设备,支持应用软件开发和运行的系统，是无需用户干预的各种程序的集合，主要功能是调度，监控和维护计算机系统；负责管理计算机系统中各种独立的硬件，使得它们可以协调工作。系统软件使得计算机使用者和其他软件将计算机当作一个整体而不需要顾及到底层每个硬件是如何工作的。', '[{\"name\":\"外部设备\",\"href\":\"/item/%E5%A4%96%E9%83%A8%E8%AE%BE%E5%A4%87\"},{\"name\":\"应用软件开发\",\"href\":\"/item/%E5%BA%94%E7%94%A8%E8%BD%AF%E4%BB%B6%E5%BC%80%E5%8F%91\"},{\"name\":\"计算机系统\",\"href\":\"/item/%E8%AE%A1%E7%AE%97%E6%9C%BA%E7%B3%BB%E7%BB%9F/7210959\",\"id\":\"7210959\"}]', 'https://baike.baidu.com/item/系统软件/215962', '本词条由“科普中国”科学百科词条编写与应用工作项目审核。', '224122');
INSERT INTO `baike_related_items_js` VALUES ('2206126', 7, '控制器', '834', '53', '', '', '控制器（英文名称：controller）是指按照预定顺序改变主电路或控制电路的接线和改变电路中电阻值来控制电动机的启动、调速、制动和反向的主令装置。由程序计数器、指令寄存器、指令译码器、时序产生器和操作控制器组成，它是发布命令的“决策机构”，即完成协调和指挥整个计算机系统的操作。', '[{\"name\":\"电路\",\"href\":\"/item/%E7%94%B5%E8%B7%AF/33197\",\"id\":\"33197\"}]', 'https://baike.baidu.com/item/控制器/2206126', '', '8');
INSERT INTO `baike_related_items_js` VALUES ('224122', 7, '软件系统', '744', '31', '', '', '软件系统(Software Systems)是指由系统软件、支撑软件和应用软件组成的计算机软件系统，它是计算机系统中由软件组成的部分。', '[{\"name\":\"软件\",\"href\":\"/item/%E8%BD%AF%E4%BB%B6\"},{\"name\":\"系统软件\",\"href\":\"/item/%E7%B3%BB%E7%BB%9F%E8%BD%AF%E4%BB%B6/215962\",\"id\":\"215962\"},{\"name\":\"支撑软件\",\"href\":\"/item/%E6%94%AF%E6%92%91%E8%BD%AF%E4%BB%B6/10621213\",\"id\":\"10621213\"},{\"name\":\"应用软件\",\"href\":\"/item/%E5%BA%94%E7%94%A8%E8%BD%AF%E4%BB%B6/216367\",\"id\":\"216367\"},{\"name\":\"计算机\",\"href\":\"/item/%E8%AE%A1%E7%AE%97%E6%9C%BA\"},{\"name\":\"计算机系统\",\"href\":\"/item/%E8%AE%A1%E7%AE%97%E6%9C%BA%E7%B3%BB%E7%BB%9F/7210959\",\"id\":\"7210959\"},{\"name\":\"软件\",\"href\":\"/item/%E8%BD%AF%E4%BB%B6/12053\",\"id\":\"12053\"}]', 'https://baike.baidu.com/item/软件系统/224122', '本词条由“科普中国”科学百科词条编写与应用工作项目审核。', '124859');
INSERT INTO `baike_related_items_js` VALUES ('2667121', 9, '个体', '326', '17', '', '', '通常是数字的名称，或者是某个物体的计量单位。一般指一个生物个体或是一个群体中的特定主体。个体的哲学意义：个体指处在一定社会关系中，在社会地位、能力、作用上有区别的有生命的个体。在中国的主流文化中，一般都忽视个体的力量和作用。个体的利益与集体的利益并不是对立的。个体能量的最大发挥，往往才是集体能量的最大发挥。现代文化颠覆了以丧失个体为代价的传统文化价值观，明确了“人”的价值，它充分肯定每一个个体的价值和潜能，肯定个体的努力，把个体看成是一种独立的存在。然而放眼整个自然界，个体与群体不一定与社会有关。个体的概念是相对的，也就是说若干个相同或不相同的事物构成的群体相对于不同的事物其还是不是个体会改变。个体的广义定义是: 若干个相同或不相同的事物构成的群体相对于某事物时，会因为此事物的改变而改变，那么该群体相对于该事物而言是个体。', '[{\"name\":\"群体\",\"href\":\"/item/%E7%BE%A4%E4%BD%93/4094259\",\"id\":\"4094259\"},{\"name\":\"哲学\",\"href\":\"/item/%E5%93%B2%E5%AD%A6\"},{\"name\":\"社会关系\",\"href\":\"/item/%E7%A4%BE%E4%BC%9A%E5%85%B3%E7%B3%BB/6543215\",\"id\":\"6543215\"},{\"name\":\"作用\",\"href\":\"/item/%E4%BD%9C%E7%94%A8/33062\",\"id\":\"33062\"}]', 'https://baike.baidu.com/item/个体/2667121', '', '1539938');
INSERT INTO `baike_related_items_js` VALUES ('2688172', 9, '劳务', '294', '19', '', '', '劳务（labour service），以活劳动形式为他人提供某种特殊使用价值的劳动。这种劳动不是以实物形式，而是以活劳动形式提供某种服务。这种服务可以是满足人们精神上的需要，也可以是满足人们物质生产的需要。', '[]', 'https://baike.baidu.com/item/劳务/2688172', '', '10605212');
INSERT INTO `baike_related_items_js` VALUES ('2692368', 8, '物理设备', '10', '1', '', '', '物理设备(physical device)是指硬盘和系统所挂接的各种设备，物理设备是实际存在的。', '[]', 'https://baike.baidu.com/item/物理设备/2692368', '', '1513031');
INSERT INTO `baike_related_items_js` VALUES ('269454', 7, '整理', '228', '5', '', '', '整理：常用于表示：去除不需要的东西。整理，著作权法术语，指对内容零散、层次不清的已有文字作品或者材料进行条理化、系统化的加工，如古籍的校点、补遗等。', '[{\"name\":\"表示\",\"href\":\"/item/%E8%A1%A8%E7%A4%BA/8223003\",\"id\":\"8223003\"},{\"name\":\"著作权法\",\"href\":\"/item/%E8%91%97%E4%BD%9C%E6%9D%83%E6%B3%95/19963973\",\"id\":\"19963973\"},{\"name\":\"零散\",\"href\":\"/item/%E9%9B%B6%E6%95%A3/4589789\",\"id\":\"4589789\"},{\"name\":\"进行\",\"href\":\"/item/%E8%BF%9B%E8%A1%8C/9989812\",\"id\":\"9989812\"},{\"name\":\"系统化\",\"href\":\"/item/%E7%B3%BB%E7%BB%9F%E5%8C%96/10897329\",\"id\":\"10897329\"},{\"name\":\"校点\",\"href\":\"/item/%E6%A0%A1%E7%82%B9/10888124\",\"id\":\"10888124\"},{\"name\":\"补遗\",\"href\":\"/item/%E8%A1%A5%E9%81%97/9027252\",\"id\":\"9027252\"}]', 'https://baike.baidu.com/item/整理/269454', '', '479832');
INSERT INTO `baike_related_items_js` VALUES ('2832422', 3, '超文本', '730', '30', '', '', '“超文本”是超级文本的中文缩写。[1] 超文本是用超链接的方法，将各种不同空间的文字信息组织在一起的网状文本。超文本更是一种用户界面范式，用以显示文本及与文本之间相关的内容。现时超文本普遍以电子文档方式存在，其中的文字包含有可以链结到其他位置或者文档的连结，允许从当前阅读位置直接切换到超文本连结所指向的位置。超文本的格式有很多，目前最常使用的是超文本标记语言（标准通用标记语言下的一个应用）及富文本格式。', '[{\"name\":\"文本\",\"href\":\"/item/%E6%96%87%E6%9C%AC\"},{\"name\":\"超链接\",\"href\":\"/item/%E8%B6%85%E9%93%BE%E6%8E%A5/97857\",\"id\":\"97857\"},{\"name\":\"信息组织\",\"href\":\"/item/%E4%BF%A1%E6%81%AF%E7%BB%84%E7%BB%87\"},{\"name\":\"文本\",\"href\":\"/item/%E6%96%87%E6%9C%AC\"},{\"name\":\"文本\",\"href\":\"/item/%E6%96%87%E6%9C%AC\"},{\"name\":\"电子文档\",\"href\":\"/item/%E7%94%B5%E5%AD%90%E6%96%87%E6%A1%A3/3045210\",\"id\":\"3045210\"},{\"name\":\"链结\",\"href\":\"/item/%E9%93%BE%E7%BB%93/10512750\",\"id\":\"10512750\"},{\"name\":\"文本\",\"href\":\"/item/%E6%96%87%E6%9C%AC\"},{\"name\":\"超文本标记语言\",\"href\":\"/item/%E8%B6%85%E6%96%87%E6%9C%AC%E6%A0%87%E8%AE%B0%E8%AF%AD%E8%A8%80/6972570\",\"id\":\"6972570\"},{\"name\":\"标准通用标记语言\",\"href\":\"/item/%E6%A0%87%E5%87%86%E9%80%9A%E7%94%A8%E6%A0%87%E8%AE%B0%E8%AF%AD%E8%A8%80/6805073\",\"id\":\"6805073\"},{\"name\":\"富文本格式\",\"href\":\"/item/%E5%AF%8C%E6%96%87%E6%9C%AC%E6%A0%BC%E5%BC%8F/1017816\",\"id\":\"1017816\"}]', 'https://baike.baidu.com/item/超文本/2832422', '', '');
INSERT INTO `baike_related_items_js` VALUES ('2842227', 5, '磁盘', '1224', '100', '', '', '计算机的外部存储器中也采用了类似磁带的装置，比较常用的一种叫磁盘，将圆形的磁性盘片装在一个方的密封盒子里，这样做的目的是为了防止磁盘表面划伤，导致数据丢失。文件系统：曾将圆形的磁性盘片装在一个方形的密封盒子里。有了磁盘之后，人们使用计算机就方便多了，不但可以把数据处理结果存放在磁盘中，还可以把很多输入到计算机中的数据存储到磁盘中，这样这些数据可以反复使用，避免了重复劳动。可是不久之后，人们又发现了另一个问题：人们要存储到磁盘上的内容越来越多，众多的信息存储在一起，很不方便。这样就导致了文件系统的产生。只有低格才对磁盘有很大的伤害，其它的读写是不要紧的。', '[{\"name\":\"计算机\",\"href\":\"/item/%E8%AE%A1%E7%AE%97%E6%9C%BA/140338\",\"id\":\"140338\"},{\"name\":\"存储器\",\"href\":\"/item/%E5%AD%98%E5%82%A8%E5%99%A8\"},{\"name\":\"磁带\",\"href\":\"/item/%E7%A3%81%E5%B8%A6/964004\",\"id\":\"964004\"},{\"name\":\"装置\",\"href\":\"/item/%E8%A3%85%E7%BD%AE/7145594\",\"id\":\"7145594\"},{\"name\":\"比较\",\"href\":\"/item/%E6%AF%94%E8%BE%83/3442442\",\"id\":\"3442442\"},{\"name\":\"磁性\",\"href\":\"/item/%E7%A3%81%E6%80%A7/2546649\",\"id\":\"2546649\"},{\"name\":\"盘片\",\"href\":\"/item/%E7%9B%98%E7%89%87/4461428\",\"id\":\"4461428\"},{\"name\":\"表面\",\"href\":\"/item/%E8%A1%A8%E9%9D%A2/32942\",\"id\":\"32942\"},{\"name\":\"数据\",\"href\":\"/item/%E6%95%B0%E6%8D%AE/5947370\",\"id\":\"5947370\"},{\"name\":\"磁性\",\"href\":\"/item/%E7%A3%81%E6%80%A7/2546649\",\"id\":\"2546649\"},{\"name\":\"数据处理\",\"href\":\"/item/%E6%95%B0%E6%8D%AE%E5%A4%84%E7%90%86/944504\",\"id\":\"944504\"},{\"name\":\"计算机\",\"href\":\"/item/%E8%AE%A1%E7%AE%97%E6%9C%BA/140338\",\"id\":\"140338\"},{\"name\":\"数据存储\",\"href\":\"/item/%E6%95%B0%E6%8D%AE%E5%AD%98%E5%82%A8/9827490\",\"id\":\"9827490\"},{\"name\":\"磁盘\",\"href\":\"/item/%E7%A3%81%E7%9B%98/2842227\",\"id\":\"2842227\"},{\"name\":\"存储\",\"href\":\"/item/%E5%AD%98%E5%82%A8\"},{\"name\":\"文件系统\",\"href\":\"/item/%E6%96%87%E4%BB%B6%E7%B3%BB%E7%BB%9F/4827215\",\"id\":\"4827215\"},{\"name\":\"低格\",\"href\":\"/item/%E4%BD%8E%E6%A0%BC/103358\",\"id\":\"103358\"}]', 'https://baike.baidu.com/item/磁盘/2842227', '', '3045210');
INSERT INTO `baike_related_items_js` VALUES ('2874935', 5, '引擎', '1561', '203', '（程序支持的核心组件）', '', '引擎（Engine）是电子平台上开发程序或系统的核心组件。利用引擎，开发者可迅速建立、铺设程序所需的功能，或利用其辅助程序的运转。一般而言，引擎是一个程序或一套系统的支持部分。常见的程序引擎有游戏引擎、搜索引擎、杀毒引擎等。', '[{\"name\":\"系统\",\"href\":\"/item/%E7%B3%BB%E7%BB%9F/479832\",\"id\":\"479832\"},{\"name\":\"杀毒引擎\",\"href\":\"/item/%E6%9D%80%E6%AF%92%E5%BC%95%E6%93%8E/1604578\",\"id\":\"1604578\"}]', 'https://baike.baidu.com/item/引擎/2874935', '', '');
INSERT INTO `baike_related_items_js` VALUES ('2876390', 5, '国际电工委员会', '457', '43', '', '', '国际电工委员会（IEC）成立于1906年，至2018年已有112年的历史。它是世界上成立最早的国际性电工标准化机构，负责有关电气工程和电子工程领域中的国际标准化工作。国际电工委员会的总部最初位于伦敦，1948年搬到了位于日内瓦的现总部处。1887-1900年召开的6次国际电工会议上，与会专家一致认为有必要建立一个永久性的国际电工标准化机构，以解决用电安全和电工产品标准化问题。1904年在美国圣路易召开的国际电工会议上通过了关于建立永久性机构的决议。1906年6月，13个国家的代表集会伦敦，起草了IEC章程和议事规则，正式成立了国际电工委员会。1947年作为一个电工部门并入国际标准化组织（ISO），1976年又从ISO中分立出来。宗旨是促进电工、电子和相关技术领域有关电工标准化等所有问题上（如标准的合格评定）的国际合作。该委员会的目标是：有效满足全球市场的需求；保证在全球范围内优先并最大程度地使用其标准和合格评定计划；评定并提高其标准所涉及的产品质量和服务质量；为共同使用复杂系统创造条件；提高工业化进程的有效性；提高人类健康和安全；保护环境。2018年10月22日至26日，国际电工委员会（IEC）第82届大会在韩国釜山召开。国家电网董事长舒印彪当选国际电工委员会主席。[1] ', '[{\"name\":\"国际电工委员会\",\"href\":\"/item/%E5%9B%BD%E9%99%85%E7%94%B5%E5%B7%A5%E5%A7%94%E5%91%98%E4%BC%9A/2876390\",\"id\":\"2876390\"},{\"name\":\"电工\",\"href\":\"/item/%E7%94%B5%E5%B7%A5/8889443\",\"id\":\"8889443\"},{\"name\":\"电气工程\",\"href\":\"/item/%E7%94%B5%E6%B0%94%E5%B7%A5%E7%A8%8B/6581498\",\"id\":\"6581498\"},{\"name\":\"电子工程\",\"href\":\"/item/%E7%94%B5%E5%AD%90%E5%B7%A5%E7%A8%8B/5448766\",\"id\":\"5448766\"},{\"name\":\"伦敦\",\"href\":\"/item/%E4%BC%A6%E6%95%A6/862\",\"id\":\"862\"},{\"name\":\"日内瓦\",\"href\":\"/item/%E6%97%A5%E5%86%85%E7%93%A6/705948\",\"id\":\"705948\"},{\"name\":\"保护环境\",\"href\":\"/item/%E4%BF%9D%E6%8A%A4%E7%8E%AF%E5%A2%83/10284757\",\"id\":\"10284757\"}]', 'https://baike.baidu.com/item/国际电工委员会/2876390', '', '4495981');
INSERT INTO `baike_related_items_js` VALUES ('3045210', 4, '电子文档', '306', '15', '', '', '电子文档（Electronic document）是指人们在社会活动中形成的，以计算机盘片、磁盘和光盘等化学磁性材料为载体的文字材料。依赖计算机系统存取并可在通信网络上传输。它主要包括电子文书、电子信件、电子报表、电子图纸等等。', '[{\"name\":\"计算机\",\"href\":\"/item/%E8%AE%A1%E7%AE%97%E6%9C%BA/140338\",\"id\":\"140338\"},{\"name\":\"磁盘\",\"href\":\"/item/%E7%A3%81%E7%9B%98/2842227\",\"id\":\"2842227\"},{\"name\":\"光盘\",\"href\":\"/item/%E5%85%89%E7%9B%98/170215\",\"id\":\"170215\"},{\"name\":\"计算机系统\",\"href\":\"/item/%E8%AE%A1%E7%AE%97%E6%9C%BA%E7%B3%BB%E7%BB%9F/7210959\",\"id\":\"7210959\"},{\"name\":\"通信网络\",\"href\":\"/item/%E9%80%9A%E4%BF%A1%E7%BD%91%E7%BB%9C/1302896\",\"id\":\"1302896\"},{\"name\":\"传输\",\"href\":\"/item/%E4%BC%A0%E8%BE%93/7078195\",\"id\":\"7078195\"}]', 'https://baike.baidu.com/item/电子文档/3045210', '本词条由“科普中国”科学百科词条编写与应用工作项目审核。', '6805073');
INSERT INTO `baike_related_items_js` VALUES ('313121', 5, '超链接', '45', '8', '', '', '超级链接简单来讲，就是指按内容链接。超级链接在本质上属于一个网页的一部分，它是一种允许我们同其他网页或站点之间进行连接的元素。各个网页链接在一起后，才能真正构成一个网站。所谓的超链接是指从一个网页指向一个目标的连接关系，这个目标可以是另一个网页，也可以是相同网页上的不同位置，还可以是一个图片，一个电子邮件地址，一个文件，甚至是一个应用程序。而在一个网页中用来超链接的对象，可以是一段文本或者是一个图片。当浏览者单击已经链接的文字或图片后，链接目标将显示在浏览器上，并且根据目标的类型来打开或运行。', '[{\"name\":\"超级链接\",\"href\":\"/item/%E8%B6%85%E7%BA%A7%E9%93%BE%E6%8E%A5/313121\",\"id\":\"313121\"},{\"name\":\"网页\",\"href\":\"/item/%E7%BD%91%E9%A1%B5/99347\",\"id\":\"99347\"},{\"name\":\"网页\",\"href\":\"/item/%E7%BD%91%E9%A1%B5/99347\",\"id\":\"99347\"}]', 'https://baike.baidu.com/item/超级链接/313121', '本词条由“科普中国”科学百科词条编写与应用工作项目审核。', '97857');
INSERT INTO `baike_related_items_js` VALUES ('31801', 9, '宇宙', '28373', '1196', '（天文学名词）', '', '广义的宇宙定义是万物的总称，是时间和空间的统一。狭义的宇宙定义是地球大气层以外的空间和物质。“宇宙航行”的“宇宙”定义就是狭义的“宇宙”的定义，宇宙航行意思就是在大气层以外的空间航行。而宇宙本质，目前大致有三种概念。唯心者的意识宇宙，唯物者的物质宇宙，和法则宇宙。古代对宇宙的定义，有西汉的《淮南子》：“往古来今谓之宙，四方上下谓之宇”。通过宇宙微波背景辐射的观测发现我们的宇宙已经膨胀了138.2亿年，最新的研究认为宇宙的直径可达到920亿光年，甚至更大。[1] 人类所观察到的部分宇宙的物件大约是由4.9%的普通物质（构成恒星、行星、气体和尘埃的物质）或“重子”，26.8%的暗物质和68.3%的暗能量构成。重子物质构成星系际的“蛛网”。[2-3] 在宇宙中，地球是目前人类所知唯一一颗有生命存在的星球。宇宙大爆炸是描述宇宙诞生初始条件及其后续演化的宇宙学模型，这一模型得到了当今科学研究和观测最广泛且最精确的支持。宇宙学家通常所指的大爆炸观点为：宇宙是在过去有限的时间之前，由一个密度极大且温度极高的太初状态演变而来的，并经过不断的膨胀到达今天的状态。[4] 暗物质和暗能量分别通过对普通物质产生的引力作用和推动宇宙做加速膨胀而表明它们的存在。如果暗能量不存在，那么物质间的万有引力作用就会减慢宇宙的膨胀，但是天文观测表明我们的宇宙在做加速膨胀运动。宇宙由一切天体组成。[5] ', '[{\"name\":\"淮南子\",\"href\":\"/item/%E6%B7%AE%E5%8D%97%E5%AD%90\"},{\"name\":\"宇宙微波背景辐射\",\"href\":\"/item/%E5%AE%87%E5%AE%99%E5%BE%AE%E6%B3%A2%E8%83%8C%E6%99%AF%E8%BE%90%E5%B0%84\"},{\"name\":\"光年\",\"href\":\"/item/%E5%85%89%E5%B9%B4/70940\",\"id\":\"70940\"},{\"name\":\"恒星\",\"href\":\"/item/%E6%81%92%E6%98%9F/493\",\"id\":\"493\"},{\"name\":\"行星\",\"href\":\"/item/%E8%A1%8C%E6%98%9F/15991\",\"id\":\"15991\"},{\"name\":\"气体\",\"href\":\"/item/%E6%B0%94%E4%BD%93/254432\",\"id\":\"254432\"},{\"name\":\"物质\",\"href\":\"/item/%E7%89%A9%E8%B4%A8/12756928\",\"id\":\"12756928\"},{\"name\":\"重子\",\"href\":\"/item/%E9%87%8D%E5%AD%90/24750\",\"id\":\"24750\"},{\"name\":\"暗物质\",\"href\":\"/item/%E6%9A%97%E7%89%A9%E8%B4%A8\"},{\"name\":\"暗能量\",\"href\":\"/item/%E6%9A%97%E8%83%BD%E9%87%8F\"},{\"name\":\"重子\",\"href\":\"/item/%E9%87%8D%E5%AD%90/24750\",\"id\":\"24750\"},{\"name\":\"星系\",\"href\":\"/item/%E6%98%9F%E7%B3%BB\"}]', 'https://baike.baidu.com/item/宇宙/31801', '', '55280');
INSERT INTO `baike_related_items_js` VALUES ('321142', 1, 'javascript', '5375', '589', '', '', 'JavaScript一种直译式脚本语言，是一种动态类型、弱类型、基于原型的语言，内置支持类型。它的解释器被称为JavaScript引擎，为浏览器的一部分，广泛用于客户端的脚本语言，最早是在HTML（标准通用标记语言下的一个应用）网页上使用，用来给HTML网页增加动态功能。在1995年时，由Netscape公司的Brendan Eich，在网景导航者浏览器上首次设计实现而成。因为Netscape与Sun合作，Netscape管理层希望它外观看起来像Java，因此取名为JavaScript。但实际上它的语法风格与Self及Scheme较为接近。[1] 为了取得技术优势，微软推出了JScript，CEnvi推出ScriptEase，与JavaScript同样可在浏览器上运行。为了统一规格，因为JavaScript兼容于ECMA标准，因此也称为ECMAScript。', '[{\"name\":\"HTML\",\"href\":\"/item/HTML\"},{\"name\":\"Netscape\",\"href\":\"/item/Netscape\"},{\"name\":\"Brendan Eich\",\"href\":\"/item/Brendan%20Eich\"},{\"name\":\"网景导航者\",\"href\":\"/item/%E7%BD%91%E6%99%AF%E5%AF%BC%E8%88%AA%E8%80%85/10404300\",\"id\":\"10404300\"},{\"name\":\"Netscape\",\"href\":\"/item/Netscape\"},{\"name\":\"Sun\",\"href\":\"/item/Sun/69463\",\"id\":\"69463\"},{\"name\":\"Netscape\",\"href\":\"/item/Netscape\"},{\"name\":\"Java\",\"href\":\"/item/Java/85979\",\"id\":\"85979\"},{\"name\":\"Self\",\"href\":\"/item/Self/4959923\",\"id\":\"4959923\"},{\"name\":\"Scheme\",\"href\":\"/item/Scheme\"},{\"name\":\"微软\",\"href\":\"/item/%E5%BE%AE%E8%BD%AF/124767\",\"id\":\"124767\"},{\"name\":\"JScript\",\"href\":\"/item/JScript\"},{\"name\":\"ECMAScript\",\"href\":\"/item/ECMAScript\"}]', 'https://baike.baidu.com/item/javascript/321142', '本词条由“科普中国”科学百科词条编写与应用工作项目审核。', '');
INSERT INTO `baike_related_items_js` VALUES ('32794', 8, '基础', '1075', '352', '（汉语词语）', '', '基础【Foundation】指建筑底部与地基接触的承重构件，它的作用泛指把建筑上部的荷载传给地基。因此地基必须坚固、稳定而可靠。 工程结构物地面以下的部分结构构件，用来将上部结构荷载传给地基，是房屋、桥梁、码头及其他构筑物的重要组成部分。', '[{\"name\":\"构件\",\"href\":\"/item/%E6%9E%84%E4%BB%B6\"},{\"name\":\"房屋\",\"href\":\"/item/%E6%88%BF%E5%B1%8B/1040087\",\"id\":\"1040087\"},{\"name\":\"码头\",\"href\":\"/item/%E7%A0%81%E5%A4%B4/81196\",\"id\":\"81196\"}]', 'https://baike.baidu.com/item/基础/32794', '', '3303325');
INSERT INTO `baike_related_items_js` VALUES ('32935', 8, '原因', '394', '13', '（汉语词语）', '', '原因yuán yīn是对事物所以如此的解释。出自《水浒传》第四十四回：“原因押送花石纲，要造大舡，嗔怪这提调官催并责罸他，把本官一时杀了。”[1] ', '[{\"name\":\"水浒传\",\"href\":\"/item/%E6%B0%B4%E6%B5%92%E4%BC%A0\"},{\"name\":\"石纲\",\"href\":\"/item/%E7%9F%B3%E7%BA%B2\"}]', 'https://baike.baidu.com/item/原因/32935', '', '1176273');
INSERT INTO `baike_related_items_js` VALUES ('3303325', 7, '根本', '436', '31', '', '', '根本，指基础或本质；比喻事物的本源、根基。语出《韩非子·解老》：“上不属天，而下不著地，以肠胃为根本，不食则不能活。”', '[{\"name\":\"基础\",\"href\":\"/item/%E5%9F%BA%E7%A1%80/32794\",\"id\":\"32794\"},{\"name\":\"本质\",\"href\":\"/item/%E6%9C%AC%E8%B4%A8/33073\",\"id\":\"33073\"},{\"name\":\"事物\",\"href\":\"/item/%E4%BA%8B%E7%89%A9/1693084\",\"id\":\"1693084\"},{\"name\":\"根基\",\"href\":\"/item/%E6%A0%B9%E5%9F%BA/11034177\",\"id\":\"11034177\"}]', 'https://baike.baidu.com/item/根本/3303325', '', '763181');
INSERT INTO `baike_related_items_js` VALUES ('33045', 9, '能力', '1917', '219', '（汉语词语）', '', '能力 是完成一项目标或者任务所体现出来的综合素质。 人们在完成活动中表现出来的能力有所不同。能力是直接影响活动效率，并使活动顺利完成的个性心理特征。能力总是和人完成一定的实践相联系在一起的。离开了具体实践既不能表现人的能力，也不能发展人的能力。掌握和运用知识技能所需的心理特征。达成一个目的所具备的条件和水平。能力：是生命物体对自然探索、认知、改造水平的度量。如人解决问题的能力，动物、植物的生殖能力等。', '[{\"name\":\"综合素质\",\"href\":\"/item/%E7%BB%BC%E5%90%88%E7%B4%A0%E8%B4%A8/8343309\",\"id\":\"8343309\"},{\"name\":\"心理\",\"href\":\"/item/%E5%BF%83%E7%90%86\"}]', 'https://baike.baidu.com/item/能力/33045', '', '33065');
INSERT INTO `baike_related_items_js` VALUES ('33065', 8, '技能', '937', '183', '（汉语词语）', '', '个体运用已有的知识经验,通过练习而形成的一定的动作方式或智力活动方式。[1]  指掌握并能运用专门技术的能力。指技术、能力。', '[{\"name\":\"能力\",\"href\":\"/item/%E8%83%BD%E5%8A%9B/33045\",\"id\":\"33045\"}]', 'https://baike.baidu.com/item/技能/33065', '本词条由“科普中国”科学百科词条编写与应用工作项目审核。', '34170');
INSERT INTO `baike_related_items_js` VALUES ('33073', 8, '本质', '839', '103', '（汉语词语）', '', '本质，指本身的形体，本来的形体；指事物本身所固有的根本的属性。语出晋刘智《论天》：“言闇虚者，以为当日之冲，地体之荫，日光不至，谓之闇虚。凡光之所照，光体小於蔽，则大於本质。”本质可使人们脱离具体的形象进行创新活动。', '[{\"name\":\"形体\",\"href\":\"/item/%E5%BD%A2%E4%BD%93/8610084\",\"id\":\"8610084\"},{\"name\":\"属性\",\"href\":\"/item/%E5%B1%9E%E6%80%A7/1405051\",\"id\":\"1405051\"},{\"name\":\"论天\",\"href\":\"/item/%E8%AE%BA%E5%A4%A9/9877583\",\"id\":\"9877583\"}]', 'https://baike.baidu.com/item/本质/33073', '', '3303325');
INSERT INTO `baike_related_items_js` VALUES ('33197', 8, '电路', '4803', '481', '（科技名词）', '', '电路：由金属导线和电气、电子部件组成的导电回路，称为电路。在电路输入端加上电源使输入端产生电势差，电路连通时即可工作。电流的存在可以通过一些仪器测试出来，如电压表或电流表偏转、灯泡发光等；按照流过的电流性质，一般把它分为两种：直流电通过的电路称为“直流电路”，交流电通过的电路称为“交流电路”。', '[{\"name\":\"电势差\",\"href\":\"/item/%E7%94%B5%E5%8A%BF%E5%B7%AE/9498602\",\"id\":\"9498602\"},{\"name\":\"直流电\",\"href\":\"/item/%E7%9B%B4%E6%B5%81%E7%94%B5/1023266\",\"id\":\"1023266\"},{\"name\":\"直流电路\",\"href\":\"/item/%E7%9B%B4%E6%B5%81%E7%94%B5%E8%B7%AF/1162083\",\"id\":\"1162083\"},{\"name\":\"交流电\",\"href\":\"/item/%E4%BA%A4%E6%B5%81%E7%94%B5/1023508\",\"id\":\"1023508\"},{\"name\":\"交流电路\",\"href\":\"/item/%E4%BA%A4%E6%B5%81%E7%94%B5%E8%B7%AF/8852272\",\"id\":\"8852272\"}]', 'https://baike.baidu.com/item/电路/33197', '本词条由“科普中国”科学百科词条编写与应用工作项目审核。', '2206126');
INSERT INTO `baike_related_items_js` VALUES ('33204', 9, '状态', '620', '160', '（汉语词语）', '', '状态，是指对象涉及的过程，由一组物理量来表征。例如质点的机械运动状态由质点的位置和动量来确定；由一定质量的气体组成的系统的热学状态可由系统的温度、压强和体积来描述。该词亦指各种物态，例如物质的固态、液态和气态等。', '[{\"name\":\"状态\",\"href\":\"/item/%E7%8A%B6%E6%80%81/33204\",\"id\":\"33204\"},{\"name\":\"物理量\",\"href\":\"/item/%E7%89%A9%E7%90%86%E9%87%8F/9984692\",\"id\":\"9984692\"},{\"name\":\"质点\",\"href\":\"/item/%E8%B4%A8%E7%82%B9/495707\",\"id\":\"495707\"},{\"name\":\"机械运动\",\"href\":\"/item/%E6%9C%BA%E6%A2%B0%E8%BF%90%E5%8A%A8/822487\",\"id\":\"822487\"},{\"name\":\"位置\",\"href\":\"/item/%E4%BD%8D%E7%BD%AE/36166\",\"id\":\"36166\"},{\"name\":\"动量\",\"href\":\"/item/%E5%8A%A8%E9%87%8F/168287\",\"id\":\"168287\"},{\"name\":\"热学\",\"href\":\"/item/%E7%83%AD%E5%AD%A6/1412541\",\"id\":\"1412541\"},{\"name\":\"压强\",\"href\":\"/item/%E5%8E%8B%E5%BC%BA/1485336\",\"id\":\"1485336\"},{\"name\":\"描述\",\"href\":\"/item/%E6%8F%8F%E8%BF%B0/8928757\",\"id\":\"8928757\"},{\"name\":\"固态\",\"href\":\"/item/%E5%9B%BA%E6%80%81/11056794\",\"id\":\"11056794\"},{\"name\":\"气态\",\"href\":\"/item/%E6%B0%94%E6%80%81/3079016\",\"id\":\"3079016\"}]', 'https://baike.baidu.com/item/状态/33204', '', '502192');
INSERT INTO `baike_related_items_js` VALUES ('33802', 9, '动作', '2616', '1113', '（词语解释）', '', '具有一定动机和目的并指向一定客体的运动系统。简单的解释是：动作是角色五官位置的变化（即表情变化）、角色肢体位置的变化（即动作变化）和角色与所处环境相对位置的变化（即运动距离的变化）的过程。人的动作不是孤立的，而是包括在人的整体活动之中。是活动的组成部分，它是以自觉的目的为特征，并且总是由一定的动机所激发，因而具有社会的性质。[1] ', '[{\"name\":\"动机\",\"href\":\"/item/%E5%8A%A8%E6%9C%BA/6441541\",\"id\":\"6441541\"},{\"name\":\"运动系统\",\"href\":\"/item/%E8%BF%90%E5%8A%A8%E7%B3%BB%E7%BB%9F/1145168\",\"id\":\"1145168\"}]', 'https://baike.baidu.com/item/动作/33802', '', '502192');
INSERT INTO `baike_related_items_js` VALUES ('34170', 7, '人才', '1075', '56', '（词语概念）', '', '人才，是指具有一定的专业知识或专门技能，进行创造性劳动，并对社会做出贡献的人，是人力资源中能力和素质较高的劳动者。人才一词出于古老的《易经》“三才之道”，即孔子及孔门弟子的《易传》讲：“《易》之为书也，广大悉备。有天道焉，有人道焉，有地道焉。兼三才而两之，故六。六者非它也，三才之道也。”', '[{\"name\":\"专业知识\",\"href\":\"/item/%E4%B8%93%E4%B8%9A%E7%9F%A5%E8%AF%86/4844469\",\"id\":\"4844469\"},{\"name\":\"技能\",\"href\":\"/item/%E6%8A%80%E8%83%BD/33065\",\"id\":\"33065\"},{\"name\":\"人力资源\",\"href\":\"/item/%E4%BA%BA%E5%8A%9B%E8%B5%84%E6%BA%90/127703\",\"id\":\"127703\"},{\"name\":\"能力\",\"href\":\"/item/%E8%83%BD%E5%8A%9B/33045\",\"id\":\"33045\"},{\"name\":\"易经\",\"href\":\"/item/%E6%98%93%E7%BB%8F\"},{\"name\":\"三才之道\",\"href\":\"/item/%E4%B8%89%E6%89%8D%E4%B9%8B%E9%81%93/8326432\",\"id\":\"8326432\"},{\"name\":\"孔子\",\"href\":\"/item/%E5%AD%94%E5%AD%90/1584\",\"id\":\"1584\"},{\"name\":\"孔门弟子\",\"href\":\"/item/%E5%AD%94%E9%97%A8%E5%BC%9F%E5%AD%90\"},{\"name\":\"易传\",\"href\":\"/item/%E6%98%93%E4%BC%A0/620238\",\"id\":\"620238\"},{\"name\":\"易\",\"href\":\"/item/%E6%98%93/15969903\",\"id\":\"15969903\"}]', 'https://baike.baidu.com/item/人才/34170', '', '86');
INSERT INTO `baike_related_items_js` VALUES ('3439049', 6, '纽约州', '889', '67', '', '', '纽约州（英语：State of New York），位于美国东北部，是美国经济最发达的州之一。[1] 纽约州是美国的神经中枢和经济心脏。金融、商业、工业、艺术、服装等方面在美国各州居于领导地位，农业和制造业为该州的主要产业。它拥有美国最大之纽约市及纽约港。[2] 纽约市及郊县 （下州）以外的地区称为上州。别称帝国州[1] 。纽约州原为印第安人居住[1] ，17世纪前半叶为荷兰殖民地，1664年英国占领后改名为纽约。[1] 2018年2月，为了打击暴力枪击，纽约、新泽西和康涅狄格州的州长决定建立一个禁枪联盟。[3] ', '[{\"name\":\"美国\",\"href\":\"/item/%E7%BE%8E%E5%9B%BD/125486\",\"id\":\"125486\"},{\"name\":\"纽约\",\"href\":\"/item/%E7%BA%BD%E7%BA%A6/6230\",\"id\":\"6230\"},{\"name\":\"纽约港\",\"href\":\"/item/%E7%BA%BD%E7%BA%A6%E6%B8%AF/3176000\",\"id\":\"3176000\"},{\"name\":\"纽约\",\"href\":\"/item/%E7%BA%BD%E7%BA%A6/6230\",\"id\":\"6230\"},{\"name\":\"印第安人\",\"href\":\"/item/%E5%8D%B0%E7%AC%AC%E5%AE%89%E4%BA%BA/254718\",\"id\":\"254718\"}]', 'https://baike.baidu.com/item/纽约州/3439049', '', '6230');
INSERT INTO `baike_related_items_js` VALUES ('3463603', 7, '非营利组织', '399', '52', '', '', '非营利组织是指不以营利为目的的组织，它的目标通常是支持或处理个人关心或者公众关注的议题或事件。非营利组织所涉及的领域非常广，包括艺术、慈善、教育、学术、环保等等。它的运作并不是为了产生利益，这一点通常被视为这类组织的主要特性，同时具有非营利性、民间性、自治性、志愿性、非政治性、非宗教性等重要特征。非营利组织有时亦称为第三部门（the third sector），与政府部门（第一部门）和企业界的私部门（第二部门），形成三种影响社会的主要力量。非营利组织还是必须产生收益，以提供其活动的资金。但是，其收入和支出都是受到限制的。非营利组织因此往往由公、私部门捐赠来获得经费，而且经常是免税的状态。私人对非营利组织的捐款有时还可以扣税。非营利组织是指在政府部门和以营利为目的的企业之外的一切志愿团体、社会组织或民间协会，是介于政府与营利性企业之间的“第三部门”。', '[{\"name\":\"营利\",\"href\":\"/item/%E8%90%A5%E5%88%A9/10605212\",\"id\":\"10605212\"},{\"name\":\"个人\",\"href\":\"/item/%E4%B8%AA%E4%BA%BA/1539938\",\"id\":\"1539938\"},{\"name\":\"议题\",\"href\":\"/item/%E8%AE%AE%E9%A2%98/10811020\",\"id\":\"10811020\"},{\"name\":\"艺术\",\"href\":\"/item/%E8%89%BA%E6%9C%AF/12004323\",\"id\":\"12004323\"},{\"name\":\"慈善\",\"href\":\"/item/%E6%85%88%E5%96%84/3540300\",\"id\":\"3540300\"},{\"name\":\"教育\",\"href\":\"/item/%E6%95%99%E8%82%B2/143397\",\"id\":\"143397\"},{\"name\":\"学术\",\"href\":\"/item/%E5%AD%A6%E6%9C%AF/8799690\",\"id\":\"8799690\"},{\"name\":\"环保\",\"href\":\"/item/%E7%8E%AF%E4%BF%9D/278373\",\"id\":\"278373\"},{\"name\":\"第三部门\",\"href\":\"/item/%E7%AC%AC%E4%B8%89%E9%83%A8%E9%97%A8/2422649\",\"id\":\"2422649\"}]', 'https://baike.baidu.com/item/非营利组织/3463603', '本词条由“科普中国”科学百科词条编写与应用工作项目审核。', '1416088');
INSERT INTO `baike_related_items_js` VALUES ('3703820', 8, '古典艺术', '26', '3', '', '', '一本介绍意大利文艺复兴的书   。全书分两部分讨论意大利文艺复兴时期艺术，第一部分为作品研究，分别介绍、赏析文艺复兴盛期大师们和这些大师前辈们的作品；第二部分为理论研究，描述了文艺复兴古典风格所具有的审美理想、审美观念和绘画形式的特征。', '[]', 'https://baike.baidu.com/item/古典艺术/3703820', '', '9848425');
INSERT INTO `baike_related_items_js` VALUES ('414904', 4, '时代华纳', '1166', '41', '', '', '时代华纳（英语：Time Warner Inc.）是美国一家跨国媒体企业，成立于1990年，总部位于纽约。其事业版图横跨出版、电影与电视产业，包括时代杂志、体育画报、财富杂志、生活杂志、特纳电视网、CNN、HBO、DC漫画公司、华纳兄弟、等具有全球影响力的媒体皆为旗下事业。2012年财富世界500强排行榜排名第381名。[1] 2000年美国在线（AOL）与时代华纳合并为美国在线时代华纳（AOL Time Warner），2009年美国在线和时代华纳分拆。时代华纳是互联网时代媒体与娱乐公司，2014年康卡斯特以450亿美元并购时代华纳有线。2017年《财富》美国500强排行榜发布，其中时代华纳排名第95位。[2] 2018年7月19日，《财富》世界500强排行榜发布，时代华纳位列379位。[3] 在2018世界品牌500强排行榜中，时代华纳排名第108位。[4] ', '[{\"name\":\"纽约\",\"href\":\"/item/%E7%BA%BD%E7%BA%A6/6230\",\"id\":\"6230\"},{\"name\":\"体育画报\",\"href\":\"/item/%E4%BD%93%E8%82%B2%E7%94%BB%E6%8A%A5/840993\",\"id\":\"840993\"},{\"name\":\"财富杂志\",\"href\":\"/item/%E8%B4%A2%E5%AF%8C%E6%9D%82%E5%BF%97/10349982\",\"id\":\"10349982\"},{\"name\":\"特纳电视网\",\"href\":\"/item/%E7%89%B9%E7%BA%B3%E7%94%B5%E8%A7%86%E7%BD%91/372719\",\"id\":\"372719\"},{\"name\":\"CNN\",\"href\":\"/item/CNN\"},{\"name\":\"HBO\",\"href\":\"/item/HBO\"},{\"name\":\"DC漫画公司\",\"href\":\"/item/DC%E6%BC%AB%E7%94%BB%E5%85%AC%E5%8F%B8\"},{\"name\":\"华纳兄弟\",\"href\":\"/item/%E5%8D%8E%E7%BA%B3%E5%85%84%E5%BC%9F/1931797\",\"id\":\"1931797\"},{\"name\":\"美国在线\",\"href\":\"/item/%E7%BE%8E%E5%9B%BD%E5%9C%A8%E7%BA%BF/4994270\",\"id\":\"4994270\"},{\"name\":\"康卡斯特\",\"href\":\"/item/%E5%BA%B7%E5%8D%A1%E6%96%AF%E7%89%B9/5034451\",\"id\":\"5034451\"}]', 'https://baike.baidu.com/item/时代华纳/414904', '', '4994270');
INSERT INTO `baike_related_items_js` VALUES ('4381481', 9, '子姓', '355', '39', '', '', '子姓（殷本读依燕颖声）是殷商帝王家族的姓氏。殷商帝王家族以子为姓，是从偰【契（xiè）本写偰】（商朝祖因生在殷水，因之为姓，后又辅佐大禹治水有功劳， 被舜帝封在商地，并赐姓子，所以商族是以殷和子为姓氏的）开始的。据《古今姓氏书辩证》[1] 和《通志 氏族略》：“商始祖偰，为舜之司徒，受封于商，赐姓子。”', '[{\"name\":\"偰\",\"href\":\"/item/%E5%81%B0/8275808\",\"id\":\"8275808\"},{\"name\":\"契\",\"href\":\"/item/%E5%A5%91/4024961\",\"id\":\"4024961\"},{\"name\":\"商朝\",\"href\":\"/item/%E5%95%86%E6%9C%9D/194655\",\"id\":\"194655\"},{\"name\":\"舜帝\",\"href\":\"/item/%E8%88%9C%E5%B8%9D/29149\",\"id\":\"29149\"},{\"name\":\"古今姓氏书辩证\",\"href\":\"/item/%E5%8F%A4%E4%BB%8A%E5%A7%93%E6%B0%8F%E4%B9%A6%E8%BE%A9%E8%AF%81\"},{\"name\":\"通志\",\"href\":\"/item/%E9%80%9A%E5%BF%97/14843\",\"id\":\"14843\"},{\"name\":\"舜\",\"href\":\"/item/%E8%88%9C/79389\",\"id\":\"79389\"}]', 'https://baike.baidu.com/item/子姓/4381481', '', '6');
INSERT INTO `baike_related_items_js` VALUES ('4495981', 4, '国际标准', '179', '14', '', '', '国际标准是指国际标准化组织（ISO）、国际电工委员会（IEC）和国际电信联盟（ITU）制定的标准，以及国际标准化组织确认并公布的其他国际组织制定的标准。国际标准在世界范围内统一使用。', '[{\"name\":\"国际标准化组织\",\"href\":\"/item/%E5%9B%BD%E9%99%85%E6%A0%87%E5%87%86%E5%8C%96%E7%BB%84%E7%BB%87/779832\",\"id\":\"779832\"},{\"name\":\"国际电工委员会\",\"href\":\"/item/%E5%9B%BD%E9%99%85%E7%94%B5%E5%B7%A5%E5%A7%94%E5%91%98%E4%BC%9A/2876390\",\"id\":\"2876390\"},{\"name\":\"国际电信联盟\",\"href\":\"/item/%E5%9B%BD%E9%99%85%E7%94%B5%E4%BF%A1%E8%81%94%E7%9B%9F\"},{\"name\":\"标准\",\"href\":\"/item/%E6%A0%87%E5%87%86/219665\",\"id\":\"219665\"},{\"name\":\"标准化\",\"href\":\"/item/%E6%A0%87%E5%87%86%E5%8C%96\"},{\"name\":\"国际组织\",\"href\":\"/item/%E5%9B%BD%E9%99%85%E7%BB%84%E7%BB%87/261053\",\"id\":\"261053\"}]', 'https://baike.baidu.com/item/国际标准/4495981', '', '6805073');
INSERT INTO `baike_related_items_js` VALUES ('4546', 9, '关系', '7396', '1395', '（汉语词语）', '', '关系，是汉语词汇，汉语拼音为guān xì，指事物之间相互作用、相互影响的状态。如：《宣和遗事·前集》：“这箇阴阳，都关系着皇帝一人心术之邪正是也。”', '[]', 'https://baike.baidu.com/item/关系/4546', '', '7193606');
INSERT INTO `baike_related_items_js` VALUES ('4574890', 8, '不列颠人', '109', '2', '', '', '不列颠人（Briton）：6世纪以前居住在不列颠群岛的克尔特民族。起源关于克尔特人最初移徙不列颠诸岛的具体年代，亦存异议。一种看法主张，首批克尔特人约于公元前8—前5世纪之间由莱茵河下游和塞纳河流域分批迁入不列颠定居。而另一种观点则将之前推至公元前二十世纪早中期，认为甚至钟形杯文化时期就有操原始克尔特语的移民到来了。依照此说，克尔特语言、文化与民族播迁于不列颠诸岛，迄今已逾三千多年。', '[{\"name\":\"不列颠群岛\",\"href\":\"/item/%E4%B8%8D%E5%88%97%E9%A2%A0%E7%BE%A4%E5%B2%9B/6312089\",\"id\":\"6312089\"},{\"name\":\"不列颠\",\"href\":\"/item/%E4%B8%8D%E5%88%97%E9%A2%A0/7446734\",\"id\":\"7446734\"},{\"name\":\"莱茵河\",\"href\":\"/item/%E8%8E%B1%E8%8C%B5%E6%B2%B3/20481\",\"id\":\"20481\"},{\"name\":\"塞纳河\",\"href\":\"/item/%E5%A1%9E%E7%BA%B3%E6%B2%B3/1004608\",\"id\":\"1004608\"},{\"name\":\"克尔特语\",\"href\":\"/item/%E5%85%8B%E5%B0%94%E7%89%B9%E8%AF%AD/14479319\",\"id\":\"14479319\"}]', 'https://baike.baidu.com/item/不列颠人/4574890', '', '74292');
INSERT INTO `baike_related_items_js` VALUES ('4577821', 10, '具体', '202', '17', '（词语概念）', '', '具体，是汉语词汇，汉语拼音为jùtǐ，指的是不抽象，不笼统，细节很明确。具体也指实际存在的，真实的；特定的。如：胡采 《序<在和平的日子里>》：“但各人具体的创作道路却不尽相同。”[1] ', '[{\"name\":\"笼统\",\"href\":\"/item/%E7%AC%BC%E7%BB%9F/10432057\",\"id\":\"10432057\"},{\"name\":\"明确\",\"href\":\"/item/%E6%98%8E%E7%A1%AE/9792010\",\"id\":\"9792010\"},{\"name\":\"胡采\",\"href\":\"/item/%E8%83%A1%E9%87%87\"},{\"name\":\"在和平的日子里\",\"href\":\"/item/%E5%9C%A8%E5%92%8C%E5%B9%B3%E7%9A%84%E6%97%A5%E5%AD%90%E9%87%8C\"}]', 'https://baike.baidu.com/item/具体/4577821', '', '1405051');
INSERT INTO `baike_related_items_js` VALUES ('4743637', 9, '土耳其语', '500', '42', '', '', '土耳其语(Türkçe, Türk dili )，属突厥语系乌古斯语族，是一种现有6500万到7300万人使用的语言，主要在土耳其本土使用，并通行于阿塞拜疆、塞浦路斯、希腊、马其顿、罗马尼亚，以及在西欧居住的数百万土耳其族移民（主要集中在德国）。土耳其语一个显著的特色，是其元音和谐及大量胶着语的词缀变化。土耳其语的字词采用SOV词序。', '[{\"name\":\"突厥语系\",\"href\":\"/item/%E7%AA%81%E5%8E%A5%E8%AF%AD%E7%B3%BB/307854\",\"id\":\"307854\"},{\"name\":\"土耳其\",\"href\":\"/item/%E5%9C%9F%E8%80%B3%E5%85%B6/198448\",\"id\":\"198448\"},{\"name\":\"阿塞拜疆\",\"href\":\"/item/%E9%98%BF%E5%A1%9E%E6%8B%9C%E7%96%86/129306\",\"id\":\"129306\"},{\"name\":\"塞浦路斯\",\"href\":\"/item/%E5%A1%9E%E6%B5%A6%E8%B7%AF%E6%96%AF/129361\",\"id\":\"129361\"},{\"name\":\"希腊\",\"href\":\"/item/%E5%B8%8C%E8%85%8A/197766\",\"id\":\"197766\"},{\"name\":\"马其顿\",\"href\":\"/item/%E9%A9%AC%E5%85%B6%E9%A1%BF/417760\",\"id\":\"417760\"},{\"name\":\"罗马尼亚\",\"href\":\"/item/%E7%BD%97%E9%A9%AC%E5%B0%BC%E4%BA%9A/395923\",\"id\":\"395923\"},{\"name\":\"土耳其族\",\"href\":\"/item/%E5%9C%9F%E8%80%B3%E5%85%B6%E6%97%8F/2327902\",\"id\":\"2327902\"},{\"name\":\"胶着语\",\"href\":\"/item/%E8%83%B6%E7%9D%80%E8%AF%AD/6315894\",\"id\":\"6315894\"},{\"name\":\"词缀\",\"href\":\"/item/%E8%AF%8D%E7%BC%80/6140318\",\"id\":\"6140318\"}]', 'https://baike.baidu.com/item/土耳其语/4743637', '', '129361');
INSERT INTO `baike_related_items_js` VALUES ('479832', 6, '系统', '1111', '117', '', '', '能够完成一种或者几种生理功能的多个器官按照一定的次序组合在一起的结构叫做系统。系统一词创成于英文system的音译，并对应其外文内涵加以丰富。系统是指将零散的东西进行有序的整理、编排形成的具有整体性的整体。在数字信号处理的理论中，人们把能加工、变换数字信号的实体称作系统。由于处理数字信号的系统是在指定的时刻或时序对信号进行加工运算，所以这种系统被看作是离散时间的，也可以用基于时间的语言、表格、公式、波形四种方法来描述。[1] 从抽象的意义来说，系统和信号都可以看作是序列。但是，系统是加工信号的机构，这点与信号不同。人们研究系统，设计系统，利用系统加工信号、服务人类。除上文的四种描述方法，描述系统的方法还有符号、单位脉冲响应、差分方程和图形。中国著名学者钱学森认为：系统是由相互作用相互依赖的若干组成部分结合而成的，具有特定功能的有机整体，而且这个有机整体又是它从属的更大系统的组成部分。[2] 运动着的若干部分，在相互联系、相互作用之中形成的具有某种确定功能的整体，谓之系统。', '[{\"name\":\"组合\",\"href\":\"/item/%E7%BB%84%E5%90%88/1218690\",\"id\":\"1218690\"},{\"name\":\"整理\",\"href\":\"/item/%E6%95%B4%E7%90%86/269454\",\"id\":\"269454\"},{\"name\":\"编排\",\"href\":\"/item/%E7%BC%96%E6%8E%92/1517467\",\"id\":\"1517467\"},{\"name\":\"整体\",\"href\":\"/item/%E6%95%B4%E4%BD%93/7193606\",\"id\":\"7193606\"},{\"name\":\"语言\",\"href\":\"/item/%E8%AF%AD%E8%A8%80/72744\",\"id\":\"72744\"},{\"name\":\"表格\",\"href\":\"/item/%E8%A1%A8%E6%A0%BC/3371820\",\"id\":\"3371820\"},{\"name\":\"公式\",\"href\":\"/item/%E5%85%AC%E5%BC%8F/9991\",\"id\":\"9991\"},{\"name\":\"波形\",\"href\":\"/item/%E6%B3%A2%E5%BD%A2/742851\",\"id\":\"742851\"},{\"name\":\"描述\",\"href\":\"/item/%E6%8F%8F%E8%BF%B0/8928757\",\"id\":\"8928757\"},{\"name\":\"脉冲\",\"href\":\"/item/%E8%84%89%E5%86%B2\"},{\"name\":\"钱学森\",\"href\":\"/item/%E9%92%B1%E5%AD%A6%E6%A3%AE/26105\",\"id\":\"26105\"},{\"name\":\"有机整体\",\"href\":\"/item/%E6%9C%89%E6%9C%BA%E6%95%B4%E4%BD%93/7557061\",\"id\":\"7557061\"},{\"name\":\"组成\",\"href\":\"/item/%E7%BB%84%E6%88%90\"}]', 'https://baike.baidu.com/item/系统/479832', '本词条由“科普中国”科学百科词条编写与应用工作项目审核。', '2874935');
INSERT INTO `baike_related_items_js` VALUES ('4844469', 8, '专业知识', '238', '14', '', '', '专业知识是指沟通者对主张支持的权威程度。医生、科学家和教授在其领域内最具专业性。可信性是指信息来源被认为客观和诚实的程度，例如朋友比陌生的推销员更被信赖。可爱性是指信息来源对接收者有多少的吸引力。人们喜欢坦白、幽默和自然的来源。毫无疑问地，最可靠的来源是在这三种因素中得分高的人。[1] ', '[]', 'https://baike.baidu.com/item/专业知识/4844469', '', '34170');
INSERT INTO `baike_related_items_js` VALUES ('4994270', 3, '美国在线', '821', '25', '', '', '美国在线（American Online），2000年至2009年期间是美国时代华纳的子公司，著名的因特网服务提供商。在2000年美国在线和时代华纳（Time Warner）宣布计划合并，2001年1月11日该交易被联邦贸易委员会（Federal Trade Commission）证实。合并及以后的运作的信息见时代华纳。该企业品牌在世界品牌实验室（World Brand Lab）编制的2006年度《世界品牌500强》排行榜中名列第一百三十九。美国在线服务(AOL)公司：总部设在弗吉尼亚州维也纳的一家在线信息服务公司，可提供电子邮件、新闻组、教育和娱乐服务，并支持对因特网访问。美国在线服务(AOL)公司是美国最大因特网服务提供商之一[1] 。2015年5月11日，Verizon宣布44亿美元收购美国在线[2-3] 。', '[{\"name\":\"因特网服务提供商\",\"href\":\"/item/%E5%9B%A0%E7%89%B9%E7%BD%91%E6%9C%8D%E5%8A%A1%E6%8F%90%E4%BE%9B%E5%95%86/4994328\",\"id\":\"4994328\"},{\"name\":\"时代华纳\",\"href\":\"/item/%E6%97%B6%E4%BB%A3%E5%8D%8E%E7%BA%B3/414904\",\"id\":\"414904\"},{\"name\":\"世界品牌实验室\",\"href\":\"/item/%E4%B8%96%E7%95%8C%E5%93%81%E7%89%8C%E5%AE%9E%E9%AA%8C%E5%AE%A4\"},{\"name\":\"弗吉尼亚\",\"href\":\"/item/%E5%BC%97%E5%90%89%E5%B0%BC%E4%BA%9A\"},{\"name\":\"因特网\",\"href\":\"/item/%E5%9B%A0%E7%89%B9%E7%BD%91/114119\",\"id\":\"114119\"},{\"name\":\"因特网服务提供商\",\"href\":\"/item/%E5%9B%A0%E7%89%B9%E7%BD%91%E6%9C%8D%E5%8A%A1%E6%8F%90%E4%BE%9B%E5%95%86/4994328\",\"id\":\"4994328\"},{\"name\":\"Verizon\",\"href\":\"/item/Verizon\"}]', 'https://baike.baidu.com/item/美国在线/4994270', '', '');
INSERT INTO `baike_related_items_js` VALUES ('4994328', 4, 'ISP', '140', '', '（互联网服务提供商）', '', 'ISP(Internet Service Provider)，互联网服务提供商，即向广大用户综合提供互联网接入业务、信息业务和增值业务的电信运营商。ICP（Internet Content Provider）是互联网内容提供商，向广大用户综合提供互联网信息业务和增值业务的电信运营商。在互联网应用服务产业链“设备供应商——基础网络运营商——内容收集者和生产者——业务提供者——用户”中，ISP/ICP处于内容收集者、生产者以及业务提供者的位置。', '[{\"name\":\"ICP\",\"href\":\"/item/ICP\"}]', 'https://baike.baidu.com/item/因特网服务提供商/4994328', '', '4994270');
INSERT INTO `baike_related_items_js` VALUES ('5', 6, '概念', '2429', '97', '', '', '概念（Idea；Notion；Concept）人类在认识过程中，从感性认识上升到理性认识，把所感知的事物的共同本质特点抽象出来，加以概括，是自我认知意识的一种表达，形成概念式思维惯性。在人类所认知的思维体系中最基本的构筑单位。心理学上认为，概念是人脑对客观事物本质的反映，这种反映是以词来标示和记载的。概念是思维活动的结果和产物，同时又是思维活动借以进行的单元。表达概念的语言形式是词或词组。概念都有内涵和外延，即其涵义和适用范围。概念随着社会历史和人类认识的发展而变化。中华人民共和国国家标准GB/T15237.1-2000：“概念”是对特征的独特组合而形成的知识单元。德国工业标准2342将概念定义为一个“通过使用抽象化的方式从一群事物中提取出来的反映其共同特性的思维单位”。[1] 从广义上讲：事物能够改变模型的性质称为事物的概念。', '[{\"name\":\"概念\",\"href\":\"/item/%E6%A6%82%E5%BF%B5\"},{\"name\":\"认识\",\"href\":\"/item/%E8%AE%A4%E8%AF%86\"},{\"name\":\"感性认识\",\"href\":\"/item/%E6%84%9F%E6%80%A7%E8%AE%A4%E8%AF%86\"},{\"name\":\"理性认识\",\"href\":\"/item/%E7%90%86%E6%80%A7%E8%AE%A4%E8%AF%86\"},{\"name\":\"形成\",\"href\":\"/item/%E5%BD%A2%E6%88%90\"},{\"name\":\"思维\",\"href\":\"/item/%E6%80%9D%E7%BB%B4/475\",\"id\":\"475\"},{\"name\":\"单位\",\"href\":\"/item/%E5%8D%95%E4%BD%8D/32292\",\"id\":\"32292\"},{\"name\":\"表达\",\"href\":\"/item/%E8%A1%A8%E8%BE%BE/4649737\",\"id\":\"4649737\"},{\"name\":\"抽象化\",\"href\":\"/item/%E6%8A%BD%E8%B1%A1%E5%8C%96\"},{\"name\":\"模型\",\"href\":\"/item/%E6%A8%A1%E5%9E%8B\"},{\"name\":\"性质\",\"href\":\"/item/%E6%80%A7%E8%B4%A8\"}]', 'https://baike.baidu.com/item/概念', '', '829047');
INSERT INTO `baike_related_items_js` VALUES ('502192', 8, '动词', '3710', '496', '', '', '动词（Verb）一般就是用来表示动作或状态的词汇。在英语中，动词按作用和功能主要分为两大类，一类是谓语动词，另一类是非谓语动词。<比如> 突跃,突击,突袭等描述动作过程均属动词。中文语法中表示人或事物的动作或一种动态变化。一般出现在名词主语或主句后面。[1] ', '[{\"name\":\"动作\",\"href\":\"/item/%E5%8A%A8%E4%BD%9C/33802\",\"id\":\"33802\"},{\"name\":\"状态\",\"href\":\"/item/%E7%8A%B6%E6%80%81/33204\",\"id\":\"33204\"},{\"name\":\"词汇\",\"href\":\"/item/%E8%AF%8D%E6%B1%87/1890163\",\"id\":\"1890163\"},{\"name\":\"谓语\",\"href\":\"/item/%E8%B0%93%E8%AF%AD\"}]', 'https://baike.baidu.com/item/动词/502192', '', '1218690');
INSERT INTO `baike_related_items_js` VALUES ('502528', 9, '巴尔干半岛', '1282', '127', '', '', '巴尔干半岛（Balkan Peninsula），是一个历史和地理上的名词，用以描述欧洲的东南隅位于亚得里亚海和黑海之间的陆地，详细的范围依照定义不同有许多种说法。巴尔干一词是由土耳其语的“山脉”一词派生出来的。[1] 该地约有55万平方公里和近5500万人口。在古典希腊时代的巴尔干半岛指的是Haemus半岛。该地区采用其名称套用到通过保加利亚中心到西部塞尔维亚的巴尔干山脉上。巴尔干半岛与西班牙、葡萄牙所在的伊比利亚半岛及意大利所在的亚平宁半岛并称为南欧三大半岛。', '[{\"name\":\"欧洲\",\"href\":\"/item/%E6%AC%A7%E6%B4%B2/145550\",\"id\":\"145550\"},{\"name\":\"亚得里亚海\",\"href\":\"/item/%E4%BA%9A%E5%BE%97%E9%87%8C%E4%BA%9A%E6%B5%B7/1003434\",\"id\":\"1003434\"},{\"name\":\"黑海\",\"href\":\"/item/%E9%BB%91%E6%B5%B7/10976\",\"id\":\"10976\"},{\"name\":\"保加利亚\",\"href\":\"/item/%E4%BF%9D%E5%8A%A0%E5%88%A9%E4%BA%9A/419072\",\"id\":\"419072\"},{\"name\":\"塞尔维亚\",\"href\":\"/item/%E5%A1%9E%E5%B0%94%E7%BB%B4%E4%BA%9A/5409143\",\"id\":\"5409143\"},{\"name\":\"巴尔干山脉\",\"href\":\"/item/%E5%B7%B4%E5%B0%94%E5%B9%B2%E5%B1%B1%E8%84%89/1813179\",\"id\":\"1813179\"},{\"name\":\"西班牙\",\"href\":\"/item/%E8%A5%BF%E7%8F%AD%E7%89%99/148941\",\"id\":\"148941\"},{\"name\":\"葡萄牙\",\"href\":\"/item/%E8%91%A1%E8%90%84%E7%89%99/144714\",\"id\":\"144714\"},{\"name\":\"伊比利亚半岛\",\"href\":\"/item/%E4%BC%8A%E6%AF%94%E5%88%A9%E4%BA%9A%E5%8D%8A%E5%B2%9B/973488\",\"id\":\"973488\"},{\"name\":\"意大利\",\"href\":\"/item/%E6%84%8F%E5%A4%A7%E5%88%A9/148336\",\"id\":\"148336\"},{\"name\":\"亚平宁半岛\",\"href\":\"/item/%E4%BA%9A%E5%B9%B3%E5%AE%81%E5%8D%8A%E5%B2%9B/1026622\",\"id\":\"1026622\"},{\"name\":\"南欧三大半岛\",\"href\":\"/item/%E5%8D%97%E6%AC%A7%E4%B8%89%E5%A4%A7%E5%8D%8A%E5%B2%9B/10574100\",\"id\":\"10574100\"}]', 'https://baike.baidu.com/item/巴尔干半岛/502528', '', '197766');
INSERT INTO `baike_related_items_js` VALUES ('5151566', 7, '场合', '70', '2', '', '', '[situation; occasion; context] 指某个特定的时间和空间。魏巍 《东方》第三部第十六章：“这支歌已经成为人民心中的歌和心中的诗。人们经常在各种场合唱它。” 徐迟 《牡丹》三：“在旧社会里，艺术的力量，在大多数的场合中，都是抵御不住小市民的低级庸俗的趣味的。”', '[{\"name\":\"时\",\"href\":\"/item/%E6%97%B6\"},{\"name\":\"空间\",\"href\":\"/item/%E7%A9%BA%E9%97%B4/55280\",\"id\":\"55280\"},{\"name\":\"魏巍\",\"href\":\"/item/%E9%AD%8F%E5%B7%8D/3804\",\"id\":\"3804\"},{\"name\":\"东方\",\"href\":\"/item/%E4%B8%9C%E6%96%B9\"},{\"name\":\"徐迟\",\"href\":\"/item/%E5%BE%90%E8%BF%9F/2613057\",\"id\":\"2613057\"},{\"name\":\"旧社会\",\"href\":\"/item/%E6%97%A7%E7%A4%BE%E4%BC%9A/1223117\",\"id\":\"1223117\"},{\"name\":\"力量\",\"href\":\"/item/%E5%8A%9B%E9%87%8F\"},{\"name\":\"抵御\",\"href\":\"/item/%E6%8A%B5%E5%BE%A1/3491326\",\"id\":\"3491326\"},{\"name\":\"市民\",\"href\":\"/item/%E5%B8%82%E6%B0%91\"},{\"name\":\"庸俗\",\"href\":\"/item/%E5%BA%B8%E4%BF%97/1793102\",\"id\":\"1793102\"}]', 'https://baike.baidu.com/item/场合/5151566', '', '1416088');
