INSERT INTO `baike_related_items_js` VALUES ('55280', 8, '空间', '3045', '605', '（科学名词）', '', '空间是与时间相对的一种物质客观 存在形式，但两者密不可分，按照宇宙大爆炸理论，宇宙从奇点爆炸之后，宇宙的状态由初始的“一”分裂开来，从而有了不同的存在形式、运动状态等差异，物与物的位置差异度量称之为“空间”，位置的变化则由“时间”度量。空间由长度、宽度、高度、大小表现出来。通常指四方（方向）上下。空间有宇宙空间 、网络空间、思想空间、数字空间、物理空间等等，都属空间的范畴。地理学与天文学中指地球表面的一部分，有绝对空间与相对空间之分。空间由不同的线组成，线组成不同形状，线内便是空间。空间是一个相对概念，构成了事物的抽象概念，事物的抽象概念是参照于空间存在的。[1] ', '[{\"name\":\"空间\",\"href\":\"/item/%E7%A9%BA%E9%97%B4/55280\",\"id\":\"55280\"},{\"name\":\"宇宙\",\"href\":\"/item/%E5%AE%87%E5%AE%99/31801\",\"id\":\"31801\"},{\"name\":\"长度\",\"href\":\"/item/%E9%95%BF%E5%BA%A6/1584632\",\"id\":\"1584632\"},{\"name\":\"宽度\",\"href\":\"/item/%E5%AE%BD%E5%BA%A6/944305\",\"id\":\"944305\"},{\"name\":\"高度\",\"href\":\"/item/%E9%AB%98%E5%BA%A6/6108380\",\"id\":\"6108380\"},{\"name\":\"宇宙空间\",\"href\":\"/item/%E5%AE%87%E5%AE%99%E7%A9%BA%E9%97%B4/3725304\",\"id\":\"3725304\"},{\"name\":\"网络空间\",\"href\":\"/item/%E7%BD%91%E7%BB%9C%E7%A9%BA%E9%97%B4/7650101\",\"id\":\"7650101\"},{\"name\":\"思想空间\",\"href\":\"/item/%E6%80%9D%E6%83%B3%E7%A9%BA%E9%97%B4/9719377\",\"id\":\"9719377\"},{\"name\":\"数字空间\",\"href\":\"/item/%E6%95%B0%E5%AD%97%E7%A9%BA%E9%97%B4/8328255\",\"id\":\"8328255\"},{\"name\":\"范畴\",\"href\":\"/item/%E8%8C%83%E7%95%B4/4127668\",\"id\":\"4127668\"},{\"name\":\"地理学\",\"href\":\"/item/%E5%9C%B0%E7%90%86%E5%AD%A6/661412\",\"id\":\"661412\"},{\"name\":\"天文学\",\"href\":\"/item/%E5%A4%A9%E6%96%87%E5%AD%A6/402068\",\"id\":\"402068\"},{\"name\":\"绝对空间\",\"href\":\"/item/%E7%BB%9D%E5%AF%B9%E7%A9%BA%E9%97%B4/259734\",\"id\":\"259734\"},{\"name\":\"相对空间\",\"href\":\"/item/%E7%9B%B8%E5%AF%B9%E7%A9%BA%E9%97%B4/9383340\",\"id\":\"9383340\"},{\"name\":\"相对概念\",\"href\":\"/item/%E7%9B%B8%E5%AF%B9%E6%A6%82%E5%BF%B5/8012336\",\"id\":\"8012336\"},{\"name\":\"抽象\",\"href\":\"/item/%E6%8A%BD%E8%B1%A1/82058\",\"id\":\"82058\"},{\"name\":\"\",\"href\":\"/item/%E5%8F%82%E7%85%A7\"}]', 'https://baike.baidu.com/item/空间/55280', '本词条由“科普中国”科学百科词条编写与应用工作项目审核。', '5151566');
INSERT INTO `baike_related_items_js` VALUES ('5630557', 7, '希腊人', '507', '18', '（希腊和塞浦路斯的主体民族）', '', '希腊人，是希腊和塞浦路斯的主体民族，生活于欧洲的巴尔干半岛南端。希腊北与保加利亚、马其顿以及阿尔巴尼亚接壤，东与土耳其接壤，濒临爱琴海，西南临爱奥尼亚海及地中海。希腊被誉为是西方文明的发源地，拥有悠久的历史，并对三大洲的历史发展有过重大影响。', '[{\"name\":\"希腊\",\"href\":\"/item/%E5%B8%8C%E8%85%8A/197766\",\"id\":\"197766\"},{\"name\":\"塞浦路斯\",\"href\":\"/item/%E5%A1%9E%E6%B5%A6%E8%B7%AF%E6%96%AF/129361\",\"id\":\"129361\"},{\"name\":\"欧洲\",\"href\":\"/item/%E6%AC%A7%E6%B4%B2/145550\",\"id\":\"145550\"},{\"name\":\"巴尔干半岛\",\"href\":\"/item/%E5%B7%B4%E5%B0%94%E5%B9%B2%E5%8D%8A%E5%B2%9B/502528\",\"id\":\"502528\"},{\"name\":\"保加利亚\",\"href\":\"/item/%E4%BF%9D%E5%8A%A0%E5%88%A9%E4%BA%9A/419072\",\"id\":\"419072\"},{\"name\":\"马其顿\",\"href\":\"/item/%E9%A9%AC%E5%85%B6%E9%A1%BF/417760\",\"id\":\"417760\"},{\"name\":\"阿尔巴尼亚\",\"href\":\"/item/%E9%98%BF%E5%B0%94%E5%B7%B4%E5%B0%BC%E4%BA%9A/361248\",\"id\":\"361248\"},{\"name\":\"土耳其\",\"href\":\"/item/%E5%9C%9F%E8%80%B3%E5%85%B6/198448\",\"id\":\"198448\"},{\"name\":\"爱琴海\",\"href\":\"/item/%E7%88%B1%E7%90%B4%E6%B5%B7/659\",\"id\":\"659\"},{\"name\":\"爱奥尼亚海\",\"href\":\"/item/%E7%88%B1%E5%A5%A5%E5%B0%BC%E4%BA%9A%E6%B5%B7/6210624\",\"id\":\"6210624\"},{\"name\":\"地中海\",\"href\":\"/item/%E5%9C%B0%E4%B8%AD%E6%B5%B7/11515\",\"id\":\"11515\"},{\"name\":\"西方文明\",\"href\":\"/item/%E8%A5%BF%E6%96%B9%E6%96%87%E6%98%8E/5442174\",\"id\":\"5442174\"}]', 'https://baike.baidu.com/item/希腊人/5630557', '', '675775');
INSERT INTO `baike_related_items_js` VALUES ('5935617', 7, '电信业务', '38', '5', '', '', '电信业务（Telecommunication Business）指的是电信网向公众提供的业务。电信业务根据业务类型分类为基础电信业务和增值电信业务；根据提供业务的网络，可以分为固定电信业务和无线电信业务等。', '[]', 'https://baike.baidu.com/item/电信业务/5935617', '本词条由“科普中国”科学百科词条编写与应用工作项目审核。', '81');
INSERT INTO `baike_related_items_js` VALUES ('6', 9, '构件', '3860', '2562', '', '', '构件是系统中实际存在的可更换部分，它实现特定的功能，符合一套接口标准并实现一组接口。构件代表系统中的一部分物理实施，包括软件代码（源代码、二进制代码或可执行代码）或其等价物（如脚本或命令文件）。在图中，构件表示为一个带有标签的矩形。在工程实际中，各种机械与结构得到广泛应用。组成机械与结构的零、构件，在工程力学中统称为构件。', '[{\"name\":\"实际\",\"href\":\"/item/%E5%AE%9E%E9%99%85/81811\",\"id\":\"81811\"},{\"name\":\"软件代码\",\"href\":\"/item/%E8%BD%AF%E4%BB%B6%E4%BB%A3%E7%A0%81/3030633\",\"id\":\"3030633\"},{\"name\":\"源代码\",\"href\":\"/item/%E6%BA%90%E4%BB%A3%E7%A0%81/3814213\",\"id\":\"3814213\"},{\"name\":\"二进制代码\",\"href\":\"/item/%E4%BA%8C%E8%BF%9B%E5%88%B6%E4%BB%A3%E7%A0%81/4879654\",\"id\":\"4879654\"},{\"name\":\"可执行代码\",\"href\":\"/item/%E5%8F%AF%E6%89%A7%E8%A1%8C%E4%BB%A3%E7%A0%81\"}]', 'https://baike.baidu.com/item/构件', '', '32794');
INSERT INTO `baike_related_items_js` VALUES ('6230', 5, '纽约', '14611', '2166', '（美国第一大城市）', '', '纽约市（New York City，简称NYC），位于美国纽约州东南部大西洋沿岸，是美国第一大城市及第一大港口，世界第一大城市，与英国伦敦、中国香港并称为“纽伦港”（Nylonkong）。2018年11月，纽约被GaWC评为Alpha++级世界一线城市。[1-3] 截至2017年，纽约市总面积达1214.4平方公里，人口约851万人，居住在789平方公里的土地上。而纽约大都市圈则有2000万人左右，仅次于东京、墨西哥城、孟买，位居世界第四位。2017年，纽约地区生产总值已达到9007亿美元。纽约在商业和金融的方面也发挥着巨大的影响力。纽约的金融区以曼哈顿下城及华尔街为龙头，被称为世界的金融中心，世界500强企业中，有56家总部企业位于纽约。 纽约证券交易所是世界第二大证交所，它曾是最大的交易所，全球市值为15万亿美元，直到1996年它的交易量被纳斯达克超过。纽约时代广场位于百老汇剧院区枢纽，被称作“世界的十字路口”，亦是世界娱乐产业的中心之一。曼哈顿的唐人街是西半球最为密集的华人集中地。纽约还拥有哥伦比亚大学、纽约大学、洛克菲勒大学等名校。纽约地铁和纽新航港局过哈德逊河捷运（PATH）所组成的纽约地下铁路系统是世界上最为发达的城市轨道交通系统之一，提供一日24小时、一周七日的服务。 而长岛铁路，大都会北方铁路，新泽西捷运和美铁则共同组成了纽约的城际和通勤铁路系统。[4] ', '[{\"name\":\"纽约州\",\"href\":\"/item/%E7%BA%BD%E7%BA%A6%E5%B7%9E/3439049\",\"id\":\"3439049\"},{\"name\":\"大西洋\",\"href\":\"/item/%E5%A4%A7%E8%A5%BF%E6%B4%8B/10883\",\"id\":\"10883\"},{\"name\":\"美国\",\"href\":\"/item/%E7%BE%8E%E5%9B%BD/125486\",\"id\":\"125486\"},{\"name\":\"纽伦港\",\"href\":\"/item/%E7%BA%BD%E4%BC%A6%E6%B8%AF/79244\",\"id\":\"79244\"},{\"name\":\"世界一线城市\",\"href\":\"/item/%E4%B8%96%E7%95%8C%E4%B8%80%E7%BA%BF%E5%9F%8E%E5%B8%82/4722524\",\"id\":\"4722524\"},{\"name\":\"曼哈顿\",\"href\":\"/item/%E6%9B%BC%E5%93%88%E9%A1%BF/635\",\"id\":\"635\"},{\"name\":\"下城\",\"href\":\"/item/%E4%B8%8B%E5%9F%8E\"},{\"name\":\"华尔街\",\"href\":\"/item/%E5%8D%8E%E5%B0%94%E8%A1%97/165\",\"id\":\"165\"},{\"name\":\"世界500强\",\"href\":\"/item/%E4%B8%96%E7%95%8C500%E5%BC%BA\"},{\"name\":\"纽约证券交易所\",\"href\":\"/item/%E7%BA%BD%E7%BA%A6%E8%AF%81%E5%88%B8%E4%BA%A4%E6%98%93%E6%89%80/271637\",\"id\":\"271637\"},{\"name\":\"纳斯达克\",\"href\":\"/item/%E7%BA%B3%E6%96%AF%E8%BE%BE%E5%85%8B/17437\",\"id\":\"17437\"},{\"name\":\"时代广场\",\"href\":\"/item/%E6%97%B6%E4%BB%A3%E5%B9%BF%E5%9C%BA/17101\",\"id\":\"17101\"},{\"name\":\"百老汇\",\"href\":\"/item/%E7%99%BE%E8%80%81%E6%B1%87/71294\",\"id\":\"71294\"},{\"name\":\"曼哈顿\",\"href\":\"/item/%E6%9B%BC%E5%93%88%E9%A1%BF/635\",\"id\":\"635\"},{\"name\":\"唐人街\",\"href\":\"/item/%E5%94%90%E4%BA%BA%E8%A1%97/6352\",\"id\":\"6352\"},{\"name\":\"西半球\",\"href\":\"/item/%E8%A5%BF%E5%8D%8A%E7%90%83\"},{\"name\":\"哥伦比亚大学\",\"href\":\"/item/%E5%93%A5%E4%BC%A6%E6%AF%94%E4%BA%9A%E5%A4%A7%E5%AD%A6/513683\",\"id\":\"513683\"},{\"name\":\"纽约大学\",\"href\":\"/item/%E7%BA%BD%E7%BA%A6%E5%A4%A7%E5%AD%A6/2610719\",\"id\":\"2610719\"},{\"name\":\"洛克菲勒大学\",\"href\":\"/item/%E6%B4%9B%E5%85%8B%E8%8F%B2%E5%8B%92%E5%A4%A7%E5%AD%A6/5407719\",\"id\":\"5407719\"},{\"name\":\"纽约地铁\",\"href\":\"/item/%E7%BA%BD%E7%BA%A6%E5%9C%B0%E9%93%81/7887987\",\"id\":\"7887987\"},{\"name\":\"纽新航港局过哈德逊河捷运\",\"href\":\"/item/%E7%BA%BD%E6%96%B0%E8%88%AA%E6%B8%AF%E5%B1%80%E8%BF%87%E5%93%88%E5%BE%B7%E9%80%8A%E6%B2%B3%E6%8D%B7%E8%BF%90/1269077\",\"id\":\"1269077\"},{\"name\":\"长岛铁路\",\"href\":\"/item/%E9%95%BF%E5%B2%9B%E9%93%81%E8%B7%AF/6712920\",\"id\":\"6712920\"},{\"name\":\"大都会北方铁路\",\"href\":\"/item/%E5%A4%A7%E9%83%BD%E4%BC%9A%E5%8C%97%E6%96%B9%E9%93%81%E8%B7%AF/6712639\",\"id\":\"6712639\"},{\"name\":\"新泽西捷运\",\"href\":\"/item/%E6%96%B0%E6%B3%BD%E8%A5%BF%E6%8D%B7%E8%BF%90/22941242\",\"id\":\"22941242\"},{\"name\":\"美铁\",\"href\":\"/item/%E7%BE%8E%E9%93%81/6078637\",\"id\":\"6078637\"}]', 'https://baike.baidu.com/item/纽约/6230', '', '414904');
INSERT INTO `baike_related_items_js` VALUES ('6391646', 9, '古英语', '906', '37', '', '', '古英语（Old English或Anglo-Saxon）是指从450年到1150年间的英语。语法和德语比较相近，形态变化很复杂。语言史学家一般把英语的历史分为三个时期：古英语、中古英语、现代英语。古英语的名词有数和格的分别；数分为单数、复数；格分为主格、宾格、所有格、与格，一个名词加起来共有8种变化形式。', '[{\"name\":\"语法\",\"href\":\"/item/%E8%AF%AD%E6%B3%95/2447258\",\"id\":\"2447258\"},{\"name\":\"德语\",\"href\":\"/item/%E5%BE%B7%E8%AF%AD/240836\",\"id\":\"240836\"},{\"name\":\"形态\",\"href\":\"/item/%E5%BD%A2%E6%80%81\"},{\"name\":\"语言\",\"href\":\"/item/%E8%AF%AD%E8%A8%80/72744\",\"id\":\"72744\"},{\"name\":\"史学家\",\"href\":\"/item/%E5%8F%B2%E5%AD%A6%E5%AE%B6/3190073\",\"id\":\"3190073\"},{\"name\":\"古英语\",\"href\":\"/item/%E5%8F%A4%E8%8B%B1%E8%AF%AD/6391646\",\"id\":\"6391646\"},{\"name\":\"中古英语\",\"href\":\"/item/%E4%B8%AD%E5%8F%A4%E8%8B%B1%E8%AF%AD/9130478\",\"id\":\"9130478\"},{\"name\":\"现代英语\",\"href\":\"/item/%E7%8E%B0%E4%BB%A3%E8%8B%B1%E8%AF%AD/6450936\",\"id\":\"6450936\"},{\"name\":\"单数\",\"href\":\"/item/%E5%8D%95%E6%95%B0/1658633\",\"id\":\"1658633\"},{\"name\":\"复数\",\"href\":\"/item/%E5%A4%8D%E6%95%B0/13131232\",\"id\":\"13131232\"},{\"name\":\"主格\",\"href\":\"/item/%E4%B8%BB%E6%A0%BC/10879467\",\"id\":\"10879467\"},{\"name\":\"宾格\",\"href\":\"/item/%E5%AE%BE%E6%A0%BC/10879472\",\"id\":\"10879472\"},{\"name\":\"所有格\",\"href\":\"/item/%E6%89%80%E6%9C%89%E6%A0%BC/879404\",\"id\":\"879404\"},{\"name\":\"与格\",\"href\":\"/item/%E4%B8%8E%E6%A0%BC\"}]', 'https://baike.baidu.com/item/古英语/6391646', '', '2024035');
INSERT INTO `baike_related_items_js` VALUES ('6431', 7, '地球', '48962', '2898', '（太阳系八大行星之一）', '', '地球（Earth）是太阳系八大行星之一，按离太阳由近及远的次序排为第三颗，也是太阳系中直径、质量和密度最大的类地行星，距离太阳1.5亿公里。地球自西向东自转，同时围绕太阳公转。现有40~46亿岁，[1] 它有一个天然卫星——月球，二者组成一个天体系统——地月系统。46亿年以前起源于原始太阳星云。地球赤道半径6378.137千米，极半径6356.752千米，平均半径约6371千米，赤道周长大约为40076千米，呈两极稍扁赤道略鼓的不规则的椭圆球体。地球表面积5.1亿平方公里，其中71%为海洋，29%为陆地，在太空上看地球呈蓝色。地球内部有核、幔、壳结构，地球外部有水圈、大气圈以及磁场。地球是目前宇宙中已知存在生命的唯一的天体，是包括人类在内上百万种生物的家园。[1] ', '[{\"name\":\"太阳系\",\"href\":\"/item/%E5%A4%AA%E9%98%B3%E7%B3%BB\"},{\"name\":\"大行星\",\"href\":\"/item/%E5%A4%A7%E8%A1%8C%E6%98%9F\"},{\"name\":\"太阳\",\"href\":\"/item/%E5%A4%AA%E9%98%B3/24010\",\"id\":\"24010\"},{\"name\":\"天然卫星\",\"href\":\"/item/%E5%A4%A9%E7%84%B6%E5%8D%AB%E6%98%9F/4223869\",\"id\":\"4223869\"},{\"name\":\"月球\",\"href\":\"/item/%E6%9C%88%E7%90%83/30767\",\"id\":\"30767\"},{\"name\":\"地月系统\",\"href\":\"/item/%E5%9C%B0%E6%9C%88%E7%B3%BB%E7%BB%9F/4678826\",\"id\":\"4678826\"},{\"name\":\"赤道\",\"href\":\"/item/%E8%B5%A4%E9%81%93\"},{\"name\":\"半径\",\"href\":\"/item/%E5%8D%8A%E5%BE%84\"},{\"name\":\"周长\",\"href\":\"/item/%E5%91%A8%E9%95%BF\"},{\"name\":\"蓝色\",\"href\":\"/item/%E8%93%9D%E8%89%B2/35972\",\"id\":\"35972\"}]', 'https://baike.baidu.com/item/地球/6431', '', '10883');
