INSERT INTO `baike_related_items_js` VALUES ('675775', 6, '希腊语', '1686', '41', '', '', '希腊语，希腊人的语言，属于印欧语系-希腊语族，广泛用于希腊、阿尔巴尼亚、塞浦路斯等国，与土耳其一带的某些地区。古代希腊语原有26个字母，荷马时期后逐渐演变并确定为24个，一直沿用到现代希腊语中。希腊语言元音发达，希腊人增添了元音字母。因为希腊人的书写工具是蜡板，有时前一行从右向左写完后顺势就从左向右写，变成所谓“耕地”（boustrophedon）式书写，后来逐渐演变成全部从左向右写。', '[{\"name\":\"希腊人\",\"href\":\"/item/%E5%B8%8C%E8%85%8A%E4%BA%BA/5630557\",\"id\":\"5630557\"},{\"name\":\"印欧语系\",\"href\":\"/item/%E5%8D%B0%E6%AC%A7%E8%AF%AD%E7%B3%BB/1188904\",\"id\":\"1188904\"},{\"name\":\"阿尔巴尼亚\",\"href\":\"/item/%E9%98%BF%E5%B0%94%E5%B7%B4%E5%B0%BC%E4%BA%9A/361248\",\"id\":\"361248\"},{\"name\":\"塞浦路斯\",\"href\":\"/item/%E5%A1%9E%E6%B5%A6%E8%B7%AF%E6%96%AF/129361\",\"id\":\"129361\"},{\"name\":\"字母\",\"href\":\"/item/%E5%AD%97%E6%AF%8D\"},{\"name\":\"荷马时期\",\"href\":\"/item/%E8%8D%B7%E9%A9%AC%E6%97%B6%E6%9C%9F/1380012\",\"id\":\"1380012\"},{\"name\":\"元音\",\"href\":\"/item/%E5%85%83%E9%9F%B3/2811\",\"id\":\"2811\"},{\"name\":\"元音字母\",\"href\":\"/item/%E5%85%83%E9%9F%B3%E5%AD%97%E6%AF%8D/890495\",\"id\":\"890495\"},{\"name\":\"行从\",\"href\":\"/item/%E8%A1%8C%E4%BB%8E\"}]', 'https://baike.baidu.com/item/希腊语/675775', '', '779832');
