INSERT INTO `baike_related_items_js` VALUES ('6805073', 3, '标准通用置标语言', '30', '8', '', '', '标准通用标记语言（以下简称“通用标言”），是一种定义电子文档结构和描述其内容的国际标准语言；[1] 通用标言为语法置标提供了异常强大的工具，同时具有极好的扩展性，因此在数据分类和索引中非常有用；[2] 是所有电子文档标记语言的起源，早在万维网发明之前“通用标言”就已存在。[1] “通用标言”允许用户标记电子文档的元素创建一个适当的标记方案，便于在各种印刷和电子格式的多个版本的生产。[3] “通用标言”多用于科技文献和政府办公文件中。[2] ', '[{\"name\":\"电子文档\",\"href\":\"/item/%E7%94%B5%E5%AD%90%E6%96%87%E6%A1%A3/3045210\",\"id\":\"3045210\"},{\"name\":\"国际标准\",\"href\":\"/item/%E5%9B%BD%E9%99%85%E6%A0%87%E5%87%86/4495981\",\"id\":\"4495981\"},{\"name\":\"数据分类\",\"href\":\"/item/%E6%95%B0%E6%8D%AE%E5%88%86%E7%B1%BB/4952449\",\"id\":\"4952449\"},{\"name\":\"万维网\",\"href\":\"/item/%E4%B8%87%E7%BB%B4%E7%BD%91/215515\",\"id\":\"215515\"}]', 'https://baike.baidu.com/item/标准通用标记语言/6805073', '', '');
INSERT INTO `baike_related_items_js` VALUES ('7193606', 8, '整体', '141', '8', '（汉语词语）', '', '整体是指一个由有内在关系的部分所组成的体系对象。各个组成部分一定有某种内在关系，或功能互补，或利益共同，或协调行动等等。简单地说，就是一个有组织的事物。一般情况下，“整体”有一定的组成原则、组织规则、组织机构、运转规则和运行秩序等。在词性理解和实际应用上，要特别注意“整体”和“总体”的区别。通过这两个词的对比，可以实现更为准确的词性和使用环境的把握。（下文有描述）', '[{\"name\":\"关系\",\"href\":\"/item/%E5%85%B3%E7%B3%BB/4546\",\"id\":\"4546\"}]', 'https://baike.baidu.com/item/整体/7193606', '', '1218690');
INSERT INTO `baike_related_items_js` VALUES ('74292', 7, '英国人', '1840', '228', '（英伦三岛居民总称）', '', '英国人（British people），普遍专指英格兰人，而不是其他不列颠人（Britons）和北爱尔兰人（people of Northern Ireland）。另一种意义上指拥有英国国籍或是父母方具有英国民族血统。英国人总人口6513万。无官方语言，但通用语言为英语，此外威尔士北部还使用威尔士语，苏格兰西北高地及北爱尔兰部分地区仍使用盖尔语。居民多信奉基督教新教，主要分英格兰教会（亦称英国国教圣公会，其成员约占英成人的60%）和苏格兰教会（亦称长老会，有成年教徒59万）。另有天主教、伊斯兰教、印度教、锡克教、犹太教和佛教等较大的宗教社团。', '[{\"name\":\"英格兰人\",\"href\":\"/item/%E8%8B%B1%E6%A0%BC%E5%85%B0%E4%BA%BA/2024035\",\"id\":\"2024035\"},{\"name\":\"不列颠人\",\"href\":\"/item/%E4%B8%8D%E5%88%97%E9%A2%A0%E4%BA%BA/4574890\",\"id\":\"4574890\"},{\"name\":\"北爱尔兰\",\"href\":\"/item/%E5%8C%97%E7%88%B1%E5%B0%94%E5%85%B0/4463472\",\"id\":\"4463472\"},{\"name\":\"英语\",\"href\":\"/item/%E8%8B%B1%E8%AF%AD/109997\",\"id\":\"109997\"},{\"name\":\"盖尔语\",\"href\":\"/item/%E7%9B%96%E5%B0%94%E8%AF%AD/5090530\",\"id\":\"5090530\"},{\"name\":\"天主教\",\"href\":\"/item/%E5%A4%A9%E4%B8%BB%E6%95%99/201996\",\"id\":\"201996\"},{\"name\":\"伊斯兰教\",\"href\":\"/item/%E4%BC%8A%E6%96%AF%E5%85%B0%E6%95%99/242135\",\"id\":\"242135\"},{\"name\":\"印度教\",\"href\":\"/item/%E5%8D%B0%E5%BA%A6%E6%95%99/971197\",\"id\":\"971197\"},{\"name\":\"锡克教\",\"href\":\"/item/%E9%94%A1%E5%85%8B%E6%95%99/1135484\",\"id\":\"1135484\"},{\"name\":\"犹太教\",\"href\":\"/item/%E7%8A%B9%E5%A4%AA%E6%95%99/88496\",\"id\":\"88496\"},{\"name\":\"佛教\",\"href\":\"/item/%E4%BD%9B%E6%95%99/163332\",\"id\":\"163332\"}]', 'https://baike.baidu.com/item/英国人/74292', '', '1188904');
INSERT INTO `baike_related_items_js` VALUES ('7446734', 9, '不列颠', '989', '18', '', '', '不列颠岛（Great Britain）是一个位于欧洲西方外海的岛屿，分为英格兰、苏格兰、威尔士三部分，以及周围一些小岛，目前为英国控制。 不列颠岛为欧洲最大的岛屿。', '[{\"name\":\"英格兰\",\"href\":\"/item/%E8%8B%B1%E6%A0%BC%E5%85%B0/1064478\",\"id\":\"1064478\"},{\"name\":\"威尔士\",\"href\":\"/item/%E5%A8%81%E5%B0%94%E5%A3%AB/4834248\",\"id\":\"4834248\"}]', 'https://baike.baidu.com/item/不列颠/7446734', '', '4574890');
INSERT INTO `baike_related_items_js` VALUES ('763181', 6, '基本', '817', '161', '', '', '基本，拼音是ji ben，是指根本的，一个基本的事实。出自 《汉书·谷永传》。', '[{\"name\":\"根本\",\"href\":\"/item/%E6%A0%B9%E6%9C%AC/3303325\",\"id\":\"3303325\"}]', 'https://baike.baidu.com/item/基本/763181', '', '99347');
INSERT INTO `baike_related_items_js` VALUES ('779832', 5, '国际标准化组织', '566', '216', '', '', '国际标准化组织（International Organization for Standardization，ISO）简称ISO，是一个全球性的非政府组织，是国际标准化领域中一个十分重要的组织。ISO一来源于希腊语“ISOS”，即“EQUAL”——平等之意。ISO国际标准组织成立于1946年，中国是ISO的正式成员，代表中国参加ISO的国家机构是中国国家技术监督局（CSBTS）。[1] ISO负责目前绝大部分领域（包括军工、石油、船舶等垄断行业）的标准化活动。ISO现有117个成员，包括117个国家和地区。ISO的最高权力机构是每年一次的“全体大会”，其日常办事机构是中央秘书处，设在瑞士日内瓦。中央秘书处现有170名职员，由秘书长领导。ISO的宗旨是“在世界上促进标准化及其相关活动的发展，以便于商品和服务的国际交换，在智力、科学、技术和经济领域开展合作。”ISO通过它的2856个技术结构开展技术活动，其中技术委员会（简称SC）共611个，工作组（WG）2022个，特别工作组38个。中国于1978年加入ISO，在2008年10月的第31届国际化标准组织大会上，中国正式成为ISO的常任理事国。国际标准化组织总部设于瑞士日内瓦，成员包括162个会员国。该组织自我定义为非政府组织，官方语言是英语、法语和俄语。参加者包括各会员国的国家标准机构和主要公司。它是世界上最大的非政府性标准化专门机构，是国际标准化领域中一个十分重要的组织。', '[{\"name\":\"非政府组织\",\"href\":\"/item/%E9%9D%9E%E6%94%BF%E5%BA%9C%E7%BB%84%E7%BB%87/1416088\",\"id\":\"1416088\"},{\"name\":\"希腊语\",\"href\":\"/item/%E5%B8%8C%E8%85%8A%E8%AF%AD/675775\",\"id\":\"675775\"},{\"name\":\"平等\",\"href\":\"/item/%E5%B9%B3%E7%AD%89/2699794\",\"id\":\"2699794\"},{\"name\":\"国家机构\",\"href\":\"/item/%E5%9B%BD%E5%AE%B6%E6%9C%BA%E6%9E%84/1779733\",\"id\":\"1779733\"},{\"name\":\"国家技术监督局\",\"href\":\"/item/%E5%9B%BD%E5%AE%B6%E6%8A%80%E6%9C%AF%E7%9B%91%E7%9D%A3%E5%B1%80/8963422\",\"id\":\"8963422\"},{\"name\":\"办事机构\",\"href\":\"/item/%E5%8A%9E%E4%BA%8B%E6%9C%BA%E6%9E%84/5379866\",\"id\":\"5379866\"},{\"name\":\"日内瓦\",\"href\":\"/item/%E6%97%A5%E5%86%85%E7%93%A6\"},{\"name\":\"常任理事国\",\"href\":\"/item/%E5%B8%B8%E4%BB%BB%E7%90%86%E4%BA%8B%E5%9B%BD/2668950\",\"id\":\"2668950\"},{\"name\":\"瑞士\",\"href\":\"/item/%E7%91%9E%E5%A3%AB\"},{\"name\":\"日内瓦\",\"href\":\"/item/%E6%97%A5%E5%86%85%E7%93%A6\"},{\"name\":\"国\",\"href\":\"/item/%E5%9B%BD\"},{\"name\":\"定义\",\"href\":\"/item/%E5%AE%9A%E4%B9%89/483965\",\"id\":\"483965\"},{\"name\":\"非政府组织\",\"href\":\"/item/%E9%9D%9E%E6%94%BF%E5%BA%9C%E7%BB%84%E7%BB%87/1416088\",\"id\":\"1416088\"},{\"name\":\"官方语言\",\"href\":\"/item/%E5%AE%98%E6%96%B9%E8%AF%AD%E8%A8%80/2410217\",\"id\":\"2410217\"},{\"name\":\"英语\",\"href\":\"/item/%E8%8B%B1%E8%AF%AD/109997\",\"id\":\"109997\"},{\"name\":\"法语\",\"href\":\"/item/%E6%B3%95%E8%AF%AD/660115\",\"id\":\"660115\"},{\"name\":\"俄语\",\"href\":\"/item/%E4%BF%84%E8%AF%AD/315852\",\"id\":\"315852\"},{\"name\":\"公司\",\"href\":\"/item/%E5%85%AC%E5%8F%B8/251430\",\"id\":\"251430\"}]', 'https://baike.baidu.com/item/国际标准化组织/779832', '本词条由“科普中国”科学百科词条编写与应用工作项目审核。', '4495981');
INSERT INTO `baike_related_items_js` VALUES ('7990672', 9, '八大行星', '13817', '466', '', '', '八大行星是太阳系的八个大行星，按照离太阳的距离从近到远，它们依次为水星（☿）、金星（♀）、地球（⊕）、火星（♂）、木星（♃）、土星（♄）、天王星（♅）、海王星（♆）。八大行星自转方向多数也和公转方向一致。只有金星和天王星两个例外。金星自转方向与公转方向相反。行星的定义：一是必须围绕恒星运转的天体；二是质量足够大，能依靠自身引力使天体呈圆球状；三是这个轨道附近应该没有其他物体。按这样的划分，太阳系的行星就只有水、金、地、火、木、土，加上天王、海王星这八颗。[1] 与2006年之前提到的九大行星概念不同，在2006年8月24日于布拉格举行的第26届国际天文学联会中通过的第5号决议中，冥王星被划为矮行星，从太阳系九大行星中被除名。必须是围绕恒星运转的天体——冥王星相符。质量足够大，能依靠自身引力使天体呈圆球状相符，但是冥王星没有能够清空其轨道上的其他物体，因此降级为矮行星。而同样具有足够质量、成圆球形，但不能清除其轨道附近其他物体的天体称为“矮行星”，冥王星恰好符合这一定义，并被国际天文学联合会确认是一颗“矮行星”。所以冥王星被归为矮行星。从此太阳系从九大行星变成了八大行星。', '[{\"name\":\"太阳系\",\"href\":\"/item/%E5%A4%AA%E9%98%B3%E7%B3%BB/173281\",\"id\":\"173281\"},{\"name\":\"大行星\",\"href\":\"/item/%E5%A4%A7%E8%A1%8C%E6%98%9F/9672298\",\"id\":\"9672298\"},{\"name\":\"水星\",\"href\":\"/item/%E6%B0%B4%E6%98%9F/135917\",\"id\":\"135917\"},{\"name\":\"金星\",\"href\":\"/item/%E9%87%91%E6%98%9F/19410\",\"id\":\"19410\"},{\"name\":\"地球\",\"href\":\"/item/%E5%9C%B0%E7%90%83/6431\",\"id\":\"6431\"},{\"name\":\"火星\",\"href\":\"/item/%E7%81%AB%E6%98%9F/5627\",\"id\":\"5627\"},{\"name\":\"木星\",\"href\":\"/item/%E6%9C%A8%E6%98%9F/222105\",\"id\":\"222105\"},{\"name\":\"土星\",\"href\":\"/item/%E5%9C%9F%E6%98%9F/136354\",\"id\":\"136354\"},{\"name\":\"天王星\",\"href\":\"/item/%E5%A4%A9%E7%8E%8B%E6%98%9F/21805\",\"id\":\"21805\"},{\"name\":\"海王星\",\"href\":\"/item/%E6%B5%B7%E7%8E%8B%E6%98%9F/30351\",\"id\":\"30351\"},{\"name\":\"海王星\",\"href\":\"/item/%E6%B5%B7%E7%8E%8B%E6%98%9F/30351\",\"id\":\"30351\"},{\"name\":\"国际天文学联会\",\"href\":\"/item/%E5%9B%BD%E9%99%85%E5%A4%A9%E6%96%87%E5%AD%A6%E8%81%94%E4%BC%9A/2287571\",\"id\":\"2287571\"},{\"name\":\"冥王星\",\"href\":\"/item/%E5%86%A5%E7%8E%8B%E6%98%9F/137498\",\"id\":\"137498\"},{\"name\":\"轨道\",\"href\":\"/item/%E8%BD%A8%E9%81%93/77741\",\"id\":\"77741\"},{\"name\":\"矮行星\",\"href\":\"/item/%E7%9F%AE%E8%A1%8C%E6%98%9F/7990374\",\"id\":\"7990374\"},{\"name\":\"矮行星\",\"href\":\"/item/%E7%9F%AE%E8%A1%8C%E6%98%9F/7990374\",\"id\":\"7990374\"},{\"name\":\"国际天文学联合会\",\"href\":\"/item/%E5%9B%BD%E9%99%85%E5%A4%A9%E6%96%87%E5%AD%A6%E8%81%94%E5%90%88%E4%BC%9A/8135728\",\"id\":\"8135728\"}]', 'https://baike.baidu.com/item/八大行星/7990672', '', '');
INSERT INTO `baike_related_items_js` VALUES ('8', 6, '存储器', '782', '469', '', '', '存储器（Memory）是现代信息技术中用于保存信息的记忆设备。其概念很广，有很多层次，在数字系统中，只要能保存二进制数据的都可以是存储器；在集成电路中，一个没有实物形式的具有存储功能的电路也叫存储器，如RAM、FIFO等；在系统中，具有实物形式的存储设备也叫存储器，如内存条、TF卡等。计算机中全部信息，包括输入的原始数据、计算机程序、中间运行结果和最终运行结果都保存在存储器中。它根据控制器指定的位置存入和取出信息。有了存储器，计算机才有记忆功能，才能保证正常工作。计算机中的存储器按用途存储器可分为主存储器（内存）和辅助存储器（外存）,也有分为外部存储器和内部存储器的分类方法。外存通常是磁性介质或光盘等，能长期保存信息。内存指主板上的存储部件，用来存放当前正在执行的数据和程序，但仅用于暂时存放程序和数据，关闭电源或断电，数据会丢失。', '[{\"name\":\"控制器\",\"href\":\"/item/%E6%8E%A7%E5%88%B6%E5%99%A8/2206126\",\"id\":\"2206126\"}]', 'https://baike.baidu.com/item/存储器', '', '2842227');
INSERT INTO `baike_related_items_js` VALUES ('81', 6, '增值电信业务经营许可证', '1545', '19', '', '', '电信业务分基础电信业务和增值电信业务。基础电信业务指提供公共网络基础设施、公共数据传送和基本语音通信服务的业务。增值电信业务指利用公共网络基础设施提供的电信与信息服务的业务。增值电信业务经营许可证是指利用公共网络基础设施提供的电信与信息服务的业务的许可证。国家对电信业务经营实行许可制度。经营电信业务，必须依照规定取得国务院信息产业主管部门或者省、自治区、直辖市电信管理机构颁发的电信业务经营许可证。未取得电信业务经营许可证，任何组织或个人不得从事电信业务经营活动。', '[{\"name\":\"电信业务\",\"href\":\"/item/%E7%94%B5%E4%BF%A1%E4%B8%9A%E5%8A%A1/5935617\",\"id\":\"5935617\"},{\"name\":\"业务\",\"href\":\"/item/%E4%B8%9A%E5%8A%A1/1176273\",\"id\":\"1176273\"}]', 'https://baike.baidu.com/item/ICP证', '', '');
INSERT INTO `baike_related_items_js` VALUES ('8223003', 8, '表示', '336', '49', '', '', '表示是一个汉语词汇，读音为biǎo shì，作动词时意思是用言行表现出；事物本身显出某种意义或者凭借某种事物显出某种意义。作名词时意为“心意”、“礼品”等。[1] ', '[{\"name\":\"动词\",\"href\":\"/item/%E5%8A%A8%E8%AF%8D/502192\",\"id\":\"502192\"},{\"name\":\"言行\",\"href\":\"/item/%E8%A8%80%E8%A1%8C/6793494\",\"id\":\"6793494\"}]', 'https://baike.baidu.com/item/表示/8223003', '', '269454');
INSERT INTO `baike_related_items_js` VALUES ('829047', 5, '概念', '1410', '94', '', '', '概念（Idea；Notion；Concept）人类在认识过程中，从感性认识上升到理性认识，把所感知的事物的共同本质特点抽象出来，加以概括，是自我认知意识的一种表达，形成概念式思维惯性。在人类所认知的思维体系中最基本的构筑单位。心理学上认为，概念是人脑对客观事物本质的反映，这种反映是以词来标示和记载的。概念是思维活动的结果和产物，同时又是思维活动借以进行的单元。表达概念的语言形式是词或词组。概念都有内涵和外延，即其涵义和适用范围。概念随着社会历史和人类认识的发展而变化。中华人民共和国国家标准GB/T15237.1-2000：“概念”是对特征的独特组合而形成的知识单元。德国工业标准2342将概念定义为一个“通过使用抽象化的方式从一群事物中提取出来的反映其共同特性的思维单位”。[1] 从广义上讲：事物能够改变模型的性质称为事物的概念。', '[{\"name\":\"概念\",\"href\":\"/item/%E6%A6%82%E5%BF%B5\"},{\"name\":\"认识\",\"href\":\"/item/%E8%AE%A4%E8%AF%86\"},{\"name\":\"感性认识\",\"href\":\"/item/%E6%84%9F%E6%80%A7%E8%AE%A4%E8%AF%86\"},{\"name\":\"理性认识\",\"href\":\"/item/%E7%90%86%E6%80%A7%E8%AE%A4%E8%AF%86\"},{\"name\":\"形成\",\"href\":\"/item/%E5%BD%A2%E6%88%90\"},{\"name\":\"思维\",\"href\":\"/item/%E6%80%9D%E7%BB%B4/475\",\"id\":\"475\"},{\"name\":\"单位\",\"href\":\"/item/%E5%8D%95%E4%BD%8D/32292\",\"id\":\"32292\"},{\"name\":\"表达\",\"href\":\"/item/%E8%A1%A8%E8%BE%BE/4649737\",\"id\":\"4649737\"},{\"name\":\"抽象化\",\"href\":\"/item/%E6%8A%BD%E8%B1%A1%E5%8C%96\"},{\"name\":\"模型\",\"href\":\"/item/%E6%A8%A1%E5%9E%8B\"},{\"name\":\"性质\",\"href\":\"/item/%E6%80%A7%E8%B4%A8\"}]', 'https://baike.baidu.com/item/概念/829047', '', '');
INSERT INTO `baike_related_items_js` VALUES ('8309940', 3, '网页浏览器', '420', '28', '', '', '网页浏览器（英语：web browser），常被简称为浏览器，是一种用于检索并展示万维网信息资源的应用程序。这些信息资源可为网页、图片、影音或其他内容，它们由统一资源标志符标志。信息资源中的超链接可使用户方便地浏览相关信息。', '[{\"name\":\"万维网\",\"href\":\"/item/%E4%B8%87%E7%BB%B4%E7%BD%91\"},{\"name\":\"应用程序\",\"href\":\"/item/%E5%BA%94%E7%94%A8%E7%A8%8B%E5%BA%8F\"},{\"name\":\"超链接\",\"href\":\"/item/%E8%B6%85%E9%93%BE%E6%8E%A5\"}]', 'https://baike.baidu.com/item/网页浏览器/8309940', '本词条由“科普中国”科学百科词条编写与应用工作项目审核。', '');
INSERT INTO `baike_related_items_js` VALUES ('8343309', 10, '综合素质', '65', '7', '', '', '《综合素质》[1] ，一书不仅为你提供了一些实用的技能，让你更有效地领导并影响他人，也教你如何培养信心和动力，使你成为杰出且成功的经理。生动有力的提示帮助你处理实际工作中发生的情况并抓住每一次机会使自己在工作中日臻完美。', '[]', 'https://baike.baidu.com/item/综合素质/8343309', '', '33045');
INSERT INTO `baike_related_items_js` VALUES ('83601', 8, '华盛顿哥伦比亚特区', '2675', '657', '（美国首都）', '', '华盛顿哥伦比亚特区（Washington D.C.），简称华盛顿，又称华都、华府，美利坚合众国的首都，得名于美国首任总统乔治·华盛顿，靠近弗吉尼亚州和马里兰州，位于美国的东北部、中大西洋地区，是1790年作为首都而设置、由美国国会直接管辖的特别行政区划，因此不属于美国的任何一州。截至2016年，华盛顿市区面积177平方公里；2019年1月，人口约70万。华盛顿哥伦比亚特区的最高权力机构为美国国会，通过华盛顿市政府实施管理。但是华盛顿市民在众议院仅有一名有选举权的代表，在参议院没有代表。[1] 华盛顿2016年的实际地区生产总值为1093亿美元，位列美国各州第34位，其中主要产业均与政府机构相关，是大多数美国联邦政府机关与各国驻美国大使馆的所在地，也是世界银行、国际货币基金组织、美洲国家组织等国际组织总部的所在地，还拥有为数众多的博物馆与文化史迹。[2] ', '[{\"name\":\"美利坚合众国\",\"href\":\"/item/%E7%BE%8E%E5%88%A9%E5%9D%9A%E5%90%88%E4%BC%97%E5%9B%BD/379269\",\"id\":\"379269\"},{\"name\":\"乔治·华盛顿\",\"href\":\"/item/%E4%B9%94%E6%B2%BB%C2%B7%E5%8D%8E%E7%9B%9B%E9%A1%BF/25610\",\"id\":\"25610\"},{\"name\":\"美国国会\",\"href\":\"/item/%E7%BE%8E%E5%9B%BD%E5%9B%BD%E4%BC%9A/3361029\",\"id\":\"3361029\"},{\"name\":\"参议院\",\"href\":\"/item/%E5%8F%82%E8%AE%AE%E9%99%A2/10829500\",\"id\":\"10829500\"},{\"name\":\"世界银行\",\"href\":\"/item/%E4%B8%96%E7%95%8C%E9%93%B6%E8%A1%8C/1055632\",\"id\":\"1055632\"},{\"name\":\"国际货币基金组织\",\"href\":\"/item/%E5%9B%BD%E9%99%85%E8%B4%A7%E5%B8%81%E5%9F%BA%E9%87%91%E7%BB%84%E7%BB%87/386540\",\"id\":\"386540\"},{\"name\":\"美洲国家组织\",\"href\":\"/item/%E7%BE%8E%E6%B4%B2%E5%9B%BD%E5%AE%B6%E7%BB%84%E7%BB%87/1468991\",\"id\":\"1468991\"}]', 'https://baike.baidu.com/item/华盛顿哥伦比亚特区/83601', '', '125486');
INSERT INTO `baike_related_items_js` VALUES ('840993', 5, '体育画报', '231', '9', '', '', '体育画报是由媒体巨擘时代华纳所拥有的美国体育周刊。每个礼拜2300万成人的阅读量，拥有超过300万的订户，在美国包括超过1300万、19%的男性。是第一个获得美国国家杂志奖的卓越表现奖两次的杂志中，超过百万流通量的。它的泳装特刊（Swimsuit Issue），从1964年发行以来，已变成年度的活动，发行自己的电视节目、影视产品以及月历。', '[]', 'https://baike.baidu.com/item/体育画报/840993', '', '414904');
INSERT INTO `baike_related_items_js` VALUES ('86', 6, '认识', '212', '127', '', '', '认识是人脑反映客观事物的特性与联系、并揭露事物对人的意义与作用的思维活动。从广义上讲，认识包含人的所有认知活动，即为感知、记忆、思维、想象、语言的理解和产生等心理现象的统称。认识是一种信息加工过程，可以分为刺激的接收、编码、存储、提取和利用等一系列阶段。从狭义上讲，认识有时等同于记忆或思维。[1] ', '[{\"name\":\"感知\",\"href\":\"/item/%E6%84%9F%E7%9F%A5/10752910\",\"id\":\"10752910\"}]', 'https://baike.baidu.com/item/认识', '', '829047');
INSERT INTO `baike_related_items_js` VALUES ('8610084', 9, '形体', '262', '3', '', '', '形体是一个汉语词汇，读音为xíngtǐ，有身体、形象；形状、疆界；地域等意思。清· 薛福成《观巴黎油画记》等均有相关记载。', '[{\"name\":\"薛福成\",\"href\":\"/item/%E8%96%9B%E7%A6%8F%E6%88%90/1011729\",\"id\":\"1011729\"}]', 'https://baike.baidu.com/item/形体/8610084', '', '33073');
INSERT INTO `baike_related_items_js` VALUES ('87', 5, '英语', '2502', '462', '（印欧语系-日耳曼语族下语言）', '', '英语（English）是印欧语系-日耳曼语族下的语言，由26个字母组成，英文字母渊源于拉丁字母，拉丁字母渊源于希腊字母，而希腊字母则是由腓尼基字母演变而来的。英语是国际指定的官方语言（作为母语），也是世界上使用最广泛的语言，英语包含约49万词，外加技术名词约30万个，是词汇最多的语言，也是欧盟以及许多国际组织以及英联邦国家的官方语言，拥有世界第三位的母语使用者人数，仅次于汉语和西班牙语母语使用者人数。英语由古代从丹麦等斯堪的纳维亚半岛以及德国、荷兰及周边移民至不列颠群岛的盎格鲁-撒克逊人，以及朱特部落的白人所说的语言演变而来，并通过英国的殖民活动传播到了世界各地。由于在历史上曾和多种民族语言接触，它的词汇从一元变为多元，语法从“多屈折”变为“少屈折”，语音也发生了规律性的变化。在19至20世纪，英国以及美国在文化、经济、军事、政治和科学在世界上的领先地位使得英语成为一种国际语言。如今，许多国际场合都使用英语做为沟通媒介。英语也是与电脑联系最密切的语言，大多数编程语言都与英语有联系，而且随着网络的使用，英文的使用更普及。英语是联合国的工作语言之一。 低地撒克逊语、丹麦语、德语、荷兰语和英语也很接近。拥有法国血统的诺曼人于11世纪征服英格兰王国，带来数万法语词汇和拉丁语词汇，很大程度地丰富了英语词汇外，相对也驱使不少原生的语汇作废。', '[{\"name\":\"英语\",\"href\":\"/item/%E8%8B%B1%E8%AF%AD/19915502\",\"id\":\"19915502\"},{\"name\":\"印欧语系\",\"href\":\"/item/%E5%8D%B0%E6%AC%A7%E8%AF%AD%E7%B3%BB/1188904\",\"id\":\"1188904\"},{\"name\":\"日耳曼语族\",\"href\":\"/item/%E6%97%A5%E8%80%B3%E6%9B%BC%E8%AF%AD%E6%97%8F/1188647\",\"id\":\"1188647\"},{\"name\":\"拉丁字母\",\"href\":\"/item/%E6%8B%89%E4%B8%81%E5%AD%97%E6%AF%8D/1936851\",\"id\":\"1936851\"},{\"name\":\"希腊字母\",\"href\":\"/item/%E5%B8%8C%E8%85%8A%E5%AD%97%E6%AF%8D/4428067\",\"id\":\"4428067\"},{\"name\":\"腓尼基字母\",\"href\":\"/item/%E8%85%93%E5%B0%BC%E5%9F%BA%E5%AD%97%E6%AF%8D/5285617\",\"id\":\"5285617\"},{\"name\":\"官方语言\",\"href\":\"/item/%E5%AE%98%E6%96%B9%E8%AF%AD%E8%A8%80/2410217\",\"id\":\"2410217\"},{\"name\":\"英联邦国家\",\"href\":\"/item/%E8%8B%B1%E8%81%94%E9%82%A6%E5%9B%BD%E5%AE%B6/3905041\",\"id\":\"3905041\"},{\"name\":\"官方语言\",\"href\":\"/item/%E5%AE%98%E6%96%B9%E8%AF%AD%E8%A8%80/2410217\",\"id\":\"2410217\"},{\"name\":\"斯堪的纳维亚半岛\",\"href\":\"/item/%E6%96%AF%E5%A0%AA%E7%9A%84%E7%BA%B3%E7%BB%B4%E4%BA%9A%E5%8D%8A%E5%B2%9B/531962\",\"id\":\"531962\"},{\"name\":\"德国\",\"href\":\"/item/%E5%BE%B7%E5%9B%BD/147953\",\"id\":\"147953\"},{\"name\":\"荷兰\",\"href\":\"/item/%E8%8D%B7%E5%85%B0/190469\",\"id\":\"190469\"},{\"name\":\"不列颠群岛\",\"href\":\"/item/%E4%B8%8D%E5%88%97%E9%A2%A0%E7%BE%A4%E5%B2%9B/6312089\",\"id\":\"6312089\"},{\"name\":\"盎格鲁-撒克逊人\",\"href\":\"/item/%E7%9B%8E%E6%A0%BC%E9%B2%81-%E6%92%92%E5%85%8B%E9%80%8A%E4%BA%BA/8591707\",\"id\":\"8591707\"},{\"name\":\"白人\",\"href\":\"/item/%E7%99%BD%E4%BA%BA/6715447\",\"id\":\"6715447\"},{\"name\":\"民族语言\",\"href\":\"/item/%E6%B0%91%E6%97%8F%E8%AF%AD%E8%A8%80/15817432\",\"id\":\"15817432\"},{\"name\":\"美国\",\"href\":\"/item/%E7%BE%8E%E5%9B%BD/125486\",\"id\":\"125486\"},{\"name\":\"文化\",\"href\":\"/item/%E6%96%87%E5%8C%96/23624\",\"id\":\"23624\"},{\"name\":\"政治\",\"href\":\"/item/%E6%94%BF%E6%B2%BB/169778\",\"id\":\"169778\"},{\"name\":\"编程语言\",\"href\":\"/item/%E7%BC%96%E7%A8%8B%E8%AF%AD%E8%A8%80/9845131\",\"id\":\"9845131\"},{\"name\":\"工作语言\",\"href\":\"/item/%E5%B7%A5%E4%BD%9C%E8%AF%AD%E8%A8%80/15714728\",\"id\":\"15714728\"},{\"name\":\"低地撒克逊语\",\"href\":\"/item/%E4%BD%8E%E5%9C%B0%E6%92%92%E5%85%8B%E9%80%8A%E8%AF%AD/9104730\",\"id\":\"9104730\"},{\"name\":\"丹麦语\",\"href\":\"/item/%E4%B8%B9%E9%BA%A6%E8%AF%AD/3546141\",\"id\":\"3546141\"},{\"name\":\"德语\",\"href\":\"/item/%E5%BE%B7%E8%AF%AD/240836\",\"id\":\"240836\"},{\"name\":\"荷兰语\",\"href\":\"/item/%E8%8D%B7%E5%85%B0%E8%AF%AD/676102\",\"id\":\"676102\"},{\"name\":\"诺曼人\",\"href\":\"/item/%E8%AF%BA%E6%9B%BC%E4%BA%BA/10972144\",\"id\":\"10972144\"},{\"name\":\"英格兰\",\"href\":\"/item/%E8%8B%B1%E6%A0%BC%E5%85%B0\"}]', 'https://baike.baidu.com/item/英文', '', '91');
INSERT INTO `baike_related_items_js` VALUES ('8889443', 6, '电工', '939', '65', '（电气工程学名词）', '', '电工指研究电磁领域的客观规律及其应用的科学技术，以及电力生产和电工制造两大工业生产体系。', '[]', 'https://baike.baidu.com/item/电工/8889443', '本词条由“科普中国”科学百科词条编写与应用工作项目审核。', '2876390');
INSERT INTO `baike_related_items_js` VALUES ('895', 8, '工业革命', '23304', '15954', '（资本主义工业化过渡阶段）', '', '工业革命（The Industrial Revolution ）开始于十八世纪六十年代，通常认为它发源于英格兰中部地区，是指资本主义工业化的早期历程，即资本主义生产完成了从工场手工业向机器大工业过渡的阶段。工业革命是以机器取代人力，以大规模工厂化生产取代个体工场手工生产的一场生产与科技革命。由于机器的发明及运用成为了这个时代的标志，因此历史学家称这个时代为“机器时代”（the Age of Machines）。18世纪中叶，英国人瓦特改良蒸汽机之后，由一系列技术革命引起了从手工劳动向动力机器生产转变的重大飞跃。随后向英国乃至整个欧洲大陆传播，19世纪传至北美。一般认为，蒸汽机、煤、铁和钢是促成工业革命技术加速发展的四项主要因素。英国是最早开始工业革命也是最早结束工业革命的国家。', '[{\"name\":\"英格兰\",\"href\":\"/item/%E8%8B%B1%E6%A0%BC%E5%85%B0/1064478\",\"id\":\"1064478\"},{\"name\":\"资本主义工业化\",\"href\":\"/item/%E8%B5%84%E6%9C%AC%E4%B8%BB%E4%B9%89%E5%B7%A5%E4%B8%9A%E5%8C%96/10422272\",\"id\":\"10422272\"},{\"name\":\"资本主义\",\"href\":\"/item/%E8%B5%84%E6%9C%AC%E4%B8%BB%E4%B9%89\"},{\"name\":\"工场手工业\",\"href\":\"/item/%E5%B7%A5%E5%9C%BA%E6%89%8B%E5%B7%A5%E4%B8%9A/10921007\",\"id\":\"10921007\"},{\"name\":\"机器大工业\",\"href\":\"/item/%E6%9C%BA%E5%99%A8%E5%A4%A7%E5%B7%A5%E4%B8%9A/4869773\",\"id\":\"4869773\"},{\"name\":\"标志\",\"href\":\"/item/%E6%A0%87%E5%BF%97\"},{\"name\":\"瓦特\",\"href\":\"/item/%E7%93%A6%E7%89%B9/5465\",\"id\":\"5465\"},{\"name\":\"蒸汽机\",\"href\":\"/item/%E8%92%B8%E6%B1%BD%E6%9C%BA/367409\",\"id\":\"367409\"},{\"name\":\"欧洲\",\"href\":\"/item/%E6%AC%A7%E6%B4%B2\"},{\"name\":\"北美\",\"href\":\"/item/%E5%8C%97%E7%BE%8E/10447373\",\"id\":\"10447373\"}]', 'https://baike.baidu.com/item/工业革命/895', '', '9848425');
INSERT INTO `baike_related_items_js` VALUES ('91', 4, 'www', '24270', '138', '（万维网缩写）', '', 'WWW是环球信息网的缩写，（亦作“Web”、“WWW”、“\'W3\'”，英文全称为“World Wide Web”），中文名字为“万维网”，\"环球网\"等，常简称为Web。 分为Web客户端和Web服务器程序。 WWW可以让Web客户端（常用浏览器）访问浏览Web服务器上的页面。 是一个由许多互相链接的超文本组成的系统，通过互联网访问。在这个系统中，每个有用的事物，称为一样“资源”；并且由一个全局“统一资源标识符”（URI）标识；这些资源通过超文本传输协议（Hypertext Transfer Protocol）传送给用户，而后者通过点击链接来获得资源。万维网联盟（英语：World Wide Web Consortium，简称W3C），又称W3C理事会。1994年10月在麻省理工学院（MIT）计算机科学实验室成立。万维网联盟的创建者是万维网的发明者蒂姆·伯纳斯-李。万维网并不等同互联网，万维网只是互联网所能提供的服务其中之一，是靠着互联网运行的一项服务。', '[{\"name\":\"环球信息网\",\"href\":\"/item/%E7%8E%AF%E7%90%83%E4%BF%A1%E6%81%AF%E7%BD%91/9377238\",\"id\":\"9377238\"},{\"name\":\"英文\",\"href\":\"/item/%E8%8B%B1%E6%96%87\"},{\"name\":\"万维网\",\"href\":\"/item/%E4%B8%87%E7%BB%B4%E7%BD%91/215515\",\"id\":\"215515\"},{\"name\":\"客户端\",\"href\":\"/item/%E5%AE%A2%E6%88%B7%E7%AB%AF/101081\",\"id\":\"101081\"},{\"name\":\"客户端\",\"href\":\"/item/%E5%AE%A2%E6%88%B7%E7%AB%AF/101081\",\"id\":\"101081\"},{\"name\":\"浏览器\",\"href\":\"/item/%E6%B5%8F%E8%A7%88%E5%99%A8/213911\",\"id\":\"213911\"},{\"name\":\"服务器\",\"href\":\"/item/%E6%9C%8D%E5%8A%A1%E5%99%A8\"},{\"name\":\"超文本\",\"href\":\"/item/%E8%B6%85%E6%96%87%E6%9C%AC/2832422\",\"id\":\"2832422\"},{\"name\":\"互联网\",\"href\":\"/item/%E4%BA%92%E8%81%94%E7%BD%91\"},{\"name\":\"统一资源标识符\",\"href\":\"/item/%E7%BB%9F%E4%B8%80%E8%B5%84%E6%BA%90%E6%A0%87%E8%AF%86%E7%AC%A6/2890807\",\"id\":\"2890807\"},{\"name\":\"URI\",\"href\":\"/item/URI\"},{\"name\":\"超文本传输协议\",\"href\":\"/item/%E8%B6%85%E6%96%87%E6%9C%AC%E4%BC%A0%E8%BE%93%E5%8D%8F%E8%AE%AE/8535513\",\"id\":\"8535513\"},{\"name\":\"万维网联盟\",\"href\":\"/item/%E4%B8%87%E7%BB%B4%E7%BD%91%E8%81%94%E7%9B%9F/1458269\",\"id\":\"1458269\"},{\"name\":\"英语\",\"href\":\"/item/%E8%8B%B1%E8%AF%AD/109997\",\"id\":\"109997\"},{\"name\":\"麻省理工学院\",\"href\":\"/item/%E9%BA%BB%E7%9C%81%E7%90%86%E5%B7%A5%E5%AD%A6%E9%99%A2\"},{\"name\":\"互联网\",\"href\":\"/item/%E4%BA%92%E8%81%94%E7%BD%91/199186\",\"id\":\"199186\"}]', 'https://baike.baidu.com/item/万维网', '', '8309940');
INSERT INTO `baike_related_items_js` VALUES ('9377238', 5, 'www', '75', '', '（万维网缩写）', '', 'WWW是环球信息网的缩写，（亦作“Web”、“WWW”、“\'W3\'”，英文全称为“World Wide Web”），中文名字为“万维网”，\"环球网\"等，常简称为Web。 分为Web客户端和Web服务器程序。 WWW可以让Web客户端（常用浏览器）访问浏览Web服务器上的页面。 是一个由许多互相链接的超文本组成的系统，通过互联网访问。在这个系统中，每个有用的事物，称为一样“资源”；并且由一个全局“统一资源标识符”（URI）标识；这些资源通过超文本传输协议（Hypertext Transfer Protocol）传送给用户，而后者通过点击链接来获得资源。万维网联盟（英语：World Wide Web Consortium，简称W3C），又称W3C理事会。1994年10月在麻省理工学院（MIT）计算机科学实验室成立。万维网联盟的创建者是万维网的发明者蒂姆·伯纳斯-李。万维网并不等同互联网，万维网只是互联网所能提供的服务其中之一，是靠着互联网运行的一项服务。', '[{\"name\":\"环球信息网\",\"href\":\"/item/%E7%8E%AF%E7%90%83%E4%BF%A1%E6%81%AF%E7%BD%91/9377238\",\"id\":\"9377238\"},{\"name\":\"英文\",\"href\":\"/item/%E8%8B%B1%E6%96%87\"},{\"name\":\"万维网\",\"href\":\"/item/%E4%B8%87%E7%BB%B4%E7%BD%91/215515\",\"id\":\"215515\"},{\"name\":\"客户端\",\"href\":\"/item/%E5%AE%A2%E6%88%B7%E7%AB%AF/101081\",\"id\":\"101081\"},{\"name\":\"客户端\",\"href\":\"/item/%E5%AE%A2%E6%88%B7%E7%AB%AF/101081\",\"id\":\"101081\"},{\"name\":\"浏览器\",\"href\":\"/item/%E6%B5%8F%E8%A7%88%E5%99%A8/213911\",\"id\":\"213911\"},{\"name\":\"服务器\",\"href\":\"/item/%E6%9C%8D%E5%8A%A1%E5%99%A8\"},{\"name\":\"超文本\",\"href\":\"/item/%E8%B6%85%E6%96%87%E6%9C%AC/2832422\",\"id\":\"2832422\"},{\"name\":\"互联网\",\"href\":\"/item/%E4%BA%92%E8%81%94%E7%BD%91\"},{\"name\":\"统一资源标识符\",\"href\":\"/item/%E7%BB%9F%E4%B8%80%E8%B5%84%E6%BA%90%E6%A0%87%E8%AF%86%E7%AC%A6/2890807\",\"id\":\"2890807\"},{\"name\":\"URI\",\"href\":\"/item/URI\"},{\"name\":\"超文本传输协议\",\"href\":\"/item/%E8%B6%85%E6%96%87%E6%9C%AC%E4%BC%A0%E8%BE%93%E5%8D%8F%E8%AE%AE/8535513\",\"id\":\"8535513\"},{\"name\":\"万维网联盟\",\"href\":\"/item/%E4%B8%87%E7%BB%B4%E7%BD%91%E8%81%94%E7%9B%9F/1458269\",\"id\":\"1458269\"},{\"name\":\"英语\",\"href\":\"/item/%E8%8B%B1%E8%AF%AD/109997\",\"id\":\"109997\"},{\"name\":\"麻省理工学院\",\"href\":\"/item/%E9%BA%BB%E7%9C%81%E7%90%86%E5%B7%A5%E5%AD%A6%E9%99%A2\"},{\"name\":\"互联网\",\"href\":\"/item/%E4%BA%92%E8%81%94%E7%BD%91/199186\",\"id\":\"199186\"}]', 'https://baike.baidu.com/item/环球信息网/9377238', '', '91');
INSERT INTO `baike_related_items_js` VALUES ('9672298', 9, '大行星', '251', '10', '', '', '大行星是指太阳系的八大行星。太阳系是由太阳、行星及其卫星、小行星、彗星、流星和行星际物质构成的天体系统，太阳是太阳系的中心。在庞大的太阳系家族中，太阳的质量占太阳系总质量的99.8%，八大行星以及数以万计的小行星所占比例微乎其微。它们沿着自己的轨道万古不息地绕太阳运转着，同时，太阳又慷慨无私地奉献出自己的光和热，温暖着太阳系中的每一个成员，促使他们不停地发展和演变。 在这个家族中，离太阳最近的行星是水星，向外依次是金星、地球、火星、木星、土星、天王星、海王星。它们当中，肉眼能看到的只有五颗，对这五颗星，各国命名不同，我国古代有五行学说，因此便用金、木、水、火、土这五行来分别把它们命名为金星、木星、水星、火星和土星，这并不是因为水星上有水，木星上有树木才这样称呼的。而欧洲呢，则是用罗马神话人物的名字来称呼它们。近代发现的两颗远日行星，西方按照以神话人物名字命名的传统，以天空之神和海洋之神的名称来称呼它们，在中文里便相应译为天王星和海王星。', '[{\"name\":\"大行星\",\"href\":\"/item/%E5%A4%A7%E8%A1%8C%E6%98%9F/9672298\",\"id\":\"9672298\"},{\"name\":\"八大行星\",\"href\":\"/item/%E5%85%AB%E5%A4%A7%E8%A1%8C%E6%98%9F/7990672\",\"id\":\"7990672\"},{\"name\":\"行星际物质\",\"href\":\"/item/%E8%A1%8C%E6%98%9F%E9%99%85%E7%89%A9%E8%B4%A8/1307829\",\"id\":\"1307829\"},{\"name\":\"天体系统\",\"href\":\"/item/%E5%A4%A9%E4%BD%93%E7%B3%BB%E7%BB%9F/8891801\",\"id\":\"8891801\"},{\"name\":\"水星\",\"href\":\"/item/%E6%B0%B4%E6%98%9F/135917\",\"id\":\"135917\"},{\"name\":\"金星\",\"href\":\"/item/%E9%87%91%E6%98%9F/19410\",\"id\":\"19410\"},{\"name\":\"土星\",\"href\":\"/item/%E5%9C%9F%E6%98%9F/136354\",\"id\":\"136354\"},{\"name\":\"天王星\",\"href\":\"/item/%E5%A4%A9%E7%8E%8B%E6%98%9F/21805\",\"id\":\"21805\"},{\"name\":\"海王星\",\"href\":\"/item/%E6%B5%B7%E7%8E%8B%E6%98%9F/30351\",\"id\":\"30351\"},{\"name\":\"罗马神话\",\"href\":\"/item/%E7%BD%97%E9%A9%AC%E7%A5%9E%E8%AF%9D/63443\",\"id\":\"63443\"},{\"name\":\"远日行星\",\"href\":\"/item/%E8%BF%9C%E6%97%A5%E8%A1%8C%E6%98%9F/944817\",\"id\":\"944817\"}]', 'https://baike.baidu.com/item/大行星/9672298', '', '');
INSERT INTO `baike_related_items_js` VALUES ('97857', 4, '超链接', '2329', '106', '', '', '超级链接简单来讲，就是指按内容链接。超级链接在本质上属于一个网页的一部分，它是一种允许我们同其他网页或站点之间进行连接的元素。各个网页链接在一起后，才能真正构成一个网站。所谓的超链接是指从一个网页指向一个目标的连接关系，这个目标可以是另一个网页，也可以是相同网页上的不同位置，还可以是一个图片，一个电子邮件地址，一个文件，甚至是一个应用程序。而在一个网页中用来超链接的对象，可以是一段文本或者是一个图片。当浏览者单击已经链接的文字或图片后，链接目标将显示在浏览器上，并且根据目标的类型来打开或运行。', '[{\"name\":\"超级链接\",\"href\":\"/item/%E8%B6%85%E7%BA%A7%E9%93%BE%E6%8E%A5/313121\",\"id\":\"313121\"},{\"name\":\"网页\",\"href\":\"/item/%E7%BD%91%E9%A1%B5/99347\",\"id\":\"99347\"},{\"name\":\"网页\",\"href\":\"/item/%E7%BD%91%E9%A1%B5/99347\",\"id\":\"99347\"}]', 'https://baike.baidu.com/item/超链接/97857', '本词条由“科普中国”科学百科词条编写与应用工作项目审核。', '2832422');
INSERT INTO `baike_related_items_js` VALUES ('9848425', 7, '19世纪', '56', '16', '（历史年代）', '', '19世纪，1801年1月1日----1900年12月31日的这一段期间被称为19世纪。这段期间最显著的是西欧与北美因工业革命促成的技术与经济上的进步，各种自然科学学科，如物理、化学、生物学、地质学等皆逐渐成形，并影响到社会科学的诞生或重塑，在艺术上上世纪流行的古典艺术逐渐被浪漫主义替代又开始朝向写实主义发展，这其中又以印象派最为著名。', '[{\"name\":\"工业革命\",\"href\":\"/item/%E5%B7%A5%E4%B8%9A%E9%9D%A9%E5%91%BD/895\",\"id\":\"895\"},{\"name\":\"古典艺术\",\"href\":\"/item/%E5%8F%A4%E5%85%B8%E8%89%BA%E6%9C%AF/3703820\",\"id\":\"3703820\"},{\"name\":\"浪漫主义\",\"href\":\"/item/%E6%B5%AA%E6%BC%AB%E4%B8%BB%E4%B9%89/214808\",\"id\":\"214808\"},{\"name\":\"写实主义\",\"href\":\"/item/%E5%86%99%E5%AE%9E%E4%B8%BB%E4%B9%89/8026526\",\"id\":\"8026526\"},{\"name\":\"印象派\",\"href\":\"/item/%E5%8D%B0%E8%B1%A1%E6%B4%BE/95120\",\"id\":\"95120\"}]', 'https://baike.baidu.com/item/十九世纪/9848425', '', '1188904');
INSERT INTO `baike_related_items_js` VALUES ('99347', 5, '网页', '3386', '864', '', '', '网页是构成网站的基本元素，是承载各种网站应用的平台。通俗地说，您的网站就是由网页组成的，如果您只有域名和虚拟主机而没有制作任何网页的话，您的客户仍旧无法访问您的网站。网页是一个包含HTML标签的纯文本文件，它可以存放在世界某个角落的某一台计算机中，是万维网中的一“页”，是超文本标记语言格式（标准通用标记语言的一个应用，文件扩展名为.html或.htm）。网页通常用图像档来提供图画。网页要通过网页浏览器来阅读。', '[{\"name\":\"网站\",\"href\":\"/item/%E7%BD%91%E7%AB%99/155722\",\"id\":\"155722\"},{\"name\":\"基本\",\"href\":\"/item/%E5%9F%BA%E6%9C%AC/763181\",\"id\":\"763181\"},{\"name\":\"元素\",\"href\":\"/item/%E5%85%83%E7%B4%A0/29645\",\"id\":\"29645\"},{\"name\":\"域名\",\"href\":\"/item/%E5%9F%9F%E5%90%8D/86062\",\"id\":\"86062\"},{\"name\":\"虚拟主机\",\"href\":\"/item/%E8%99%9A%E6%8B%9F%E4%B8%BB%E6%9C%BA/208420\",\"id\":\"208420\"},{\"name\":\"HTML\",\"href\":\"/item/HTML\"},{\"name\":\"计算机\",\"href\":\"/item/%E8%AE%A1%E7%AE%97%E6%9C%BA/140338\",\"id\":\"140338\"},{\"name\":\"万维网\",\"href\":\"/item/%E4%B8%87%E7%BB%B4%E7%BD%91/215515\",\"id\":\"215515\"},{\"name\":\"超文本标记语言\",\"href\":\"/item/%E8%B6%85%E6%96%87%E6%9C%AC%E6%A0%87%E8%AE%B0%E8%AF%AD%E8%A8%80/6972570\",\"id\":\"6972570\"},{\"name\":\"标准通用标记语言\",\"href\":\"/item/%E6%A0%87%E5%87%86%E9%80%9A%E7%94%A8%E6%A0%87%E8%AE%B0%E8%AF%AD%E8%A8%80/6805073\",\"id\":\"6805073\"},{\"name\":\"文件扩展名\",\"href\":\"/item/%E6%96%87%E4%BB%B6%E6%89%A9%E5%B1%95%E5%90%8D\"},{\"name\":\"图像\",\"href\":\"/item/%E5%9B%BE%E5%83%8F/773234\",\"id\":\"773234\"},{\"name\":\"网页浏览器\",\"href\":\"/item/%E7%BD%91%E9%A1%B5%E6%B5%8F%E8%A7%88%E5%99%A8/8309940\",\"id\":\"8309940\"}]', 'https://baike.baidu.com/item/网页/99347', '本词条由“科普中国”科学百科词条编写与应用工作项目审核。', '97857');
INSERT INTO `baike_related_items_js` VALUES ('9984692', 10, '物理量', '1585', '36', '', '', '物理量，是指物理学中所描述的现象、物体或物质可定性区别和定量确定的属性。都是用数字和单位联合表达的。一般先选几个独立的物理量，如长度、时间等，并以使用方便为原则规定出它们的单位。这些物理量称为基本量，其单位称为基本单位。其他的物理量，如速度、加速度等的单位则根据其本身的物理意义，由有关基本单位组合构成，这种单位称为导出单位。由于历史、地区及各个学科的要求不同，对基本量及其单位的选择有所不同，因而产生了多种不同的单位制度。[1] ', '[]', 'https://baike.baidu.com/item/物理量/9984692', '', '33204');
INSERT INTO `baike_related_items_pili` VALUES ('10376904', 4, '霹雳至尊', 81, 5, '', '', '《霹雳至尊》是台湾霹雳布袋戏于1989年发行的剧集，共15集，是霹雳布袋戏系列的第3部剧集。[1] ', '[]', 'https://baike.baidu.com/item/霹雳至尊/10376904', '', '9464374');
INSERT INTO `baike_related_items_pili` VALUES ('10388082', 5, '潮汕三市', 45, 3, '', '', '潮汕三市是对广东省潮汕地区的汕头、潮州、揭阳三个地级市的合称，简称汕潮揭，是全球潮汕人和潮商的发源地。潮汕三市地理相连、历史相承、文化相同，从建制以来到1991年是一个城市政区[1] ，秦汉西晋同属古揭阳县，隋、唐、宋、元、明、清、民国初期历代名称潮州府，当代原称汕头市，1991年汕头市分治为今汕头、潮州、揭阳三市，统称潮汕地区。宋元时期潮州下辖的海阳、潮阳、揭阳潮汕民系3县合称潮州三阳，明清时期潮州府下辖的聚居潮汕人的海阳、潮阳、揭阳、澄海、普宁、惠来、饶平和丰顺8县合称潮州八邑。潮汕三市位于粤东沿海，闽粤交界，西东与粤港澳大湾区、海西经济区两大城市群衔接，北与梅州市接壤，南濒南海。潮汕三市涵盖10区4县、1个县级市普宁，总常住人口1000多万，总面积10918平方公里[2] ，接近温州市面积（11612平方公里）[3] 。潮汕历史文化底蕴悠久独特，国际化营商历史底蕴丰厚 ，一直到改革开放前，汕头仍是广东仅次于广州的第二大城市[4] 。是著名的侨乡，潮汕人跨海至他国始于宋元[5] ，海外潮籍侨胞2000万，遍布五大洲40多个国家[6] ，自古经济发达，商贸繁荣，文教昌盛，享有“岭海名邦、南国邦郡、海滨邹鲁”的美誉。2017年潮汕三市实现GDP5577.19亿元，2017年温州市实现GDP5453.2亿元[7] 。', '[{\"name\":\"潮汕\",\"href\":\"/item/%E6%BD%AE%E6%B1%95/143016\",\"id\":\"143016\"},{\"name\":\"汕头\",\"href\":\"/item/%E6%B1%95%E5%A4%B4\"},{\"name\":\"潮州\",\"href\":\"/item/%E6%BD%AE%E5%B7%9E\"},{\"name\":\"揭阳\",\"href\":\"/item/%E6%8F%AD%E9%98%B3\"},{\"name\":\"汕潮揭\",\"href\":\"/item/%E6%B1%95%E6%BD%AE%E6%8F%AD/10151852\",\"id\":\"10151852\"},{\"name\":\"潮汕人\",\"href\":\"/item/%E6%BD%AE%E6%B1%95%E4%BA%BA/802038\",\"id\":\"802038\"},{\"name\":\"潮商\",\"href\":\"/item/%E6%BD%AE%E5%95%86/691436\",\"id\":\"691436\"},{\"name\":\"历史\",\"href\":\"/item/%E5%8E%86%E5%8F%B2/360\",\"id\":\"360\"},{\"name\":\"古揭阳\",\"href\":\"/item/%E5%8F%A4%E6%8F%AD%E9%98%B3/7831561\",\"id\":\"7831561\"},{\"name\":\"潮州府\",\"href\":\"/item/%E6%BD%AE%E5%B7%9E%E5%BA%9C/6294516\",\"id\":\"6294516\"},{\"name\":\"汕头\",\"href\":\"/item/%E6%B1%95%E5%A4%B4/156487\",\"id\":\"156487\"},{\"name\":\"潮州\",\"href\":\"/item/%E6%BD%AE%E5%B7%9E/199502\",\"id\":\"199502\"},{\"name\":\"揭阳\",\"href\":\"/item/%E6%8F%AD%E9%98%B3/348670\",\"id\":\"348670\"},{\"name\":\"潮汕地区\",\"href\":\"/item/%E6%BD%AE%E6%B1%95%E5%9C%B0%E5%8C%BA/389739\",\"id\":\"389739\"},{\"name\":\"潮阳\",\"href\":\"/item/%E6%BD%AE%E9%98%B3/215414\",\"id\":\"215414\"},{\"name\":\"潮汕民系\",\"href\":\"/item/%E6%BD%AE%E6%B1%95%E6%B0%91%E7%B3%BB/16703143\",\"id\":\"16703143\"},{\"name\":\"潮阳\",\"href\":\"/item/%E