INSERT INTO `baike_related_items_pili` VALUES ('106554', 5, '中华人民共和国', 136283, 9113, '', '', '中华人民共和国（People\'s Republic of China），简称“中国”，成立于1949年10月1日[1] ，位于亚洲东部，太平洋西岸[2] ，是工人阶级领导的、以工农联盟为基础的人民民主专政的社会主义国家[3] ，以五星红旗为国旗[4] 、《义勇军进行曲》为国歌[5] ，国徽内容为国旗、天安门、齿轮和麦稻穗[6] ，通用语言文字是普通话和规范汉字[7] ，首都北京[8] ，是一个以汉族为主体、56个民族共同组成的统一的多民族国家。[9] 中国陆地面积约960万平方千米，东部和南部大陆海岸线1.8万多千米，内海和边海的水域面积约470多万平方千米。海域分布有大小岛屿7600多个，其中台湾岛最大，面积35798平方千米[2] 。中国同14国接壤，与8国海上相邻。省级行政区划为23个省、5个自治区、4个直辖市、2个特别行政区。[2] 中国是世界上历史最悠久的国家之一，有着光辉灿烂的文化和光荣的革命传统[3] ，世界遗产数量全球领先[10] 。1949年新中国成立后，进入社会主义革命和建设时期，1956年实现向社会主义过渡，此后社会主义建设在探索中曲折发展[11] 。“文化大革命”结束后实行改革开放，沿着中国特色社会主义道路，集中力量进行社会主义现代化建设[3] 。经过长期努力，中国特色社会主义进入了新时代。[12] 中国是世界上人口最多的发展中国家[13] ，国土面积居世界第三位[14] ，是世界第二大经济体，并持续成为世界经济增长最大的贡献者，2018年经济总量突破90万亿元[15] 。中国坚持独立自主的和平外交政策，是联合国安全理事会常任理事国，也是许多国际组织的重要成员，被认为是潜在超级大国之一。[16] ', '[{\"name\":\"亚洲\",\"href\":\"/item/%E4%BA%9A%E6%B4%B2/133681\",\"id\":\"133681\"},{\"name\":\"太平洋\",\"href\":\"/item/%E5%A4%AA%E5%B9%B3%E6%B4%8B/118304\",\"id\":\"118304\"},{\"name\":\"工人阶级\",\"href\":\"/item/%E5%B7%A5%E4%BA%BA%E9%98%B6%E7%BA%A7/7290384\",\"id\":\"7290384\"},{\"name\":\"工农联盟\",\"href\":\"/item/%E5%B7%A5%E5%86%9C%E8%81%94%E7%9B%9F/1007284\",\"id\":\"1007284\"},{\"name\":\"人民民主专政\",\"href\":\"/item/%E4%BA%BA%E6%B0%91%E6%B0%91%E4%B8%BB%E4%B8%93%E6%94%BF/1007991\",\"id\":\"1007991\"},{\"name\":\"社会主义国家\",\"href\":\"/item/%E7%A4%BE%E4%BC%9A%E4%B8%BB%E4%B9%89%E5%9B%BD%E5%AE%B6/412767\",\"id\":\"412767\"},{\"name\":\"五星红旗\",\"href\":\"/item/%E4%BA%94%E6%98%9F%E7%BA%A2%E6%97%97/21897\",\"id\":\"21897\"},{\"name\":\"义勇军进行曲\",\"href\":\"/item/%E4%B9%89%E5%8B%87%E5%86%9B%E8%BF%9B%E8%A1%8C%E6%9B%B2/311080\",\"id\":\"311080\"},{\"name\":\"天安门\",\"href\":\"/item/%E5%A4%A9%E5%AE%89%E9%97%A8/63708\",\"id\":\"63708\"},{\"name\":\"通用语言文字\",\"href\":\"/item/%E9%80%9A%E7%94%A8%E8%AF%AD%E8%A8%80%E6%96%87%E5%AD%97/1092811\",\"id\":\"1092811\"},{\"name\":\"普通话\",\"href\":\"/item/%E6%99%AE%E9%80%9A%E8%AF%9D/161653\",\"id\":\"161653\"},{\"name\":\"规范汉字\",\"href\":\"/it