INSERT INTO `baike_related_items_pili` VALUES ('10746401', 4, '藏镜人', 483, 19, '（《金光布袋戏》虚拟人物）', '', '金光布袋戏虚拟人物。苗疆战神，甲子名人帖上，与史艳文并列天下第一掌，本名罗碧，豪气万千、我行我素，唯我独尊，长年以面具遮掩面容，因国仇家恨而视史艳文为毕生宿敌。在女暴君刻意透漏讯息、西剑流胁持忆无心的双重压迫下，藏镜人被迫在众人面前摘下面罩，揭露其为史艳文孪生兄弟秘辛。因此遭到追杀，其後历经许多心境转折，更於史艳文重伤昏迷的当下，藉其身分领导中原，安定人心。然而颢穹孤鸣却因大祭司的预言对他穷追不舍，藏镜人遂愤怒反扑。', '[{\"name\":\"金光布袋戏\",\"href\":\"/item/%E9%87%91%E5%85%89%E5%B8%83%E8%A2%8B%E6%88%8F/8712638\",\"id\":\"8712638\"},{\"name\":\"苗疆\",\"href\":\"/item/%E8%8B%97%E7%96%86/13002926\",\"id\":\"13002926\"},{\"name\":\"女暴君\",\"href\":\"/item/%E5%A5%B3%E6%9A%B4%E5%90%9B\"},{\"name\":\"忆无心\",\"href\":\"/item/%E5%BF%86%E6%97%A0%E5%BF%83\"},{\"name\":\"史艳文\",\"href\":\"/item/%E5%8F%B2%E8%89%B3%E6%96%87/3996641\",\"id\":\"3996641\"},{\"name\":\"史艳文\",\"href\":\"/item/%E5%8F%B2%E8%89%B3%E6%96%87/3996641\",\"id\":\"3996641\"},{\"name\":\"颢穹孤鸣\",\"href\":\"/item/%E9%A2%A2%E7%A9%B9%E5%AD%A4%E9%B8%A3\"}]', 'https://baike.baidu.com/item/藏镜人/10746401', '', '3996641');
INSERT INTO `baike_related_items_pili` VALUES ('11010885', 3, '圣石传说', 458, 12, '', '', '《圣石传说》是台湾霹雳布袋戏于2000年上映的数码武侠动画电影。该片在台湾上映时，票房盖过了包括《玩具总动员》在内的许多好莱坞动画大片。[1] ', '[{\"name\":\"霹雳布袋戏\",\"href\":\"/item/%E9%9C%B9%E9%9B%B3%E5%B8%83%E8%A2%8B%E6%88%8F/155118\",\"id\":\"155118\"},{\"name\":\"玩具总动员\",\"href\":\"/item/%E7%8E%A9%E5%85%B7%E6%80%BB%E5%8A%A8%E5%91%98/35533\",\"id\":\"35533\"}]', 'https://baike.baidu.com/item/圣石传说/11010885', '', '1987744');
INSERT INTO `baike_related_items_pili` VALUES ('1115740', 4, '大儒侠史艳文', 513, 4, '', '50集', '《大儒侠史艳文》叙述了史艳文的出身，结识刘三及与刘萱姑定亲，史艳文行侠仗义，威名远播，赢得云州大儒侠的尊称，惜后史艳文得罪当朝权相安其谋，被陷罪入狱充军，及后取得龙泉剑和天地人三卷天书，大破太华山，解救钦差大人，破除乱党造反阴谋。接着以鞑靼之乱与女暴君为祸武林为背景，鞑靼国大公主勾结外人篡父位，并在奸人挑拨下引发征服中原的野心，三公主苦海女神龙不得已流落江湖。而原是交趾公主的姚明月因战败出走，却因机缘巧合学得一身强横功夫，基于对中原的仇恨，以女暴君之名大闹江湖，成为新的魔魁。', '[{\"name\":\"史艳文\",\"href\":\"/item/%E5%8F%B2%E8%89%B3%E6%96%87/3996641\",\"id\":\"3996641\"},{\"name\":\"刘三\",\"href\":\"/item/%E5%88%98%E4%B8%89/6189315\",\"id\":\"6189315\"},{\"name\":\"刘萱姑\",\"href\":\"/item/%E5%88%98%E8%90%B1%E5%A7%91/2597860\",\"id\":\"2597860\"},{\"name\":\"云州大儒侠\",\"href\":\"/item/%E4%BA%91%E5%B7%9E%E5%A4%A7%E5%84%92%E4%BE%A0/898720\",\"id\":\"898720\"},{\"name\":\"龙泉剑\",\"href\":\"/item/%E9%BE%99%E6%B3%89%E5%89%91/5278879\",\"id\":\"5278879\"},{\"name\":\"女暴君\",\"href\":\"/item/%E5%A5%B3%E6%9A%B4%E5%90%9B\"},{\"name\":\"三公主\",\"href\":\"/item/%E4%B8%89%E5%85%AC%E4%B8%BB/6192454\",\"id\":\"6192454\"},{\"name\":\"苦海女神龙\",\"href\":\"/item/%E8%8B%A6%E6%B5%B7%E5%A5%B3%E7%A5%9E%E9%BE%99/1400108\",\"id\":\"1400108\"},{\"name\":\"魔魁\",\"href\":\"/item/%E9%AD%94%E9%AD%81/3497708\",\"id\":\"3497708\"}]', 'https://baike.baidu.com/item/大儒侠史艳文/1115740', '', '0');
INSERT INTO `baike_related_items_pili` VALUES ('1369965', 3, '黄海岱', 124, 16, '', '', '黄海岱（1901——2007），男，台湾布袋戏艺师。生于台湾。11岁起，黄海岱即被父亲黄马送他到学堂读汉学，建立起文学、音乐的基础。1998年黄海岱荣获台湾教育部门民族艺术艺师，成为台湾最高龄之布袋戏宗师。1999年更获得全球中华文艺艺术薪传奖、终身奉献奖。2000年获颁台“行政院”文化奖的殊荣，2002年荣获台“国家”文艺奖。2007年云林县议会更决议将黄海岱的生日1月2日定为“云林布袋戏日”。', '[{\"name\":\"台湾布袋戏\",\"href\":\"/item/%E5%8F%B0%E6%B9%BE%E5%B8%83%E8%A2%8B%E6%88%8F\"}]', 'https://baike.baidu.com/item/黄海岱/1369965', '', '1987744');
INSERT INTO `baike_related_items_pili` VALUES ('147639', 5, '杭州', 15804, 1024, '（浙江省省会、副省级市）', '', '杭州，简称“杭”，浙江省省会、副省级市、长江三角洲城市群中心城市、环杭州湾大湾区核心城市、杭州都市圈核心城市[1] 、沪嘉杭G60科创走廊中心城市[2] 、国际重要的电子商务中心[3] ，位于中国东南沿海、浙江省北部、钱塘江下游、京杭大运河南端，是浙江省的政治、经济、文化、教育、交通和金融中心。截至2017年，杭州下辖10个区、2个县、代管1个县级市，总面积16853.57平方千米[4] 。杭州自秦朝设县治以来已有2200多年的历史，曾是吴越国和南宋的都城。因风景秀丽，素有“人间天堂”的美誉。杭州得益于京杭运河和通商口岸的便利，以及自身发达的丝绸和粮食产业，历史上曾是重要的商业集散中心。后来依托沪杭铁路等铁路线路的通车以及上海在进出口贸易方面的带动，轻工业发展迅速。新世纪以来，随着阿里巴巴等高科技企业的带动，互联网经济成为杭州新的经济增长点。杭州人文古迹众多，西湖及其周边有大量的自然及人文景观遗迹，具代表性的有西湖文化、良渚文化、丝绸文化、茶文化，以及流传下来的许多故事传说成为杭州文化代表。2018年世界短池游泳锦标赛、2022年亚运会在杭州举办。2018年1月，杭州入选首批社会信用体系建设示范城市。2017年中国百强城市排行榜排第7位。2017年，常住人口946.8万人，城镇化率76.8%[5] ，居民人均可支配收入49832元[6] ，社会消费品零售总额5717亿元，高新技术企业达2844家。[7-8] ', '[{\"name\":\"浙江省\",\"href\":\"/item/%E6%B5%99%E6%B1%9F%E7%9C%81/190275\",\"id\":\"190275\"},{\"name\":\"省会\",\"href\":\"/item/%E7%9C%81%E4%BC%9A/2089891\",\"id\":\"2089891\"},{\"name\":\"副省级市\",\"href\":\"/item/%E5%89%AF%E7%9C%81%E7%BA%A7%E5%B8%82\"},{\"name\":\"长江三角洲城市群\",\"href\":\"/item/%E9%95%BF%E6%B1%9F%E4%B8%89%E8%A7%92%E6%B4%B2%E5%9F%8E%E5%B8%82%E7%BE%A4/5973620\",\"id\":\"5973620\"},{\"name\":\"环杭州湾大湾区\",\"href\":\"/item/%E7%8E%AF%E6%9D%AD%E5%B7%9E%E6%B9%BE%E5%A4%A7%E6%B9%BE%E5%8C%BA/22024891\",\"id\":\"22024891\"},{\"name\":\"杭州都市圈\",\"href\":\"/item/%E6%9D%AD%E5%B7%9E%E9%83%BD%E5%B8%82%E5%9C%88/2085421\",\"id\":\"2085421\"},{\"name\":\"G60科创走廊\",\"href\":\"/item/G60%E7%A7%91%E5%88%9B%E8%B5%B0%E5%BB%8A/22629070\",\"id\":\"22629070\"},{\"name\":\"电子商务中心\",\"href\":\"/item/%E7%94%B5%E5%AD%90%E5%95%86%E5%8A%A1%E4%B8%AD%E5%BF%83/5822907\",\"id\":\"5822907\"},{\"name\":\"钱塘江\",\"href\":\"/item/%E9%92%B1%E5%A1%98%E6%B1%9F/389131\",\"id\":\"389131\"},{\"name\":\"京杭大运河\",\"href\":\"/item/%E4%BA%AC%E6%9D%AD%E5%A4%A7%E8%BF%90%E6%B2%B3/345335\",\"id\":\"345335\"},{\"name\":\"秦朝\",\"href\":\"/item/%E7%A7%A6%E6%9C%9D/195083\",\"id\":\"195083\"},{\"name\":\"吴越国\",\"href\":\"/item/%E5%90%B4%E8%B6%8A%E5%9B%BD/1551908\",\"id\":\"1551908\"},{\"name\":\"南宋\",\"href\":\"/item/%E5%8D%97%E5%AE%8B/457341\",\"id\":\"457341\"},{\"name\":\"丝绸\",\"href\":\"/item/%E4%B8%9D%E7%BB%B8/83312\",\"id\":\"83312\"},{\"name\":\"沪杭铁路\",\"href\":\"/item/%E6%B2%AA%E6%9D%AD%E9%93%81%E8%B7%AF/3940397\",\"id\":\"3940397\"},{\"name\":\"上海\",\"href\":\"/item/%E4%B8%8A%E6%B5%B7/114606\",\"id\":\"114606\"},{\"name\":\"轻工业\",\"href\":\"/item/%E8%BD%BB%E5%B7%A5%E4%B8%9A/902184\",\"id\":\"902184\"},{\"name\":\"阿里巴巴\",\"href\":\"/item/%E9%98%BF%E9%87%8C%E5%B7%B4%E5%B7%B4/33\",\"id\":\"33\"},{\"name\":\"互联网经济\",\"href\":\"/item/%E4%BA%92%E8%81%94%E7%BD%91%E7%BB%8F%E6%B5%8E/4369409\",\"id\":\"4369409\"},{\"name\":\"西湖\",\"href\":\"/item/%E8%A5%BF%E6%B9%96/4668821\",\"id\":\"4668821\"},{\"name\":\"良渚文化\",\"href\":\"/item/%E8%89%AF%E6%B8%9A%E6%96%87%E5%8C%96/111653\",\"id\":\"111653\"},{\"name\":\"茶文化\",\"href\":\"/item/%E8%8C%B6%E6%96%87%E5%8C%96/222768\",\"id\":\"222768\"},{\"name\":\"世界短池游泳锦标赛\",\"href\":\"/item/%E4%B8%96%E7%95%8C%E7%9F%AD%E6%B1%A0%E6%B8%B8%E6%B3%B3%E9%94%A6%E6%A0%87%E8%B5%9B/9048009\",\"id\":\"9048009\"},{\"name\":\"亚运会\",\"href\":\"/item/%E4%BA%9A%E8%BF%90%E4%BC%9A/343628\",\"id\":\"343628\"},{\"name\":\"中国百强城市排行榜\",\"href\":\"/item/%E4%B8%AD%E5%9B%BD%E7%99%BE%E5%BC%BA%E5%9F%8E%E5%B8%82%E6%8E%92%E8%A1%8C%E6%A6%9C/20158050\",\"id\":\"20158050\"},{\"name\":\"常住人口\",\"href\":\"/item/%E5%B8%B8%E4%BD%8F%E4%BA%BA%E5%8F%A3\"},{\"name\":\"城镇化率\",\"href\":\"/item/%E5%9F%8E%E9%95%87%E5%8C%96%E7%8E%87\"},{\"name\":\"人均可支配收入\",\"href\":\"/item/%E4%BA%BA%E5%9D%87%E5%8F%AF%E6%94%AF%E9%85%8D%E6%94%B6%E5%85%A5/9866975\",\"id\":\"9866975\"},{\"name\":\"社会消费品零售总额\",\"href\":\"/item/%E7%A4%BE%E4%BC%9A%E6%B6%88%E8%B4%B9%E5%93%81%E9%9B%B6%E5%94%AE%E6%80%BB%E9%A2%9D/3459025\",\"id\":\"3459025\"}]', 'https://baike.baidu.com/item/杭州/147639', '', '154399');
INSERT INTO `baike_related_items_pili` VALUES ('1533003', 5, '榕城区', 40, 2, '', '', '榕城区，1991年12月成立，是广东省揭阳市市辖区，位于广东省东南部，东和潮州市潮安区接壤，西与揭东区、普宁市相连，南邻普宁市、汕头市潮阳区，北临榕江，和揭东区隔江相望。榕城区是广东省级历史文化名城，旧城区辟建于南宋绍兴十年（公元1140年），尔后一直为揭阳县治驻地。榕城地处粤东潮汕平原中部，榕江流域中段，榕江南北二河由城区至双溪嘴汇流后，经妈屿流入南海。城区自西向东延伸，接壤渔湖塘埔、京岗等村界，自黄岐山顶向南俯视，城区被南北两河勾勒成葫芦状，江河如葫芦之系缥带，素有“浮水葫芦”“水上莲花”之称。[1] 2013年榕城区户籍人口94万人。榕城区水陆空交通便捷。距揭阳潮汕机场20公里，国道G206线、省道S234、S236线和广梅汕铁路横贯区境，揭阳火车站坐落榕城。榕华大桥、南河大桥、北河大桥、梅东大桥横跨榕江，连接市区，形成纵横交错的陆上交通网络。素有“黄金水道”之称的榕江南河、北河两河穿境而过，5000吨级货轮可由市区直航国内各大港口和港澳地区。[2] ', '[{\"name\":\"揭阳\",\"href\":\"/item/%E6%8F%AD%E9%98%B3\"},{\"name\":\"广东省\",\"href\":\"/item/%E5%B9%BF%E4%B8%9C%E7%9C%81/132473\",\"id\":\"132473\"},{\"name\":\"潮安区\",\"href\":\"/item/%E6%BD%AE%E5%AE%89%E5%8C%BA/8836283\",\"id\":\"8836283\"},{\"name\":\"揭东区\",\"href\":\"/item/%E6%8F%AD%E4%B8%9C%E5%8C%BA/1954649\",\"id\":\"1954649\"},{\"name\":\"普宁市\",\"href\":\"/item/%E6%99%AE%E5%AE%81%E5%B8%82/1054986\",\"id\":\"1054986\"},{\"name\":\"汕头市\",\"href\":\"/item/%E6%B1%95%E5%A4%B4%E5%B8%82/1416572\",\"id\":\"1416572\"},{\"name\":\"榕江\",\"href\":\"/item/%E6%A6%95%E6%B1%9F/24844\",\"id\":\"24844\"},{\"name\":\"历史文化名城\",\"href\":\"/item/%E5%8E%86%E5%8F%B2%E6%96%87%E5%8C%96%E5%90%8D%E5%9F%8E/726117\",\"id\":\"726117\"},{\"name\":\"揭阳县\",\"href\":\"/item/%E6%8F%AD%E9%98%B3%E5%8E%BF/4470005\",\"id\":\"4470005\"},{\"name\":\"潮汕平原\",\"href\":\"/item/%E6%BD%AE%E6%B1%95%E5%B9%B3%E5%8E%9F/2755208\",\"id\":\"2755208\"}]', 'https://baike.baidu.com/item/榕城/1533003', '', '165311');
INSERT INTO `baike_related_items_pili` VALUES ('154399', 4, '浙江', 9409, 557, '', '', '浙江，简称“浙”，是中华人民共和国省级行政区。省会杭州，位于中国东南沿海，浙江界于东经118°01\'-123°10\'，北纬27°02\'-31°11\'之间，东临东海，南接福建，西与安徽、江西相连，北与上海、江苏接壤，浙江省总面积10.55万平方千米。[1-3] 浙江地势由西南向东北倾斜，地形复杂。山脉自西南向东北成大致平行的三支。地跨钱塘江、瓯江、灵江、苕溪、甬江、飞云江、鳌江、曹娥江八大水系，由平原、丘陵、盆地、山地、岛屿构成。浙江省地处亚热带中部，属季风性湿润气候。[4-5] 截至2017年底，浙江省下辖11个省辖市，19个县级市，32个县，1个自治县，37个市辖区。[6-7] 截至2018年末，初步核算，全年地区生产总值（GDP）56197亿元，比上年增长7.1%。年末全省常住人口5737万人，比上年末增加80万人。', '[{\"name\":\"浙\",\"href\":\"/item/%E6%B5%99/15838620\",\"id\":\"15838620\"},{\"name\":\"中华人民共和国\",\"href\":\"/item/%E4%B8%AD%E5%8D%8E%E4%BA%BA%E6%B0%91%E5%85%B1%E5%92%8C%E5%9B%BD/106554\",\"id\":\"106554\"},{\"name\":\"杭州\",\"href\":\"/item/%E6%9D%AD%E5%B7%9E/147639\",\"id\":\"147639\"},{\"name\":\"东海\",\"href\":\"/item/%E4%B8%9C%E6%B5%B7/18322\",\"id\":\"18322\"},{\"name\":\"福建\",\"href\":\"/item/%E7%A6%8F%E5%BB%BA/132090\",\"id\":\"132090\"},{\"name\":\"安徽\",\"href\":\"/item/%E5%AE%89%E5%BE%BD/37014\",\"id\":\"37014\"},{\"name\":\"江西\",\"href\":\"/item/%E6%B1%9F%E8%A5%BF/215383\",\"id\":\"215383\"},{\"name\":\"上海\",\"href\":\"/item/%E4%B8%8A%E6%B5%B7/114606\",\"id\":\"114606\"},{\"name\":\"江苏\",\"href\":\"/item/%E6%B1%9F%E8%8B%8F/154268\",\"id\":\"154268\"},{\"name\":\"钱塘江\",\"href\":\"/item/%E9%92%B1%E5%A1%98%E6%B1%9F/389131\",\"id\":\"389131\"},{\"name\":\"瓯江\",\"href\":\"/item/%E7%93%AF%E6%B1%9F/563741\",\"id\":\"563741\"},{\"name\":\"灵江\",\"href\":\"/item/%E7%81%B5%E6%B1%9F/2976677\",\"id\":\"2976677\"},{\"name\":\"苕溪\",\"href\":\"/item/%E8%8B%95%E6%BA%AA/3613916\",\"id\":\"3613916\"},{\"name\":\"甬江\",\"href\":\"/item/%E7%94%AC%E6%B1%9F/2975698\",\"id\":\"2975698\"},{\"name\":\"飞云江\",\"href\":\"/item/%E9%A3%9E%E4%BA%91%E6%B1%9F/2977980\",\"id\":\"2977980\"},{\"name\":\"鳌江\",\"href\":\"/item/%E9%B3%8C%E6%B1%9F/1593774\",\"id\":\"1593774\"},{\"name\":\"曹娥江\",\"href\":\"/item/%E6%9B%B9%E5%A8%A5%E6%B1%9F/2977347\",\"id\":\"2977347\"}]', 'https://baike.baidu.com/item/浙江/154399', '', '');
INSERT INTO `baike_related_items_pili` VALUES ('155118', 1, '霹雳布袋戏', 10777, 658, '', '中国台湾（霹雳金光）至2018年（霹雳惊涛）已有2380集（加轰动武林序章）', '霹雳布袋戏，因每出剧名皆有“霹雳”二字得名，由“十车书”黄强华职司编剧、由“八音才子”黄文择统筹口白[1] ，以1984年《霹雳城》为创始，不过大家所熟悉的霹雳布袋戏，是指1988年开始播出的《霹雳金光》，剧情以霹雳三大主角清香白莲素还真、百世经纶一页书、刀狂剑痴叶小钗作为主线而衍生发展的天下武林故事，剧情以魔幻为主，剧集之间既环环相扣又可独立成章。霹雳系列从《霹雳金光》、《霹雳眼》、《霹雳至尊》三部作品开始，到2018年上档的《霹雳魔封》已播出超过两千四百余集，为霹雳国际多媒体的主干布袋戏。[2] 霹雳布袋戏以剧集系列的区隔作为剧情联贯的基础，剧中仅有名有姓的主要人物不下数千，播出迄今剧集集数最少的，是只有六集的《霹雳外传之叶小钗传奇》剧集系列，而集数最多是六十集的《霹雳狂刀》剧集系列。[3] 其中剧集《霹雳九皇座》的导演王嘉祥荣获2005年台湾金钟奖“戏剧类导演奖”。[4] ', '[{\"name\":\"布袋戏\",\"href\":\"/item/%E5%B8%83%E8%A2%8B%E6%88%8F\"},{\"name\":\"黄文择\",\"href\":\"/item/%E9%BB%84%E6%96%87%E6%8B%A9/1987744\",\"id\":\"1987744\"},{\"name\":\"口白\",\"href\":\"/item/%E5%8F%A3%E7%99%BD/9803820\",\"id\":\"9803820\"},{\"name\":\"霹雳城\",\"href\":\"/item/%E9%9C%B9%E9%9B%B3%E5%9F%8E/5552753\",\"id\":\"5552753\"},{\"name\":\"霹雳金光\",\"href\":\"/item/%E9%9C%B9%E9%9B%B3%E9%87%91%E5%85%89/10391428\",\"id\":\"10391428\"},{\"name\":\"素还真\",\"href\":\"/item/%E7%B4%A0%E8%BF%98%E7%9C%9F/848658\",\"id\":\"848658\"},{\"name\":\"一页书\",\"href\":\"/item/%E4%B8%80%E9%A1%B5%E4%B9%A6/10870163\",\"id\":\"10870163\"},{\"name\":\"叶小钗\",\"href\":\"/item/%E5%8F%B6%E5%B0%8F%E9%92%97\"},{\"name\":\"霹雳金光\",\"href\":\"/item/%E9%9C%B9%E9%9B%B3%E9%87%91%E5%85%89/10391428\",\"id\":\"10391428\"},{\"name\":\"霹雳眼\",\"href\":\"/item/%E9%9C%B9%E9%9B%B3%E7%9C%BC/10376929\",\"id\":\"10376929\"},{\"name\":\"霹雳至尊\",\"href\":\"/item/%E9%9C%B9%E9%9B%B3%E8%87%B3%E5%B0%8A/10376904\",\"id\":\"10376904\"},{\"name\":\"霹雳外传之叶小钗传奇\",\"href\":\"/item/%E9%9C%B9%E9%9B%B3%E5%A4%96%E4%BC%A0%E4%B9%8B%E5%8F%B6%E5%B0%8F%E9%92%97%E4%BC%A0%E5%A5%87/10376492\",\"id\":\"10376492\"},{\"name\":\"霹雳狂刀\",\"href\":\"/item/%E9%9C%B9%E9%9B%B3%E7%8B%82%E5%88%80/3423161\",\"id\":\"3423161\"},{\"name\":\"霹雳九皇座\",\"href\":\"/item/%E9%9C%B9%E9%9B%B3%E4%B9%9D%E7%9A%87%E5%BA%A7/10374703\",\"id\":\"10374703\"},{\"name\":\"王嘉祥\",\"href\":\"/item/%E7%8E%8B%E5%98%89%E7%A5%A5/3506107\",\"id\":\"3506107\"}]', 'https://baike.baidu.com/item/霹雳布袋戏/155118', '', '');
INSERT INTO `baike_related_items_pili` VALUES ('165311', 4, '福州', 6129, 512, '（福建省省会）', '', '福州，别称榕城，简称福、榕，隶属于福建省，位于福建省东部、闽江下游及沿海地区，是福建省省会，福建省的政治、文化、交通中心，海峡西岸经济区中心城市之一。福州建城于公元前202年，历史上曾长期作为福建的政治中心。是中国东南沿海重要都市、东部战区陆军机关驻地。福州地貌属典型的河口盆地，盆地四周被群山峻岭所环抱，其海拔多在600~1000米之间。福州是首批14个对外开放的沿海港口城市之一，海上丝绸之路门户以及中国（福建）自由贸易试验区三片区之一；福州也是近代中国最早开放的五个通商口岸之一，福州马尾是中国近代海军的摇篮，中国船政文化的发祥地；曾获“中国优秀旅游城市”[1] 、“国家卫生城市”、“滨江滨海生态园林城市”[2] 、“国家环保模范城”[3] 、“全国双拥模范城市”[4] 、“国家历史文化名城”[2] 、“全国文明城市”[5] 等称号。截至2017年末，福州共有6个市辖区、1个县级市、6个县，全市陆地总面积11968平方公里，其中城市面积1219.37平方公里，建成区面积291平方公里，城镇化率69.5%。截至2017年末全市常住人口766万人，全市海域总面积11.09万平方公里，海岸线长1137公里，占福建省的1/3，当地居民以汉族的闽海系族群为主，通行闽东语福州方言。2018年12月，2018中国大陆最佳商业城市排名第25名，获评气候生态类国家气候标志。[6] ', '[{\"name\":\"榕城\",\"href\":\"/item/%E6%A6%95%E5%9F%8E/1533003\",\"id\":\"1533003\"},{\"name\":\"榕\",\"href\":\"/item/%E6%A6%95/6661323\",\"id\":\"6661323\"},{\"name\":\"闽江\",\"href\":\"/item/%E9%97%BD%E6%B1%9F/497041\",\"id\":\"497041\"},{\"name\":\"海峡西岸经济区\",\"href\":\"/item/%E6%B5%B7%E5%B3%A1%E8%A5%BF%E5%B2%B8%E7%BB%8F%E6%B5%8E%E5%8C%BA/6852509\",\"id\":\"6852509\"},{\"name\":\"东南\",\"href\":\"/item/%E4%B8%9C%E5%8D%97/19404863\",\"id\":\"19404863\"},{\"name\":\"沿海\",\"href\":\"/item/%E6%B2%BF%E6%B5%B7\"},{\"name\":\"东部战区\",\"href\":\"/item/%E4%B8%9C%E9%83%A8%E6%88%98%E5%8C%BA\"},{\"name\":\"对外开放\",\"href\":\"/item/%E5%AF%B9%E5%A4%96%E5%BC%80%E6%94%BE/11045958\",\"id\":\"11045958\"},{\"name\":\"沿海\",\"href\":\"/item/%E6%B2%BF%E6%B5%B7/3564064\",\"id\":\"3564064\"},{\"name\":\"港口\",\"href\":\"/item/%E6%B8%AF%E5%8F%A3/33130\",\"id\":\"33130\"},{\"name\":\"海上丝绸之路\",\"href\":\"/item/%E6%B5%B7%E4%B8%8A%E4%B8%9D%E7%BB%B8%E4%B9%8B%E8%B7%AF/439948\",\"id\":\"439948\"},{\"name\":\"中国（福建）自由贸易试验区\",\"href\":\"/item/%E4%B8%AD%E5%9B%BD%EF%BC%88%E7%A6%8F%E5%BB%BA%EF%BC%89%E8%87%AA%E7%94%B1%E8%B4%B8%E6%98%93%E8%AF%95%E9%AA%8C%E5%8C%BA\"},{\"name\":\"马尾\",\"href\":\"/item/%E9%A9%AC%E5%B0%BE\"},{\"name\":\"中国船政文化\",\"href\":\"/item/%E4%B8%AD%E5%9B%BD%E8%88%B9%E6%94%BF%E6%96%87%E5%8C%96/12773482\",\"id\":\"12773482\"},{\"name\":\"中国优秀旅游城市\",\"href\":\"/item/%E4%B8%AD%E5%9B%BD%E4%BC%98%E7%A7%80%E6%97%85%E6%B8%B8%E5%9F%8E%E5%B8%82/1677344\",\"id\":\"1677344\"},{\"name\":\"国家卫生城市\",\"href\":\"/item/%E5%9B%BD%E5%AE%B6%E5%8D%AB%E7%94%9F%E5%9F%8E%E5%B8%82/7019998\",\"id\":\"7019998\"},{\"name\":\"国家环保模范城\",\"href\":\"/item/%E5%9B%BD%E5%AE%B6%E7%8E%AF%E4%BF%9D%E6%A8%A1%E8%8C%83%E5%9F%8E/11029660\",\"id\":\"11029660\"},{\"name\":\"全国双拥模范城市\",\"href\":\"/item/%E5%85%A8%E5%9B%BD%E5%8F%8C%E6%8B%A5%E6%A8%A1%E8%8C%83%E5%9F%8E%E5%B8%82/7225780\",\"id\":\"7225780\"},{\"name\":\"国家历史文化名城\",\"href\":\"/item/%E5%9B%BD%E5%AE%B6%E5%8E%86%E5%8F%B2%E6%96%87%E5%8C%96%E5%90%8D%E5%9F%8E/6412721\",\"id\":\"6412721\"},{\"name\":\"全国文明城市\",\"href\":\"/item/%E5%85%A8%E5%9B%BD%E6%96%87%E6%98%8E%E5%9F%8E%E5%B8%82\"},{\"name\":\"闽东语\",\"href\":\"/item/%E9%97%BD%E4%B8%9C%E8%AF%AD/9214239\",\"id\":\"9214239\"}]', 'https://baike.baidu.com/item/福州/165311', '', '');
INSERT INTO `baike_related_items_pili` VALUES ('18322', 5, '东海', 3142, 105, '（中华人民共和国管辖海域）', '', '东海是由中国大陆和中国台湾岛以及朝鲜半岛与日本九洲岛、琉球群岛等围绕的边缘海。东北部通过对马海峡与日本海相通，西南部通过台湾海峡与南海相连。[1] ', '[]', 'https://baike.baidu.com/item/东海/18322', '本词条由“科普中国”科学百科词条编写与应用工作项目审核。', '154399');
INSERT INTO `baike_related_items_pili` VALUES ('1987744', 2, '黄文择', 740, 35, '', '', '黄文择，1956年生，台湾云林人，台湾霹雳国际多媒体总经理，黄海岱先生布袋戏家族的第三代成员，是赋予霹雳布袋戏所有角色声音、灵魂的传奇人物，塑造了诸如素还真、叶小钗等著名人物，并主导拍摄了全球首部布袋戏电影《圣石传说》。因其声线多变，故有八音才子的称号，是布袋戏配音界的第一号人物。', '[{\"name\":\"黄海岱\",\"href\":\"/item/%E9%BB%84%E6%B5%B7%E5%B2%B1/1369965\",\"id\":\"1369965\"},{\"name\":\"素还真\",\"href\":\"/item/%E7%B4%A0%E8%BF%98%E7%9C%9F/848658\",\"id\":\"848658\"},{\"name\":\"叶小钗\",\"href\":\"/item/%E5%8F%B6%E5%B0%8F%E9%92%97/9464374\",\"id\":\"9464374\"},{\"name\":\"圣石传说\",\"href\":\"/item/%E5%9C%A3%E7%9F%B3%E4%BC%A0%E8%AF%B4/11010885\",\"id\":\"11010885\"}]', 'https://baike.baidu.com/item/黄文择/1987744', '', '155118');
INSERT INTO `baike_related_items_pili` VALUES ('207811', 5, '广东', 20262, 1655, '（中华人民共和国省级行政区）', '', '广东，简称“粤”，是中华人民共和国省级行政区，省会广州。名由岭南东道、广南东路演变而来。位于南岭以南，南海之滨，与香港、澳门、广西、湖南、江西及福建接壤，与海南隔海相望[1] 。下辖地级市21个、市辖区65个、县级市20个、县34个、自治县3个[2] 。广东是岭南文化的重要传承地，在语言、风俗、生活习惯和历史文化等方面都有着独特风格。广东通行粤语、客家语和闽语，而且粤、客两大方言的中心都在广东。广东也是目前中国人口最多的省份。[3-7] 广东是太古“南海盘古国”所在地。[8] 考古证实广东于先秦已存在高度文明，是中华文明发源地之一[9] 。广东是中国的南大门，处在南海航运枢纽位置上，广东先民从秦汉开始就通过海洋走上与世界各地交往的道路，成为海上丝绸之路最早发源地[10] 。改革开放后，广东成为改革开放前沿阵地和引进西方经济、文化、科技的窗口，取得骄人的成绩。自1989年起，广东国内生产总值连续居全国第一位[11] ，成为中国第一经济大省，经济总量占全国的1/8，已达到中上等收入国家水平[12] 、中等发达国家水平[13] 。广东省域经济综合竞争力居全国第一[14] 。2016年，广东高新技术企业数量达到19857家，总量居全国第一；PCT国际专利申请量连续15年领跑全国[15-16] 。广东珠三角9市将联手港澳打造粤港澳大湾区，成为与纽约湾区、旧金山湾区、东京湾区并肩的世界四大湾区之一[17-18] 。', '[{\"name\":\"中华人民共和国\",\"href\":\"/item/%E4%B8%AD%E5%8D%8E%E4%BA%BA%E6%B0%91%E5%85%B1%E5%92%8C%E5%9B%BD/106554\",\"id\":\"106554\"},{\"name\":\"广州\",\"href\":\"/item/%E5%B9%BF%E5%B7%9E/72101\",\"id\":\"72101\"},{\"name\":\"广南东路\",\"href\":\"/item/%E5%B9%BF%E5%8D%97%E4%B8%9C%E8%B7%AF/4800188\",\"id\":\"4800188\"},{\"name\":\"南岭\",\"href\":\"/item/%E5%8D%97%E5%B2%AD/2207019\",\"id\":\"2207019\"},{\"name\":\"南海\",\"href\":\"/item/%E5%8D%97%E6%B5%B7/27429\",\"id\":\"27429\"},{\"name\":\"香港\",\"href\":\"/item/%E9%A6%99%E6%B8%AF/128775\",\"id\":\"128775\"},{\"name\":\"澳门\",\"href\":\"/item/%E6%BE%B3%E9%97%A8/24335\",\"id\":\"24335\"},{\"name\":\"广西\",\"href\":\"/item/%E5%B9%BF%E8%A5%BF/162679\",\"id\":\"162679\"},{\"name\":\"湖南\",\"href\":\"/item/%E6%B9%96%E5%8D%97/228213\",\"id\":\"228213\"},{\"name\":\"江西\",\"href\":\"/item/%E6%B1%9F%E8%A5%BF/215383\",\"id\":\"215383\"},{\"name\":\"福建\",\"href\":\"/item/%E7%A6%8F%E5%BB%BA/132090\",\"id\":\"132090\"},{\"name\":\"海南\",\"href\":\"/item/%E6%B5%B7%E5%8D%97/13346\",\"id\":\"13346\"},{\"name\":\"岭南文化\",\"href\":\"/item/%E5%B2%AD%E5%8D%97%E6%96%87%E5%8C%96/819521\",\"id\":\"819521\"},{\"name\":\"语言\",\"href\":\"/item/%E8%AF%AD%E8%A8%80/72744\",\"id\":\"72744\"},{\"name\":\"风俗\",\"href\":\"/item/%E9%A3%8E%E4%BF%97\"},{\"name\