INSERT INTO `baike_related_items_pili` VALUES ('212091', 5, '温州', 8612, 458, '（浙江省地级市）', '', '温州，简称“温”或“瓯”，浙江省地级市；是国家历史文化名城，东南沿海重要的商贸城市[1] ，浙江省区域中心城市之一。温州位于浙江省东南部，瓯江下游南岸。全市陆域面积11612.94平方千米，海域面积约11000平方千米。全市辖4个市辖区、5个县、2个县级市。2017年常住人口921.5万人。温州是国家历史文化名城[2] ，素有“东南山水甲天下”之美誉。[3] 温州古为瓯地，也称东瓯，公元323年建郡，为永嘉郡,传说建郡城时有白鹿衔花绕城一周,故名鹿城。[4] 唐朝时（公元675年）始称温州[4] ，至今已有2000余年的建城历史。温州是中国民营经济发展的先发地区与改革开放的前沿阵地，在改革开放初期，以“南有吴川，北有温州”享誉全国。温州文化属瓯越文化，温州人属江浙民系使用吴语，温州话被评为中国最难懂方言之一。温州是中国数学家的摇篮、中国南戏的故乡、中国海鲜鸡蛋之乡，温州人被国人称之为东方犹太人。2017年中国百强城市排行榜排37位。[5-6] 2017年，温州市生产总值（GDP）5453.2亿元，比2016年增长8.4%。[7] 2018年12月，温州入选2018中国大陆最佳地级城市30强。[8] ', '[{\"name\":\"瓯\",\"href\":\"/item/%E7%93%AF/13382235\",\"id\":\"13382235\"},{\"name\":\"浙江省\",\"href\":\"/item/%E6%B5%99%E6%B1%9F%E7%9C%81/190275\",\"id\":\"190275\"},{\"name\":\"中心城市\",\"href\":\"/item/%E4%B8%AD%E5%BF%83%E5%9F%8E%E5%B8%82\"},{\"name\":\"浙江省\",\"href\":\"/item/%E6%B5%99%E6%B1%9F%E7%9C%81/190275\",\"id\":\"190275\"},{\"name\":\"瓯江\",\"href\":\"/item/%E7%93%AF%E6%B1%9F/563741\",\"id\":\"563741\"},{\"name\":\"国家历史文化名城\",\"href\":\"/item/%E5%9B%BD%E5%AE%B6%E5%8E%86%E5%8F%B2%E6%96%87%E5%8C%96%E5%90%8D%E5%9F%8E/6412721\",\"id\":\"6412721\"},{\"name\":\"东瓯\",\"href\":\"/item/%E4%B8%9C%E7%93%AF/5128028\",\"id\":\"5128028\"},{\"name\":\"永嘉郡\",\"href\":\"/item/%E6%B0%B8%E5%98%89%E9%83%A1/3873973\",\"id\":\"3873973\"},{\"name\":\"鹿城\",\"href\":\"/item/%E9%B9%BF%E5%9F%8E/3922603\",\"id\":\"3922603\"},{\"name\":\"民营经济\",\"href\":\"/item/%E6%B0%91%E8%90%A5%E7%BB%8F%E6%B5%8E\"},{\"name\":\"改革开放\",\"href\":\"/item/%E6%94%B9%E9%9D%A9%E5%BC%80%E6%94%BE/886098\",\"id\":\"886098\"},{\"name\":\"前沿阵地\",\"href\":\"/item/%E5%89%8D%E6%B2%BF%E9%98%B5%E5%9C%B0/5531016\",\"id\":\"5531016\"},{\"name\":\"改革开放\",\"href\":\"/item/%E6%94%B9%E9%9D%A9%E5%BC%80%E6%94%BE/886098\",\"id\":\"886098\"},{\"name\":\"瓯越文化\",\"href\":\"/item/%E7%93%AF%E8%B6%8A%E6%96%87%E5%8C%96/5608700\",\"id\":\"5608700\"},{\"name\":\"江浙民系\",\"href\":\"/item/%E6%B1%9F%E6%B5%99%E6%B0%91%E7%B3%BB/4366953\",\"id\":\"43