INSERT INTO `baike_related_items_pili` VALUES ('220985', 5, '泉州', 7686, 503, '', '', '泉州，福建省下辖地级市，简称泉、鲤，别名鲤城、刺桐城，位于福建省东南沿海，北承福州，南接厦门，东望宝岛台湾，地处低纬度，东临海洋，属亚热带海洋性季风气候，气候条件优越；总面积11014.78平方千米，辖四区、三市、五县；2017年常住人口865万。泉州历史悠久，经济开发早在周秦时期就已开始。三国吴永安三年（260年），在今南安市丰州镇置东安县治，南朝梁天监间（502～519年）置南安郡作郡治，为本地设置县、郡治之始。西晋末年，中原战乱，中原士族大批入泉多沿江而居，由此得名。[1] 泉州是列入国家“一带一路”战略的21世纪海上丝绸之路先行区。[2] 2017年，泉州入选为第五届全国文明城市。[3] 2018年4月，泉州入选新一批城市开展创新型城市建设的名单。[4] 2017年，泉州市实现地区生产总值（GDP）7548.01亿元，按可比价格计算，比上年增长8.4%，经济总量连续19年保持全省第一。其中，第一产业增加值198.03亿元，增长0.9%；第二产业增加值4397.78亿元，增长7.2%；第三产业增加值2952.19亿元，增长10.6%。[5] ', '[{\"name\":\"一带一路\",\"href\":\"/item/%E4%B8%80%E5%B8%A6%E4%B8%80%E8%B7%AF/13132427\",\"id\":\"13132427\"},{\"name\":\"21世纪海上丝绸之路\",\"href\":\"/item/21%E4%B8%96%E7%BA%AA%E6%B5%B7%E4%B8%8A%E4%B8%9D%E7%BB%B8%E4%B9%8B%E8%B7%AF/13238102\",\"id\":\"13238102\"}]', 'https://baike.baidu.com/item/泉州/220985', '', '4314818');
INSERT INTO `baike_related_items_pili` VALUES ('22349086', 5, '道域', 5, 2, '（金光布袋戏虚拟势力）', '', '金光布袋戏虚拟势力。与中原、苗疆、佛国、海境、羽国、魔世、妖界等境界构成中土九龙地界。', '[{\"name\":\"金光布袋戏\",\"href\":\"/item/%E9%87%91%E5%85%89%E5%B8%83%E8%A2%8B%E6%88%8F/8712638\",\"id\":\"8712638\"},{\"name\":\"中原\",\"href\":\"/item/%E4%B8%AD%E5%8E%9F/22349174\",\"id\":\"22349174\"},{\"name\":\"苗疆\",\"href\":\"/item/%E8%8B%97%E7%96%86/13002926\",\"id\":\"13002926\"},{\"name\":\"佛国\",\"href\":\"/item/%E4%BD%9B%E5%9B%BD/22349112\",\"id\":\"22349112\"},{\"name\":\"海境\",\"href\":\"/item/%E6%B5%B7%E5%A2%83/16069149\",\"id\":\"16069149\"},{\"name\":\"羽国\",\"href\":\"/item/%E7%BE%BD%E5%9B%BD\"},{\"name\":\"魔世\",\"href\":\"/item/%E9%AD%94%E4%B8%96/12809784\",\"id\":\"12809784\"},{\"name\":\"妖界\",\"href\":\"/item/%E5%A6%96%E7%95%8C/22349166\",\"id\":\"22349166\"}]', 'https://baike.baidu.com/item/道域/22349086', '', '22349174');
INSERT INTO `baike_related_items_pili` VALUES ('24888', 5, '黄俊雄', 454, 15, '（台湾布袋戏宗师）', '', '黄俊雄（1933年－），男，台湾云林县虎尾镇人，黄海岱的次子。并曾连任两届台湾省戏剧公会理事长，14岁起，随父学习布袋戏。', '[{\"name\":\"云林县\",\"href\":\"/item/%E4%BA%91%E6%9E%97%E5%8E%BF\"},{\"name\":\"黄海岱\",\"href\":\"/item/%E9%BB%84%E6%B5%B7%E5%B2%B1/1369965\",\"id\":\"1369965\"},{\"name\":\"布袋戏\",\"href\":\"/item/%E5%B8%83%E8%A2%8B%E6%88%8F/304743\",\"id\":\"304743\"}]', 'https://baike.baidu.com/item/黄俊雄/24888', '', '8712638');
INSERT INTO `baike_related_items_pili` VALUES ('2597860', 5, '刘萱姑', 45, 1, '', '', '布袋戏虚拟人物。史艳文正妻。杭州第一美人，品貌端庄、秀中外慧的才女，为人知书达理，十分温柔善良。', '[]', 'https://baike.baidu.com/item/刘萱姑/2597860', '', '1115740');
INSERT INTO `baike_related_items_pili` VALUES ('280360', 5, '漳州', 3316, 225, '', '', '漳州，福建省下辖地级行政区域，是海峡西岸城市之一，中国“田园都市，生态之城”，生态竞争力位居福建前列[1] ，国家闽南文化生态保护区[2] 。漳州地处“闽南金三角”，中心城区为芗城区 、龙文区、漳州台商投资区、漳州高新技术产业开发区，是厦深铁路、龙厦铁路、鹰厦铁路、福厦高铁交汇的重要枢纽地区、国家区域级流通节点城市[3] 。漳州是著名的“鱼米花果之乡”，漳州平原是福建最大平原，素有“海滨邹鲁”的美誉，2014年当选福布斯中国最佳商业百强城市，先后荣获国家历史文化名城、全国文明城市、国家森林城市[4] 、中国优秀旅游城市、全国科技先进城市、国家园林城市、全国双拥模范城市、世界食用菌罐头之都[5] 、中国温泉之城[6] 等称号。境内有东山岛、漳州滨海火山公园、南靖土楼、云洞岩等景点。漳州系历史文化名城，是闽南文化的发祥地之一，早于一万年前就有先民在这里繁衍生息。686年中国唯一的女皇帝武则天敕建漳州郡，迄今已有一千三百余年历史。历史上走出了林语堂、 黄道周等名人[7] 。全市户籍人口514.41万人[8] ，人口自然增长率12.77‰[8] 。2017年GDP3563.48亿元[8-9] ，增速连续4年位居福建第一[9] 、财政收入318.08亿元[8] 。漳州是著名的侨乡和台湾祖居地，旅居海外的华侨、港澳同胞有70万人，台胞三分之一祖籍漳州[10-12] 。2017年，漳州市复查确认继续保留全国文明城市荣誉称号。[13] 第一批国家农业可持续发展试验示范区。[14] 2018年11月，入选中国城市全面小康指数前100名。[15] ', '[{\"name\":\"福建省\",\"href\":\"/item/%E7%A6%8F%E5%BB%BA%E7%9C%81/122534\",\"id\":\"122534\"},{\"name\":\"海峡西岸\",\"href\":\"/item/%E6%B5%B7%E5%B3%A1%E8%A5%BF%E5%B2%B8/239777\",\"id\":\"239777\"},{\"name\":\"闽南文化生态保护区\",\"href\":\"/item/%E9%97%BD%E5%8D%97%E6%96%87%E5%8C%96%E7%94%9F%E6%80%81%E4%BF%9D%E6%8A%A4%E5%8C%BA/13874573\",\"id\":\"13874573\"},{\"name\":\"闽南金三角\",\"href\":\"/item/%E9%97%BD%E5%8D%97%E9%87%91%E4%B8%89%E8%A7%92/4737799\",\"id\":\"4737799\"},{\"name\":\"芗城区\",\"href\":\"/item/%E8%8A%97%E5%9F%8E%E5%8C%BA/10712455\",\"id\":\"10712455\"},{\"name\":\"龙文区\",\"href\":\"/item/%E9%BE%99%E6%96%87%E5%8C%BA/8902708\",\"id\":\"8902708\"},{\"name\":\"漳州台商投资区\",\"href\":\"/item/%E6%BC%B3%E5%B7%9E%E5%8F%B0%E5%95%86%E6%8A%95%E8%B5%84%E5%8C%BA/3682653\",\"id\":\"3682653\"},{\"name\":\"漳州高新技术产业开发区\",\"href\":\"/item/%E6%BC%B3%E5%B7%9E%E9%AB%98%E6%96%B0%E6%8A%80%E6%9C%AF%E4%BA%A7%E4%B8%9A%E5%BC%80%E5%8F%91%E5%8C%BA/18913678\",\"id\":\"18913678\"},{\"name\":\"厦深铁路\",\"href\":\"/item/%E5%8E%A6%E6%B7%B1%E9%93%81%E8%B7%AF/654601\",\"id\":\"654601\"},{\"name\":\"龙厦铁路\",\"href\":\"/item/%E9%BE%99%E5%8E%A6%E9%93%81%E8%B7%AF/653691\",\"id\":\"653691\"},{\"name\":\"鹰厦铁路\",\"href\":\"/item/%E9%B9%B0%E5%8E%A6%E9%93%81%E8%B7%AF/505