INSERT INTO `baike_related_items_pili` VALUES ('29000', 4, '戏剧', 8291, 1899, '（舞台表演艺术）', '', '戏剧，指以语言、动作、舞蹈、音乐、木偶等形式达到叙事目的的舞台表演艺术的总称。文学上的戏剧概念是指为戏剧表演所创作的脚本，即剧本。戏剧的表演形式多种多样，常见的包括话剧、歌剧、舞剧、音乐剧、木偶戏等。戏剧是由演员扮演角色在舞台上当众表演故事的一种综合艺术。戏剧的起源实不可考，目前有多种假说。比较主流的看法有二：一为原始宗教的巫术仪式，比如上古中文，“巫”、“舞”、“武”三字同源，可能是对一种乞求战斗胜利的巫术活动的合称，即戏剧的原始形态。另一为劳动或庆祝丰收时的即兴歌舞表演，这种说法主要依据是古希腊戏剧，它被认为是起源于酒神祭祀。戏剧是由演员将某个故事或情境，以对话、歌唱或动作等方式表演出来的艺术。戏剧有四个元素，包括了“演员”、“故事（情境）”、“舞台（表演场地）”和“观众”。“演员”是四者当中最重要的元素，他是角色的代言人，必须具备扮演的能力，戏剧与其它艺术类最大的不同之处便在于扮演了，通过演员的扮演，剧本中的角色才能得以伸张，如果抛弃了演员的扮演，那么所演出的便不再是戏剧。', '[{\"name\":\"戏剧\",\"href\":\"/item/%E6%88%8F%E5%89%A7/29000\",\"id\":\"29000\"},{\"name\":\"语言\",\"href\":\"/item/%E8%AF%AD%E8%A8%80/72744\",\"id\":\"72744\"},{\"name\":\"动作\",\"href\":\"/item/%E5%8A%A8%E4%BD%9C/33802\",\"id\":\"33802\"},{\"name\":\"舞蹈\",\"href\":\"/item/%E8%88%9E%E8%B9%88/6228\",\"id\":\"6228\"},{\"name\":\"音乐\",\"href\":\"/item/%E9%9F%B3%E4%B9%90/61907\",\"id\":\"61907\"},{\"name\":\"木偶\",\"href\":\"/item/%E6%9C%A8%E5%81%B6/81773\",\"id\":\"81773\"},{\"name\":\"叙事\",\"href\":\"/item/%E5%8F%99%E4%BA%8B/3376333\",\"id\":\"3376333\"},{\"name\":\"表演艺术\",\"href\":\"/item/%E8%A1%A8%E6%BC%94%E8%89%BA%E6%9C%AF/7803083\",\"id\":\"7803083\"},{\"name\":\"文学\",\"href\":\"/item/%E6%96%87%E5%AD%A6/6437\",\"id\":\"6437\"},{\"name\":\"戏剧表演\",\"href\":\"/item/%E6%88%8F%E5%89%A7%E8%A1%A8%E6%BC%94/5815120\",\"id\":\"5815120\"},{\"name\":\"话剧\",\"href\":\"/item/%E8%AF%9D%E5%89%A7/1004902\",\"id\":\"1004902\"},{\"name\":\"歌剧\",\"href\":\"/item/%E6%AD%8C%E5%89%A7/9208371\",\"id\":\"9208371\"},{\"name\":\"舞剧\",\"href\":\"/item/%E8%88%9E%E5%89%A7/1476543\",\"id\":\"1476543\"},{\"name\":\"音乐剧\",\"href\":\"/item/%E9%9F%B3%E4%B9%90%E5%89%A7/250231\",\"id\":\"250231\"},{\"name\":\"木偶戏\",\"href\":\"/item/%E6%9C%A8%E5%81%B6%E6%88%8F/76900\",\"id\":\"76900\"},{\"name\":\"戏剧\",\"href\":\"/item/%E6%88%8F%E5%89%A7/29000\",\"id\":\"29000\"},{\"name\":\"演员\",\"href\":\"/item/%E6%BC%94%E5%91%98/3106682\",\"id\":\"3106682\"},{\"name\":\"综合艺术\",\"href\