INSERT INTO `baike_related_items_pili` VALUES ('304743', 5, '布袋戏', 755, 62, '', '', '布袋戏（闽南语读音：boo dei hi）又称布袋木偶戏、手操傀儡戏、手袋傀儡戏、掌中戏、小笼、指花戏，是一种起源于17世纪中国福建泉州或漳州；主要在福建泉州、漳州（闽南地区）、广东潮汕与台湾等地区流传的用布偶来表演的传统地方戏剧剧种。布偶的头是用木头雕刻成中空的人头，除出偶头、戏偶手掌与人偶足部外，布袋戏偶身之躯干与四肢都是用布料做出的服装；演出时，将手套入戏偶的服装中进行操偶表演。而正因为早期此类型演出的戏偶偶身极像“用布料所做的袋子”，因此有了布袋戏之通称。早期许多的迎神庙会场合里，布袋戏是最常看到的民间戏曲表演之一。', '[{\"name\":\"闽南\",\"href\":\"/item/%E9%97%BD%E5%8D%97/3487594\",\"id\":\"3487594\"},{\"name\":\"傀儡戏\",\"href\":\"/item/%E5%82%80%E5%84%A1%E6%88%8F\"},{\"name\":\"掌中戏\",\"href\":\"/item/%E6%8E%8C%E4%B8%AD%E6%88%8F/3703499\",\"id\":\"3703499\"},{\"name\":\"福建\",\"href\":\"/item/%E7%A6%8F%E5%BB%BA\"},{\"name\":\"泉州\",\"href\":\"/item/%E6%B3%89%E5%B7%9E/220985\",\"id\":\"220985\"},{\"name\":\"漳州\",\"href\":\"/item/%E6%BC%B3%E5%B7%9E/280360\",\"id\":\"280360\"},{\"name\":\"福建\",\"href\":\"/item/%E7%A6%8F%E5%BB%BA/132090\",\"id\":\"132090\"},{\"name\":\"泉州\",\"href\":\"/item/%E6%B3%89%E5%B7%9E/220985\",\"id\":\"220985\"},{\"name\":\"漳州\",\"href\":\"/item/%E6%BC%B3%E5%B7%9E/280360\",\"id\":\"280360\"},{\"name\":\"广东\",\"href\":\"/item/%E5%B9%BF%E4%B8%9C/207811\",\"id\":\"207811\"},{\"name\":\"潮汕\",\"href\":\"/item/%E6%BD%AE%E6%B1%95/143016\",\"id\":\"143016\"},{\"name\":\"台湾\",\"href\":\"/item/%E5%8F%B0%E6%B9%BE/122340\",\"id\":\"122340\"}]', 'https://baike.baidu.com/item/布袋戏/304743', '', '8712638');
INSERT INTO `baike_related_items_pili` VALUES ('32355', 5, '剧本', 6463, 161, '（文学体裁）', '', '剧本主要分为文学剧本与摄影剧本。文学剧本是比较突出文学性的剧本，摄影感偏低，包含话剧本（或称戏剧本）、小说剧本（或称剧小说）、小品剧本、相声剧本等；摄影剧本是比较突出拍摄感的剧本，文学艺术性可高可低（根据影片题材、市场、投资金等综合情况决定），包含分景剧本、分镜剧本（分镜脚本或电影剧本）、台本等。剧本是戏剧艺术创作的文本基础，编导与演员根据剧本进行演出。与剧本类似的词汇还包括脚本、剧作等等。它是以代言体方式为主，表现故事情节的文学样式。剧本是舞台表演或拍戏的必要工具之一，是剧中人物进行对话的参考语言，是一门为舞台表演服务的艺术样式，区别于戏剧和其他文学样式。', '[{\"name\":\"剧小说\",\"href\":\"/item/%E5%89%A7%E5%B0%8F%E8%AF%B4/19847579\",\"id\":\"19847579\"},{\"name\":\"艺术创作\",\"href\":\"/item/%E8%89%BA%E6%9C%AF%E5%88%9B%E4%BD%9C/1424225\",\"id\":\"1424225\"},{\"name\":\"编导\",\"href\":\"/item/%E7%BC%96%E5%AF%BC/1517131\",\"id\":\"1517131\"},{\"name\":\"演出\",\"href\":\"/item/%E6%BC%94%E5%87%BA/1479710\",\"id\":\"1479710\"},{\"name\":\"拍戏\",\"href\":\"/item/%E6%8B%8D%E6%88%8F/9083585\",\"id\":\"9083585\"},{\"name\":\"戏剧\",\"href\":\"/item/%E6%88%8F%E5%89%A7/29000\",\"id\":\"29000\"}]', 'https://baike.baidu.com/item/剧本/32355', '', '4356872');
INSERT INTO `baike_related_items_pili` VALUES ('33802', 5, '动作', 2616, 1113, '（词语解释）', '', '具有一定动机和目的并指向一定客体的运动系统。简单的解释是：动作是角色五官位置的变化（即表情变化）、角色肢体位置的变化（即动作变化）和角色与所处环境相对位置的变化（即运动距离的变化）的过程。人的动作不是孤立的，而是包括在人的整体活动之中。是活动的组成部分，它是以自觉的目的为特征，并且总是由一定的动机所激发，因而具有社会的性质。[1] ', '[{\"name\":\"动机\",\"href\":\"/item/%E5%8A%A8%E6%9C%BA/6441541\",\"id\":\"6441541\"},{\"name\":\"运动系统\",\"href\":\"/item/%E8%BF%90%E5%8A%A8%E7%B3%BB%E7%BB%9F/1145168\",\"id\":\"1145168\"}]', 'https://baike.baidu.com/item/动作/33802', '', '29000');
INSERT INTO `baike_related_items_pili` VALUES ('3442697', 5, '胡迪', 268, 17, '（美国动画片《玩具总动员》中人物）', '', '胡迪，英文名Woody，迪士尼公司和皮克斯动画工作室公司于1995年合作推出的动画片《玩具总动员》（Toy Story）主角之一。个性评价 ：乐观、有团结的精神，是众多玩具的首领，单纯地把自己看做是一个玩具。', '[{\"name\":\"玩具总动员\",\"href\":\"/item/%E7%8E%A9%E5%85%B7%E6%80%BB%E5%8A%A8%E5%91%98/35533\",\"id\":\"35533\"}]', 'https://baike.baidu.com/item/胡迪/3442697', '', '35533');
INSERT INTO `baike_related_items_pili` VALUES ('3487594', 3, '闽南', 1213, 35, '', '', '闽南(Hokkien)，即指福建的南部，从地域和文化等多方面来说，闽南包括厦门、漳 州、泉 州、龙岩地区新罗绝大部分和福建 漳平、福建 大田和尤溪的部分地区。北接福州莆田，南与广东潮汕地区相连，西与原汀州府界交界。在1949年前，闽南人凭借吃苦耐劳的精神在东南亚（如：马来西亚、菲律宾）大量创业，涌现了一批的富豪。如今近千万闽南华侨、华人在外，闽南成为侨乡地区之一。闽南地区民营经济较为发达，民营工业发展尤为突出， 人民生活十分富裕，涌现出恒安、达利、安踏、金龙客车等一大批知名企业。', '[{\"name\":\"漳平\",\"href\":\"/item/%E6%BC%B3%E5%B9%B3/6392295\",\"id\":\"6392295\"},{\"name\":\"潮汕地区\",\"href\":\"/item/%E6%BD%AE%E6%B1%95%E5%9C%B0%E5%8C%BA/389739\",\"id\":\"389739\"},{\"name\":\"闽南地区\",\"href\":\"/item/%E9%97%BD%E5%8D%97%E5%9C%B0%E5%8C%BA/4314818\",\"id\":\"4314818\"}]', 'https://baike.baidu.com/item/闽南/3487594', '', '');
INSERT INTO `baike_related_items_pili` VALUES ('3521633', 5, '上海电影制片厂', 525, 96, '', '', '上海电影制片厂，是中国电影老企业，是中国三大电影基地之一。成立于1949年11月16日。1950～1952年，上海长江电影制片厂、昆仑影业公司、文华影业公司、国泰影业公司等8家私营电影企业联合组建为国营的上海联合电影制片厂。1953年2月上海电影制片厂与上海联合电影制片厂合并，仍沿用上海电影制片厂厂名。', '[{\"name\":\"昆仑影业公司\",\"href\":\"/item/%E6%98%86%E4%BB%91%E5%BD%B1%E4%B8%9A%E5%85%AC%E5%8F%B8/2218841\",\"id\":\"2218841\"},{\"name\":\"文华影业公司\",\"href\":\"/item/%E6%96%87%E5%8D%8E%E5%BD%B1%E4%B8%9A%E5%85%AC%E5%8F%B8/3022529\",\"id\":\"3022529\"},{\"name\":\"国泰影业公司\",\"href\":\"/item/%E5%9B%BD%E6%B3%B0%E5%BD%B1%E4%B8%9A%E5%85%AC%E5%8F%B8/9260211\",\"id\":\"9260211\"}]', 'https://baike.baidu.com/item/上海电影制片厂/3521633', '', '3528980');
INSERT INTO `baike_related_items_pili` VALUES ('3528980', 4, '上海美术电影制片厂', 1531, 101, '', '', '上海美术电影制片厂是中国规模最大的美术电影制片，亦是中国历史最老的动画制片厂之一，（动画、木偶、剪纸、折纸）基地，厂址上海。代表作，大闹天宫，阿凡提，神笔，济公斗蟋蟀，半夜鸡叫，三毛流浪记，草原英雄小姐妹，红军桥，占地10611平方米，建有动画 、剪纸、行政工作楼和木偶摄影棚，是中国摄制美术片的主要基地。前身是东北电影制片厂的卡通股，1949年成立美术片组，次年迁到上海隶属上海电影制片厂。1957年4月正式建厂，设动画、木偶和剪纸3个制片部门。有两个下属企业：中外合资上海亿利美动画有限公司和集体所有制上海美术电影绘制厂。生产能力为年产14～15部。美术片组阶段创作的动画片《骄傲的将军》、木偶片《神笔》在探索民族风格方面取得了经验，建厂后共摄制美术片428部，占全国美术片产量80%以上。逐渐形成了中国美术片的风格。具有较强的影视动画片创作、制作和衍生产品研发实力。', '[{\"name\":\"东北电影制片厂\",\"href\":\"/item/%E4%B8%9C%E5%8C%97%E7%94%B5%E5%BD%B1%E5%88%B6%E7%89%87%E5%8E%82/798909\",\"id\":\"798909\"},{\"name\":\"上海电影制片厂\",\"href\":\"/item/%E4%B8%8A%E6%B5%B7%E7%94%B5%E5%BD%B1%E5%88%B6%E7%89%87%E5%8E%82/3521633\",\"id\":\"3521633\"},{\"name\":\"骄傲的将军\",\"href\":\"/item/%E9%AA%84%E5%82%B2%E7%9A%84%E5%B0%86%E5%86%9B/8459988\",\"id\":\"8459988\"},{\"name\":\"神笔\",\"href\":\"/item/%E7%A5%9E%E7%AC%94/3547228\",\"id\":\"3547228\"}]', 'https://baike.baidu.com/item/上海美术电影制片厂/3528980', '', '3703499');
INSERT INTO `baike_related_items_pili` VALUES ('3547228', 5, '神笔', 169, 7, '（词语释义）', '', '神笔是一个汉语词语。拼音为shén bǐ。释有神妙的文笔等释义。', '[]', 'https://baike.baidu.com/item/神笔/3547228', '', '3528980');
INSERT INTO `baike_related_items_pili` VALUES ('35533', 4, '玩具总动员', 2636, 104, '', '美国1995年11月22日', '《玩具总动员》是皮克斯的动画系列电影，截止2015年共制作了三部，由华特·迪士尼影片公司和皮克斯动画工作室合作推出。讲述了主角两个玩具牛仔警长胡迪和太空骑警巴斯光年的故事。', '[{\"name\":\"皮克斯动画工作室\",\"href\":\"/item/%E7%9A%AE%E5%85%8B%E6%96%AF%E5%8A%A8%E7%94%BB%E5%B7%A5%E4%BD%9C%E5%AE%A4/6472365\",\"id\":\"6472365\"},{\"name\":\"胡迪\",\"href\":\"/item/%E8%83%A1%E8%BF%AA/3442697\",\"id\":\"3442697\"}]', 'https://baike.baidu.com/item/玩具总动员/35533', '', '11010885');
INSERT INTO `baike_related_items_pili` VALUES ('389739', 4, '潮汕地区', 480, 91, '', '', '潮汕地区，位于广东东部沿海，主体是潮汕三市（汕头、潮州、揭阳），潮汕三市地理相连、历史相承、文化相同，历代是一个城市政区，历代隶属潮州府，当代隶属汕头市，1991年汕头市分治为今潮汕三市，涵盖10区4县1县级市普宁，总常住人口1300多万，总面积10918平方公里，接近温州面积（11612平方公里）。潮汕是广东原省委书记、省经济特区管理委员会主任、深圳市委书记兼市长吴南生的故乡。[1] 潮汕是著名华侨之乡[2] 、美食之乡、名茶之乡[3] ，亚洲玉都[4] ，国家历史文化名城，中国中药[5] 、商贸名城，中国纺织[6] 、五金[7] 、不锈钢基地[8] ，自古是海丝重镇[9-10] 和广东第二大城市[11] ，享有“岭海名邦、南国邦郡、海滨邹鲁、文化橱窗”和中国体育“世界冠军摇篮”[12] 等美誉。潮汕是港澳台同胞祖籍地之一[13-15] ，是世界上分布范围广泛、影响深远的汉族族群[16] ，自古在世界政治[17] 、经济[18-19] 、文化[20] 、科技[21] 、艺术[22] 领域有着极高成就[23] ，上世纪初被泰国国王称为东方犹太人。潮汕名人有泰国吞武里王朝建立者达信大帝[24] ，法国首位华人国会议员[25] 陈文雄，中共中央党校党建部原主任陈登才[26-27] 等；富豪陈慈黉、连瀛洲、陈弼臣、李嘉诚、黄光裕、马化腾等；国学家饶宗颐[28] 、经济学家许涤新、北大博导肖灼基[29] ；“世界人工细胞之父”张明瑞，世界顶级癌症专家林重庆等至少64位中国科学院士和10位欧美国家院士；李宏平，许银川等30位体育世界冠军[30] ；香港歌影坛天后郑秀文、杨千嬅等；食神戴龙[31] 、蔡澜[32] 等。潮汕1991年后发展滞后[11] ，2013年政协委员建言合并，百余名委员联名支持。[33-34] ', '[{\"name\":\"广东\",\"href\":\"/item/%E5%B9%BF%E4%B8%9C/207811\",\"id\":\"207811\"},{\"name\":\"潮州府\",\"href\":\"/item/%E6%BD%AE%E5%B7%9E%E5%BA%9C/6294516\",\"id\":\"6294516\"},{\"name\":\"潮汕三市\",\"href\":\"/item/%E6%BD%AE%E6%B1%95%E4%B8%89%E5%B8%82/10388082\",\"id\":\"10388082\"},{\"name\":\"温州\",\"href\":\"/item/%E6%B8%A9%E5%B7%9E/212091\",\"id\":\"212091\"},{\"name\":\"经济特区\",\"href\":\"/item/%E7%BB%8F%E6%B5%8E%E7%89%B9%E5%8C%BA/508091\",\"id\":\"508091\"},{\"name\":\"吴南生\",\"href\":\"/item/%E5%90%B4%E5%8D%97%E7%94%9F/5760510\",\"id\":\"5760510\"},{\"name\":\"华侨之乡\",\"href\":\"/item/%E5%8D%8E%E4%BE%A8%E4%B9%8B%E4%B9%A1/97672\",\"id\":\"97672\"},{\"name\":\"海滨邹鲁\",\"href\":\"/item/%E6%B5%B7%E6%BB%A8%E9%82%B9%E9%B2%81/3895303\",\"id\":\"3895303\"},{\"name\":\"港澳台\",\"href\":\"/item/%E6%B8%AF%E6%BE%B3%E5%8F%B0/896625\",\"id\":\"896625\"},{\"name\":\"东方犹太人\",\"href\":\"/item/%E4%B8%9C%E6%96%B9%E7%8A%B9%E5%A4%AA%E4%BA%BA/1762732\",\"id\":\"1762732\"},{\"name\":\"吞武里王朝\",\"href\":\"/item/%E5%90%9E%E6%AD%A6%E9%87%8C%E7%8E%8B%E6%9C%9D/8491273\",\"id\":\"8491273\"},{\"name\":\"达信大帝\",\"href\":\"/item/%E8%BE%BE%E4%BF%A1%E5%A4%A7%E5%B8%9D/2647069\",\"id\":\"2647069\"},{\"name\":\"陈文雄\",\"href\":\"/item/%E9%99%88%E6%96%87%E9%9B%84/20380459\",\"id\":\"20380459\"},{\"name\":\"陈慈黉\",\"href\":\"/item/%E9%99%88%E6%85%88%E9%BB%89/10066586\",\"id\":\"10066586\"},{\"name\":\"连瀛洲\",\"href\":\"/item/%E8%BF%9E%E7%80%9B%E6%B4%B2/1334461\",\"id\":\"1334461\"},{\"name\":\"陈弼臣\",\"href\":\"/item/%E9%99%88%E5%BC%BC%E8%87%A3/1654663\",\"id\":\"1654663\"},{\"name\":\"李嘉诚\",\"href\":\"/item/%E6%9D%8E%E5%98%89%E8%AF%9A/1044\",\"id\":\"1044\"},{\"name\":\"黄光裕\",\"href\":\"/item/%E9%BB%84%E5%85%89%E8%A3%95/216703\",\"id\":\"216703\"},{\"name\":\"马化腾\",\"href\":\"/item/%E9%A9%AC%E5%8C%96%E8%85%BE/124988\",\"id\":\"124988\"},{\"name\":\"饶宗颐\",\"href\":\"/item/%E9%A5%B6%E5%AE%97%E9%A2%90/1069601\",\"id\":\"1069601\"},{\"name\":\"许涤新\",\"href\":\"/item/%E8%AE%B8%E6%B6%A4%E6%96%B0/2168018\",\"id\":\"2168018\"},{\"name\":\"肖灼基\",\"href\":\"/item/%E8%82%96%E7%81%BC%E5%9F%BA/6830543\",\"id\":\"6830543\"},{\"name\":\"张明瑞\",\"href\":\"/item/%E5%BC%A0%E6%98%8E%E7%91%9E/20601452\",\"id\":\"20601452\"},{\"name\":\"林重庆\",\"href\":\"/item/%E6%9E%97%E9%87%8D%E5%BA%86/12597037\",\"id\":\"12597037\"},{\"name\":\"李宏平\",\"href\":\"/item/%E6%9D%8E%E5%AE%8F%E5%B9%B3/10766214\",\"id\":\"10766214\"},{\"name\":\"许银川\",\"href\":\"/item/%E8%AE%B8%E9%93%B6%E5%B7%9D/1121589\",\"id\":\"1121589\"},{\"name\":\"郑秀文\",\"href\":\"/item/%E9%83%91%E7%A7%80%E6%96%87/325723\",\"id\":\"325723\"},{\"name\":\"杨千嬅\",\"href\":\"/item/%E6%9D%A8%E5%8D%83%E5%AC%85/142934\",\"id\":\"142934\"}]', 'https://baike.baidu.com/item/潮汕地区/389739', '', '3487594');
INSERT INTO `baike_related_items_pili` VALUES ('3996641', 3, '史艳文', 1119, 74, '', '', '史艳文，金光布袋戏虚拟人物，是金光系列里的第一主角，是台湾布袋戏的灵魂人物。太阳星转世，背部刻有四字“纯忠报国”。[1] 人称云州大儒侠、玉圣人，中原武林的中流砥柱。甲子名人帖上，与藏镜人并列天下第一掌，[2] 其纯阳功体独霸武林。史艳文乃是温文儒雅、饱读诗书的儒家君子。虽多情但不滥情、风雅而不风流，个性内敛持重、气质出众、风度翩翩。因其品行高洁、君子端方，世称“史君子”、“史贤人”。修养与包容力过人，仁德处世，对于一些“尚可救药”的歹人，往往会网开一面。为此，史艳文甚至不惜牺牲自身利益，无怨无悔地奔走跋涉。[3] 但若忍无可忍，则会一反和平处事的理念，以暴制暴。长年带领群侠抵御苗疆的入侵，与世仇苗疆战神藏镜人作战多年。[4] 被西剑流囚禁五年期间，酷刑加身仍不屈不挠。[5] 后联手藏镜人三战炎魔幻十郎，协助默苍离抵挡魔世入侵中原。与次子戮世摩罗一战后失踪。[6] 数年后从魔世归来，救下元邪皇刀下的长子俏如来以及众人，[7] 成为对抗元邪皇不可或缺的战力。诗号1：回忆迷惘杀戮多，往事情仇待如何。绢写黑诗无限恨，夙兴夜寐枉徒劳。诗号2：乾坤乙定不休功，卦卜将来绝对空。蹙额连思兼叹息，徒然命运不亨通。[8] ', '[{\"name\":\"金光布袋戏\",\"href\":\"/item/%E9%87%91%E5%85%89%E5%B8%83%E8%A2%8B%E6%88%8F/8712638\",\"id\":\"8712638\"},{\"name\":\"台湾布袋戏\",\"href\":\"/item/%E5%8F%B0%E6%B9%BE%E5%B8%83%E8%A2%8B%E6%88%8F/5872657\",\"id\":\"5872657\"},{\"name\":\"中原\",\"href\":\"/item/%E4%B8%AD%E5%8E%9F/22349174\",\"id\":\"22349174\"},{\"name\":\"藏镜人\",\"href\":\"/item/%E8%97%8F%E9%95%9C%E4%BA%BA/10746401\",\"id\":\"10746401\"},{\"name\":\"苗疆\",\"href\":\"/item/%E8%8B%97%E7%96%86/13002926\",\"id\":\"13002926\"},{\"name\":\"西剑流\",\"href\":\"/item/%E8%A5%BF%E5%89%91%E6%B5%81/3764261\",\"id\":\"3764261\"},{\"name\":\"炎魔幻十郎\",\"href\":\"/item/%E7%82%8E%E9%AD%94%E5%B9%BB%E5%8D%81%E9%83%8E/10546277\",\"id\":\"10546277\"},{\"name\":\"默苍离\",\"href\":\"/item/%E9%BB%98%E8%8B%8D%E7%A6%BB/1984552\",\"id\":\"1984552\"},{\"name\":\"魔世\",\"href\":\"/item/%E9%AD%94%E4%B8%96/12809784\",\"id\":\"12809784\"},{\"name\":\"戮世摩罗\",\"href\":\"/item/%E6%88%AE%E4%B8%96%E6%91%A9%E7%BD%97/12009516\",\"id\":\"12009516\"},{\"name\":\"元邪皇\",\"href\":\"/item/%E5%85%83%E9%82%AA%E7%9A%87/16762525\",\"id\":\"16762525\"},{\"name\":\"俏如来\",\"href\":\"/item/%E4%BF%8F%E5%A6%82%E6%9D%A5/5061430\",\"id\":\"5061430\"}]', 'https://baike.baidu.com/item/史艳文/3996641', '', '5552753');
INSERT INTO `baike_related_items_pili` VALUES ('4314818', 4, '闽南地区', 36, 9, '', '', '闽南地区指福建省东南部厦门、泉州、漳州、龙岩新罗区和漳平，方言通行闽南语，其主要是依据语言、文化、风俗上等来划分的。莆田通行语言莆仙话源于闽南语系但现代已有较大差别，已经不能与其它地区的闽南语交流。龙岩市新罗区和漳平市虽行政区划与闽西有较大关联，但地理位置、血统、语言、文化、风俗都属于闽南，并且在历史上龙岩新罗区和漳平属于漳州市。因此狭义上所指的闽南仅指厦门-泉州-漳州-龙岩新罗区和漳平。', '[{\"name\":\"泉州\",\"href\":\"/item/%E6%B3%89%E5%B7%9E/220985\",\"id\":\"220985\"},{\"name\":\"漳州\",\"href\":\"/item/%E6%BC%B3%E5%B7%9E/280360\",\"id\":\"280360\"},{\"name\":\"莆仙话\",\"href\":\"/item/%E8%8E%86%E4%BB%99%E8%AF%9D/9061342\",\"id\":\"9061342\"}]', 'https://baike.baidu.com/item/闽南地区/4314818', '', '3487594');
INSERT INTO `baike_related_items_pili` VALUES ('4348895', 5, '宁洋县', 24, 8, '', '', '宁洋（英文：Ningyang）（古属漳州府宁洋县），位于福建省的中西部 ，东接大田县，西邻连城县，南毗漳平县、龙岩县，北与永安县接壤。县中心距永安县45公里，离福州市325公里，总面积1390.3平方公里。宁洋县已于1956年撤销。', '[{\"name\":\"漳州府\",\"href\":\"/item/%E6%BC%B3%E5%B7%9E%E5%BA%9C/9570098\",\"id\":\"9570098\"},{\"name\":\"宁洋县\",\"href\":\"/item/%E5%AE%81%E6%B4%8B%E5%8E%BF/4348895\",\"id\":\"4348895\"},{\"name\":\"大田县\",\"href\":\"/item/%E5%A4%A7%E7%94%B0%E5%8E%BF/3450481\",\"id\":\"3450481\"},{\"name\":\"连城县\",\"href\":\"/item/%E8%BF%9E%E5%9F%8E%E5%8E%BF/3449672\",\"id\":\"3449672\"},{\"name\":\"漳平县\",\"href\":\"/item/%E6%BC%B3%E5%B9%B3%E5%8E%BF/852866\",\"id\":\"852866\"},{\"name\":\"龙岩县\",\"href\":\"/item/%E9%BE%99%E5%B2%A9%E5%8E%BF/20413961\",\"id\":\"20413961\"},{\"name\":\"永安县\",\"href\":\"/item/%E6%B0%B8%E5%AE%89%E5%8E%BF/53162\",\"id\":\"53162\"},{\"name\":\"福州市\",\"href\":\"/item/%E7%A6%8F%E5%B7%9E%E5%B8%82\"}]', 'https://baike.baidu.com/item/宁洋县/4348895', '', '6392295');
INSERT INTO `baike_related_items_pili` VALUES ('4356872', 4, '表演', 776, 73, '', '', '表演，著作权法术语，指演奏乐曲，上演剧本，朗诵诗词等直接或者借助技术设备以声音、表情、动作公开再现的作品。', '[{\"name\":\"乐曲\",\"href\":\"/item/%E4%B9%90%E6%9B%B2/8961659\",\"id\":\"8961659\"},{\"name\":\"剧本\",\"href\":\"/item/%E5%89%A7%E6%9C%AC/32355\",\"id\":\"32355\"},{\"name\":\"诗词\",\"href\":\"/item/%E8%AF%97%E8%AF%8D/9166843\",\"id\":\"9166843\"}]', 'https://baike.baidu.com/item/表演/4356872', '', '');
INSERT INTO `baike_related_items_pili` VALUES ('446324', 5, '九龙江', 312, 9, '（福建省第二大河流）', '', '九龙江，亦名漳州河，是福建省仅次于闽江的第二大河流，最早名“柳营江”，因六朝以来“戍闽者屯兵于龙溪，阻江为界，插柳为营”故名。九龙江由干流北溪和支流西溪、南溪汇合，过漳州在厦门港对岸注入台湾海峡，下游漳州平原是福建省四大平原之一。上游水流湍急，下游江宽水稳，可通航。九龙江干线长度258公里，流量446立方米/秒。九龙江流域范围的坐标为东经116°47′～118°02′，北纬24°13′～25°51′，流域面积14741平方公里，约占福建省陆域面积的12%，涵盖12个县（市、区）。流域人口占全省人口总数的17%，经济总量约占福建省的 26.7%[1] 。', '[{\"name\":\"九龙江\",\"href\":\"/item/%E4%B9%9D%E9%BE%99%E6%B1%9F/446324\",\"id\":\"446324\"},{\"name\":\"漳州河\",\"href\":\"/item/%E6%BC%B3%E5%B7%9E%E6%B2%B3/6199159\",\"id\":\"6199159\"},{\"name\":\"福建省\",\"href\":\"/item/%E7%A6%8F%E5%BB%BA%E7%9C%81/122534\",\"id\":\"122534\"},{\"name\":\"闽江\",\"href\":\"/item/%E9%97%BD%E6%B1%9F/497041\",\"id\":\"497041\"},{\"name\":\"漳州\",\"href\":\"/item/%E6%BC%B3%E5%B7%9E/280360\",\"id\":\"280360\"},{\"name\":\"厦门港\",\"href\":\"/item/%E5%8E%A6%E9%97%A8%E6%B8%AF/5265856\",\"id\":\"5265856\"},{\"name\":\"台湾海峡\",\"href\":\"/item/%E5%8F%B0%E6%B9%BE%E6%B5%B7%E5%B3%A1/25347\",\"id\":\"25347\"},{\"name\":\"漳州平原\",\"href\":\"/item/%E6%BC%B3%E5%B7%9E%E5%B9%B3%E5%8E%9F/2347292\",\"id\":\"2347292\"}]', 'https://baike.baidu.com/item/九龙江/446324', '', '6392295');
INSERT INTO `baike_related_items_pili` VALUES ('497041', 5, '闽江', 675, 37, '', '', '闽江，中国福建省最大独流入海（东海）河流。发源于福建、江西交界的建宁县均口镇。建溪、富屯溪、沙溪三大主要支流在南平延平区附近汇合后称闽江。穿过沿海山脉至福州市南台岛分南北两支，至罗星塔复合为一，折向东北流出琅岐岛注入东海。以沙溪为正源，全长562千米，流域面积60,992平方公里，约占福建全省面积的一半。[1] 主要支流除三支流外，还有中下游的尤溪、古田溪、大樟溪。闽江洪灾较重，干流上建设安砂水库、水口电站后，灾害减轻。水力资源丰富，建有古田溪梯级开发4个电站、沙溪口电站装机、水口电站，总装机容量140万千瓦。[1] 闽江流域是闽越族人的世居地，而上游的三明、南平则是客家人的祖地。闽越人及客家人在依江而居，创造了丰富的历史文化。进入现代，闽江流域已经成为福建省内重要的机械、商贸、旅游、水电发达地区。', '[{\"name\":\"福建\",\"href\":\"/item/%E7%A6%8F%E5%BB%BA\"},{\"name\":\"江西\",\"href\":\"/item/%E6%B1%9F%E8%A5%BF/215383\",\"id\":\"215383\"},{\"name\":\"建宁县\",\"href\":\"/item/%E5%BB%BA%E5%AE%81%E5%8E%BF/3450628\",\"id\":\"3450628\"},{\"name\":\"建溪\",\"href\":\"/item/%E5%BB%BA%E6%BA%AA/5180753\",\"id\":\"5180753\"},{\"name\":\"富屯溪\",\"href\":\"/item/%E5%AF%8C%E5%B1%AF%E6%BA%AA/5180828\",\"id\":\"5180828\"},{\"name\":\"沙溪\",\"href\":\"/item/%E6%B2%99%E6%BA%AA\"},{\"name\":\"支流\",\"href\":\"/item/%E6%94%AF%E6%B5%81/5419973\",\"id\":\"5419973\"},{\"name\":\"沿海山脉\",\"href\":\"/item/%E6%B2%BF%E6%B5%B7%E5%B1%B1%E8%84%89/10857781\",\"id\":\"10857781\"},{\"name\":\"南台岛\",\"href\":\"/item/%E5%8D%97%E5%8F%B0%E5%B2%9B/5612174\",\"id\":\"5612174\"},{\"name\":\"罗星塔\",\"href\":\"/item/%E7%BD%97%E6%98%9F%E5%A1%94/2962958\",\"id\":\"2962958\"},{\"name\":\"琅岐岛\",\"href\":\"/item/%E7%90%85%E5%B2%90%E5%B2%9B/606725\",\"id\":\"606725\"},{\"name\":\"东海\",\"href\":\"/item/%E4%B8%9C%E6%B5%B7/18322\",\"id\":\"18322\"},{\"name\":\"流域面积\",\"href\":\"/item/%E6%B5%81%E5%9F%9F%E9%9D%A2%E7%A7%AF\"},{\"name\":\"安砂水库\",\"href\":\"/item/%E5%AE%89%E7%A0%82%E6%B0%B4%E5%BA%93/819946\",\"id\":\"819946\"},{\"name\":\"水口电站\",\"href\":\"/item/%E6%B0%B4%E5%8F%A3%E7%94%B5%E7%AB%99/8708490\",\"id\":\"8708490\"}]', 'https://baike.baidu.com/item/闽江/497041', '', '165311');
INSERT INTO `baike_related_items_pili` VALUES ('5552753', 2, '霹雳城', 141, 7, '', '', '霹雳城是录影带版霹雳布袋戏第一部戏。正当武林支柱云州大儒侠史艳文生死不明的情况之下，万恶罪魁藏镜人继续为害武林，另外一股灰暗不明的黑暗新势力渐渐成形，而化身为天道一侠圣剑白阳生的史艳文，是否真能以暗藏的身份破解新的黑暗势力，而且圣剑与魔刀之争谁胜一筹呢，又有好坏不分黑白郎君以别人的失败为快乐挑战武林众多高手，所引出的隐藏高人擎天子能击败南宫恨，以慰九百九十九条冤魂在天之灵吗，除此之外再看刘三、怪老子、二齿、秦假仙，四个武林搞笑组又要如何作怪。第一部霹雳的精彩好戏不容错过，想看史艳文所主导的新武林局势非看霹雳城不可。', '[{\"name\":\"霹雳布袋戏\",\"href\":\"/item/%E9%9C%B9%E9%9B%B3%E5%B8%83%E8%A2%8B%E6%88%8F/155118\",\"id\":\"155118\"},{\"name\":\"云州大儒侠\",\"href\":\"/item/%E4%BA%91%E5%B7%9E%E5%A4%A7%E5%84%92%E4%BE%A0\"},{\"name\":\"史艳文\",\"href\":\"/item/%E5%8F%B2%E8%89%B3%E6%96%87\"},{\"name\":\"史艳文\",\"href\":\"/item/%E5%8F%B2%E8%89%B3%E6%96%87/3996641\",\"id\":\"3996641\"},{\"name\":\"黑白郎君\",\"href\":\"/item/%E9%BB%91%E7%99%BD%E9%83%8E%E5%90%9B/10117949\",\"id\":\"10117949\"},{\"name\":\"南宫恨\",\"href\":\"/item/%E5%8D%97%E5%AE%AB%E6%81%A8/10131585\",\"id\":\"10131585\"},{\"name\":\"刘三\",\"href\":\"/item/%E5%88%98%E4%B8%89/6189315\",\"id\":\"6189315\"},{\"name\":\"怪老子\",\"href\":\"/item/%E6%80%AA%E8%80%81%E5%AD%90\"},{\"name\":\"秦假仙\",\"href\":\"/item/%E7%A7%A6%E5%81%87%E4%BB%99/7169049\",\"id\":\"7169049\"}]', 'https://baike.baidu.com/item/霹雳城/5552753', '', '155118');
INSERT INTO `baike_related_items_pili` VALUES ('6189315', 5, '刘三', 88, 1, '（金光布袋戏人物）', '', '刘三，金光布袋戏人物 。为人风趣幽默，很疼爱自己的妹妹刘萱姑。曾为了将妹妹嫁给江湖上赫赫有名的少年俊才史艳文，笑料百出。武功高深莫测，给人一种隐士高人之感。与二齿、怪老子为最早的三口组。', '[{\"name\":\"刘萱姑\",\"href\":\"/item/%E5%88%98%E8%90%B1%E5%A7%91/2597860\",\"id\":\"2597860\"},{\"name\":\"史艳文\",\"href\":\"/item/%E5%8F%B2%E8%89%B3%E6%96%87/3996641\",\"id\":\"3996641\"},{\"name\":\"怪老子\",\"href\":\"/item/%E6%80%AA%E8%80%81%E5%AD%90/15088108\",\"id\":\"15088108\"}]', 'https://baike.baidu.com/item/刘三/6189315', '', '1115740');
INSERT INTO `baike_related_items_pili` VALUES ('6228', 5, '舞蹈', 4111, 296, '（表演艺术）', '', '舞蹈是一种表演艺术，使用身体来完成各种优雅或高难度的动作，一般有音乐伴奏，以有节奏的动作为主要表现手段的艺术形式。它一般借助音乐，也借助其他的道具。舞蹈本身有多元的社会意义及作用，包括运动、社交/求偶、祭祀、礼仪等。在人类文明起源前，舞蹈在仪式，礼仪，庆典和娱乐方面都十分重要。中国在五千年以前就已经出现了舞蹈，它产生于奴隶社会，发展到秦汉之际已形成一定特色。', '[{\"name\":\"舞蹈\",\"href\":\"/item/%E8%88%9E%E8%B9%88/6228\",\"id\":\"6228\"},{\"name\":\"表演艺术\",\"href\":\"/item/%E8%A1%A8%E6%BC%94%E8%89%BA%E6%9C%AF/7803083\",\"id\":\"7803083\"},{\"name\":\"优雅\",\"href\":\"/item/%E4%BC%98%E9%9B%85/1591303\",\"id\":\"1591303\"},{\"name\":\"动作\",\"href\":\"/item/%E5%8A%A8%E4%BD%9C/33802\",\"id\":\"33802\"},{\"name\":\"运动\",\"href\":\"/item/%E8%BF%90%E5%8A%A8/522\",\"id\":\"522\"},{\"name\":\"祭祀\",\"href\":\"/item/%E7%A5%AD%E7%A5%80/646557\",\"id\":\"646557\"},{\"name\":\"礼仪\",\"href\":\"/item/%E7%A4%BC%E4%BB%AA/225\",\"id\":\"225\"},{\"name\":\"人类文明\",\"href\":\"/item/%E4%BA%BA%E7%B1%BB%E6%96%87%E6%98%8E/3533075\",\"id\":\"3533075\"},{\"name\":\"庆典\",\"href\":\"/item/%E5%BA%86%E5%85%B8/6767212\",\"id\":\"6767212\"},{\"name\":\"奴隶社会\",\"href\":\"/item/%E5%A5%B4%E9%9A%B6%E7%A4%BE%E4%BC%9A/551903\",\"id\":\"551903\"},{\"name\":\"秦汉之际\",\"href\":\"/item/%E7%A7%A6%E6%B1%89%E4%B9%8B%E9%99%85\"}]', 'https://baike.baidu.com/item/舞蹈/6228', '', '29000');
INSERT INTO `baike_related_items_pili` VALUES ('6294516', 5, '潮州府', 115, 9, '', '', '隋文帝开皇十一年（591年）改义安郡为潮州，潮汕地区因地临南海取“在潮之洲，潮水往复”之意，潮州名称始此[1] 。元代改潮州为潮州路总管府。明洪武二年（1369年），改潮州路为潮州府，潮州府是明清时期在广东省下辖的一个府。明代潮州府辖海阳、潮阳、揭阳、程乡、饶平、惠来、大埔、澄海、普宁、平远、镇平11县，程乡、平远、镇平3县聚居客家人，故聚居潮汕人的海阳、揭阳、潮阳、饶平（别称饶阳）、惠来（别称葵阳）、澄海（别称莲阳）、普宁（别称洪阳）、大埔（别称茶阳）8县合称潮州八邑。清承明制，仍称潮州府，仍领11县。清雍正十一年（1733年），原潮州府下辖的程乡县、平远县、镇平县3县与兴宁、长乐2县另设立嘉应州，合称“嘉应五属”。析出嘉应州后，潮州府共辖8县[1] 。清乾隆三年（1738年）析潮州府海阳县、揭阳县、大埔县三县地合置丰顺县后，潮州府共辖九县，大埔县聚居客家人，故潮州府下辖聚居潮汕人的海阳、潮阳、揭阳、饶平、普宁、惠来、澄海、丰顺8县合称潮州八邑。潮州八邑隶属潮州府，地理相连、历史相承、文化相同，故合称潮州八邑，非仅指现潮州市，是现潮汕三市（汕头、潮州、揭阳）和丰顺县。潮州府历代名称潮州，当代原来名称汕头市，1991年汕头市分置为今潮汕三市（汕头、潮州、揭阳），统称潮汕地区。', '[{\"name\":\"开皇\",\"href\":\"/item/%E5%BC%80%E7%9A%87\"},{\"name\":\"义安郡\",\"href\":\"/item/%E4%B9%89%E5%AE%89%E9%83%A1\"},{\"name\":\"潮汕地区\",\"href\":\"/item/%E6%BD%AE%E6%B1%95%E5%9C%B0%E5%8C%BA/389739\",\"id\":\"389739\"},{\"name\":\"潮州路\",\"href\":\"/item/%E6%BD%AE%E5%B7%9E%E8%B7%AF/7518290\",\"id\":\"7518290\"},{\"name\":\"洪武\",\"href\":\"/item/%E6%B4%AA%E6%AD%A6\"},{\"name\":\"潮州路\",\"href\":\"/item/%E6%BD%AE%E5%B7%9E%E8%B7%AF/7518290\",\"id\":\"7518290\"},{\"name\":\"客家人\",\"href\":\"/item/%E5%AE%A2%E5%AE%B6%E4%BA%BA\"},{\"name\":\"潮汕人\",\"href\":\"/item/%E6%BD%AE%E6%B1%95%E4%BA%BA/802038\",\"id\":\"802038\"},{\"name\":\"葵阳\",\"href\":\"/item/%E8%91%B5%E9%98%B3\"},{\"name\":\"洪阳\",\"href\":\"/item/%E6%B4%AA%E9%98%B3\"},{\"name\":\"潮州八邑\",\"href\":\"/item/%E6%BD%AE%E5%B7%9E%E5%85%AB%E9%82%91\"},{\"name\":\"清承明制\",\"href\":\"/item/%E6%B8%85%E6%89%BF%E6%98%8E%E5%88%B6\"},{\"name\":\"嘉应州\",\"href\":\"/item/%E5%98%89%E5%BA%94%E5%B7%9E\"},{\"name\":\"嘉应\",\"href\":\"/item/%E5%98%89%E5%BA%94\"},{\"name\":\"嘉应州\",\"href\":\"/item/%E5%98%89%E5%BA%94%E5%B7%9E\"},{\"name\":\"丰顺县\",\"href\":\"/item/%E4%B8%B0%E9%A1%BA%E5%8E%BF\"},{\"name\":\"客家人\",\"href\":\"/item/%E5%AE%A2%E5%AE%B6%E4%BA%BA\"},{\"name\":\"潮州八邑\",\"href\":\"/item/%E6%BD%AE%E5%B7%9E%E5%85%AB%E9%82%91\"},{\"name\":\"潮州八邑\",\"href\":\"/item/%E6%BD%AE%E5%B7%9E%E5%85%AB%E9%82%91/5877799\",\"id\":\"5877799\"},{\"name\":\"潮州\",\"href\":\"/item/%E6%BD%AE%E5%B7%9E/199502\",\"id\":\"199502\"},{\"name\":\"丰顺\",\"href\":\"/item/%E4%B8%B0%E9%A1%BA/965086\",\"id\":\"965086\"},{\"name\":\"潮汕三市\",\"href\":\"/item/%E6%BD%AE%E6%B1%95%E4%B8%89%E5%B8%82/10388082\",\"id\":\"10388082\"},{\"name\":\"潮汕地区\",\"href\":\"/item/%E6%BD%AE%E6%B1%95%E5%9C%B0%E5%8C%BA/389739\",\"id\":\"389739\"}]', 'https://baike.baidu.com/item/潮州府/6294516', '', '389739');
INSERT INTO `baike_related_items_pili` VALUES ('6392295', 4, '漳平', 449, 32, '', '', '漳平（古属漳州府漳平县，宁洋县），名取“邑居漳水上流、千山之中，此地独平”之意，位于福建省西南部，九龙江（北溪）上游，介于北纬24°54′-25°47′，东经117°11′-117°44′之间，地处闽西的东大门，东毗永春、安溪，南连华安、南靖，西邻新罗，北接永安、大田，外接厦门等闽南沿海发达地区，内联闽、粤、赣腹地。漳平于明成化七年（1471年）置县，1990年撤县建市。通行闽南方言漳州腔漳平话（部分地区如溪南新桥等接近泉州地区为泉腔）。[1]   2017年实现地区生产总值232.56亿元，比上年增长8.8%[2] ', '[{\"name\":\"漳州府\",\"href\":\"/item/%E6%BC%B3%E5%B7%9E%E5%BA%9C/9570098\",\"id\":\"9570098\"},{\"name\":\"漳平县\",\"href\":\"/item/%E6%BC%B3%E5%B9%B3%E5%8E%BF/852866\",\"id\":\"852866\"},{\"name\":\"宁洋县\",\"href\":\"/item/%E5%AE%81%E6%B4%8B%E5%8E%BF/4348895\",\"id\":\"4348895\"},{\"name\":\"九龙江\",\"href\":\"/item/%E4%B9%9D%E9%BE%99%E6%B1%9F/446324\",\"id\":\"446324\"},{\"name\":\"永春\",\"href\":\"/item/%E6%B0%B8%E6%98%A5/3501971\",\"id\":\"3501971\"},{\"name\":\"安溪\",\"href\":\"/item/%E5%AE%89%E6%BA%AA/874062\",\"id\":\"874062\"},{\"name\":\"华安\",\"href\":\"/item/%E5%8D%8E%E5%AE%89/790854\",\"id\":\"790854\"},{\"name\":\"南靖\",\"href\":\"/item/%E5%8D%97%E9%9D%96/791267\",\"id\":\"791267\"},{\"name\":\"新罗\",\"href\":\"/item/%E6%96%B0%E7%BD%97/684413\",\"id\":\"684413\"},{\"name\":\"永安\",\"href\":\"/item/%E6%B0%B8%E5%AE%89/47156\",\"id\":\"47156\"},{\"name\":\"大田\",\"href\":\"/item/%E5%A4%A7%E7%94%B0/8292\",\"id\":\"8292\"},{\"name\":\"漳州腔\",\"href\":\"/item/%E6%BC%B3%E5%B7%9E%E8%85%94/4191766\",\"id\":\"4191766\"}]', 'https://baike.baidu.com/item/漳平/6392295', '', '3487594');
INSERT INTO `baike_related_items_pili` VALUES ('6472365', 5, '皮克斯动画工作室', 517, 215, '', '', '皮克斯动画工作室，简称皮克斯，是一家专门制作电脑动画的公司。该公司目前位于美国加州的爱莫利维尔（Emeryville）市。该公司也发展尖端的电脑三维软件，包括有专为三维动画设计的软件：PRMan，使用该软件可做出如相片般拟真的三维景像。[1] 皮克斯的前身，是乔治·卢卡斯的电影公司的电脑动画部。1979年，由于《星球大战》电影大获成功，卢卡斯影业成立了电脑绘图部，雇请艾德文·卡特姆负责和其他技术人员一起设计电子编辑和特效系统。卡特姆后被认为是皮克斯的缔造者和纯电脑制作电影的发明人。1984年，刚刚离开迪士尼的约翰·拉赛特（John Lasseter）加入卢卡斯电脑动画部，成为后来皮克斯的重要人物，他是皮克斯创造力的驱动者。1986年，史蒂夫·乔布斯（Steve Jobs）以1000万美元收购了乔治·卢卡斯的电脑动画部，成立了皮克斯动画工作室。2006年，皮克斯被迪士尼以74亿美元收购，成为华特迪士尼公司的一部分。皮克斯公司自创立就引起了世人的注意。在他们于SIGGRAPH的首次公演会中，他们的动画短片赢得了大众的掌声。并且，他们的作品成为了电脑动画的经典。他们的动画被收录在电脑动画教学的教材里作参考。每年出品的皮克斯视频是奥斯卡奖的热门。', '[{\"name\":\"加州\",\"href\":\"/item/%E5%8A%A0%E5%B7%9E\"},{\"name\":\"爱莫利维尔\",\"href\":\"/item/%E7%88%B1%E8%8E%AB%E5%88%A9%E7%BB%B4%E5%B0%94/7634393\",\"id\":\"7634393\"},{\"name\":\"三维动画\",\"href\":\"/item/%E4%B8%89%E7%BB%B4%E5%8A%A8%E7%94%BB\"},{\"name\":\"乔治·卢卡斯\",\"href\":\"/item/%E4%B9%94%E6%B2%BB%C2%B7%E5%8D%A2%E5%8D%A1%E6%96%AF/450183\",\"id\":\"450183\"},{\"name\":\"卢卡斯影业\",\"href\":\"/item/%E5%8D%A2%E5%8D%A1%E6%96%AF%E5%BD%B1%E4%B8%9A/6361215\",\"id\":\"6361215\"},{\"name\":\"艾德文·卡特姆\",\"href\":\"/item/%E8%89%BE%E5%BE%B7%E6%96%87%C2%B7%E5%8D%A1%E7%89%B9%E5%A7%86/12612887\",\"id\":\"12612887\"},{\"name\":\"史蒂夫·乔布斯\",\"href\":\"/item/%E5%8F%B2%E8%92%82%E5%A4%AB%C2%B7%E4%B9%94%E5%B8%83%E6%96%AF/85300\",\"id\":\"85300\"},{\"name\":\"华特迪士尼公司\",\"href\":\"/item/%E5%8D%8E%E7%89%B9%E8%BF%AA%E5%A3%AB%E5%B0%BC%E5%85%AC%E5%8F%B8/1451772\",\"id\":\"1451772\"},{\"name\":\"SIGGRAPH\",\"href\":\"/item/SIGGRAPH\"},{\"name\":\"奥斯卡奖\",\"href\":\"/item/%E5%A5%A5%E6%96%AF%E5%8D%A1%E5%A5%96/184354\",\"id\":\"184354\"}]', 'https://baike.baidu.com/item/皮克斯动画工作室/6472365', '', '35533');
INSERT INTO `baike_related_items_pili` VALUES ('66475', 4, '福建', 1656, 691, '', '', '福建，简称“闽”，是中华人民共和国省级行政区。省会福州，位于中国东南沿海，东北与浙江毗邻，西北与江西接界，西南与广东相连，东南隔台湾海峡与台湾相望，福建省陆地总面积12.14万平方千米。[1] 福建地势呈“依山傍海”态势，地势西北高，东南低，境内山地、丘陵面积约占全省总面积的90%；地跨闽江、晋江、九龙江、汀江四大水系，属亚热带季风气候。[2] 截至2017年底，福建省下辖9个省辖市，12个县级市，44个县，29个市辖区。[3-4] 截至2017年末，福建省常住人口3911万人，实现地区生产总值（GDP）32298.28亿元，第一产业2442.44亿元，第二产业15770.32亿元，第三产业增加值14085.52亿元，人均地区生产总值实现82976元。[5] ', '[{\"name\":\"闽\",\"href\":\"/item/%E9%97%BD/66475\",\"id\":\"66475\"},{\"name\":\"中华人民共和国\",\"href\":\"/item/%E4%B8%AD%E5%8D%8E%E4%BA%BA%E6%B0%91%E5%85%B1%E5%92%8C%E5%9B%BD/106554\",\"id\":\"106554\"},{\"name\":\"福州\",\"href\":\"/item/%E7%A6%8F%E5%B7%9E/165311\",\"id\":\"165311\"},{\"name\":\"浙江\",\"href\":\"/item/%E6%B5%99%E6%B1%9F/154399\",\"id\":\"154399\"},{\"name\":\"江西\",\"href\":\"/item/%E6%B1%9F%E8%A5%BF/215383\",\"id\":\"215383\"},{\"name\":\"广东\",\"href\":\"/item/%E5%B9%BF%E4%B8%9C/207811\",\"id\":\"207811\"},{\"name\":\"台湾海峡\",\"href\":\"/item/%E5%8F%B0%E6%B9%BE%E6%B5%B7%E5%B3%A1/25347\",\"id\":\"25347\"},{\"name\":\"台湾\",\"href\":\"/item/%E5%8F%B0%E6%B9%BE/122340\",\"id\":\"122340\"},{\"name\":\"闽江\",\"href\":\"/item/%E9%97%BD%E6%B1%9F/497041\",\"id\":\"497041\"},{\"name\":\"晋江\",\"href\":\"/item/%E6%99%8B%E6%B1%9F/1254263\",\"id\":\"1254263\"},{\"name\":\"九龙江\",\"href\":\"/item/%E4%B9%9D%E9%BE%99%E6%B1%9F/446324\",\"id\":\"446324\"},{\"name\":\"汀江\",\"href\":\"/item/%E6%B1%80%E6%B1%9F/12638959\",\"id\":\"12638959\"}]', 'https://baike.baidu.com/item/闽/66475', '', '');
INSERT INTO `baike_related_items_pili` VALUES ('6661323', 5, '榕', 183, 8, '', '', '榕，木名。――《玉篇》一种常绿乔木 [banyan],树干分枝多，枝上又长出许多气生根，其向下长入土中形成一支柱，树冠大，叶互生，椭圆形或卵形，花黄色或淡红色，果实倒卵形，黄色或赤褐色。榕，也是当今福建省 “福州市” 的简称。[1] ', '[{\"name\":\"常绿乔木\",\"href\":\"/item/%E5%B8%B8%E7%BB%BF%E4%B9%94%E6%9C%A8/5202575\",\"id\":\"5202575\"},{\"name\":\"气生根\",\"href\":\"/item/%E6%B0%94%E7%94%9F%E6%A0%B9/542567\",\"id\":\"542567\"},{\"name\":\"叶互生\",\"href\":\"/item/%E5%8F%B6%E4%BA%92%E7%94%9F/12718389\",\"id\":\"12718389\"},{\"name\":\"福州市\",\"href\":\"/item/%E7%A6%8F%E5%B7%9E%E5%B8%82\"}]', 'https://baike.baidu.com/item/榕/6661323', '', '165311');
INSERT INTO `baike_related_items_pili` VALUES ('6852509', 5, '海峡西岸经济区', 1381, 30, '', '', '海峡西岸经济区，简称“海西经济区”，是指台湾海峡西岸，以福建为主体包括周边地区，南北与珠三角、长三角两个经济区衔接，东与台湾 岛、西与江西、浙江的广大内陆腹地贯通，具有对台工作、统一祖国，并进一步带动全国经济走向世界的特点和独特优势的地域经济综合体。它是一个涵盖经济、政治、文化、社会等各个领域的综合性概念，总的目标任务是“对外开放、协调发展、全面繁荣”，基本要求是经济一体化、投资贸易自由化、宏观政策统一化、产业高级化、区域城镇化、社会文明化。', '[{\"name\":\"海西经济区\",\"href\":\"/item/%E6%B5%B7%E8%A5%BF%E7%BB%8F%E6%B5%8E%E5%8C%BA/4925042\",\"id\":\"4925042\"},{\"name\":\"台湾海峡\",\"href\":\"/item/%E5%8F%B0%E6%B9%BE%E6%B5%B7%E5%B3%A1\"},{\"name\":\"福建\",\"href\":\"/item/%E7%A6%8F%E5%BB%BA/132090\",\"id\":\"132090\"},{\"name\":\"珠三角\",\"href\":\"/item/%E7%8F%A0%E4%B8%89%E8%A7%92/5140424\",\"id\":\"5140424\"},{\"name\":\"长三角\",\"href\":\"/item/%E9%95%BF%E4%B8%89%E8%A7%92/3288923\",\"id\":\"3288923\"},{\"name\":\"地域经济综合体\",\"href\":\"/item/%E5%9C%B0%E5%9F%9F%E7%BB%8F%E6%B5%8E%E7%BB%BC%E5%90%88%E4%BD%93/9836600\",\"id\":\"9836600\"},{\"name\":\"政治\",\"href\":\"/item/%E6%94%BF%E6%B2%BB/169778\",\"id\":\"169778\"},{\"name\":\"对外开放\",\"href\":\"/item/%E5%AF%B9%E5%A4%96%E5%BC%80%E6%94%BE/11045958\",\"id\":\"11045958\"},{\"name\":\"协调发展\",\"href\":\"/item/%E5%8D%8F%E8%B0%83%E5%8F%91%E5%B1%95/3202451\",\"id\":\"3202451\"},{\"name\":\"经济一体化\",\"href\":\"/item/%E7%BB%8F%E6%B5%8E%E4%B8%80%E4%BD%93%E5%8C%96/3167608\",\"id\":\"3167608\"},{\"name\":\"城镇化\",\"href\":\"/item/%E5%9F%8E%E9%95%87%E5%8C%96/7810544\",\"id\":\"7810544\"}]', 'https://baike.baidu.com/item/海峡西岸经济区/6852509', '', '165311');
INSERT INTO `baike_related_items_pili` VALUES ('72744', 5, '语言', 3486, 181, '（人类交际工具）', '', '语言即传递信息的声音。是人类最重要的交际工具，是人们进行沟通的主要表达方式。人们借助语言保存和传递人类文明的成果。语言是民族的重要特征之一。一般来说，各个民族都有自己的语言。汉语，法语，俄语，西班牙语，阿拉伯语，英语是世界上的主要语言，也是联合国的工作语言。汉语是世界上使用人口最多的语言，汉语和英语是世界上使用最广泛的语言。据德国出版的《语言学及语言交际工具问题手册》，现在世界上查明的有5651种语言。在这些语言中，有1400多种还没有被人们承认是独立的语言，或者是正在衰亡的语言。语言是人们交流思想的媒介，它必然会对政治、经济和社会、科技乃至文化本身产生影响。语言这种文化现象是不断发展的，其现今的空间分布也是过去发展的结果。根据其语音、语法和词汇等方面特征的共同之处与起源关系，把世界上的语言分成语系。每个语系包括有数量不等的语种，这些语系与语种在地域上都有一定的分布区，很多文化特征都与此有密切的关系。语言是由词汇按一定的语法所构成的复杂的符号系统，它包括语音系统、词汇系统和语法系统。语言是人类所特有的交际工具，随着人类社会而产生和发展。语言是人群体（G）内可通用的共识标记（Mk）与共识记忆（Mm）相交的部分。每个在某人群（G1）学习成长的人可拥有该群体内可通用的共识标记与共识记忆相交的部分;当遭遇别的人群体（G2）内可通用的共识标记时，常短暂建立与某G1共识记忆相交的部分替代应有的G2共识记忆部分。', '[{\"name\":\"人类\",\"href\":\"/item/%E4%BA%BA%E7%B1%BB/31910\",\"id\":\"31910\"},{\"name\":\"重要\",\"href\":\"/item/%E9%87%8D%E8%A6%81/9154462\",\"id\":\"9154462\"},{\"name\":\"交际工具\",\"href\":\"/item/%E4%BA%A4%E9%99%85%E5%B7%A5%E5%85%B7/6139852\",\"id\":\"6139852\"},{\"name\":\"沟通\",\"href\":\"/item/%E6%B2%9F%E9%80%9A/81026\",\"id\":\"81026\"},{\"name\":\"表达方式\",\"href\":\"/item/%E8%A1%A8%E8%BE%BE%E6%96%B9%E5%BC%8F/516081\",\"id\":\"516081\"},{\"name\":\"人类文明\",\"href\":\"/item/%E4%BA%BA%E7%B1%BB%E6%96%87%E6%98%8E/3533075\",\"id\":\"3533075\"},{\"name\":\"民族\",\"href\":\"/item/%E6%B0%91%E6%97%8F/665\",\"id\":\"665\"},{\"name\":\"民族\",\"href\":\"/item/%E6%B0%91%E6%97%8F/665\",\"id\":\"665\"},{\"name\":\"汉语\",\"href\":\"/item/%E6%B1%89%E8%AF%AD/114218\",\"id\":\"114218\"},{\"name\":\"法语\",\"href\":\"/item/%E6%B3%95%E8%AF%AD/660115\",\"id\":\"660115\"},{\"name\":\"俄语\",\"href\":\"/item/%E4%BF%84%E8%AF%AD/315852\",\"id\":\"315852\"},{\"name\":\"西班牙语\",\"href\":\"/item/%E8%A5%BF%E7%8F%AD%E7%89%99%E8%AF%AD/398390\",\"id\":\"398390\"},{\"name\":\"阿拉伯语\",\"href\":\"/item/%E9%98%BF%E6%8B%89%E4%BC%AF%E8%AF%AD/450547\",\"id\":\"450547\"},{\"name\":\"英语\",\"href\":\"/item/%E8%8B%B1%E8%AF%AD/109997\",\"id\":\"109997\"},{\"name\":\"汉语\",\"href\":\"/item/%E6%B1%89%E8%AF%AD/22488993\",\"id\":\"22488993\"},{\"name\":\"英语\",\"href\":\"/item/%E8%8B%B1%E8%AF%AD/109997\",\"id\":\"109997\"},{\"name\":\"语言学\",\"href\":\"/item/%E8%AF%AD%E8%A8%80%E5%AD%A6/3632\",\"id\":\"3632\"},{\"name\":\"语言交际\",\"href\":\"/item/%E8%AF%AD%E8%A8%80%E4%BA%A4%E9%99%85\"},{\"name\":\"交流\",\"href\":\"/item/%E4%BA%A4%E6%B5%81/2700357\",\"id\":\"2700357\"},{\"name\":\"媒介\",\"href\":\"/item/%E5%AA%92%E4%BB%8B/5378050\",\"id\":\"5378050\"},{\"name\":\"文化现象\",\"href\":\"/item/%E6%96%87%E5%8C%96%E7%8E%B0%E8%B1%A1/8502215\",\"id\":\"8502215\"},{\"name\":\"语音\",\"href\":\"/item/%E8%AF%AD%E9%9F%B3/6140117\",\"id\":\"6140117\"},{\"name\":\"语法\",\"href\":\"/item/%E8%AF%AD%E6%B3%95/2447258\",\"id\":\"2447258\"},{\"name\":\"词汇\",\"href\":\"/item/%E8%AF%8D%E6%B1%87/1890163\",\"id\":\"1890163\"},{\"name\":\"语种\",\"href\":\"/item/%E8%AF%AD%E7%A7%8D/1762396\",\"id\":\"1762396\"},{\"name\":\"语系\",\"href\":\"/item/%E8%AF%AD%E7%B3%BB/1218915\",\"id\":\"1218915\"},{\"name\":\"语种\",\"href\":\"/item/%E8%AF%AD%E7%A7%8D/1762396\",\"id\":\"1762396\"},{\"name\":\"地域\",\"href\":\"/item/%E5%9C%B0%E5%9F%9F/4437973\",\"id\":\"4437973\"}]', 'https://baike.baidu.com/item/语言/72744', '', '29000');
INSERT INTO `baike_related_items_pili` VALUES ('76900', 4, '木偶戏', 651, 61, '（国家级非物质文化遗产）', '', '木偶戏是用木偶来表演故事的戏剧。中国传统艺术之一，在中国古代又称傀儡戏。中国木偶戏历史悠久，普遍的观点是：\"源于汉，兴于唐\"。三国时已有偶人可进行杂技表演，隋代则开始用偶人表演故事。表演时，演员在幕后一边操纵木偶，一边演唱，并配以音乐。根据木偶形体和操纵技术的不同，有布袋木偶、提线木偶、杖头木偶、铁线木偶等。 木偶戏是由演员在幕后操纵木制玩偶进行表演的戏剧形式。[1] 2006年5月20日，木偶戏经国务院批准列入第一批国家级非物质文化遗产名录。[2] ', '[{\"name\":\"木偶戏\",\"href\":\"/item/%E6%9C%A8%E5%81%B6%E6%88%8F/76900\",\"id\":\"76900\"},{\"name\":\"木偶\",\"href\":\"/item/%E6%9C%A8%E5%81%B6/81773\",\"id\":\"81773\"},{\"name\":\"表演\",\"href\":\"/item/%E8%A1%A8%E6%BC%94/4356872\",\"id\":\"4356872\"},{\"name\":\"戏剧\",\"href\":\"/item/%E6%88%8F%E5%89%A7/29000\",\"id\":\"29000\"},{\"name\":\"傀儡戏\",\"href\":\"/item/%E5%82%80%E5%84%A1%E6%88%8F/1731341\",\"id\":\"1731341\"},{\"name\":\"杂技\",\"href\":\"/item/%E6%9D%82%E6%8A%80\"},{\"name\":\"隋代\",\"href\":\"/item/%E9%9A%8B%E4%BB%A3/9860135\",\"id\":\"9860135\"},{\"name\":\"木偶\",\"href\":\"/item/%E6%9C%A8%E5%81%B6/81773\",\"id\":\"81773\"},{\"name\":\"国务院\",\"href\":\"/item/%E5%9B%BD%E5%8A%A1%E9%99%A2/343590\",\"id\":\"343590\"},{\"name\":\"批准\",\"href\":\"/item/%E6%89%B9%E5%87%86\"},{\"name\":\"国家级非物质文化遗产名录\",\"href\":\"/item/%E5%9B%BD%E5%AE%B6%E7%BA%A7%E9%9D%9E%E7%89%A9%E8%B4%A8%E6%96%87%E5%8C%96%E9%81%97%E4%BA%A7%E5%90%8D%E5%BD%95\"}]', 'https://baike.baidu.com/item/木偶戏/76900', '', '3703499');
INSERT INTO `baike_related_items_pili` VALUES ('798909', 5, '东北电影制片厂', 90, 17, '', '', '1946年10月1日，东北电影制片厂成立，袁牧之任厂长。 “东影”除影片生产外，在培养人才和干部方面做了大量工作，举办过三期电影培训班。并对电影厂的分工、机构、部门进行调整、增补，制定了科学的管理。为今后在全国范围领导管理电影生产取得了经验。在制片生产上，坚持为工农兵服务的方向，把电影看成是打击敌人、消灭敌人、团结人民、教育人民的工具，并确立了以生产新闻纪录电影为主的制片方针，以配合当时决定中国命运的国共内战。[1] ', '[{\"name\":\"袁牧之\",\"href\":\"/item/%E8%A2%81%E7%89%A7%E4%B9%8B/2796946\",\"id\":\"2796946\"}]', 'https://baike.baidu.com/item/东北电影制片厂/798909', '', '3528980');
INSERT INTO `baike_related_items_pili` VALUES ('81773', 4, '木偶', 1466, 96, '（汉语词汇）', '', '木偶是一个汉语词汇，读音为mù ǒu，古代叫傀儡、魁儡子、窟儡子。指 木刻偶像。用木头雕刻的人像或者形似其他生物的小东西， 常用来形容痴呆的神情。用它来表演的戏剧叫木偶戏，也叫傀儡戏。', '[{\"name\":\"木偶戏\",\"href\":\"/item/%E6%9C%A8%E5%81%B6%E6%88%8F/76900\",\"id\":\"76900\"}]', 'https://baike.baidu.com/item/木偶/81773', '', '');
INSERT INTO `baike_related_items_pili` VALUES ('83', 5, '忆无心', 10940, 3124, '', '', '金光布袋戏虚拟人物。绰号「石头仔」，为女暴君姚明月与藏镜人之女，婴儿时期即被女暴君遗弃，机缘下被叹悲欢捡回灵界，心性善良单纯、通情达理，却又带点倔强。身负异能，能与石头进行交流，甚至能操控石头。曾因身世之故，引起若干风波，因与白狼、黑龙的友情，投射在黑白郎君身上，进而产生交集。后加入苗疆祭祀台，在大祭司步天踪死后继任苗疆大祭司一职，是苗疆有史以来最年轻的大祭司。[1] 天下风云碑再开之时，留名天下第一术。', '[{\"name\":\"女暴君\",\"href\":\"/item/%E5%A5%B3%E6%9A%B4%E5%90%9B/10250746\",\"id\":\"10250746\"},{\"name\":\"藏镜人\",\"href\":\"/item/%E8%97%8F%E9%95%9C%E4%BA%BA/10746401\",\"id\":\"10746401\"},{\"name\":\"女暴君\",\"href\":\"/item/%E5%A5%B3%E6%9A%B4%E5%90%9B\"},{\"name\":\"叹悲欢\",\"href\":\"/item/%E5%8F%B9%E6%82%B2%E6%AC%A2\"},{\"name\":\"白狼\",\"href\":\"/item/%E7%99%BD%E7%8B%BC/12707495\",\"id\":\"12707495\"},{\"name\":\"黑龙\",\"href\":\"/item/%E9%BB%91%E9%BE%99/12706453\",\"id\":\"12706453\"},{\"name\":\"黑白郎君\",\"href\":\"/item/%E9%BB%91%E7%99%BD%E9%83%8E%E5%90%9B/10117949\",\"id\":\"10117949\"},{\"name\":\"步天踪\",\"href\":\"/item/%E6%AD%A5%E5%A4%A9%E8%B8%AA/22334228\",\"id\":\"22334228\"},{\"name\":\"苗疆\",\"href\":\"/item/%E8%8B%97%E7%96%86/13002926\",\"id\":\"13002926\"},{\"name\":\"天下风云碑\",\"href\":\"/item/%E5%A4%A9%E4%B8%8B%E9%A3%8E%E4%BA%91%E7%A2%91/19411232\",\"id\":\"19411232\"}]', 'https://baike.baidu.com/item/忆无心', '', '10746401');
INSERT INTO `baike_related_items_pili` VALUES ('8459988', 5, '骄傲的将军', 267, 52, '', '', '《骄傲的将军》是由上海美术电影制片厂1956年推出的作品。导演是特伟和李克弱，钱家骏担任总设计，漫画家华君武担任编剧[1] 。该片为了“探民族形式之路，敲喜剧风格之门”，借鉴京剧脸谱艺术，讲述了一位得胜归来的将军骄傲自满，荒废武艺兵法，最后被敌人活捉的故事[2-3] 。', '[{\"name\":\"上海美术电影制片厂\",\"href\":\"/item/%E4%B8%8A%E6%B5%B7%E7%BE%8E%E6%9C%AF%E7%94%B5%E5%BD%B1%E5%88%B6%E7%89%87%E5%8E%82/3528980\",\"id\":\"3528980\"},{\"name\":\"特伟\",\"href\":\"/item/%E7%89%B9%E4%BC%9F/304154\",\"id\":\"304154\"},{\"name\":\"李克弱\",\"href\":\"/item/%E6%9D%8E%E5%85%8B%E5%BC%B1/3918784\",\"id\":\"3918784\"},{\"name\":\"钱家骏\",\"href\":\"/item/%E9%92%B1%E5%AE%B6%E9%AA%8F/4097845\",\"id\":\"4097845\"},{\"name\":\"华君武\",\"href\":\"/item/%E5%8D%8E%E5%90%9B%E6%AD%A6/401877\",\"id\":\"401877\"}]', 'https://baike.baidu.com/item/骄傲的将军/8459988', '', '3528980');
INSERT INTO `baike_related_items_pili` VALUES ('848658', 3, '素还真', 3685, 201, '（《霹雳布袋戏》的虚拟人物）', '', '霹雳布袋戏虚拟人物，首席男主角，2001年-2018年连续十八年荣获霹雳人气票选排行榜第一名，是当之无愧的霹雳一哥。诗号：半神半圣亦半仙，全儒全道是全贤，脑中真书藏万卷，掌握文武半边天。霹雳化身最多的首席男主角，温文儒雅、器宇轩昂、超凡脱俗、武学莫测高深、足智多谋、博学多才、谦虚有礼，处世圆融冷静、慈悲亲和、关怀众生；以武林和平、天下大同为己任，“谋为天下谋、利为天下利” - 无我、无为！为武林风尘默默承受一切，多次以绝顶智慧化解灾厄，置之死地而后生，为天下苍生应现各种精彩玄奇的身份！幽默风趣的随机教化，难舍能舍、忍辱负重、不惧毁谤、无怨无悔，默默付出，不遗余力、不求回报，真乃具足大慈悲与大智慧的凡圣一体，反璞归真“素还真”。[1] ', '[{\"name\":\"霹雳布袋戏\",\"href\":\"/item/%E9%9C%B9%E9%9B%B3%E5%B8%83%E8%A2%8B%E6%88%8F/155118\",\"id\":\"155118\"}]', 'https://baike.baidu.com/item/素还真/848658', '', '1987744');
INSERT INTO `baike_related_items_pili` VALUES ('852866', 5, '漳平', 21, 2, '', '', '漳平（古属漳州府漳平县，宁洋县），名取“邑居漳水上流、千山之中，此地独平”之意，位于福建省西南部，九龙江（北溪）上游，介于北纬24°54′-25°47′，东经117°11′-117°44′之间，地处闽西的东大门，东毗永春、安溪，南连华安、南靖，西邻新罗，北接永安、大田，外接厦门等闽南沿海发达地区，内联闽、粤、赣腹地。漳平于明成化七年（1471年）置县，1990年撤县建市。通行闽南方言漳州腔漳平话（部分地区如溪南新桥等接近泉州地区为泉腔）。[1]   2017年实现地区生产总值232.56亿元，比上年增长8.8%[2] ', '[{\"name\":\"漳州府\",\"href\":\"/item/%E6%BC%B3%E5%B7%9E%E5%BA%9C/9570098\",\"id\":\"9570098\"},{\"name\":\"漳平县\",\"href\":\"/item/%E6%BC%B3%E5%B9%B3%E5%8E%BF/852866\",\"id\":\"852866\"},{\"name\":\"宁洋县\",\"href\":\"/item/%E5%AE%81%E6%B4%8B%E5%8E%BF/4348895\",\"id\":\"4348895\"},{\"name\":\"九龙江\",\"href\":\"/item/%E4%B9%9D%E9%BE%99%E6%B1%9F/446324\",\"id\":\"446324\"},{\"name\":\"永春\",\"href\":\"/item/%E6%B0%B8%E6%98%A5/3501971\",\"id\":\"3501971\"},{\"name\":\"安溪\",\"href\":\"/item/%E5%AE%89%E6%BA%AA/874062\",\"id\":\"874062\"},{\"name\":\"华安\",\"href\":\"/item/%E5%8D%8E%E5%AE%89/790854\",\"id\":\"790854\"},{\"name\":\"南靖\",\"href\":\"/item/%E5%8D%97%E9%9D%96/791267\",\"id\":\"791267\"},{\"name\":\"新罗\",\"href\":\"/item/%E6%96%B0%E7%BD%97/684413\",\"id\":\"684413\"},{\"name\":\"永安\",\"href\":\"/item/%E6%B0%B8%E5%AE%89/47156\",\"id\":\"47156\"},{\"name\":\"大田\",\"href\":\"/item/%E5%A4%A7%E7%94%B0/8292\",\"id\":\"8292\"},{\"name\":\"漳州腔\",\"href\":\"/item/%E6%BC%B3%E5%B7%9E%E8%85%94/4191766\",\"id\":\"4191766\"}]', 'https://baike.baidu.com/item/漳平县/852866', '', '6392295');
INSERT INTO `baike_related_items_pili` VALUES ('87', 3, '史艳文', 2502, 462, '', '', '史艳文，金光布袋戏虚拟人物，是金光系列里的第一主角，是台湾布袋戏的灵魂人物。太阳星转世，背部刻有四字“纯忠报国”。[1] 人称云州大儒侠、玉圣人，中原武林的中流砥柱。甲子名人帖上，与藏镜人并列天下第一掌，[2] 其纯阳功体独霸武林。史艳文乃是温文儒雅、饱读诗书的儒家君子。虽多情但不滥情、风雅而不风流，个性内敛持重、气质出众、风度翩翩。因其品行高洁、君子端方，世称“史君子”、“史贤人”。修养与包容力过人，仁德处世，对于一些“尚可救药”的歹人，往往会网开一面。为此，史艳文甚至不惜牺牲自身利益，无怨无悔地奔走跋涉。[3] 但若忍无可忍，则会一反和平处事的理念，以暴制暴。长年带领群侠抵御苗疆的入侵，与世仇苗疆战神藏镜人作战多年。[4] 被西剑流囚禁五年期间，酷刑加身仍不屈不挠。[5] 后联手藏镜人三战炎魔幻十郎，协助默苍离抵挡魔世入侵中原。与次子戮世摩罗一战后失踪。[6] 数年后从魔世归来，救下元邪皇刀下的长子俏如来以及众人，[7] 成为对抗元邪皇不可或缺的战力。诗号1：回忆迷惘杀戮多，往事情仇待如何。绢写黑诗无限恨，夙兴夜寐枉徒劳。诗号2：乾坤乙定不休功，卦卜将来绝对空。蹙额连思兼叹息，徒然命运不亨通。[8] ', '[{\"name\":\"金光布袋戏\",\"href\":\"/item/%E9%87%91%E5%85%89%E5%B8%83%E8%A2%8B%E6%88%8F/8712638\",\"id\":\"8712638\"},{\"name\":\"台湾布袋戏\",\"href\":\"/item/%E5%8F%B0%E6%B9%BE%E5%B8%83%E8%A2%8B%E6%88%8F/5872657\",\"id\":\"5872657\"},{\"name\":\"中原\",\"href\":\"/item/%E4%B8%AD%E5%8E%9F/22349174\",\"id\":\"22349174\"},{\"name\":\"藏镜人\",\"href\":\"/item/%E8%97%8F%E9%95%9C%E4%BA%BA/10746401\",\"id\":\"10746401\"},{\"name\":\"苗疆\",\"href\":\"/item/%E8%8B%97%E7%96%86/13002926\",\"id\":\"13002926\"},{\"name\":\"西剑流\",\"href\":\"/item/%E8%A5%BF%E5%89%91%E6%B5%81/3764261\",\"id\":\"3764261\"},{\"name\":\"炎魔幻十郎\",\"href\":\"/item/%E7%82%8E%E9%AD%94%E5%B9%BB%E5%8D%81%E9%83%8E/10546277\",\"id\":\"10546277\"},{\"name\":\"默苍离\",\"href\":\"/item/%E9%BB%98%E8%8B%8D%E7%A6%BB/1984552\",\"id\":\"1984552\"},{\"name\":\"魔世\",\"href\":\"/item/%E9%AD%94%E4%B8%96/12809784\",\"id\":\"12809784\"},{\"name\":\"戮世摩罗\",\"href\":\"/item/%E6%88%AE%E4%B8%96%E6%91%A9%E7%BD%97/12009516\",\"id\":\"12009516\"},{\"name\":\"元邪皇\",\"href\":\"/item/%E5%85%83%E9%82%AA%E7%9A%87/16762525\",\"id\":\"16762525\"},{\"name\":\"俏如来\",\"href\":\"/item/%E4%BF%8F%E5%A6%82%E6%9D%A5/5061430\",\"id\":\"5061430\"}]', 'https://baike.baidu.com/item/史艳文', '', '5552753');
INSERT INTO `baike_related_items_pili` VALUES ('8712638', 4, '金光布袋戏', 848, 64, '', '', '黄俊雄布袋戏又称之金光系列，因为1950至1970时的布袋戏主流。以声音道具等奇关变景吸引观众的表演形态，被称之为「金光戏」，也就是开始舍弃传统掌中戏偶，而改以较大的戏偶来表演，此一时期的变革给了布袋戏的一个转变契机，后来黄俊雄大师把金光戏的表演型态搬上电视舞台，也就是1970年，云州大儒侠史艳文的故事，后于1994年，黄俊雄大师重新开拍云州大儒侠系列故事时，因为感怀1970年的「金光戏变革」，故把自己旗下的布袋戏事业，称为金光布袋戏。如今经营公司的是黄立纲的金光多媒体。主要剧集《黑白龙狼传》《天地风云录之决战时刻》开始的新金光布袋戏至今。', '[{\"name\":\"黄俊雄\",\"href\":\"/item/%E9%BB%84%E4%BF%8A%E9%9B%84/24888\",\"id\":\"24888\"},{\"name\":\"布袋戏\",\"href\":\"/item/%E5%B8%83%E8%A2%8B%E6%88%8F/304743\",\"id\":\"304743\"},{\"name\":\"布袋戏\",\"href\":\"/item/%E5%B8%83%E8%A2%8B%E6%88%8F/304743\",\"id\":\"304743\"},{\"name\":\"掌中戏\",\"href\":\"/item/%E6%8E%8C%E4%B8%AD%E6%88%8F/3703499\",\"id\":\"3703499\"},{\"name\":\"布袋戏\",\"href\":\"/item/%E5%B8%83%E8%A2%8B%E6%88%8F/304743\",\"id\":\"304743\"},{\"name\":\"黄俊雄\",\"href\":\"/item/%E9%BB%84%E4%BF%8A%E9%9B%84/24888\",\"id\":\"24888\"},{\"name\":\"云州大儒侠\",\"href\":\"/item/%E4%BA%91%E5%B7%9E%E5%A4%A7%E5%84%92%E4%BE%A0\"},{\"name\":\"史艳文\",\"href\":\"/item/%E5%8F%B2%E8%89%B3%E6%96%87/3996641\",\"id\":\"3996641\"},{\"name\":\"黄俊雄\",\"href\":\"/item/%E9%BB%84%E4%BF%8A%E9%9B%84/24888\",\"id\":\"24888\"},{\"name\":\"云州大儒侠\",\"href\":\"/item/%E4%BA%91%E5%B7%9E%E5%A4%A7%E5%84%92%E4%BE%A0/19906550\",\"id\":\"19906550\"},{\"name\":\"布袋戏\",\"href\":\"/item/%E5%B8%83%E8%A2%8B%E6%88%8F/304743\",\"id\":\"304743\"},{\"name\":\"布袋戏\",\"href\":\"/item/%E5%B8%83%E8%A2%8B%E6%88%8F/304743\",\"id\":\"304743\"},{\"name\":\"黄立纲\",\"href\":\"/item/%E9%BB%84%E7%AB%8B%E7%BA%B2/1771324\",\"id\":\"1771324\"},{\"name\":\"黑白龙狼传\",\"href\":\"/item/%E9%BB%91%E7%99%BD%E9%BE%99%E7%8B%BC%E4%BC%A0/2881938\",\"id\":\"2881938\"},{\"name\":\"天地风云录之决战时刻\",\"href\":\"/item/%E5%A4%A9%E5%9C%B0%E9%A3%8E%E4%BA%91%E5%BD%95%E4%B9%8B%E5%86%B3%E6%88%98%E6%97%B6%E5%88%BB/8552915\",\"id\":\"8552915\"}]', 'https://baike.baidu.com/item/金光布袋戏/8712638', '', '87');
INSERT INTO `baike_related_items_pili` VALUES ('8961659', 5, '乐曲', 482, 5, '', '', '乐曲，或称音乐，广义而言可以指任何一种艺术的、令人愉快的、审慎的或其他什么方式排列起来的声音。音乐的定义仍存在着激烈的争议，但通常可以解释为一系列对于有声、无声具有时间性的组织，并含有不同音阶的节奏、旋律及和声。', '[{\"name\":\"音乐\",\"href\":\"/item/%E9%9F%B3%E4%B9%90/61907\",\"id\":\"61907\"},{\"name\":\"音阶\",\"href\":\"/item/%E9%9F%B3%E9%98%B6/135355\",\"id\":\"135355\"}]', 'https://baike.baidu.com/item/乐曲/8961659', '', '4356872');
INSERT INTO `baike_related_items_pili` VALUES ('898720', 5, '云州大儒侠', 174, 45, '', '台湾', '《千禧云州大儒侠史艳文》于2000年在台视播出，总共50集。香港亚洲电视台（ATV）曾配音粤语版本《大儒侠史艳文》。该片于2000年播出。', '[{\"name\":\"大儒侠史艳文\",\"href\":\"/item/%E5%A4%A7%E5%84%92%E4%BE%A0%E5%8F%B2%E8%89%B3%E6%96%87/1115740\",\"id\":\"1115740\"}]', 'https://baike.baidu.com/item/云州大儒侠/898720', '', '1115740');
INSERT INTO `baike_related_items_pili` VALUES ('9061342', 5, '莆仙话', 113, 7, '', '', '莆仙话，属汉藏语系汉语族闽语的分支，又称兴化语、兴化话、莆仙语，是分布于福建沿海中部的地方语言，使用人口约500万，部分有对应的文字。当地人又称之为本地话，莆田县所讲本地话称为莆田话，仙游县所讲本地话称为仙游话。莆仙话分布于兴化府莆田县（今莆田市荔城区、涵江区、城厢区、秀屿区、乌丘屿）、仙游县全境，泉州府惠安县（泉港区）北部地区，福州府福清县、永泰县的南部地区，上述地区在宋代兴化军成立时即归属于兴化府管辖。因历史上该地区属于兴化军、兴安州、兴化府，故莆仙话又称为兴化话。莆仙话，可划分为两种，一种是以莆田县城荔城话为代表的莆田话，一种是以仙游县城鲤城话为代表的仙游话。以莆仙话为载体的非物质文化遗产有莆仙戏和莆仙木偶戏等。莆仙话属汉语族闽语群。', '[{\"name\":\"汉藏语系\",\"href\":\"/item/%E6%B1%89%E8%97%8F%E8%AF%AD%E7%B3%BB/364341\",\"id\":\"364341\"},{\"name\":\"汉语\",\"href\":\"/item/%E6%B1%89%E8%AF%AD/22488993\",\"id\":\"22488993\"},{\"name\":\"闽语\",\"href\":\"/item/%E9%97%BD%E8%AF%AD/10481778\",\"id\":\"10481778\"},{\"name\":\"福建\",\"href\":\"/item/%E7%A6%8F%E5%BB%BA/132090\",\"id\":\"132090\"},{\"name\":\"仙游话\",\"href\":\"/item/%E4%BB%99%E6%B8%B8%E8%AF%9D/7979040\",\"id\":\"7979040\"},{\"name\":\"莆田市\",\"href\":\"/item/%E8%8E%86%E7%94%B0%E5%B8%82/607902\",\"id\":\"607902\"},{\"name\":\"乌丘屿\",\"href\":\"/item/%E4%B9%8C%E4%B8%98%E5%B1%BF/7611652\",\"id\":\"7611652\"},{\"name\":\"福清\",\"href\":\"/item/%E7%A6%8F%E6%B8%85\"},{\"name\":\"永泰\",\"href\":\"/item/%E6%B0%B8%E6%B3%B0/14534\",\"id\":\"14534\"},{\"name\":\"兴化府\",\"href\":\"/item/%E5%85%B4%E5%8C%96%E5%BA%9C/336182\",\"id\":\"336182\"},{\"name\":\"兴化军\",\"href\":\"/item/%E5%85%B4%E5%8C%96%E5%86%9B/4532152\",\"id\":\"4532152\"},{\"name\":\"兴安州\",\"href\":\"/item/%E5%85%B4%E5%AE%89%E5%B7%9E/224826\",\"id\":\"224826\"},{\"name\":\"兴化府\",\"href\":\"/item/%E5%85%B4%E5%8C%96%E5%BA%9C/336182\",\"id\":\"336182\"},{\"name\":\"非物质文化遗产\",\"href\":\"/item/%E9%9D%9E%E7%89%A9%E8%B4%A8%E6%96%87%E5%8C%96%E9%81%97%E4%BA%A7/271489\",\"id\":\"271489\"},{\"name\":\"莆仙木偶戏\",\"href\":\"/item/%E8%8E%86%E4%BB%99%E6%9C%A8%E5%81%B6%E6%88%8F/4491532\",\"id\":\"4491532\"},{\"name\":\"汉语\",\"href\":\"/item/%E6%B1%89%E8%AF%AD/22488993\",\"id\":\"22488993\"},{\"name\":\"闽语\",\"href\":\"/item/%E9%97%BD%E8%AF%AD/10481778\",\"id\":\"10481778\"}]', 'https://baike.baidu.com/item/莆仙话/9061342', '', '4314818');
INSERT INTO `baike_related_items_pili` VALUES ('9166843', 5, '诗词', 3211, 73, '', '', '诗词，是指以古体诗、近体诗和格律词为代表的中国古代传统诗歌。亦是汉字文化圈的特色之一。通常认为，诗较为适合“言志”，而词则更为适合“抒情”。诗词[1] 是阐述心灵的文学艺术，而诗人、词人则需要掌握成熟的艺术技巧，并按照严格的韵律要求，用凝练的语言、绵密的章法、充沛的情感以及丰富的意象来高度集中地表现社会生活和人类精神世界。中国诗起源于先秦，鼎盛于唐代。中国词起源于隋唐，流行于宋代。中华诗词源自民间，其实是一种草根文学。在21世纪的中国，诗词仍然深受普通大众青睐。', '[{\"name\":\"古体诗\",\"href\":\"/item/%E5%8F%A4%E4%BD%93%E8%AF%97/938430\",\"id\":\"938430\"},{\"name\":\"近体诗\",\"href\":\"/item/%E8%BF%91%E4%BD%93%E8%AF%97/1007619\",\"id\":\"1007619\"},{\"name\":\"格律\",\"href\":\"/item/%E6%A0%BC%E5%BE%8B/209785\",\"id\":\"209785\"},{\"name\":\"古代\",\"href\":\"/item/%E5%8F%A4%E4%BB%A3/398778\",\"id\":\"398778\"},{\"name\":\"传统诗歌\",\"href\":\"/item/%E4%BC%A0%E7%BB%9F%E8%AF%97%E6%AD%8C\"},{\"name\":\"汉字文化圈\",\"href\":\"/item/%E6%B1%89%E5%AD%97%E6%96%87%E5%8C%96%E5%9C%88/980547\",\"id\":\"980547\"},{\"name\":\"韵律\",\"href\":\"/item/%E9%9F%B5%E5%BE%8B/11008974\",\"id\":\"11008974\"},{\"name\":\"凝练\",\"href\":\"/item/%E5%87%9D%E7%BB%83/8342657\",\"id\":\"8342657\"},{\"name\":\"先秦\",\"href\":\"/item/%E5%85%88%E7%A7%A6\"},{\"name\":\"唐代\",\"href\":\"/item/%E5%94%90%E4%BB%A3/345315\",\"id\":\"345315\"},{\"name\":\"隋\",\"href\":\"/item/%E9%9A%8B/7217663\",\"id\":\"7217663\"},{\"name\":\"青睐\",\"href\":\"/item/%E9%9D%92%E7%9D%90/4146\",\"id\":\"4146\"}]', 'https://baike.baidu.com/item/诗词/9166843', '', '4356872');
INSERT INTO `baike_related_items_pili` VALUES ('9464374', 3, '叶小钗', 1856, 107, '（《霹雳至尊》中的人物）', '', '叶小钗，霹雳布袋戏三大主角之一。[1-2] 自《霹雳至尊》第一集出场，至今仍活跃中。叶小钗一生悲情，命运多舛，亲人恩人朋友一个个离他而去，遭遇令人心酸，却也因此练就了超绝的禅定功夫。耿直专一、守信重诺的侠客，虽为侍童出身，但不屈不挠的个性，丰富的人生阅历，让其成为中原武林不可或缺的一员，享有“刀狂剑痴”之盛名，披肩的白发和脸上的英雄疤，搭配沉默无言的特色，营造出该角色独特的风范。[3] ', '[{\"name\":\"霹雳布袋戏\",\"href\":\"/item/%E9%9C%B9%E9%9B%B3%E5%B8%83%E8%A2%8B%E6%88%8F/155118\",\"id\":\"155118\"},{\"name\":\"霹雳至尊\",\"href\":\"/item/%E9%9C%B9%E9%9B%B3%E8%87%B3%E5%B0%8A/10376904\",\"id\":\"10376904\"}]', 'https://baike.baidu.com/item/叶小钗/9464374', '', '1987744');
