INSERT INTO `data_stats_gov_zb` VALUES ('A020101', '国民总收入', NULL, 'hgnd', '国民总收入（GNI）即国民生产总值，指一个国家(或地区)所有常住单位在一定时期内收入初次分配的最终结果。一国常住单位从事生产活动所创造的增加值在初次分配中主要分配给该国的常住单位，但也有一部分以生产税及进口税(扣除生产和进口补贴)、劳动者报酬和财产收入等形式分配给非常住单位；同时，国外生产所创造的增加值也有一部分以生产税及进口税(扣除生产和进口补贴)、劳动者报酬和财产收入等形式分配给该国的常住单位，从而产生了国民总收入的概念。它等于国内生产总值加上来自国外的净要素收入。与国内生产总值不同，国民总收入是个收', '1', 'A0201', 'zb', '0');
INSERT INTO `data_stats_gov_zb` VALUES ('A020102', '国内生产总值', NULL, 'hgnd', '国内生产总值(GDP)指按市场价格计算的一个国家（或地区）所有常住单位在一定时期内生产活动的最终成果。国内生产总值有三种表现形态，即价值形态、收入形态和产品形态。从价值形态看，它是所有常住单位在一定时期内生产的全部货物和服务价值与同期投入的全部非固定资产货物和服务价值的差额，即所有常住单位的增加值之和；从收入形态看，它是所有常住单位在一定时期内创造并分配给常住单位和非常住单位的初次收入之和；从产品形态看，它是所有常住单位在一定时期内最终使用的货物和服务价值与货物和服务净出口价值之和。在实际核算中，国内生产', '1', 'A0201', 'zb', '0');
INSERT INTO `data_stats_gov_zb` VALUES ('A020103', '第一产业增加值', NULL, 'hgnd', '第一产业增加值是指按市场价格计算的一个国家（或地区）所有常住单位在一定时期内从事第一产业生产活动的最终成果。第一产业是指农、林、牧、渔业（不含农、林、牧、渔服务业）。', '1', 'A0201', 'zb', '0');
