INSERT INTO `data_stats_gov_zb` VALUES ('A030101', '年末总人口', NULL, 'hgnd', '年末人口数指每年12月31日24时的人口数。年度统计的全国人口总数内未包括香港、澳门特别行政区和台湾省以及海外华侨人数。', '1', 'A0301', 'zb', '0');
