INSERT INTO `data_stats_gov_zb` VALUES ('A0302', '人口出生率、死亡率和自然增长率', NULL, 'hgnd', '', '0', 'A03', 'zb', '0');
INSERT INTO `data_stats_gov_zb` VALUES ('A030201', '人口出生率', NULL, 'hgnd', '出生率(又称粗出生率)指在一定时期内(通常为一年)一定地区的出生人数与同期内平均人数(或期中人数)之比，用千分率表示。本资料中的出生率指年出生率，其计算公式为：出生率=年出生人口/年平均人口*1000‰\n\n式中：出生人数指活产婴儿，即胎儿脱离母体时(不管怀孕月数)，有过呼吸或其他生命现象。年平均人数指年初、年底人口数的平均数，也可用年中人口数代替。', '1', 'A0302', 'zb', '0');
INSERT INTO `data_stats_gov_zb` VALUES ('A030202', '人口死亡率', NULL, 'hgnd', '死亡率(又称粗死亡率)指在一定时期内(通常为一年)一定地区的死亡人数与同期内平均人数(或期中人数)之比，用千分率表示。本资料中的死亡率指年死亡率，其计算公式为：死亡率=年死亡人口/年平均人口*1000‰', '1', 'A0302', 'zb', '0');
INSERT INTO `data_stats_gov_zb` VALUES ('A030203', '人口自然增长率', NULL, 'hgnd', '人口自然增长率指在一定时期内(通常为一年)人口自然增加数(出生人数减死亡人数)与该时期内平均人数(或期中人数)之比，用千分率表示。计算公式为：人口自然增长率=（年出生人口-年死亡人口）/年平均人口*1000‰=人口出生率－人口死亡率', '1', 'A0302', 'zb', '0');
INSERT INTO `data_stats_gov_zb` VALUES ('A0303', '人口年龄结构和抚养比', NULL, 'hgnd', '', '0', 'A03', 'zb', '0');
INSERT INTO `data_stats_gov_zb` VALUES ('A030301', '年末总人口', NULL, 'hgnd', '年末人口数指每年12月31日24时的人口数。年度统计的全国人口总数内未包括香港、澳门特别行政区和台湾省以及海外华侨人数。', '1', 'A0303', 'zb', '0');
