INSERT INTO `douban_annual_widget_infos` VALUES (1, NULL, NULL, NULL, 'ActivityPageWidget', 0, 0, '开篇', 'start_page', 1, 0, NULL, '#000', NULL, '基于2015万千豆瓣用户的电影标记和访问数据，排名依据评分、评价人数和上映时间综合考虑（统计截至2015-12-25）', NULL, 'on', NULL, 'https://img3.doubanio.com/view/activity_page/raw/public/p470.jpg', NULL, NULL, '0.85', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://img3.doubanio.com/view/activity_page/raw/public/p342.jpg', NULL, NULL, 'https://img3.doubanio.com/view/activity_page/raw/public/p441.jpg', NULL, NULL, 'https://movie.douban.com/ithil_j/activity/movie_annual2015/widget/0', NULL, '2019-03-11 21:17:33.187');
INSERT INTO `douban_annual_widget_infos` VALUES (2, NULL, NULL, '2015评分最高的|外语电影', 'ActivityPageWidget', 1, 1634, 'Top 10', 'top10', 1, 0, '24750126,10757577,24405378,26393561,3592854,25864085,23761370,25955491,25766754,25738406', NULL, 'https://img3.doubanio.com/view/activity_page/raw/public/p275.jpg', '　　植于生活，长于现实的荒蛮故事。6个小故事没有短板，全都如此引人入胜。情节看似荒诞不已，却也让人笑着深思。言语的肆无忌惮和迫在眉睫的暴力，权利权力家庭舆论的畸形发展，婚姻始终是一场浪漫的闹剧。', NULL, 'on', 'on', 'https://img3.doubanio.com/view/activity_page/raw/public/p321.jpg', '37507203', NULL, '0.1', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://movie.douban.com/ithil_j/activity/movie_annual2015/widget/1', NULL, '2019-03-11 21:17:33.187');
INSERT INTO `douban_annual_widget_infos` VALUES (3, NULL, NULL, '2015评分最高的|华语电影', 'ActivityPageWidget', 1, 974, 'Top 10', 'top10', 1, 0, '25917973,24751756,25919910,26366465,24875534,25890005,25798448,24719063,25926267,20514902', NULL, 'https://img3.doubanio.com/view/activity_page/raw/public/p41.jpg', '　　 封闭的村庄，悬疑前置的凶杀，阴差阳错的众生相，故事设定和结构都像极马尔克斯的《一桩事先张扬的谋杀案》，环环相扣互为因果，挖了一堆坑，全部严谨密实的填上，故事编的一个大写的牛逼。', NULL, 'on', NULL, 'https://img3.doubanio.com/view/activity_page/raw/public/p322.jpg', '45134592', NULL, '0.1', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://movie.douban.com/ithil_j/activity/movie_annual2015/widget/2', NULL, '2019-03-11 21:17:33.187');
INSERT INTO `douban_annual_widget_infos` VALUES (4, NULL, NULL, '2015最受关注的|院线电影', 'ActivityPageWidget', 1, 654, 'Top 10', 'top10', 1, 0, '26277313,24405378,25964071,23761370,25723907,10440138,10741834,25895276,25710912,24719063', NULL, 'https://img3.doubanio.com/view/activity_page/raw/public/p281.jpg', '　　 孙悟空全副武装的造型碉堡。横扫满天神佛，骄傲沉思于云巅，红色飘带绕天飘的形象设计，透彻诠释了西游记原著大闹天宫的精髓。剧情较弱，反派现原形的设计才思枯竭，应有更好的剧情承载，但视觉效果已能和好莱坞比一比了！ ', NULL, 'on', NULL, 'https://img3.doubanio.com/view/activity_page/raw/public/p323.jpg', '67121971', NULL, '0.1', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://movie.douban.com/ithil_j/activity/movie_annual2015/widget/4', NULL, '2019-03-11 21:17:33.187');
INSERT INTO `douban_annual_widget_infos` VALUES (5, NULL, NULL, '2015最受关注的|非院线电影', 'ActivityPageWidget', 1, 381, 'Top 10', 'top10', 1, 0, '3592854,4160540,24840488,25752261,25814705,24750126,19957083,25932086,6845667,25738406', NULL, 'https://img1.doubanio.com/view/activity_page/raw/public/p278.jpg', '　　除了燃，电影还说了一件事：背井离乡七千天，无一日不惦念。不论眼下多苦，相信只要回头就有希望，因为那里是丰饶的绿洲。但这终究只是个幻觉。离开家乡越久，幻觉越严重。你以为逃离能解决一切，但真正的胜者不是寻找绿洲的人，而是改变荒芜之地的人。', NULL, 'on', NULL, 'https://img3.doubanio.com/view/activity_page/raw/public/p325.jpg', '1439314', NULL, '0.1', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://movie.douban.com/ithil_j/activity/movie_annual2015/widget/5', NULL, '2019-03-11 21:17:33.187');
INSERT INTO `douban_annual_widget_infos` VALUES (6, NULL, NULL, '2015评分最高的|大陆剧', 'ActivityPageWidget', 1, 399, 'Top 10', 'top10', 1, 0, '25754848,26603847,26298756,25994712,25851665,26100709,26345152,25865536,25777370,21961912', '#333', NULL, '　　不谈夺嫡宫斗，和有些过于设计的剧情，苏先生，景睿，靖王，哪怕是身边护卫那些劝解人的话语都落进了心里。好本子好剧组。', NULL, 'on', 'on', NULL, '42981208', NULL, '0.2', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://movie.douban.com/ithil_j/activity/movie_annual2015/widget/22', NULL, '2019-03-11 21:17:33.187');
INSERT INTO `douban_annual_widget_infos` VALUES (7, NULL, NULL, '2015评分最高的|英美剧（新剧）', 'ActivityPageWidget', 1, 217, 'Top 10', 'top10', 1, 0, '25726259,26388908,25850640,25770124,23011215,26170816,25986676,25867544,25769160,25832936', NULL, 'https://img3.doubanio.com/view/activity_page/raw/public/p76.jpg', '　　本身已是神剧。更奇妙的是，与绝命毒师一起，不管你先看哪部，看到最后那宿命的带刺铁轮，一定会碾过你的心。', NULL, 'on', NULL, 'https://img3.doubanio.com/view/activity_page/raw/public/p473.jpg', '3106355', NULL, '0.1', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://movie.douban.com/ithil_j/activity/movie_annual2015/widget/18', NULL, '2019-03-11 21:17:33.187');
INSERT INTO `douban_annual_widget_infos` VALUES (8, NULL, NULL, '最受关注的|电影', 'ActivityPageWidget', 5, 152, 'Top 5', 'top5', 1, 0, '25870084,2973079,21349734,20278505,26274910', NULL, 'https://img3.doubanio.com/view/activity_page/raw/public/p256.jpg', '　　是的，那些青春啊梦想啊足以惊艳时光；但生活啊回忆啊，是可以温柔岁月的。', NULL, 'on', 'on', 'https://img3.doubanio.com/view/activity_page/raw/public/p354.jpg', '36612113', NULL, '0.3', NULL, NULL, NULL, '1月', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://movie.douban.com/ithil_j/activity/movie_annual2015/widget/32', NULL, '2019-03-11 21:17:33.187');
INSERT INTO `douban_annual_widget_infos` VALUES (9, NULL, NULL, '2015告别我们的|英美剧（最终季）', 'ActivityPageWidget', 1, 89, 'Top 10', 'top10', 1, 0, '24859448,26254370,25923092,25885786,25905702,25947054,25742234,25834551,25846035,26263771', NULL, 'https://img1.doubanio.com/view/activity_page/raw/public/p257.jpg', '　　华美而壮丽的戏剧终于落下帷幕，但残酷的人生还得继续。命运很纠结，我们试图抗争，有人倒下就躺着了，有人倒下又站起。我宁愿相信Don最后的微笑证明了迷失的终结，最后一幕可口可乐世界大同的广告就是这段嬉皮生活的感悟。每个人都得到了自己想要的，这很好。', NULL, 'on', NULL, 'https://img3.doubanio.com/view/activity_page/raw/public/p361.jpg', 'methy', NULL, '0.2', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://movie.douban.com/ithil_j/activity/movie_annual2015/widget/20', NULL, '2019-03-11 21:17:33.187');
