INSERT INTO `douban_annual_widget_infos` VALUES (11, NULL, NULL, '最受关注的|电影', 'ActivityPageWidget', 5, 100, 'Top 5', 'top5', 1, 0, '3993588,11026735,25858759,6533054,25858785', NULL, 'https://img1.doubanio.com/view/activity_page/raw/public/p408.jpg', '　　狼演的比人好。有质感的场景，蔚为壮观，有关狼的智慧、尊严和自然规律，狼之于人的图腾内核挖得还是浅了点。狼马追逐起了高潮，后面升华显得略为单薄。最后一幕忆起PI的人虎之别，狼扭头而走。放在国内这样的电影比较难得，尽管它有缺憾。', NULL, 'on', 'on', 'https://img1.doubanio.com/view/activity_page/raw/public/p427.jpg', 'particles', NULL, '0.2', NULL, NULL, NULL, '2月', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://movie.douban.com/ithil_j/activity/movie_annual2015/widget/33', NULL, '2019-03-11 21:17:33.187');
INSERT INTO `douban_annual_widget_infos` VALUES (12, NULL, NULL, '最受关注的|电影', 'ActivityPageWidget', 5, 168, 'Top 5', 'top5', 1, 0, '26277313,25723907,25895276,24847343,24879839', NULL, 'https://img3.doubanio.com/view/activity_page/raw/public/p282.jpg', '　　比预想的还要好看！画面够美打斗也够流畅，剧情不复杂，笑泪皆具，大圣三百六十度无死角的帅，再疼也不能给小屁孩知道，百折不挠重情重义的性格塑造太棒，出场音乐一响起我立马就跟着燃起来了！', NULL, 'on', 'on', 'https://img3.doubanio.com/view/activity_page/raw/public/p365.jpg', '61212508', NULL, '0.2', NULL, NULL, NULL, '7月', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://movie.douban.com/ithil_j/activity/movie_annual2015/widget/39', NULL, '2019-03-11 21:17:33.187');
INSERT INTO `douban_annual_widget_infos` VALUES (13, NULL, NULL, '2015评分最高的|英美剧（非新剧）', 'ActivityPageWidget', 1, 265, 'Top 10', 'top10', 1, 0, '25826612,25831924,25919897,24748854,25871679,26101081,26254370,26385630,25875022,25823412', NULL, 'https://img3.doubanio.com/view/activity_page/raw/public/p415.jpg', '　　从第一季到第五季，我喜欢的角色一个接一个被灭，编剧们也是够狠的。虽然被虐，但不得不说，偏离观众常规期待的剧情，可能更接近世界的残酷事实。说不上非常喜欢这套剧，但肯定会一直追到底。', NULL, 'on', NULL, 'https://img3.doubanio.com/view/activity_page/raw/public/p426.jpg', '2140785', NULL, '0.2', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://movie.douban.com/ithil_j/activity/movie_annual2015/widget/19', NULL, '2019-03-11 21:17:33.187');
INSERT INTO `douban_annual_widget_infos` VALUES (14, NULL, NULL, '2015评分最高的|日剧', 'ActivityPageWidget', 1, 299, 'Top 10', 'top10', 1, 0, '26271868,26266666,25953663,26588970,26387719,26277318,26588676,26602200,26273478,26309935', NULL, 'https://img3.doubanio.com/view/activity_page/raw/public/p443.jpg', '　　世界上有各种各样的人，也有各种各样的活法，所以才万分美妙。你可以不认同不理解，但请你尊重与你不同的人。', NULL, 'on', NULL, 'https://img3.doubanio.com/view/activity_page/raw/public/p444.jpg', '49162787', NULL, '0.1', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://movie.douban.com/ithil_j/activity/movie_annual2015/widget/24', NULL, '2019-03-11 21:17:33.187');
INSERT INTO `douban_annual_widget_infos` VALUES (15, NULL, NULL, '2015评分最高的|韩剧', 'ActivityPageWidget', 1, 169, 'Top 10', 'top10', 1, 0, '26302614,25994747,26297399,26367601,26282488,26334946,26334949,26125890,26284619,26334229', NULL, 'https://img3.doubanio.com/view/activity_page/raw/public/p455.jpg', '　　琐碎的，平淡的，温暖的，但是有感动的亲情友情爱情，就足够让我们在其中看到自己，打动到我们各自心中柔软的地方。', NULL, 'on', NULL, 'https://img3.doubanio.com/view/activity_page/raw/public/p301.jpg', '101641236', NULL, '0.2', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://movie.douban.com/ithil_j/activity/movie_annual2015/widget/23', NULL, '2019-03-11 21:17:33.187');
