INSERT INTO `douban_annual_widget_infos` VALUES (18, NULL, NULL, '2015最受关注的|大陆综艺', 'ActivityPageWidget', 1, 314, 'Top 10', 'top10', 1, 0, '26387728,25984531,26279203,26261188,26323567,26261185,26347994,26292732,26261192,26261184', NULL, 'https://img1.doubanio.com/view/activity_page/raw/public/p449.jpg', '　　年度真人秀，好演员加一堆电影桥段，把综艺节目提升到小剧场水准。所谓与人斗其乐无穷，做好真人秀本质的鲜明个人特色和化学反应，游戏就只是形式。', NULL, 'on', 'on', 'https://img3.doubanio.com/view/activity_page/raw/public/p450.jpg', '1275416', NULL, '0.1', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://movie.douban.com/ithil_j/activity/movie_annual2015/widget/25', NULL, '2019-03-11 21:17:33.187');
INSERT INTO `douban_annual_widget_infos` VALUES (19, NULL, NULL, '最受关注的|电影', 'ActivityPageWidget', 5, 112, 'Top 5', 'top5', 1, 0, '24405378,6875263,26334244,24840488,2998373', NULL, 'https://img3.doubanio.com/view/activity_page/raw/public/p21.jpg', '　　脑洞开得好大！逼格真是爆表啊！主流的前007小强风格电影里塞进昆汀的感觉还能不时穿插各种B级片的情节场景，编剧这是忍不住要调戏观众的节奏。结尾爆头场面太华丽了 #穿西服打架的要义在于打完之后头发可以乱领带可以断但西服绝对不能乱#', NULL, 'on', 'on', 'https://img3.doubanio.com/view/activity_page/raw/public/p356.jpg', '2039887', NULL, '0.1', NULL, NULL, NULL, '3月', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://movie.douban.com/ithil_j/activity/movie_annual2015/widget/34', NULL, '2019-03-11 21:17:33.187');
INSERT INTO `douban_annual_widget_infos` VALUES (20, NULL, NULL, '最受关注的|电影', 'ActivityPageWidget', 5, 117, 'Top 5', 'top5', 1, 0, '23761370,24753810,25872931,25745752,26140241', NULL, 'https://img3.doubanio.com/view/activity_page/raw/public/p424.jpg', '　　你的车总是蓝色的，你的T恤总是白色的，六部剪影太短，一首歌太短，而对你的想念太长。虽已有一年半，但仍觉得说不出再见。always miss you，for Paul', NULL, 'on', 'on', 'https://img1.doubanio.com/view/activity_page/raw/public/p428.jpg', 'ACJG', NULL, '0.1', NULL, NULL, NULL, '4月', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://movie.douban.com/ithil_j/activity/movie_annual2015/widget/35', NULL, '2019-03-11 21:17:33.187');
INSERT INTO `douban_annual_widget_infos` VALUES (21, NULL, NULL, NULL, 'ActivityPageWidget', 2, 147, '台词', 'dialogue', 1, 0, NULL, NULL, 'https://img3.doubanio.com/view/activity_page/raw/public/p392.jpg', NULL, NULL, 'on', NULL, 'https://img3.doubanio.com/view/activity_page/raw/public/p474.jpg', NULL, NULL, '0.2', NULL, '26366465', '当女生说我没事就是有事，说没关系就是有关系；当她说再也不想理你，不是真的讨厌你，而是她很在乎你', NULL, NULL, NULL, NULL, '年度台词', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://movie.douban.com/ithil_j/activity/movie_annual2015/widget/51', NULL, '2019-03-11 21:17:33.187');
INSERT INTO `douban_annual_widget_infos` VALUES (22, NULL, NULL, '最受关注的|电影', 'ActivityPageWidget', 5, 114, 'Top 5', 'top5', 1, 0, '10741834,6846893,26259634,4160540,10741643', NULL, 'https://img3.doubanio.com/view/activity_page/raw/public/p420.jpg', '　　属于超级英雄的春晚，角色如走马灯一样出场。眼花缭乱的同时却没办法给人留下太深印象。这部内容实在太多了，这么多角色，各有黑暗历史，又为之后铺垫，弄得每个角色都很单薄。好在动作场面多，开场长镜头打斗还不错。', NULL, 'on', 'on', 'https://img1.doubanio.com/view/activity_page/raw/public/p358.jpg', 'qijiuzhiyue', NULL, '0.1', NULL, NULL, NULL, '5月', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://movie.douban.com/ithil_j/activity/movie_annual2015/widget/36', NULL, '2019-03-11 21:17:33.187');
