INSERT INTO `douban_annual_widget_infos` VALUES (24, NULL, NULL, NULL, 'ActivityPageWidget', 2, 817, '台词', 'dialogue', 1, 0, NULL, NULL, 'https://img3.doubanio.com/view/activity_page/raw/public/p276.jpg', NULL, NULL, 'on', NULL, 'https://img3.doubanio.com/view/activity_page/raw/public/p324.jpg', NULL, NULL, '0.1', NULL, '2303845', '汝今剑术已成，唯不能斩绝人伦之情', NULL, NULL, NULL, NULL, '年度台词', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://movie.douban.com/ithil_j/activity/movie_annual2015/widget/3', NULL, '2019-03-11 21:17:33.187');
INSERT INTO `douban_annual_widget_infos` VALUES (26, NULL, NULL, '最受关注的|电影', 'ActivityPageWidget', 5, 112, 'Top 5', 'top5', 1, 0, '26289144,24719063,3338862,2303845,25853727', NULL, 'https://img1.doubanio.com/view/activity_page/raw/public/p239.jpg', '　　欢乐和悲伤、现实和超现实穿插得当，一直用轻松、欢快的腔调去讲悲伤的故事，我也许习惯了生离，但却抵抗不了死别，这一秒还笑成傻逼，下一秒就已经哭成狗。这部电影让我铭记两点：不论到了什么境地，都要有乐观的态度；爱与被爱，比什么都重要。', NULL, 'on', 'on', 'https://img1.doubanio.com/view/activity_page/raw/public/p487.jpg', 'gu_yan', NULL, '0.1', NULL, NULL, NULL, '8月', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://movie.douban.com/ithil_j/activity/movie_annual2015/widget/40', NULL, '2019-03-11 21:17:33.187');
INSERT INTO `douban_annual_widget_infos` VALUES (27, NULL, NULL, '最受关注的|电影', 'ActivityPageWidget', 5, 79, 'Top 5', 'top5', 1, 0, '10727641,25710912,11624706,25823132,25746375', NULL, 'https://img3.doubanio.com/view/activity_page/raw/public/p260.jpg', '　　各种追击桥段的节奏感相当不错，紧凑抓人。此外都是典型的大片快餐，各段衔接比较粗糙生硬，视觉刺激效果明显。本片最大的优点是女主！样貌气质都像英格丽·褒曼，身手佳，真让人目不转睛。', NULL, 'on', 'on', 'https://img1.doubanio.com/view/activity_page/raw/public/p367.jpg', 'aixiaoke', NULL, '0.3', NULL, NULL, NULL, '9月', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://movie.douban.com/ithil_j/activity/movie_annual2015/widget/41', NULL, '2019-03-11 21:17:33.187');
INSERT INTO `douban_annual_widget_infos` VALUES (28, NULL, NULL, '最受关注的|电影', 'ActivityPageWidget', 5, 186, 'Top 5', 'top5', 1, 0, '25964071,10533913,1866473,24827406,25798448', NULL, 'https://img1.doubanio.com/view/activity_page/raw/public/p248.jpg', '　　同样的追忆青春爱情表述主题，同样的喜剧，同样夸老婆，同样的老歌联播……沈腾直接把徐峥的囧片甩到了四光年之外的三体世界。本片以庄周梦蝶的方式进行人生幸福指数的哲学探讨，用最低逼格阐述最深情感，一部用爆笑的手法揭露小清新是如何荒谬的伪青春片。', NULL, 'on', NULL, 'https://img1.doubanio.com/view/activity_page/raw/public/p438.jpg', '2340389', NULL, '0.1', NULL, NULL, NULL, '10月', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://movie.douban.com/ithil_j/activity/movie_annual2015/widget/42', NULL, '2019-03-11 21:17:33.187');
INSERT INTO `douban_annual_widget_infos` VALUES (29, NULL, NULL, '最受关注的|电影', 'ActivityPageWidget', 5, 150, 'Top 5', 'top5', 1, 0, '26366465,11620560,25995508,6845667,25890005', NULL, 'https://img1.doubanio.com/view/activity_page/raw/public/p379.jpg', '　　青春里面最怕有遗憾，可是遗憾是最不可能避免的。不过有一个人，寄托了全部的傻气和憧憬，还有跌跌撞撞的冒失和试探。青春里有过你，总不负少女时代。', NULL, 'on', 'on', 'https://img3.doubanio.com/view/activity_page/raw/public/p371.jpg', 'wind_field', NULL, '0.1', NULL, NULL, NULL, '11月', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '{\n  \"26366465\": {\n    \"orig_title\": \"\"\n  }\n}', NULL, NULL, NULL, 'https://movie.douban.com/ithil_j/activity/movie_annual2015/widget/43', NULL, '2019-03-11 21:17:33.187');
INSERT INTO `douban_annual_widget_infos` VALUES (30, NULL, NULL, '最受关注的|电影', 'ActivityPageWidget', 5, 205, 'Top 5', 'top5', 1, 0, '25864085,3077412,24751756,26320029,26290365', NULL, 'https://img3.doubanio.com/view/activity_page/raw/public/p52.jpg', '　　他是宇航员里最会种土豆的农民，农民里最会拆解飞船的修理工，修理工里数理化最好的学霸，学霸里最懂得求生技能的驴友，驴友中跑得最远的宇航员。他就是马特·呆萌，第三次弄丢自己，这次拥有了一个星球成了小王子。老雷这几年最好看的电影！', NULL, 'on', 'on', 'https://img3.doubanio.com/view/activity_page/raw/public/p486.jpg', 'dreamfox', NULL, '0.1', NULL, NULL, NULL, '12月', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://movie.douban.com/ithil_j/activity/movie_annual2015/widget/44', NULL, '2019-03-11 21:17:33.187');
