INSERT INTO `douban_annual_widget_infos` VALUES (40, NULL, NULL, NULL, 'ActivityPageWidget', 2, 105, '台词', 'dialogue', 1, 0, NULL, NULL, 'https://img3.doubanio.com/view/activity_page/raw/public/p456.jpg', NULL, NULL, 'on', NULL, 'https://img3.doubanio.com/view/activity_page/raw/public/p304.jpg', NULL, NULL, '0.1', NULL, '23011215', '真正的暴行，是我们太害怕成为真实的自己的时候对自己施加的，这才是不可原谅的', NULL, 'The real violence, the violence I realized was unforgivable, is the violence that we do to ourselves, when we\'re too afraid to be who we really are.', NULL, NULL, '年度台词', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://movie.douban.com/ithil_j/activity/movie_annual2015/widget/21', NULL, '2019-03-11 21:17:33.187');
