INSERT INTO `douban_annual_widget_infos` VALUES (42, NULL, NULL, NULL, 'ActivityPageWidget', 2, 491, '台词', 'dialogue', 1, 0, NULL, NULL, 'https://img1.doubanio.com/view/activity_page/raw/public/p328.jpg', NULL, NULL, 'on', NULL, 'https://img1.doubanio.com/view/activity_page/raw/public/p329.jpg', NULL, NULL, '0.1', NULL, '3592854', '血袋，见证我吧！我就是那个以最璀璨夺目之姿，直奔英灵殿的人', NULL, 'Witness me...Blood Bag! I live, I die, I live again!', NULL, NULL, '年度台词', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://movie.douban.com/ithil_j/activity/movie_annual2015/widget/7', NULL, '2019-03-11 21:17:33.187');
INSERT INTO `douban_annual_widget_infos` VALUES (43, NULL, NULL, '2015年度|冷门佳片', 'ActivityPageWidget', 1, 298, 'Top 10', 'top10', 1, 0, '25855951,25882861,10773239,24325923,11520649,26304167,25687245,21098725,26372545,25821461', NULL, 'https://img3.doubanio.com/view/activity_page/raw/public/p92.jpg', '　　老套路的追梦故事，换了个角度新意立马提升。法国人浪漫的氛围里说到的限制级话题都变成轻松的点缀，结尾的催泪药丸药效震撼。爱不是牺牲，追梦的路上会变成巨人，要以更强大的身躯来爱你。', NULL, 'on', NULL, 'https://img1.doubanio.com/view/activity_page/raw/public/p307.jpg', 'hyocheong', NULL, '0.1', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://movie.douban.com/ithil_j/activity/movie_annual2015/widget/8', NULL, '2019-03-11 21:17:33.187');
INSERT INTO `douban_annual_widget_infos` VALUES (44, NULL, NULL, '2015评分最高的|韩国电影', 'ActivityPageWidget', 1, 184, 'Top 10', 'top10', 1, 0, '25859495,21937450,25823132,25919385,26235839,25728010,25834457,26297388,11540651,26050295', NULL, 'https://img3.doubanio.com/view/activity_page/raw/public/p94.jpg', '　　实至名归的今年最佳韩影，无论故事台词情感演技音乐都堪称一流。隐忍的情感极其饱满和浓烈，几次如鲠在喉的感伤，短短两个小时经历了三代人的悲欢离合，那画着青龙的扇，那射向空中的箭，都直抵人心最柔软的地方。', NULL, 'on', NULL, 'https://img1.doubanio.com/view/activity_page/raw/public/p308.jpg', '64009647', NULL, '0.2', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://movie.douban.com/ithil_j/activity/movie_annual2015/widget/9', NULL, '2019-03-11 21:17:33.187');
INSERT INTO `douban_annual_widget_infos` VALUES (45, NULL, NULL, '2015评分最高的|日本电影', 'ActivityPageWidget', 1, 332, 'Top 10', 'top10', 1, 0, '25814705,25814707,25895901,25761178,26259677,25969201,21767183,25958787,26270517,26140405', NULL, 'https://img3.doubanio.com/view/activity_page/raw/public/p270.jpg', '　　劳作令人无暇烦恼，片中的人物时而离凡世很远，时而又触手可及。我们有舌尖上的中国，通篇累述奉献、感恩、手艺传承和文化气节，却没人教导我们劳作本身的意义。一屋一田一人食，已是最令人羡慕的事。', NULL, 'on', NULL, 'https://img1.doubanio.com/view/activity_page/raw/public/p318.jpg', 'duduxiongzhifu', NULL, '0.1', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://movie.douban.com/ithil_j/activity/movie_annual2015/widget/10', NULL, '2019-03-11 21:17:33.187');
INSERT INTO `douban_annual_widget_infos` VALUES (46, NULL, NULL, '2015评分最高的|欧洲电影', 'ActivityPageWidget', 1, 213, 'Top 10', 'top10', 1, 0, '24405378,25955491,25882861,25855951,25766754,20514947,25932086,25727048,6521506,19976774', NULL, 'https://img3.doubanio.com/view/activity_page/raw/public/p436.jpg', '　　马修·沃恩再度化腐朽为神奇，把一个青少年向的低幼特工故事拍成了精彩的娱乐佳作，标准的好莱坞商业叙事节奏，接地气的英国本土元素，眼花缭乱的血暴动作戏，更不用说令人击节的教堂屠杀戏和烟花戏。男主完美诠释了“小鲜肉”三个字。', NULL, 'on', 'on', 'https://img1.doubanio.com/view/activity_page/raw/public/p437.jpg', 'cabaret', NULL, '0.1', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://movie.douban.com/ithil_j/activity/movie_annual2015/widget/11', NULL, '2019-03-11 21:17:33.187');
INSERT INTO `douban_annual_widget_infos` VALUES (47, NULL, NULL, '2015评分最低的|华语电影', 'ActivityPageWidget', 1, 438, 'Top 10', 'top10', 1, 0, '26416155,26274910,26259634,5993138,26290365,26279120,26021055,25713420,24827406,25908042', NULL, 'https://img3.doubanio.com/view/activity_page/raw/public/p105.jpg', '　　国产3D动画的底线来了，干脆这样我不要你钱我做一部比你们这个效果还好的，把我做的拿去电影院放得了，赚到的钱我一分不要！', NULL, 'on', NULL, 'https://img3.doubanio.com/view/activity_page/raw/public/p313.jpg', '75832750', NULL, '0.2', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://movie.douban.com/ithil_j/activity/movie_annual2015/widget/53', NULL, '2019-03-11 21:17:33.187');
INSERT INTO `douban_annual_widget_infos` VALUES (48, NULL, NULL, '2015评分最低的|外语电影', 'ActivityPageWidget', 1, 264, 'Top 10', 'top10', 1, 0, '6858224,4014396,24840488,6866928,24872023,5154799,26326395,25995508,25794212,24718797', NULL, 'https://img1.doubanio.com/view/activity_page/raw/public/p108.jpg', '　　整部电影都在贩卖过时的创意，和一个恶心的光头在咆哮。如果说第一部是新颖的想法，那么这一部简直就是狗屎。无聊透顶，糟糕极了，观众不能在片中找到哪怕一丝快感。感谢这个系列终于到了终点，恶心人的反而不是设定，而是那个咆哮的光头。', NULL, 'on', NULL, 'https://img3.doubanio.com/view/activity_page/raw/public/p312.jpg', '67238808', NULL, '0.1', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://movie.douban.com/ithil_j/activity/movie_annual2015/widget/52', NULL, '2019-03-11 21:17:33.187');
INSERT INTO `douban_annual_widget_infos` VALUES (49, NULL, NULL, '2016最值得期待的|外语电影', 'ActivityPageWidget', 1, 503, 'Top 10', 'top10', 1, 0, '2131940,25786060,3569910,24750534,3543318,25820460,3718279,21817627,11526817,25726614', NULL, 'https://img3.doubanio.com/view/activity_page/raw/public/p410.jpg', '　　在这个年代，魔兽两个字就是让人热血沸腾的魔法！为了部落！', NULL, 'on', 'on', 'https://img3.doubanio.com/view/activity_page/raw/public/p485.jpg', '136042980', NULL, '0.1', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://movie.douban.com/ithil_j/activity/movie_annual2015/widget/55', NULL, '2019-03-11 21:17:33.187');
INSERT INTO `douban_annual_widget_infos` VALUES (50, NULL, NULL, '2016最值得期待的|华语电影', 'ActivityPageWidget', 1, 427, 'Top 10', 'top10', 1, 0, '21335171,5045678,25727544,19944106,24751763,10467754,25911694,6982558,11598977,20505982', NULL, 'https://img3.doubanio.com/view/activity_page/raw/public/p112.jpg', '　　《三体》是中国科幻小说界的一座丰碑，真心希望这部片子也能成为电影界上的一座丰碑。', NULL, 'on', 'on', 'https://img3.doubanio.com/view/activity_page/raw/public/p316.jpg', 'suiye47', NULL, '0.1', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://movie.douban.com/ithil_j/activity/movie_annual2015/widget/56', NULL, '2019-03-11 21:17:33.187');
