INSERT INTO `douban_annual_widget_infos` VALUES (53, NULL, NULL, NULL, 'ActivityPageWidget', 2, 133, '台词', 'dialogue', 1, 0, NULL, NULL, 'https://img1.doubanio.com/view/activity_page/raw/public/p119.jpg', NULL, NULL, 'on', NULL, 'https://img3.doubanio.com/view/activity_page/raw/public/p311.jpg', NULL, NULL, '0.1', NULL, '25761178', '好想赢，就算赢一次也好', NULL, '勝ちたかったよ･･･一度でいいから、勝ちたかった', NULL, NULL, '年度台词', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://movie.douban.com/ithil_j/activity/movie_annual2015/widget/45', NULL, '2019-03-11 21:17:33.187');
INSERT INTO `douban_annual_widget_infos` VALUES (54, NULL, NULL, '2015评分最高的|动画片', 'ActivityPageWidget', 1, 290, 'Top 10', 'top10', 1, 0, '10533913,11584019,24397586,26277313,20645098,26147706,21327493,25790555,6875863,20482777', NULL, 'https://img3.doubanio.com/view/activity_page/raw/public/p154.jpg', '　　皮克斯再一次证明了动画片是可以给所有年龄段看的。以为皮克斯被迪斯尼收购后，它的想象力和创造力就再也回不去了，看来这次我被狠狠打了一记耳光。脑洞无限大，有创意有逻辑，有欢笑有温情，所有都拿捏的恰到好处，被这样的动画片感动到流泪，一点都不丢脸。', NULL, 'on', NULL, 'https://img3.doubanio.com/view/activity_page/raw/public/p330.jpg', 'DuckLee', NULL, '0.1', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://movie.douban.com/ithil_j/activity/movie_annual2015/widget/13', NULL, '2019-03-11 21:17:33.187');
INSERT INTO `douban_annual_widget_infos` VALUES (55, NULL, NULL, '2015评分最高的|纪录片', 'ActivityPageWidget', 1, 154, 'Top 10', 'top10', 1, 0, '10741871,26334244,26276498,26276373,26334993,26336727,26582012,25978207,24532442,26279370', NULL, 'https://img1.doubanio.com/view/activity_page/raw/public/p159.jpg', '　　灵魂清洗，萨尔加多阅尽世间种种人类贪性催生的罹难悲苦，在最后选择回归于动物和自然。他一生的故事，看到了完整。别让那些不幸的事件，只沉淀为事件。别让悲伤的土地，放任干涸荒芜。在凝固瞬间的照片面前，我们也不该只是保持那一刻的哑口无言。 ', NULL, 'on', NULL, 'https://img3.doubanio.com/view/activity_page/raw/public/p331.jpg', '66186806', NULL, '0.1', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://movie.douban.com/ithil_j/activity/movie_annual2015/widget/14', NULL, '2019-03-11 21:17:33.187');
INSERT INTO `douban_annual_widget_infos` VALUES (56, NULL, NULL, '2015评分最高的|短片', 'ActivityPageWidget', 1, 168, 'Top 10', 'top10', 1, 0, '26613444,26581251,26275793,26592232,25825863,26316563,25802407,26595432,26602340,26322983', NULL, 'https://img3.doubanio.com/view/activity_page/raw/public/p166.jpg', '　　它美的让人窒息，它光滑的可映照微观，它温柔的像个女孩，它安静的像个坟墓……2212年，人类舰队国际俘获三体行星探测器，命名为，水滴。 ', NULL, 'on', NULL, 'https://img3.doubanio.com/view/activity_page/raw/public/p332.jpg', '74828977', NULL, '0.1', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://movie.douban.com/ithil_j/activity/movie_annual2015/widget/15', NULL, '2019-03-11 21:17:33.187');
INSERT INTO `douban_annual_widget_infos` VALUES (57, NULL, NULL, '2015年度LGBT电影', 'ActivityPageWidget', 1, 209, 'Top 10', 'top10', 1, 0, '10757577,25785108,3071604,25755608,6048838,26306656,25965348,25767853,25825586,21370611', NULL, 'https://img3.doubanio.com/view/activity_page/raw/public/p171.jpg', '　　不用再加“同性”的限定语，这就是今年最美的爱情电影。托德·海因斯的镜头从头到尾都是两位女性，只是两位女性，其他一切仿佛都不重要。这是最小的格局，也是最汹涌的情欲，光对视就能让人落泪，因为你知道这世界上有两人为了对方，此身愿作万矢的。', NULL, 'on', 'on', 'https://img3.doubanio.com/view/activity_page/raw/public/p333.jpg', '3540441', NULL, '0.1', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://movie.douban.com/ithil_j/activity/movie_annual2015/widget/16', NULL, '2019-03-11 21:17:33.187');
