INSERT INTO `douban_annual_widget_infos` VALUES (458, NULL, NULL, '2016评分最高的|韩国电影', 'ActivityPageWidget', 1, 157, 'Top 10', 'top10', 6, 0, '25986180, 26307755, 26713504, 25977027, 26410594, 25862354, 25835285, 26752337, 26322928, 25817534', 'rgba(5, 99, 154, 0.8)', 'https://img3.doubanio.com/view/activity_page/raw/public/p1541.jpg', '丧尸再也不是西方的专利了！韩国影人再一次向世人证明了他们非凡的叙事能力和精巧的借鉴本事。没有好莱坞式拯救人类的大英雄主义，多了的是人性的反思与情感的刻画。', NULL, 'on', 'on', 'https://img3.doubanio.com/view/activity_page/raw/public/p1952.jpg', '35790692', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://movie.douban.com/ithil_j/activity/movie_annual2016/widget/10', NULL, '2019-03-11 21:17:33.187');
