INSERT INTO `douban_annual_widget_infos` VALUES (465, NULL, NULL, '2016评分最高的|喜剧片', 'ActivityPageWidget', 1, 156, 'Top 10', 'top10', 6, 0, '26614893, 26362351, 26020796, 24872189, 26412106, 26585014, 26279353, 3868141, 26680247, 3718279', 'rgba(130, 59, 83, 0.8)', 'https://img1.doubanio.com/view/activity_page/raw/public/p1458.jpg', '人和人的关系有多么的脆弱？然而，多少人以亲近关系的名义，忘记了什么叫做界线。人生在世，怎么样才能让感情长久，四个字：难得糊涂。', NULL, 'on', 'on', 'https://img3.doubanio.com/view/activity_page/raw/public/p1885.jpg', '51061132', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://movie.douban.com/ithil_j/activity/movie_annual2016/widget/15', NULL, '2019-03-11 21:17:33.187');
INSERT INTO `douban_annual_widget_infos` VALUES (466, NULL, NULL, '2016评分最高的|爱情片', 'ActivityPageWidget', 1, 190, 'Top 10', 'top10', 6, 0, '26683290,25855071,26354587,25839662,25827935,3868141,25843022,25929151,10745397,26726098', 'rgba(1, 82, 160, 0.8)', 'https://img1.doubanio.com/view/activity_page/raw/public/p1789.jpg', '这么大的世界里，能够遇见你，竟然需要如此用力。穿越错位的时空，仰望陨落的星辰，你没留下你的名字，我却无法忘记那句“我爱你”。', NULL, 'on', NULL, 'https://img1.doubanio.com/view/activity_page/raw/public/p1887.jpg', '7542909', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://movie.douban.com/ithil_j/activity/movie_annual2016/widget/16', NULL, '2019-03-11 21:17:33.187');
INSERT INTO `douban_annual_widget_infos` VALUES (467, NULL, NULL, '2016评分最高的|科幻/动作片', 'ActivityPageWidget', 1, 146, 'Top 10', 'top10', 6, 0, '25986180, 25815034, 25786060, 3025375, 2131940, 25820460, 26220717, 3718279, 25706773, 26266072', 'rgba(109, 25, 64, 0.8)', 'https://img3.doubanio.com/view/activity_page/raw/public/p1842.jpg', '没有全开主角光环，没有太bug的战斗力，合理保存了妇孺、亲情与歌声。第一枚丧女、坦克大叔、空降丧尸、高速丧尸车祸、挂满丧尸的火车头都十分出彩。', NULL, 'on', NULL, 'https://img3.doubanio.com/view/activity_page/raw/public/p1951.jpg', 'MovieL', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://movie.douban.com/ithil_j/activity/movie_annual2016/widget/17', NULL, '2019-03-11 21:17:33.187');
