INSERT INTO `douban_annual_widget_infos` VALUES (469, NULL, NULL, '2016评分最高的|动画片', 'ActivityPageWidget', 1, 196, 'Top 10', 'top10', 6, 0, '25662329, 26683290, 26344688, 26147991, 26598021, 25821673, 11589036, 25793398, 26287884, 26374205', 'rgba(81, 123, 57, 0.8)', 'https://img3.doubanio.com/view/activity_page/raw/public/p1945.jpg', '无论是人设，世界观，动画制作，还是剧本，都挑不出毛病来！细节多到爆！！最难能可贵的是配角们的人物性格和形象设置都非常饱满（教父梗好惊喜><）！！！', NULL, 'on', 'on', 'https://img3.doubanio.com/view/activity_page/raw/public/p1953.jpg', 'elevenrobin', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://movie.douban.com/ithil_j/activity/movie_annual2016/widget/20', NULL, '2019-03-11 21:17:33.187');
