INSERT INTO `douban_annual_widget_infos` VALUES (571, NULL, NULL, NULL, 'ActivityPageWidget', 2, 78, '台词', 'dialogue', 11, 0, NULL, NULL, 'https://img1.doubanio.com/view/activity_page/raw/public/p2457.jpg', NULL, NULL, 'on', NULL, 'https://img1.doubanio.com/view/activity_page/raw/public/p2617.jpg', NULL, NULL, NULL, NULL, '25934014', '　　等你拿到这个角色，你必须要付出一切，全力以赴，这是你的梦想。', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://movie.douban.com/ithil_j/activity/movie_annual2017/widget/19', NULL, '2019-03-11 21:17:33.187');
INSERT INTO `douban_annual_widget_infos` VALUES (591, NULL, NULL, '2017评分最高的外语电影', 'ActivityPageWidget', 1, 476, 'Top 10', 'top10', 11, 0, '26387939, 26799731, 26580232, 25980443, 10512661, 26761416, 26607693, 25934014, 26844922, 27024903', 'rgba(165, 118, 53, 0.7)', 'https://img3.doubanio.com/view/activity_page/raw/public/p2446.jpg', '　　多少理想主义者背负着别人的嘲讽往前走，而大他们十倍百倍的人一心想看他们笑话，多少人收到打击后一蹶不振，而只有他们十分之一百分之一的人可以触底反弹，这部电影他蒸馏你的热血，让你血气冲上大脑，然后水从眼里流出来，告诉你要成为这样的人。', '[object Object]', 'on', 'off', 'https://img3.doubanio.com/view/activity_page/raw/public/p2950.jpg', 'thenewhope', NULL, '0.9', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://movie.douban.com/ithil_j/activity/movie_annual2017/widget/1', NULL, '2019-03-11 21:17:33.187');
INSERT INTO `douban_annual_widget_infos` VALUES (592, NULL, NULL, '2017评分最高的华语电影', 'ActivityPageWidget', 1, 204, 'Top 10', 'top10', 11, 0, '27019527, 26773744, 26657126, 11600078, 26862829, 26704590, 26606242, 26270502, 26790961, 26877237', 'rgba(16, 112, 170, 0.7)', 'https://img3.doubanio.com/view/activity_page/raw/public/p2646.jpg', '　　年度最佳华语电影，有可能成为中国版《熔炉》，而且艺术水准绝对比后者高。女导演要第三方视角拍未成年人性侵丑闻，既保证了艺术性和个人表达，又保证了它的观赏性，镜头里不见残酷，但一线善意更加凸显了现实的黑暗，最后的结尾算得上神来之笔了，情感冲击力让人看完之后陷入久久的沉默。', NULL, 'on', 'on', 'https://img3.doubanio.com/view/activity_page/raw/public/p2956.jpg', 'zhangzongqian', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://movie.douban.com/ithil_j/activity/movie_annual2017/widget/2', NULL, '2019-03-11 21:17:33.187');
INSERT INTO `douban_annual_widget_infos` VALUES (683, NULL, NULL, '2017最受关注的大陆电视综艺', 'ActivityPageWidget', 1, 51, 'Top 10', 'top10', 11, 0, '27186619,26830087,27039382,26818263,26873657,26789755,27079327,26830085,26768316,26933239', 'rgba(182, 149, 44, 0.7)', 'https://img3.doubanio.com/view/activity_page/raw/public/p2161.jpg', '　　综艺是它的外壳，可内里却是严肃认真的文化。用真人演绎历史故事的形式讲述国宝“传奇的前世今生”，不再是隔着玻璃通过文字。', NULL, 'on', NULL, 'https://img1.doubanio.com/view/activity_page/raw/public/p2397.jpg', '49522216', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://movie.douban.com/ithil_j/activity/movie_annual2017/widget/39', NULL, '2019-03-11 21:17:33.187');
INSERT INTO `douban_annual_widget_infos` VALUES (684, NULL, NULL, '2017年度佳片演员', 'ActivityPageWidget', 4, 109, '人物', 'person', 11, 0, '1010507, 1022593, 1012531, 1037028, 1046960, 1344553, 1274418, 1031238, 1035124, 1369135', 'rgba(28, 49, 116, 0.7)', 'https://img1.doubanio.com/view/activity_page/raw/public/p2919.jpg', NULL, NULL, 'on', 'off', 'https://img1.doubanio.com/view/activity_page/raw/public/p2937.jpg', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'rgba(28, 49, 116, 0.7)', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://movie.douban.com/ithil_j/activity/movie_annual2017/widget/49', NULL, '2019-03-11 21:17:33.187');
INSERT INTO `douban_annual_widget_infos` VALUES (685, NULL, NULL, '2017评分最高的动画片', 'ActivityPageWidget', 1, 42, 'Top 10', 'top10', 11, 0, '20495023, 25837262, 26935251, 5327189, 26354572, 24860289, 26145033, 26958502, 26811587, 11611021', 'rgba(242, 139, 25, 0.7)', 'https://img3.doubanio.com/view/activity_page/raw/public/p2230.jpg', '　　供奉的遗像是牵引家人回家的通道，驻留的记忆是保持亡灵存续的神力。我为你写了首歌，穿越浩瀚的岁月烟尘，捱过冰冷的孤独冬季，横跨漫长的天人之路，在你老去的时候，唱给你听。这瑰丽的灯火万家，摇曳的烛光千盏，不如你梳着麻花辫坐在床头时，眼里闪烁的星光璀璨。', NULL, 'on', 'on', 'https://img1.doubanio.com/view/activity_page/raw/public/p3017.jpg', 'xilouchen', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://movie.douban.com/ithil_j/activity/movie_annual2017/widget/24', NULL, '2019-03-11 21:17:33.187');
INSERT INTO `douban_annual_widget_infos` VALUES (686, NULL, NULL, '2017评分最高的纪录片', 'ActivityPageWidget', 1, 37, 'Top 10', 'top10', 11, 0, '26430107,26764928,26679188,26679190, 27120369, 26806099, 27047887, 26920269, 26647876, 26324232', 'rgba(70, 118, 118, 0.7)', 'https://img3.doubanio.com/view/activity_page/raw/public/p2356.jpg', '　　愤怒是一个点动的情绪，没有人能持续愤怒70年，最终一切的情绪都要归于生活，归于平淡的一分一秒。被迫成为“慰安妇”，愤怒过后沉淀下来的是什么。太多的事都太难，而她们很美。《阿里郎》很美，知足很美，友好很美。', NULL, 'on', 'off', 'https://img1.doubanio.com/view/activity_page/raw/public/p2897.jpg', '1703926', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'rgba(65, 65, 65, 0.7)', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://movie.douban.com/ithil_j/activity/movie_annual2017/widget/25', NULL, '2019-03-11 21:17:33.187');
INSERT INTO `douban_annual_widget_infos` VALUES (687, NULL, NULL, '2017评分最高的短片', 'ActivityPageWidget', 1, 16, 'Top 10', 'top10', 11, 0, '26921952, 26884340, 27141014, 26966763, 27102542, 27070044, 26789384, 27112747, 26767306, 26855528', 'rgba(42, 104, 69, 0.7)', 'https://img3.doubanio.com/view/activity_page/raw/public/p2720.jpg', '　　童稚与世故对抗，纯真与暗箱交锋，虽不是什么新命题，却被呈现得鲜活灵动，意味深长，辅以稚嫩的童声合唱，平添了收放的力度。校合唱团的秘密其实是这个世界的运行规则，习惯了被消声的成年人大约不会认为老师有错，而多数孩子们也终将长成他们原先讨厌的样子…', NULL, 'on', 'on', NULL, '1511195', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://movie.douban.com/ithil_j/activity/movie_annual2017/widget/26', NULL, '2019-03-11 21:17:33.187');
INSERT INTO `douban_annual_widget_infos` VALUES (688, NULL, NULL, '2017年度最佳电影原声', 'ActivityPageWidget', 1, 39, 'Top 10', 'top10', 11, 0, '25934014, 26799731, 25937854, 25933890, 26920017, 26528871, 20495023, 26387939, 25837262, 11803087', 'rgba(200, 162, 64, 0.7)', 'https://img3.doubanio.com/view/activity_page/raw/public/p2603.jpg', '　　返璞归真用音乐、歌舞片形式讲述一个通俗化爱情故事，主要技法登峰造极。串联影史不同音乐、歌舞类型分支（米高梅、金姐弗雷德、大爵士、雅克德米及当代乐队片、演唱会电影）在不同段落相映成趣，既是传承又带出类型演变，复古又革新，且能升华爱情主题，内外兼修。', NULL, 'on', 'off', 'https://img3.doubanio.com/view/activity_page/raw/public/p3021.jpg', 'grinch', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://movie.douban.com/ithil_j/activity/movie_annual2017/widget/27', NULL, '2019-03-11 21:17:33.187');
