INSERT INTO `douban_annual_widget_infos` VALUES (690, NULL, NULL, NULL, 'ActivityPageWidget', 2, 75, '台词', 'dialogue', 11, 0, NULL, NULL, 'https://img3.doubanio.com/view/activity_page/raw/public/p2903.jpg', NULL, NULL, 'on', NULL, 'https://img3.doubanio.com/view/activity_page/raw/public/p2904.jpg', NULL, NULL, NULL, NULL, '25980443', '　　心一旦碎了，就会永远一直碎着。', NULL, NULL, NULL, NULL, '台词13', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://movie.douban.com/ithil_j/activity/movie_annual2017/widget/50', NULL, '2019-03-11 21:17:33.187');
INSERT INTO `douban_annual_widget_infos` VALUES (692, NULL, NULL, '11月最热门电影', 'ActivityPageWidget', 1, 12, 'Top 10', 'top10', 11, 0, '20495023, 25821634, 2158490, 25790761, 27019527, 26773744, 3604148, 26935251, 26657126, 26357945', 'rgba(219, 124, 12, 0.7)', 'https://img3.doubanio.com/view/activity_page/raw/public/p2981.jpg', '　　第一次觉得死后世界通往人间的万寿菊之桥和七夕鹊桥是一样的原理，爱不分种类是共通的，相见是因为想念，存在是因为记忆的力量。而只有墨西哥人能有欢乐的能力把悼念先人的节日过得如此五彩斑斓。', NULL, 'on', 'off', 'https://img3.doubanio.com/view/activity_page/raw/public/p2982.jpg', 'lassiedusky', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://movie.douban.com/ithil_j/activity/movie_annual2017/widget/69', NULL, '2019-03-11 21:17:33.187');
INSERT INTO `douban_annual_widget_infos` VALUES (693, NULL, NULL, '12月最热门电影', 'ActivityPageWidget', 1, 18, 'Top 10', 'top10', 11, 0, '26862829, 5350027, 25837262, 26799731, 26340419, 26761416, 26774722, 26661191, 26718828, 26718836', 'rgba(192, 38, 28, 0.7)', 'https://img1.doubanio.com/view/activity_page/raw/public/p2439.jpg', '　　适合带长辈们看，或许多少年后，就没人再拍这样的电影了…后面半小时泪弹太足，我们在最好的年代虚度光阴，他们在最坏的年代洗尽铅华。', NULL, 'on', 'on', 'https://img3.doubanio.com/view/activity_page/raw/public/p2934.jpg', 'tjz230', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://movie.douban.com/ithil_j/activity/movie_annual2017/widget/70', NULL, '2019-03-11 21:17:33.187');
INSERT INTO `douban_annual_widget_infos` VALUES (694, NULL, NULL, NULL, 'ActivityPageWidget', 2, 24, '台词', 'dialogue', 11, 0, NULL, NULL, 'https://img1.doubanio.com/view/activity_page/raw/public/p3007.jpg', NULL, NULL, 'on', NULL, 'https://img1.doubanio.com/view/activity_page/raw/public/p3008.jpg', NULL, NULL, NULL, NULL, '26920017', '　　我想他们不会回来了。', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://movie.douban.com/ithil_j/activity/movie_annual2017/widget/84', NULL, '2019-03-11 21:17:33.187');
INSERT INTO `douban_annual_widget_infos` VALUES (695, NULL, NULL, '2017评分最高的韩国电影', 'ActivityPageWidget', 1, 96, 'Top 10', 'top10', 11, 0, '27000061, 26616436, 26445216, 26800978, 26748688, 27018296, 26410593, 26169607, 26340301, 26718282', 'rgba(204, 187, 50, 0.7)', 'https://img1.doubanio.com/view/activity_page/raw/public/p2437.jpg', '　　和以往慰安题材电影不同的是，这部电影看待过去和现在的视角，不是单纯展现痛苦悲惨仇恨无力，而是用温暖坚定勇气包容去安慰那些受过伤的心，一起哭过痛过，也要一起笑着努力活下去。', NULL, 'on', 'off', 'https://img3.doubanio.com/view/activity_page/raw/public/p2954.jpg', '32658852', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://movie.douban.com/ithil_j/activity/movie_annual2017/widget/12', NULL, '2019-03-11 21:17:33.187');
INSERT INTO `douban_annual_widget_infos` VALUES (696, NULL, NULL, '2017评分最高的日本电影', 'ActivityPageWidget', 1, 46, 'Top 10', 'top10', 11, 0, '26754513, 26848504, 26815162, 26798437, 26691320, 26842503, 26279289, 26421442, 26751899, 26809007', 'rgba(182, 45, 106, 0.7)', 'https://img3.doubanio.com/view/activity_page/raw/public/p2156.jpg', '　　原来我们人生的本体生来就是破破烂烂，所以才会穷其一生不停地在缝缝补补。', NULL, 'on', 'off', 'https://img3.doubanio.com/view/activity_page/raw/public/p2955.jpg', '2065435', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://movie.douban.com/ithil_j/activity/movie_annual2017/widget/13', NULL, '2019-03-11 21:17:33.187');
INSERT INTO `douban_annual_widget_infos` VALUES (697, NULL, NULL, '2017评分最高的欧洲电影', 'ActivityPageWidget', 1, 36, 'Top 10', 'top10', 11, 0, '26580232, 26799731, 26761416, 26340419, 26653676, 26616719, 26746559, 22263645, 26678509, 26964434', 'rgba(10, 160, 130, 0.8)', 'https://img3.doubanio.com/view/activity_page/raw/public/p2166.jpg', '　　电影的重点在于“叙述”和“真相”的关系。在缺乏物证链条的基础上，男主的每一次叙述其实都是自洽且成立的，但或许也都不是真的。这一点才真的引人深思。我们所认定和掌握的真相，又有多少是被叙述掌控的呢？', NULL, 'on', 'on', 'https://img3.doubanio.com/view/activity_page/raw/public/p3024.jpg', '1233038', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://movie.douban.com/ithil_j/activity/movie_annual2017/widget/14', NULL, '2019-03-11 21:17:33.187');
INSERT INTO `douban_annual_widget_infos` VALUES (698, NULL, NULL, '2017年度LGBT电影', 'ActivityPageWidget', 1, 75, 'Top 10', 'top10', 11, 0, '26799731, 26754513, 26746559, 26884826, 26279289, 26617395, 26748688, 26360518, 26648249, 26781921', 'rgba(164, 48, 79, 0.8)', 'https://img3.doubanio.com/view/activity_page/raw/public/p3032.jpg', '　　慵懒而唯美的浮生初恋，有着最美的少年和最美的少年时代。它明明可以在“耽美”的小池塘惬意游泳，却纵身跳入“古典美”的急雷深渊，将希腊罗马时代就已断绝的同性爱慕温柔的打捞起来。', NULL, 'on', 'off', 'https://img1.doubanio.com/view/activity_page/raw/public/p3028.jpg', '3540441', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://movie.douban.com/ithil_j/activity/movie_annual2017/widget/16', NULL, '2019-03-11 21:17:33.187');
INSERT INTO `douban_annual_widget_infos` VALUES (699, NULL, NULL, '2017评分最高的喜剧片', 'ActivityPageWidget', 1, 36, 'Top 10', 'top10', 11, 0, '26340419, 26700276, 6873143, 26266085, 26884892, 26710371, 27038183, 22266126, 26769480, 26723165', 'rgba(203, 40, 37, 0.7)', 'https://img3.doubanio.com/view/activity_page/raw/public/p2170.jpg', '　　即使没有热血的励志，没有对存在或情感的深刻探讨，脱离宏伟的命题后，帕丁顿熊给我们的，是冬日里的一杯热可可，是用一百多分钟挡挡你心口的风，是唤醒胃里的暖意，驱散指尖氤氲的雾气，是对世界所有的善良再次投以信任，记起种过的花还有它芬芳的四溢。', NULL, 'on', 'off', 'https://img1.doubanio.com/view/activity_page/raw/public/p2857.jpg', '68918623', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://movie.douban.com/ithil_j/activity/movie_annual2017/widget/17', NULL, '2019-03-11 21:17:33.187');
INSERT INTO `douban_annual_widget_infos` VALUES (700, NULL, NULL, '2017评分最高的爱情片', 'ActivityPageWidget', 1, 60, 'Top 10', 'top10', 11, 0, '26799731, 25934014, 26616719, 26748688, 26884892, 26707472, 26920017, 26381195, 26457368, 26639958', 'rgba(222, 201, 24, 0.7)', 'https://img3.doubanio.com/view/activity_page/raw/public/p3033.jpg', '　　我一生最深刻的记忆，就是与你相爱的那个夏天，莫奈的涯径，隔绝全世界的阳台，慢跑游泳与自行车，故意弹错的钢琴曲，有情绪的泳裤以及有记忆的水蜜桃，以你的名字呼唤我，因为这是灵魂的融合。', NULL, 'on', 'off', 'https://img3.doubanio.com/view/activity_page/raw/public/p3034.jpg', '55617091', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://movie.douban.com/ithil_j/activity/movie_annual2017/widget/18', NULL, '2019-03-11 21:17:33.187');
INSERT INTO `douban_annual_widget_infos` VALUES (701, NULL, NULL, '2017评分最高的科幻/动作片', 'ActivityPageWidget', 1, 98, 'Top 10', 'top10', 11, 0, '10512661,25765735,25937854,21324900,25821634,24753477,11803087,26333560,1578714,25933890', 'rgba(26, 199, 226, 0.7)', 'https://img1.doubanio.com/view/activity_page/raw/public/p2207.jpg', '　　当之无愧的视听饕餮，罗杰狄金斯与汉斯季默无可挑剔。全片浸染着一种悲怆而崇高的宗教感，恍若神迹。虽故事除反高潮外并未免俗，但对真实与虚幻、人与非人、因果律与自由意志的探讨已足够哲学化。', NULL, 'on', 'on', 'https://img1.doubanio.com/view/activity_page/raw/public/p2318.jpg', '58206795', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://movie.douban.com/ithil_j/activity/movie_annual2017/widget/20', NULL, '2019-03-11 21:17:33.187');
INSERT INTO `douban_annual_widget_infos` VALUES (702, NULL, NULL, '2017评分最高的恐怖片', 'ActivityPageWidget', 1, 44, 'Top 10', 'top10', 11, 0, '26688480,3604148,11803087,27027913,26653833,26363201,26704623,26704621,26616731,26720627', 'rgba(13, 135, 170, 0.7)', 'https://img3.doubanio.com/view/activity_page/raw/public/p2652.jpg', '　　用硬梆梆的喜剧桥段反复把观众从传统恐怖片或政治隐喻的预设心理中拉出来，玩性大发，声东击西。你觉得吓人吗，其实挺喜剧的；你觉得是喜剧，那这很吓人了。', NULL, 'on', 'off', 'https://img3.doubanio.com/view/activity_page/raw/public/p2656.jpg', 'nezhaboy', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://movie.douban.com/ithil_j/activity/movie_annual2017/widget/21', NULL, '2019-03-11 21:17:33.187');
INSERT INTO `douban_annual_widget_infos` VALUES (703, NULL, NULL, '2017最受关注的大陆网络综艺', 'ActivityPageWidget', 1, 52, 'Top 10', 'top10', 11, 0, '27037043, 26999861, 26747853, 26912438, 27086865, 27046738, 27029098, 26966703, 27064932, 27058214', 'rgba(210, 52, 44, 0.7)', 'https://img3.doubanio.com/view/activity_page/raw/public/p2313.jpg', '　　还有比这帮人拍《热血高校》更合适的吗？！', NULL, 'on', 'on', 'https://img3.doubanio.com/view/activity_page/raw/public/p2390.jpg', 'F06185120', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://movie.douban.com/ithil_j/activity/movie_annual2017/widget/40', NULL, '2019-03-11 21:17:33.187');
