INSERT INTO `douban_annual_widget_infos` VALUES (719, NULL, NULL, '1月最热门电影', 'ActivityPageWidget', 1, 21, 'Top 10', 'top10', 11, 0, '21324900, 25801066, 25894431, 26862259, 3434070, 26879060, 26182910, 26389696, 26287884, 3868141', 'rgba(24, 134, 54, 0.7)', 'https://img3.doubanio.com/view/activity_page/raw/public/p2985.jpg', '　　你们知道外星人为什么把降临中国的城市选中为上海吗？因为他们搜索的时候发现了这句：上海自来水来自海上。', NULL, 'on', NULL, 'https://img1.doubanio.com/view/activity_page/raw/public/p2998.jpg', 'Len.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://movie.douban.com/ithil_j/activity/movie_annual2017/widget/56', NULL, '2019-03-11 21:17:33.187');
INSERT INTO `douban_annual_widget_infos` VALUES (720, NULL, NULL, '2月最热门电影', 'ActivityPageWidget', 1, 19, 'Top 10', 'top10', 11, 0, '25934014, 20471852, 3230115, 25980443, 26354572, 11526817, 26648249, 26685451, 6873905, 26615208', 'rgba(24, 64, 125, 0.7)', 'https://img3.doubanio.com/view/activity_page/raw/public/p2996.jpg', '　　这部电影有多好呢？想象这样一个场景：二十年后的一个傍晚，你开着车(或者车载着你)在回家的路上，突然扬声器里开始放起这首电影里的旋律，听到第一个音符的一瞬间，所有的情绪全都涌上来，就好像二十年前的那个夜晚你第一次听到它们的时候那样。', NULL, 'on', 'off', 'https://img1.doubanio.com/view/activity_page/raw/public/p2997.jpg', 'ClaudWang', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://movie.douban.com/ithil_j/activity/movie_annual2017/widget/57', NULL, '2019-03-11 21:17:33.187');
