INSERT INTO `douban_annual_widget_infos` VALUES (727, NULL, NULL, '2017开播20周年的剧集', 'ActivityPageWidget', 1, 40, 'Top 10', 'top10', 11, 0, '1863941, 2993424, 2190925, 1830575, 2015069, 1432448, 1438759, 1761707, 2155335, 1475579', 'rgba(99, 59, 106, 0.7)', 'https://img1.doubanio.com/view/activity_page/raw/public/p2729.jpg', '　　剧情尽显江湖险恶，又有峰回路转，更有剪不断理还乱的三角苦恋，演员们表演都很认真，颇具可观性。该剧不失金庸原著之风范，堪称又一经典作品。', NULL, 'on', 'off', 'https://img1.doubanio.com/view/activity_page/raw/public/p2849.jpg', '151135671', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://movie.douban.com/ithil_j/activity/movie_annual2017/widget/79', NULL, '2019-03-11 21:17:33.187');
INSERT INTO `douban_annual_widget_infos` VALUES (728, NULL, NULL, '2017开播30周年的剧集', 'ActivityPageWidget', 5, 29, 'Top 5', 'top5', 11, 0, '1864810, 1817169, 1845625, 1845571, 3010196', 'rgba(227, 32, 18, 0.7)', 'https://img1.doubanio.com/view/activity_page/raw/public/p2737.jpg', '　　配乐好，与原著诗词浑然一体；陈晓旭好，天生一个林妹妹；邓婕好，举手投足都是戏；结尾好，放弃市面上流传最广的伪高续，这才是真正的千红一哭、万艳同悲、一败涂地。', NULL, 'on', 'on', 'https://img3.doubanio.com/view/activity_page/raw/public/p2850.jpg', 'luhua', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://movie.douban.com/ithil_j/activity/movie_annual2017/widget/80', NULL, '2019-03-11 21:17:33.187');
