INSERT INTO `douban_annual_widget_infos` VALUES (733, NULL, NULL, '2017-2018北美颁奖季最期待获奖佳片', 'ActivityPageWidget', 1, 27, 'Top 10', 'top10', 11, 0, '26588314, 26809592, 26611804, 26787574, 25944886, 26778790, 26990609, 26756049, 26610229, 26752852', 'rgba(167, 72, 61, 0.7)', 'https://img1.doubanio.com/view/activity_page/raw/public/p3009.jpg', '　　人只有失去了才懂得珍惜，只有在纽约逼仄的楼宇间才想起Sacramento的阳光，只有听见陌生教堂的唱诗班歌声才怀念教会学校生活，只有离开了家才知道爱着爸妈。矫情不一定是无病呻吟，有时只是无能为力。', NULL, 'on', 'off', 'https://img3.doubanio.com/view/activity_page/raw/public/p3012.jpg', '62445798', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://movie.douban.com/ithil_j/activity/movie_annual2017/widget/87', NULL, '2019-03-11 21:17:33.187');
INSERT INTO `douban_annual_widget_infos` VALUES (734, NULL, NULL, '2017评分最高的英美剧（新剧）', 'ActivityPageWidget', 1, 44, 'Top 10', 'top10', 11, 0, '27031389, 26798481, 26813221, 25884125, 26691486, 26787149, 25953429, 26926437, 26784967, 26710394', 'rgba(153, 69, 83, 0.7)', 'https://img1.doubanio.com/view/activity_page/raw/public/p2928.jpg', '　　他们多幸运啊！在这么烂的世界十几岁就找到了最爱。', NULL, 'on', 'off', 'https://img1.doubanio.com/view/activity_page/raw/public/p2929.jpg', 'NONOW', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://movie.douban.com/ithil_j/activity/movie_annual2017/widget/32', NULL, '2019-03-11 21:17:33.187');
INSERT INTO `douban_annual_widget_infos` VALUES (735, NULL, NULL, '2017评分最高的大陆网络剧集', 'ActivityPageWidget', 1, 86, 'Top 10', 'top10', 11, 0, '26883064, 26979979, 26581830, 26776350, 26930540, 26772013, 26868416, 26865362, 26322999, 27008416', 'rgba(142, 32, 23, 0.7)', 'https://img1.doubanio.com/view/activity_page/raw/public/p2538.jpg', '　　真真的低估了当今的网剧质量，印象里仍停留在几年前粗制滥造页游水平，好看程度不亚于十几年前的《黑洞》。 ', NULL, 'on', 'off', 'https://img1.doubanio.com/view/activity_page/raw/public/p2858.jpg', 'domisodagreen', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://movie.douban.com/ithil_j/activity/movie_annual2017/widget/29', NULL, '2019-03-11 21:17:33.187');
INSERT INTO `douban_annual_widget_infos` VALUES (736, NULL, NULL, '2017评分最高的大陆电视剧集', 'ActivityPageWidget', 1, 55, 'Top 10', 'top10', 11, 0, '26322644, 5923466, 26727273, 26685864, 26605881, 26663086, 26683725, 26801052, 26776469, 24827545', 'rgba(114, 93, 45, 0.7)', 'https://img3.doubanio.com/view/activity_page/raw/public/p2742.jpg', '　　白鹿原上有白鹿，世间再无陈忠实。剧版依然可以说是完美，小说给了人物皮囊，而演员给了角色灵魂，看着长辈从壮年到暮年，后辈从娃娃到成人，又看着旧制废除到新国成立，国共权势在原上风水轮流，不胜唏嘘。白鹿一村，是社会缩影，也是人生背影。', NULL, 'on', 'on', 'https://img3.doubanio.com/view/activity_page/raw/public/p2882.jpg', 'movie24city', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://movie.douban.com/ithil_j/activity/movie_annual2017/widget/30', NULL, '2019-03-11 21:17:33.187');
