INSERT INTO `douban_annual_widget_infos` VALUES (738, NULL, NULL, NULL, 'ActivityPageWidget', 2, 35, '台词', 'dialogue', 11, 0, NULL, NULL, 'https://img1.doubanio.com/view/activity_page/raw/public/p2688.jpg', NULL, NULL, 'on', NULL, 'https://img3.doubanio.com/view/activity_page/raw/public/p2864.jpg', NULL, NULL, NULL, NULL, '26784967', '　　很多事情现在都不能做了，你们现在可能觉得这“不正常”，但时间会改变一切，这会成为新“正常”。', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://movie.douban.com/ithil_j/activity/movie_annual2017/widget/34', NULL, '2019-03-11 21:17:33.187');
INSERT INTO `douban_annual_widget_infos` VALUES (739, NULL, NULL, NULL, 'ActivityPageWidget', 2, 39, '台词', 'dialogue', 11, 0, NULL, NULL, 'https://img3.doubanio.com/view/activity_page/raw/public/p2900.jpg', NULL, NULL, 'on', NULL, 'https://img1.doubanio.com/view/activity_page/raw/public/p2868.jpg', NULL, NULL, NULL, NULL, '26951886', '　　灰心丧气会使人成长，但这只限年轻人！现在的我们需要的不是成长，而是结果。', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://movie.douban.com/ithil_j/activity/movie_annual2017/widget/38', NULL, '2019-03-11 21:17:33.187');
INSERT INTO `douban_annual_widget_infos` VALUES (740, NULL, NULL, '2017评分最高的日剧', 'ActivityPageWidget', 1, 33, 'Top 10', 'top10', 11, 0, '26895171, 26947873, 26951886, 27097746, 26930506, 26924729, 26972675, 27062635, 26986846, 27054593', 'rgba(223, 145, 9, 0.8)', 'https://img3.doubanio.com/view/activity_page/raw/public/p2523.jpg', '　　坂元裕二的剧本像林夕的词那么通透，意味深长透彻心扉 总是夹杂着人性的光和残缺的美，如果此生没有看过一部坂元裕二那该多遗憾。', NULL, 'on', NULL, 'https://img3.doubanio.com/view/activity_page/raw/public/p2865.jpg', 'sukijuri', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://movie.douban.com/ithil_j/activity/movie_annual2017/widget/35', NULL, '2019-03-11 21:17:33.187');
INSERT INTO `douban_annual_widget_infos` VALUES (741, NULL, NULL, '2017评分最高的韩剧', 'ActivityPageWidget', 1, 39, 'Top 10', 'top10', 11, 0, '26934346, 27081753, 27011834, 27103757, 27097812, 26889608, 26887064, 26972688, 26870796, 26815054', 'rgba(123, 56, 47, 0.8)', 'https://img3.doubanio.com/view/activity_page/raw/public/p2724.jpg', '　　要是几年前，我还会想，什么时候我们也会有这样的剧。现在已经不想了。从艺术上的细腻到关联现实而引发的力量，太难了。', NULL, 'on', 'off', 'https://img3.doubanio.com/view/activity_page/raw/public/p2891.jpg', '84529817', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://movie.douban.com/ithil_j/activity/movie_annual2017/widget/36', NULL, '2019-03-11 21:17:33.187');
INSERT INTO `douban_annual_widget_infos` VALUES (742, NULL, NULL, '2017评分最高的其他地区剧集', 'ActivityPageWidget', 1, 26, 'Top 10', 'top10', 11, 0, '27012497, 26905456, 27112705, 26328109, 27016390, 26786561, 26949201, 26808226, 26863096, 26873132', 'rgba(170, 171, 27, 0.7)', 'https://img3.doubanio.com/view/activity_page/raw/public/p2721.jpg', '　　从友谊到爱恋到性向认同到宗教信仰，一季比一季更为拔高的主题注定了该系列的视角远不止于青春悸动那么简单——它歌颂年轻，它主张自由，它关照个体，它尊重异类，它思考社会，它还坚守着一个古老而永恒的话题：爱。', NULL, 'on', 'off', 'https://img3.doubanio.com/view/activity_page/raw/public/p2880.jpg', '48687824', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://movie.douban.com/ithil_j/activity/movie_annual2017/widget/37', NULL, '2019-03-11 21:17:33.187');
INSERT INTO `douban_annual_widget_infos` VALUES (743, NULL, NULL, '2017评分最高的英美剧（非新剧）', 'ActivityPageWidget', 1, 64, 'Top 10', 'top10', 11, 0, '26748847, 26958597, 26938395, 26869684, 26717030, 26235354, 26588239, 26776807, 26844438, 26684329', 'rgba(150, 25, 53, 0.8)', 'https://img3.doubanio.com/view/activity_page/raw/public/p2521.jpg', '　　一朋友说有点闷，但对我而言，就好像才吃了一份毒师的汉堡，结果又来了一盘律师的披萨，撑死的感觉不能再爽！！', NULL, 'on', 'on', 'https://img1.doubanio.com/view/activity_page/raw/public/p2888.jpg', '139503437', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://movie.douban.com/ithil_j/activity/movie_annual2017/widget/33', NULL, '2019-03-11 21:17:33.187');
INSERT INTO `douban_annual_widget_infos` VALUES (744, NULL, NULL, '2017最受关注的院线电影', 'ActivityPageWidget', 1, 187, 'Top 10', 'top10', 11, 0, '26363254, 26387939, 25934014, 20495023, 26862259, 26580232, 26607693, 27038183, 27024903, 25765735', 'rgba(42, 95, 74, 0.7)', 'https://img3.doubanio.com/view/activity_page/raw/public/p2815.jpg', '　　也许，你永远也不会知道你的祖国给了你多么强健的安全感；也许，你终有一日会发现你也深爱着你的祖国。', NULL, 'on', NULL, 'https://img3.doubanio.com/view/activity_page/raw/public/p2946.jpg', 'sophiagracewei', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://movie.douban.com/ithil_j/activity/movie_annual2017/widget/4', NULL, '2019-03-11 21:17:33.187');
INSERT INTO `douban_annual_widget_infos` VALUES (745, NULL, NULL, '2017最受关注的非院线电影', 'ActivityPageWidget', 1, 65, 'Top 10', 'top10', 11, 0, '26688480, 26648249, 26279289, 26600660, 26799731, 3604148, 26593587, 11600078, 26615208, 22263645', 'rgba(15, 135, 170, 0.7)', 'https://img3.doubanio.com/view/activity_page/raw/public/p2650.jpg', '　　惊悚片玩脱的最高境界。导演巧妙地把俗套的剧情反转反转再反转，硬是变成一场贺岁档合家欢喜剧片。全场爆笑，掌声不断，呼声四起，变成一场大派对。小成本制作却精良，导演懂得观众想要什么，也知道如何打造一部商业片。', NULL, 'on', 'on', 'https://img1.doubanio.com/view/activity_page/raw/public/p2667.jpg', '106347535', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://movie.douban.com/ithil_j/activity/movie_annual2017/widget/5', NULL, '2019-03-11 21:17:33.187');
INSERT INTO `douban_annual_widget_infos` VALUES (746, NULL, NULL, '2017年度最期待华语独立佳作', 'ActivityPageWidget', 1, 52, 'Top 10', 'top10', 11, 0, '26961159, 27059130, 26738204, 26903993, 27113517, 26954003, 27077266, 26647117, 26930782, 26969821', 'rgba(42, 42, 42, 0.8)', 'https://img3.doubanio.com/view/activity_page/raw/public/p2422.jpg', '　　我们要多么努力的去做一个看似正常的人，我们要是异性恋、是能控制自己情绪的人、是喝酒不失态的人、是老老实实找份稳定工作的人、是充满正能量的人。医生也搞不懂正常和不正常的边界是什么，人生而为人的尊严就像一袋袋垃圾被监护人扔进卫生局直属的填埋场，可怕的是出去又回来的人，已分不清墙内墙外。', NULL, 'on', NULL, 'https://img3.doubanio.com/view/activity_page/raw/public/p2672.jpg', '4447333', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://movie.douban.com/ithil_j/activity/movie_annual2017/widget/8', NULL, '2019-03-11 21:17:33.187');
INSERT INTO `douban_annual_widget_infos` VALUES (747, NULL, NULL, '2017年度中国大陆网络/电视电影', 'ActivityPageWidget', 1, 76, 'Top 10', 'top10', 11, 0, '26951951,26951953,26990713,26771100,26296026,26959223,27041519,26891314,27133264,27065880', 'rgba(170, 50, 41, 0.7)', 'https://img1.doubanio.com/view/activity_page/raw/public/p2309.jpg', '　　小鲜肉把小鲜肉已经拍死在了沙滩上。', NULL, 'on', 'on', 'https://img3.doubanio.com/view/activity_page/raw/public/p2675.jpg', 'metthew', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://movie.douban.com/ithil_j/activity/movie_annual2017/widget/9', NULL, '2019-03-11 21:17:33.187');
INSERT INTO `douban_annual_widget_infos` VALUES (748, NULL, NULL, '2017年度冷门佳片', 'ActivityPageWidget', 1, 45, 'Top 10', 'top10', 11, 0, '25938803, 25822430, 26586432, 26881114, 26942631, 26384493, 26593587, 26685451, 26700276, 26727890', 'rgba(54, 161, 200, 0.8)', 'https://img3.doubanio.com/view/activity_page/raw/public/p2473.jpg', '　　“我们是一对落单的袜子”，不怕被世界遗弃，只因可以与你相濡以沫，这座亮着灯的小小房子，装满了相持走过的岁月，记载了心灵融化的过程，是爱的记忆，是幸福的见证，人群中找到彼此就是盛大的幸福。', NULL, 'on', NULL, 'https://img3.doubanio.com/view/activity_page/raw/public/p2680.jpg', 'flowermumu', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://movie.douban.com/ithil_j/activity/movie_annual2017/widget/10', NULL, '2019-03-11 21:17:33.187');
