INSERT INTO `douban_annual_widget_infos` VALUES (750, NULL, NULL, '2017上映20周年的电影', 'ActivityPageWidget', 1, 65, 'Top 10', 'top10', 11, 0, '1292722,1292063,1292656,1292679,1297359,1292659,1303021,1303173,1293531,1300618', 'rgba(170, 104, 69, 0.7)', 'https://img3.doubanio.com/view/activity_page/raw/public/p3000.jpg', '　　敬意给所有从容死去的人。给安德鲁斯。给我最爱的大西洋。给童年半梦半醒那段回忆里对电影的一切记忆。', NULL, 'on', 'on', 'https://img3.doubanio.com/view/activity_page/raw/public/p3001.jpg', '46303333', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://movie.douban.com/ithil_j/activity/movie_annual2017/widget/73', NULL, '2019-03-11 21:17:33.187');
INSERT INTO `douban_annual_widget_infos` VALUES (751, NULL, NULL, '2017上映30周年的电影', 'ActivityPageWidget', 1, 36, 'Top 10', 'top10', 11, 0, '1297447,1293172,1300055,1959195,1297862,1301912,1293422,1292330,1293456,1292504', 'rgba(188, 24, 24, 0.7)', 'https://img3.doubanio.com/view/activity_page/raw/public/p3002.jpg', '　　有些电影每次看都仿佛是初看。曾经的记忆只停留在痴男怨女未可得的爱情，可如今再看，对于人间和鬼界的纠缠与辩证，才最是深刻。', NULL, 'on', NULL, 'https://img3.doubanio.com/view/activity_page/raw/public/p3003.jpg', '1083016', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://movie.douban.com/ithil_j/activity/movie_annual2017/widget/74', NULL, '2019-03-11 21:17:33.187');
