INSERT INTO `douban_annual_widget_infos` VALUES (777, NULL, NULL, '2018最受关注的非院线电影', 'ActivityPageWidget', 1, 65, 'Top 10', 'top10', 15, 0, '26588314, 26588308, 27113517, 27059130, 11584016, 26842702, 26654269, 26945085, 26654498, 26725678', 'rgba(121, 92, 78, .8)', 'https://img3.doubanio.com/view/activity_page/raw/public/p3715.jpg', '也曾经想成为看起来很酷的人，最后还是想做回自己。', '[object Object]', 'on', 'on', 'https://img1.doubanio.com/view/activity_page/raw/public/p3717.jpg', '2762059', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://movie.douban.com/ithil_j/activity/movie_annual2018/widget/5', NULL, '2019-03-11 21:17:33.187');
INSERT INTO `douban_annual_widget_infos` VALUES (834, 'off', NULL, '2018评分最高的外语电影', 'ActivityPageWidget', 1, 219, 'Top 10', 'top10', 15, 0, '4920389, 26611804, 27622447, 26787574, 27072795, 27615441, 26654498, 26683421, 26336252, 26990609', 'rgba(67, 57, 94, .8)', 'https://img3.doubanio.com/view/activity_page/raw/public/p3765.jpg', '斯皮尔伯格把他对电影的梦想、热心、爱与情怀，浓缩到这部片子，通过极具年代感的经典电影和角色，又并茂高科技的现代游戏闯关，他拿手的、专注的、想诉说的都在这里给影迷情倾盆呈现。', NULL, 'on', 'on', 'https://img1.doubanio.com/view/activity_page/raw/public/p3809.jpg', '1005928', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://movie.douban.com/ithil_j/activity/movie_annual2018/widget/2', NULL, '2019-03-11 21:17:33.187');
INSERT INTO `douban_annual_widget_infos` VALUES (835, 'on', '电影', '2018评分最高的华语电影', 'ActivityPageWidget', 1, 332, 'Top 10', 'top10', 15, 0, '26752088, 27059130, 26861685, 25716096, 26425063, 27110296, 26647117, 27113517, 27172891, 6874741', NULL, 'https://img3.doubanio.com/view/activity_page/raw/public/p3190.jpg', '在我们刚刚经历过的时代巨变洪流之中，有无数这样的小人物在时代洪流中艰难生存着，同时在竭力不丢失他们的灵魂。终于有这样一部电影，让我们能够看到时代，看到善意，看到希望。希望这部电影也能被这个时代善待。', NULL, 'on', 'on', 'https://img1.doubanio.com/view/activity_page/raw/public/p3789.jpg', '2279829', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://movie.douban.com/ithil_j/activity/movie_annual2018/widget/1', NULL, '2019-03-11 21:17:33.187');
INSERT INTO `douban_annual_widget_infos` VALUES (836, NULL, NULL, '2018最受关注的院线电影', 'ActivityPageWidget', 1, 118, 'Top 10', 'top10', 15, 0, '26752088, 4920389, 26861685, 26698897, 27605698, 26985127, 24773958, 6874741, 26611804, 26366496', 'rgba(103, 64, 50, .8)', 'https://img3.doubanio.com/view/activity_page/raw/public/p3203.jpg', '表面说的是药，深层说的是命。药能治病，命却不由自主，这是影片锲入中国现实的关键，也是引发大众共鸣的核心。盛世危言，却让人能看到希望，仅此一点，就足以让人忽略因商业和审查做出的种种妥协。', NULL, 'on', 'on', 'https://img3.doubanio.com/view/activity_page/raw/public/p3344.jpg', '2521825', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://movie.douban.com/ithil_j/activity/movie_annual2018/widget/4', NULL, '2019-03-11 21:17:33.187');
INSERT INTO `douban_annual_widget_infos` VALUES (837, NULL, NULL, '2018年度最期待华语独立佳作', 'ActivityPageWidget', 1, 47, 'Top 10', 'top10', 15, 0, '27191492, 27119586, 27191431, 26958485, 26900391, 27193255, 26633257, 30283308, 26845720, 30283179', 'rgba(162, 91, 110, .9)', 'https://img1.doubanio.com/view/activity_page/raw/public/p3338.jpg', '很少有电影中会展现这样自然有活力有趣味的家庭，诗意来自生活也来自土壤，歌声组成情绪，成为私人影像记录中毫不矫情又弥足珍贵的记忆。', NULL, 'on', 'off', 'https://img3.doubanio.com/view/activity_page/raw/public/p3342.jpg', '2744437', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://movie.douban.com/ithil_j/activity/movie_annual2018/widget/8', NULL, '2019-03-11 21:17:33.187');
INSERT INTO `douban_annual_widget_infos` VALUES (838, NULL, NULL, '2018年度冷门佳片', 'ActivityPageWidget', 1, 47, 'Top 10', 'top10', 15, 0, '26952704, 27114240, 26951692, 26793852, 1950330, 27608785, 26731376, 26965165, 27615398, 26979007', 'rgba(71, 58, 52, .8)', 'https://img3.doubanio.com/view/activity_page/raw/public/p3722.jpg', '西部片开场但打破套路，反思和情怀并存，整部电影依然是个华丽丽的歌单，味道还是科恩兄弟。', NULL, 'on', NULL, 'https://img3.doubanio.com/view/activity_page/raw/public/p3723.jpg', '3739650', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://movie.douban.com/ithil_j/activity/movie_annual2018/widget/9', NULL, '2019-03-11 21:17:33.187');
INSERT INTO `douban_annual_widget_infos` VALUES (839, NULL, NULL, '2018评分最高的韩国电影', 'ActivityPageWidget', 1, 67, 'Top 10', 'top10', 15, 0, '26683421, 27018285, 26863778, 26842702, 27017288, 11584016, 27621192, 26980827, 27003543, 26877492', NULL, 'https://img1.doubanio.com/view/activity_page/raw/public/p3728.jpg', '剧情张力十足的冷战风格间谍战，不动神色、冷静克制却又招招致命，时代感的还原和剧情的严谨度都是《密探》之后的韩影最佳，而90年代初北京和平壤的美术设计都让人拍手叫绝。', NULL, 'on', NULL, 'https://img3.doubanio.com/view/activity_page/raw/public/p3730.jpg', 'reave', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://movie.douban.com/ithil_j/activity/movie_annual2018/widget/11', NULL, '2019-03-11 21:17:33.187');
INSERT INTO `douban_annual_widget_infos` VALUES (840, NULL, NULL, '2018评分最高的日本电影', 'ActivityPageWidget', 1, 38, 'Top 10', 'top10', 15, 0, ' 27622447,30234315,27147739, 27040737, 26784898, 27108740, 26992114, 27102505, 26742730, 26972275', 'rgba(84, 84, 63, .8)', 'https://img3.doubanio.com/view/activity_page/raw/public/p3731.jpg', '如果说爱你，还打你，那一定是说谎；如果爱你，就会像安藤樱一样紧紧抱住你。', NULL, 'on', 'on', 'https://img3.doubanio.com/view/activity_page/raw/public/p3732.jpg', 'gegejing', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://movie.douban.com/ithil_j/activity/movie_annual2018/widget/12', NULL, '2019-03-11 21:17:33.187');
INSERT INTO `douban_annual_widget_infos` VALUES (841, NULL, NULL, '2018评分最高的欧洲电影', 'ActivityPageWidget', 1, 21, 'Top 10', 'top10', 15, 0, '27072795, 26781703, 26346327, 3036465, 27098888, 26872545, 26894602, 26979199, 26610229, 30162520', 'rgba(129, 153, 148, .8)', 'https://img3.doubanio.com/view/activity_page/raw/public/p3733.jpg', '拉扎罗无疑是本世纪最伟大的银幕形象之一，他对世间一切都不清楚不明白，但却从不困惑不迷惘。他的淳朴成为他蠢笨的罪证，却又如镜子一般照出旁人的丑恶。', NULL, 'on', 'on', 'https://img3.doubanio.com/view/activity_page/raw/public/p3734.jpg', 'duduxiongzhifu', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://movie.douban.com/ithil_j/activity/movie_annual2018/widget/14', NULL, '2019-03-11 21:17:33.187');
INSERT INTO `douban_annual_widget_infos` VALUES (842, NULL, NULL, '2018年度LGBT电影', 'ActivityPageWidget', 1, 77, 'Top 10', 'top10', 15, 0, '26654498, 26781703, 26979199, 26870023, 30172472, 30159390, 26656655, 11524958, 28461121, 26929023', 'rgba(73, 61, 102, .85)', 'https://img3.doubanio.com/view/activity_page/raw/public/p3735.jpg', '可爱、风趣、感人，主流银幕上独一无二的出柜故事。它没有负面挣扎，也没有安利说教，而是带着气势如虹的青春气息，让男主的一封封信和旁白见证成长。', NULL, 'on', 'off', 'https://img3.doubanio.com/view/activity_page/raw/public/p3736.jpg', '3540441', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://movie.douban.com/ithil_j/activity/movie_annual2018/widget/15', NULL, '2019-03-11 21:17:33.187');
INSERT INTO `douban_annual_widget_infos` VALUES (843, NULL, NULL, '2018评分最高的喜剧片', 'ActivityPageWidget', 1, 60, 'Top 10', 'top10', 15, 0, '26752088, 27059130, 30234315, 26952704, 27110296, 25944886, 26588308, 30140571, 27050259, 26985127', 'rgba(80, 40, 23, .9)', 'https://img3.doubanio.com/view/activity_page/raw/public/p3740.jpg', '剧作标准朴素，具有一定批判性的同时也找到了尺度上的分寸，在伦理道德与社会制度的冲突之间传递人性之善，不仅对电影产业有益，也具备社会关怀的价值，当下环境太缺这种作品了。', NULL, 'on', 'on', 'https://img3.doubanio.com/view/activity_page/raw/public/p3741.jpg', 'christopherlin', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://movie.douban.com/ithil_j/activity/movie_annual2018/widget/17', NULL, '2019-03-11 21:17:33.187');
INSERT INTO `douban_annual_widget_infos` VALUES (844, NULL, NULL, '2018评分最高的爱情片', 'ActivityPageWidget', 1, 37, 'Top 10', 'top10', 15, 0, '26654498, 27018285, 26781703, 26951692, 3036465, 26965165, 6874741, 26972258, 26809592, 26752852', 'rgba(73, 61, 102, .85)', 'https://img3.doubanio.com/view/activity_page/raw/public/p3751.jpg', '永远年轻，永远热泪盈眶，并不是钢铁摇滚直男的专利。', NULL, 'on', NULL, 'https://img3.doubanio.com/view/activity_page/raw/public/p3752.jpg', 'pigbigleg', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://movie.douban.com/ithil_j/activity/movie_annual2018/widget/18', NULL, '2019-03-11 21:17:33.187');
INSERT INTO `douban_annual_widget_infos` VALUES (845, NULL, NULL, '2018评分最高的科幻/动作片', 'ActivityPageWidget', 1, 93, 'Top 10', 'top10', 15, 0, '4920389, 24773958, 3878007, 27093707, 26588308, 3168101, 26636712, 26384741, 22265634, 26586766', 'rgba(55, 55, 97, .8)', 'https://img3.doubanio.com/view/activity_page/raw/public/p3755.jpg', '就像第一次玩俄罗斯方块，那个竖条降落的时候的感觉。我没办法给出更高的评价了。', NULL, 'on', 'off', 'https://img3.doubanio.com/view/activity_page/raw/public/p3756.jpg', 'yimaxxduck', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://movie.douban.com/ithil_j/activity/movie_annual2018/widget/20', NULL, '2019-03-11 21:17:33.187');
INSERT INTO `douban_annual_widget_infos` VALUES (846, NULL, NULL, '2018评分最高的恐怖/惊悚片', 'ActivityPageWidget', 1, 64, 'Top 10', 'top10', 15, 0, '27615441, 26725678, 26369884, 30201003, 26961821, 27621727, 26721644, 27012731, 27188152, 26997663', NULL, 'https://img1.doubanio.com/view/activity_page/raw/public/p3757.jpg', '电影的形式不单只是噱头，更像是潜移默化的透露着社交网络和流媒体对我们生活造成无处不在利与弊。当我们跟着John Cho一路抽丝剥茧地看到真相，心里不禁寒蝉，原来我们和父母有时真的是这世上最熟悉的陌生人。', NULL, 'on', NULL, 'https://img1.doubanio.com/view/activity_page/raw/public/p3758.jpg', '35790692', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://movie.douban.com/ithil_j/activity/movie_annual2018/widget/21', NULL, '2019-03-11 21:17:33.187');
INSERT INTO `douban_annual_widget_infos` VALUES (847, NULL, NULL, '2018评分最高的动画片', 'ActivityPageWidget', 1, 108, 'Top 10', 'top10', 15, 0, '26640371, 20438964, 26346327, 27042405, 26359235, 25849049, 26944582, 26649604, 25846857, 26954003', 'rgba(156, 119, 90, .8)', 'https://img3.doubanio.com/view/activity_page/raw/public/p3761.jpg', '韦斯·安德森对日本文化的熟稔程度令人咋舌，影片的视听语言更在无比闪耀的配乐下推向极致。这不是一篇关乎人与动物情感的小阙，而更像是一幅探索心脏瓣膜究竟有多纤薄，如何揉碎在触碰间的诗篇。', NULL, 'on', 'off', 'https://img3.doubanio.com/view/activity_page/raw/public/p3762.jpg', '1591741', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://movie.douban.com/ithil_j/activity/movie_annual2018/widget/23', NULL, '2019-03-11 21:17:33.187');
INSERT INTO `douban_annual_widget_infos` VALUES (848, NULL, NULL, '2018评分最高的纪录片', 'ActivityPageWidget', 1, 32, 'Top 10', 'top10', 15, 0, '26874505, 30163799, 30263943, 26984189, 30268753, 30167539, 27615467, 30234901, 27012433, 26720946', 'rgba(97, 102, 77, .9)', 'https://img3.doubanio.com/view/activity_page/raw/public/p3763.jpg', '活得越久越能明白，人生是循序渐进，不紧不慢的过程。孜孜不倦地去活，自然会结出丰硕的果。', NULL, 'on', 'off', 'https://img3.doubanio.com/view/activity_page/raw/public/p3804.jpg', 'yanluohan', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://movie.douban.com/ithil_j/activity/movie_annual2018/widget/24', NULL, '2019-03-11 21:17:33.187');
INSERT INTO `douban_annual_widget_infos` VALUES (849, NULL, NULL, '2018评分最高的短片', 'ActivityPageWidget', 1, 17, 'Top 10', 'top10', 15, 0, '30287738, 27176528, 27073245, 30167489, 30183608, 27043672, 30232270, 27119473, 27179561, 26999591						', NULL, 'https://img3.doubanio.com/view/activity_page/raw/public/p3596.jpg', '女性歧视女性，黑人歧视黑人，中年人歧视中年人……歧视和自己相同的人群，才是最可怕的。', NULL, 'on', 'off', 'https://img3.doubanio.com/view/activity_page/raw/public/p3626.jpg', 'lingrui1995', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://movie.douban.com/ithil_j/activity/movie_annual2018/widget/26', NULL, '2019-03-11 21:17:33.187');
INSERT INTO `douban_annual_widget_infos` VALUES (850, NULL, NULL, '2018年度电影原声', 'ActivityPageWidget', 1, 38, 'Top 10', 'top10', 15, 0, '5300054, 26809592, 26791455, 4058933, 3095514, 26640371, 3026559, 26952704, 4920389, 6390825', 'rgba(111, 63, 135, .8)', 'https://img3.doubanio.com/view/activity_page/raw/public/p3631.jpg', '从Freddie第一次在钢琴上轻轻敲出Bohemian Rhapsody的旋律开始，我的泪腺和毛孔便会为每一缕熟悉旋律而收缩。而最后Live Aid如临现场的冲击力，莫名的痛苦卷着鼓点的狂骚将我击溃在影院最后一排的座椅之上，鼓膜轰鸣。', NULL, 'on', 'on', 'https://img1.doubanio.com/view/activity_page/raw/public/p3677.jpg', '1237270', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://movie.douban.com/ithil_j/activity/movie_annual2018/widget/27', NULL, '2019-03-11 21:17:33.187');
INSERT INTO `douban_annual_widget_infos` VALUES (851, 'on', '剧集/综艺', '2018评分最高的大陆剧集', 'ActivityPageWidget', 1, 129, 'Top 10', 'top10', 15, 0, '26797690, 26761328, 27041389, 26828285, 26920281, 27119802, 27083735, 27029233, 27005229, 25812730', 'rgba(140, 148, 148, .8)', 'https://img3.doubanio.com/view/activity_page/raw/public/p3633.jpg', '喜欢这种时代大发展，大变革期间的故事。普通人在时代洪流的夹裹中改变命运，有种催人奋进的力量。精良认真的制作，演员精湛的演技很好的还原了时代风貌。', NULL, 'on', 'off', 'https://img1.doubanio.com/view/activity_page/raw/public/p3679.jpg', '158820715', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://movie.douban.com/ithil_j/activity/movie_annual2018/widget/29', NULL, '2019-03-11 21:17:33.187');
INSERT INTO `douban_annual_widget_infos` VALUES (852, NULL, NULL, '2018评分最高的英美剧(新剧)', 'ActivityPageWidget', 1, 53, 'Top 10', 'top10', 15, 0, '28427782, 26985973, 26869686, 26997983, 30145148, 27038857, 27016554, 27163287, 26915602, 26252279', NULL, 'https://img3.doubanio.com/view/activity_page/raw/public/p3634.jpg', '想起了生命中许多决定性的瞬间，以及走散了的那些朋友。', NULL, 'on', 'on', 'https://img3.doubanio.com/view/activity_page/raw/public/p3680.jpg', 'Eleutheria', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://movie.douban.com/ithil_j/activity/movie_annual2018/widget/30', NULL, '2019-03-11 21:17:33.187');
INSERT INTO `douban_annual_widget_infos` VALUES (853, NULL, NULL, '2018评分最高的英美剧(非新剧)', 'ActivityPageWidget', 1, 52, 'Top 10', 'top10', 15, 0, '27194302, 27077785, 26997533, 26961208, 27001001, 27055699, 27007669, 27036735, 26887174, 27016555', NULL, 'https://img3.doubanio.com/view/activity_page/raw/public/p3381.jpg', '每次更新都是值得庆祝的节日。它已经变成我的信仰，融入我的生活。愈挫愈勇，策马扬鞭。', NULL, 'on', 'on', 'https://img3.doubanio.com/view/activity_page/raw/public/p3410.jpg', '72719769', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://movie.douban.com/ithil_j/activity/movie_annual2018/widget/31', NULL, '2019-03-11 21:17:33.187');
INSERT INTO `douban_annual_widget_infos` VALUES (854, NULL, NULL, '2018评分最高的韩剧', 'ActivityPageWidget', 1, 49, 'Top 10', 'top10', 15, 0, '27602137, 27068596, 27622822, 27059183, 27603684, 27603700, 27592573, 30181455, 30269039, 30145638', 'rgba(149, 131, 99, .8)', 'https://img1.doubanio.com/view/activity_page/raw/public/p3778.jpg', '被这个世界欺负了，只要家人不知道，就能够假装拥有全世界；被家人背叛了，只求全世界不知道，就能够假装拥有家人。', NULL, 'on', 'off', 'https://img1.doubanio.com/view/activity_page/raw/public/p3777.jpg', '139990953', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://movie.douban.com/ithil_j/activity/movie_annual2018/widget/34', NULL, '2019-03-11 21:17:33.187');
INSERT INTO `douban_annual_widget_infos` VALUES (855, NULL, NULL, '2018评分最高的日剧', 'ActivityPageWidget', 1, 105, 'Top 10', 'top10', 15, 0, '27140017, 30183785, 30232260, 27065652, 30156023, 27605548, 30271241, 27192250, 30203507, 30290917', 'rgba(145, 144, 125, .8)', 'https://img3.doubanio.com/view/activity_page/raw/public/p3775.jpg', '这才叫职场剧，大家一心一意专注工作，顺便穿插人际关系与暗生情愫，这才叫大女主剧，女主靠自己的能力与专业折服他人，而不是一堆老中青帅哥围着女主转，各种给女主开挂', NULL, 'on', NULL, 'https://img3.doubanio.com/view/activity_page/raw/public/p3776.jpg', 'koiwai0908', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://movie.douban.com/ithil_j/activity/movie_annual2018/widget/33', NULL, '2019-03-11 21:17:33.187');
