INSERT INTO `douban_annual_widget_infos` VALUES (859, NULL, NULL, '2018评分最高的动画剧集', 'ActivityPageWidget', 1, 93, 'Top 10', 'top10', 15, 0, '27160633, 27149382, 26946411, 30259908, 28514091, 27015848, 27624762, 27157760, 26997470, 26805209', 'rgba(103, 46, 40, .9)', 'https://img3.doubanio.com/view/activity_page/raw/public/p3546.jpg', '你好，绿谷少年！再见，欧尔麦特。下一个就是你！', NULL, 'on', 'on', 'https://img1.doubanio.com/view/activity_page/raw/public/p3548.jpg', '147058486', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://movie.douban.com/ithil_j/activity/movie_annual2018/widget/40', NULL, '2019-03-11 21:17:33.187');
