INSERT INTO `douban_annual_widget_infos` VALUES (866, 'off', NULL, '2018上映10周年的电影', 'ActivityPageWidget', 1, 117, 'Top 10', 'top10', 15, 0, '2131459, 1485260, 2209573, 1851857, 2149806, 1783457, 2268359, 2213597, 3313801, 1432146', NULL, 'https://img3.doubanio.com/view/activity_page/raw/public/p3782.jpg', '浪漫得一塌糊涂，像废墟中开出的花，像牵手散步的下午，像世上所有伟大的爱情。', NULL, 'on', 'off', 'https://img3.doubanio.com/view/activity_page/raw/public/p3803.jpg', '16249062', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://movie.douban.com/ithil_j/activity/movie_annual2018/widget/53', NULL, '2019-03-11 21:17:33.187');
INSERT INTO `douban_annual_widget_infos` VALUES (867, NULL, NULL, '2018上映20周年的电影', 'ActivityPageWidget', 1, 61, 'Top 10', 'top10', 15, 0, '1292001, 1292064, 1293350, 1292849, 1292275, 1294833, 1292212, 1292371, 1297102, 1307014', NULL, 'https://img3.doubanio.com/view/activity_page/raw/public/p3531.jpg', '“钢琴”在影片中都充当着一个优雅的角色，在我以为，它是一个绝世独立的背影，或而出现在幽蓝的海滩，潮水一波波划过琴身；或而出现在战争的废墟中，阳光从天花板的弹孔中透进来，一束束打在琴板上。', NULL, 'on', 'off', 'https://img3.doubanio.com/view/activity_page/raw/public/p3532.jpg', '2866549', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://movie.douban.com/ithil_j/activity/movie_annual2018/widget/54', NULL, '2019-03-11 21:17:33.187');
INSERT INTO `douban_annual_widget_infos` VALUES (868, NULL, NULL, '2018上映30周年的电影', 'ActivityPageWidget', 1, 43, 'Top 10', 'top10', 15, 0, '1291560, 1291828, 1293318, 1291870, 1306505, 1300960, 1304624, 1292697, 1291859, 1432972', 'rgba(160, 154, 122, .8)', 'https://img3.doubanio.com/view/activity_page/raw/public/p3783.jpg', '龙猫真像童年时的一场梦，长大之后似乎忘记了，突然看见它毛茸茸的身躯，就想起了所有的奢望。这大概就是我们得以在孤独中相互告慰的东西吧。', NULL, 'on', NULL, 'https://img3.doubanio.com/view/activity_page/raw/public/p3806.jpg', '62675594', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://movie.douban.com/ithil_j/activity/movie_annual2018/widget/55', NULL, '2019-03-11 21:17:33.187');
INSERT INTO `douban_annual_widget_infos` VALUES (869, NULL, NULL, '2018上映40周年的电影', 'ActivityPageWidget', 1, 21, 'Top 10', 'top10', 15, 0, '1302100, 1296693, 1292403, 1299265, 1300916, 1498658, 1297268, 1299586, 1293232, 1308456', NULL, 'https://img1.doubanio.com/view/activity_page/raw/public/p3508.jpg', '个人最喜欢的一部阿加莎·克里斯蒂小说，电影改编得也非常成功。高潮迭起的三重浪，每死一个受害者都把悬疑推高一丈，最后以酣畅淋漓的集中推理一次性解开谜团，看得过瘾极了！', NULL, 'on', 'on', 'https://img1.doubanio.com/view/activity_page/raw/public/p3509.jpg', '3540441', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://movie.douban.com/ithil_j/activity/movie_annual2018/widget/56', NULL, '2019-03-11 21:17:33.187');
INSERT INTO `douban_annual_widget_infos` VALUES (870, NULL, NULL, '2018上映50周年的电影', 'ActivityPageWidget', 1, 33, 'Top 10', 'top10', 15, 0, '1292226, 1293394, 1293852, 1296697, 1305605, 1295467, 1297996, 1307973, 1298197, 1293219', NULL, 'https://img3.doubanio.com/view/activity_page/raw/public/p3544.jpg', '当华彩乐章奏响的时候，生命的思维在没有起点，没有终点的宇宙里漫游，伸向无限的未知，探索那终极的意义。伟大的电影不朽，伟大的Kubrick不朽。', NULL, 'on', 'off', 'https://img1.doubanio.com/view/activity_page/raw/public/p3547.jpg', '1275416', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://movie.douban.com/ithil_j/activity/movie_annual2018/widget/57', NULL, '2019-03-11 21:17:33.187');
INSERT INTO `douban_annual_widget_infos` VALUES (871, NULL, NULL, '2018开播10周年的剧集', 'ActivityPageWidget', 1, 75, 'Top 10', 'top10', 15, 0, '2373195, 3060542, 3011225, 3268241, 2373267, 3254235, 3077948, 3184572, 3003093, 3193101', 'rgba(128, 108, 77, .9)', 'https://img3.doubanio.com/view/activity_page/raw/public/p3796.jpg', '老白的微笑，能让人惆怅一年。这是什么样的魅力！这个男人在眼前一点点缓慢蜕变，你憎恨他，你又同情他，关键是你理解他，他心里的黑与绝望我们谁没有过，谁没想过。再见老白，你替我们悲剧，我们才能继续光明。再见老白，再见老白。', NULL, 'on', 'on', 'https://img3.doubanio.com/view/activity_page/raw/public/p3805.jpg', '1182135', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'https://movie.douban.com/ithil_j/activity/movie_annual2018/widget/59', NULL, '2019-03-11 21:17:33.187');
